INSERT INTO `ExamQuestions` VALUES (4,9,'The following statement is true:','[{\"text\":\"The fuel cell vents are located in the wing center tank\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The jet transfer pumps deliver fuel from the collector tanks to the hopper tank\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"The jet transfer pumps are driven by the engine driven fuel pumps\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"The auxiliary boost pumps on each side are powered from their respective essential bus\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(6,9,'With the boost pumps inoperative, the wing fuel tank quantity indicated but unusable is:','[{\"text\":\"Approximately 94 pounds\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Approximately 88 pounds\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Approximately 75 pounds\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Approximately 13 pounds\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(7,9,'The boost pumps:','[{\"text\":\"Are driven by the engine\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Deliver fuel to the engine-driven low-pressure fuel pumps\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Keep the collector tanks filled with fuel\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Use high-pressure fuel tapped from the engine\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(8,9,'Assuming that the jet transfer pumps are operative, the amber L and R XFER PUMP lights are extinguished by:','[{\"text\":\"Turning on the boost pumps\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Opening the crossflow valve\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Turning on the boost pumps when fuel remains in the wing tanks\",\"answerID\":2,\"feedback\":\"\"}]',2,NULL,1),(9,6,'Power for the following is transferable from the left essential bus to the right essential bus:','[{\"text\":\"The main boost pumps\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The auxiliary boost pumps\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"The jet transfer pumps\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"The crossflow valve\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(10,9,'The quick release drain valve for rapid single-point defueling is located in the:','[{\"text\":\"Hopper tank in the wing.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Crossflow line under the fuselage.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Forward collecter tank in the wing.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Aft collecter tank in the wing.\",\"answerID\":3,\"feedback\":\"\"}]',1,'yes',1),(11,9,'An accurate fuel quantity reading is obtained in flight by:','[{\"text\":\"First pressing the PRESS-TO-TEST push-button and verifying that the indicators move to the 12 o\'clock position\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"First establishing co-ordinated flight\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Balancing the fuel\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"All of the above\",\"answerID\":3,\"feedback\":\"\"}]',1,'notlast',1),(12,9,'Illumination of the R FUEL light indicates that the:','[{\"text\":\"Right wing has less than 75 pounds of fuel remaining\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Right fuel shutoff valve is closed\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Right fuel pump pressure is low\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Right fuel shutoff valve is not in the position of the right fuel shutoff switch\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(13,9,'During refueling, avoid:','[{\"text\":\"Refueling with the airplane\'s electrical power on\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Filling both tanks at the same time\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Grounding the airplane, fuel truck, and fuel nozzle\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Use of aviation gasoline\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(15,10,'One of the following best describes the four-blade propellors:','[{\"text\":\"Double-acting hydraulic\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Variable-speed, autofeathering\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Reversible, constant-speed, full feathering\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Constant-speed, double acting\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(16,10,'A heated inlet on the lower side of the nacelle supplies air for:','[{\"text\":\"The gas generator\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Internal engine cooling\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"A fuel heater\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"An automatic oil cooler\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(17,10,'A vent valve associated with the engine oil system is used for:','[{\"text\":\"Reducing oil pump drag during engine starting\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Venting the gear case to the atmosphere\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Air-oil seperation\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Lubrication of the engine bearings\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(18,10,'When the engine stop and feather control is pulled out, it will perform one of the following sequence of functions:','[{\"text\":\"Feather the propellor and close the fire shutoff valve\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Feather the propellor and shut off fuel and hydraulic fluid\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Feather the propellor and and close the fuel shutoff valve\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Close the fuel solenoid valve and feather the propellor\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(19,10,'The primaries-only solenoid valve functions to:','[{\"text\":\"Limit engine torque when power is over 90% rpm\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Provide fuel enrichment between 10 and 60% rpm\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Increase primary nozzle fuel during start\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Prevent compressor stall during starting\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(20,10,'If the fuel bypass open light of the left engine comes on during takeoff, the proper action to take is:','[{\"text\":\"Abort the takeoff if below lift-off speed\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Take no action until the critical point of the take-off is complete\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Reduce power on both engines\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Turn off the AWI system if operating\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(21,10,'If a manual engine start was made, the proper action to take after starting is:','[{\"text\":\"Leave the SRL switch in the OFF position\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Pull the ignition circuit breaker at 60% rpm\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Leave the SPEED SW SELECT in MANUAL\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Determine that the SRL function is operational\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(22,10,'The maximum acceptable difference in EGT indications between engines in the SRL on and off mode is:','[{\"text\":\"30 degrees C\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"15 degrees C\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"10 degrees C\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"0 degrees C\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(23,10,'When setting wet static takeoff power, the proper action to take is:','[{\"text\":\"Never exceed 770 degrees C EGT\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Limit torque to 107% maximum\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Do not exceed 675 degrees C for more than 5 minutes\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Limit rpm to 100%\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(24,10,'The maximum altitude for sustained operation with the fuel bypass open valve is:','[{\"text\":\"30,000 feet\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"25,000 feet\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"20,000 feet\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"15,000 feet\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(25,10,'If the fuel bypass valve has failed in the open position, the proper action to take is:','[{\"text\":\"Maintain rpm at 96% maximum\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Do not takeoff\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Maintain rpm at 100% if EGT is greater than 650 degrees C\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Do not exceed 600 degrees C EGT for operations above 15,000 feet\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(26,10,'The maximum forward speed for full reverse thrust application is:','[{\"text\":\"Unlimited on paved surfaces\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"100 knots, all conditions\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"90 knots on unpaved surfaces\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"90 knots if temperature is 90 degrees or less\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(27,10,'The maximum EGT during engine starting is:','[{\"text\":\"770 degrees C\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"650 degrees C\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"580 degrees C\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"560 degrees C\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(28,10,'Except for transients during starting and shutdown, engine operation must be avoided in the rpm range of:','[{\"text\":\"96 to 98%\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"10 to 60%\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"70 to 97%\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"18 to 28%\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(29,10,'The CAWI system fuctions to:','[{\"text\":\"Reduce compressor outlet temperature and permit higher EGT limits\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Provide engine cooling during perious of high power demands\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Restore power when the OAT is high or when taking off from high-altitude fields\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Prevent ice formation at the nacelle inlet and in the compressor inlet duct\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(30,10,'The minimum usable AWI quantity for a wet power takeoff is:','[{\"text\":\"5.2 gallons\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"10 gallons\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"14 gallons\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"16 gallons\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(34,6,'The electrical rating for the airplane batteries is:','[{\"text\":\"24 volts\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"28 volts\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"30 volts\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"34 volts\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(37,6,'The inflight electrical rating for each generator is:','[{\"text\":\"24 volts, 200 amperes\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"29.5 volts, 300 amperes\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"24 volts, 300 amperes\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"29.5 volts, 200 amperes\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(38,6,'If a generator fault is detected during a start, to turn the generator on:','[{\"text\":\"Move the generator switch to off\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Turn the battery switch to off\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Disconnect the GPU\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Move the generator switch to RESET\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(39,6,'To read just one battery\'s voltage on the DC voltmeter:','[{\"text\":\"Position the voltmeter select switch to BUS\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Shut off all other power sources\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Turn that battery switch off\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Pull the battery circuit breaker on the pilot\'s J-box\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(40,6,'During taxi, an engine flames out due to water ingestion. Prior to re-start:','[{\"text\":\"Turn off the batteries\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Turn off the associated generator switch\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"A thermal overload check must be made\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"A start circuit check must be made\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(41,6,'Electrical power from all three DC buses is used by the:','[{\"text\":\"Battery temperature indicator test\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Landing gear light test\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Pressurisation system test\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Annunciator panel test\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(42,6,'For the battery fault detection circuit to be operative:','[{\"text\":\"Have both generator switches on\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Operate only one avionics system at a time\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Remove power from the nonessential bus\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Disconnect the left battery\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(43,6,'If the left essential bus fails, to restore power to essential system circuits:','[{\"text\":\"Depress the bus-tie circuit breaker\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Reset the generators\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Use the BUS TRANSFER switches\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Use emergency battery power\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(44,6,'The voltage output of each inverter is:','[{\"text\":\"115-volt AC and 26-volt AC\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"115-volt AC and 350-volt AC\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"125-volt AC and 30-volt AC\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"28-volt AC and 120-volt AC\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(45,6,'115-volt AC bus voltage can be read:','[{\"text\":\"With a meter on the inverter\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"On the AC voltmeter\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Only by maintenance personnel\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"With the DC voltmeter\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(46,6,'The number of inverters that can be operated at a time is:','[{\"text\":\"Four\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Three\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Two\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"One\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(47,6,'If just the left 115-volt AC bus loses power, to restore it:','[{\"text\":\"Use the BUS TRANSFER switches\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Select the other inverter\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Attempt to reset the 115-volt AC bus tie circuit breaker\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Recycle the bus-tie switch\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(48,7,'The controls for the pilot\'s and copilot\'s flight instrument lights are located on the:','[{\"text\":\"Lower switch panel\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Forward side consoles\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Bottom of the pedestal\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Aft side consoles\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(49,7,'The lighting intensity for the copilot\'s airspeed, altimeter, vertical speed, and radio heading instruments is varied by the use of:','[{\"text\":\"COPILOT FLT INSTR control\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"CSL PNLS control\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"GENL INSTR control\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"GENL FLT INSTR control\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(50,7,'The following lights can be turned on with battery switches off:','[{\"text\":\"Passenger warning lights\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Navigation lights\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Overhead floodlights\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Entrance lights\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(51,7,'The nose baggage and cargo compartment timer can be reset:','[{\"text\":\"Only be maintenance\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"By cycling the entrance door light switch\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"By turning on the cargo door light\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"By pressing the RESET switch inside the left nose baggage door\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(52,7,'All exterior lights are powered from the:','[{\"text\":\"Nonessential bus\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Left essential bus\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Right essential bus\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"All of the above\",\"answerID\":3,\"feedback\":\"\"}]',0,'notlast',1),(53,8,'The annunciators can be tested:','[{\"text\":\"Only by individual system test switches\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"By pressing each light capsule\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"With the annunciator panel PRESS TO TEST switch\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"By using the dimmer switches\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(54,8,'The color(s) of annunciators on the annunciator panel that can be dimmed is:','[{\"text\":\"Red, amber and green\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Red\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Amber\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Green\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(55,8,'The annunciators are dimmed:','[{\"text\":\"When the TEST switch is depressed\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"When the BRT-DIM switch is selected\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"When the dimmers are off\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"When the ambient light is greater than 50 candlepower\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(56,8,'The L and R FUEL shutoff valve annunciators are located:','[{\"text\":\"On the valve position annunciator panel\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"On the annunciator panel\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"On the centre console\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"On th left forward console\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(57,8,'The combination crossflow switch and light assembly is located:','[{\"text\":\"On the pilot\'s instrument panel beside the crossflow switch\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"In the valve annunciator panel located on the pilot\'s instrument panel\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"On the left forward side console\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"On the right forward side console\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(58,8,'Illumination of the R HYD annunciation in the valve position annunciator indicates:','[{\"text\":\"The right hydraulic shutoff valve is closed\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The right hydraulic shutoff valve is open\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"The right hydraulic shutoff valve is not in the position selected by the right hydraulic shutoff switch\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"The right hydraulic shutoff valve is in the position selected by the right hydraulic shutoff switch\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(59,8,'The annunciator panel is powered by the:','[{\"text\":\"Left and right essential buses\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Left essential bus only\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Right main bus only\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Left and right main buses\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(60,8,'The PRESS TO TEST switch on the annunciator panel is used to check:','[{\"text\":\"The LANDING GEAR position lights\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The CARGO DOOR test lights\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Onlt the main annunciator lights\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"The main annunciator lights, the FUEL BYPASS lights, DUCT HEAT CYCLE lights, and the PASS OXY ON lights\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(61,12,'Overheat sensing within the engine nacelle will:','[{\"text\":\"Illuminate the red FIRE and amber E indicators\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Not illuminate any light unless two or more sensors detect the overheat condition\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Illuminate a red FIRE light on the main annunciator panel and automatically discharge the extinguisher\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Illuminate the red FIRE light on the respective fire extinguisher switchlight and the main annunciator panel\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(62,12,'Pushing in on the left fire extinguisher switchlight:','[{\"text\":\"Discharges the left engine fire extinguisher bottle as long as electrical power is available\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Only activates the extinguisher if the left FIRE light is illuminated\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Tests all three lights and the detector circuitry\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Discharges both fire extinguishers into the left engine nacelle\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(63,12,'A wing overheat warning is shown by:','[{\"text\":\"A flashing FIRE light on the control panel.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"A flashing WING OVHT light on the annunciator panel.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"A L ro R WING OVHT temperature gauge on the centre instrument panel.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"A L ro R WING OVHT annunciator light which is on steady.\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(64,13,'Bleed air supplied to the engine and nacelle inlet anti-icing system is:','[{\"text\":\"Unregulated\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Regulated to 18 psi\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Regulated to 31 psi\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Regulated by the bleed-air shutoff valve\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(65,13,'The following is calibrated to provide pressure-regulated bleed air to the air-conditioning system:','[{\"text\":\"Check valve\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Bleed-air shutoff valve\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Filter\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Pressure regulator\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(66,13,'The system used to monitor the 18-psi system pressure is the:','[{\"text\":\"Bleed-air pressure indicator\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Suction indicator\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Deice pressure indicator\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"LOW SUCTION warning light\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(67,13,'The indicator used to monitor the vacumn system is the:','[{\"text\":\"Bleed-air pressure indicator\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Pressure regulator\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Deice pressure indicator\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Suction indicator\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(68,13,'Bleed air supplied to the vacumn system is:','[{\"text\":\"Unregulated\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Regulated to 18 psi\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Regulated to 31 psi\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Regulated by the bleed-air shutoff valve\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(69,14,'The following components have pneumatically oprated deicing systems:','[{\"text\":\"Windshields\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Propellors\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Wings and horizontal stabilizers\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Pitot tubes\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(70,14,'One complete cycle of the deice boots timer takes:','[{\"text\":\"6 seconds\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"10 seconds\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"170 seconds\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"3 minutes\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(71,14,'Power for control of the following ice protection system is transferable from the left essential bus to the right essential bus:','[{\"text\":\"Engine intakes\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Left windshield\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Wing and horizontal stabilizer deice boots\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"All of the above\",\"answerID\":3,\"feedback\":\"\"}]',3,'notlast',1),(72,14,'Annunciators which function as valve agreement lights when the applicable system is energised and when that system is deenergised are:','[{\"text\":\"W\\/S HT\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"DUCT HEAT CYCLE\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"L\\/R INTAKE HT\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"SAS DEICE\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(73,14,'Systems which should be used continiously during icing conditions are:','[{\"text\":\"Engine and propellor heat\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Windshield heat\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Pitot and SAS heat\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"All of the above\",\"answerID\":3,\"feedback\":\"\"}]',3,'notlast',1),(74,14,'Use of engine inlet heat on the ground must be restricted to a maximum of:','[{\"text\":\"5 seconds, when OAT is above +5 degrees C\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"10 seconds, when OAT is above +5 degrees C\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"5 seconds, when OAT id above +10 degrees C\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"10 seconds, what OAT is above +10 degrees C\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(75,14,'When the WSHLD HT switches are positioned to low:','[{\"text\":\"Heating elements in each windshield are heated in series, and the W\\/S HT lights illuminate while heat is being applied\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Heating elements in each windshield are heated in series, the W\\/S HT light illuminate, and heat for either windshield system may cut off without affecting the other system\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Heating elements in each windshield are heated in series, the W\\/S HT lights illuminate, and heat cycling off for either windshield removes power from both and extinguishes both lights\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Heating elements in each windshield are heated in series, the W\\/S HT lights illuminate, and heat cycling off for either windshield removes power from both, but extinguishes only the light on the side cutting off\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(76,15,'The temperature control system maintains ____________&nbsp;temperature at a level selected by the ____________:','[{\"text\":\"Cockpit, crew\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Duct temperature, crew\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Cabin, crew\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Cabin, mode selector switch\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(77,15,'What is bypassed when the HOT or COLD position is selected by the mode selector switch:','[{\"text\":\"Automatic temperature control\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Bleed air valves\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Mixing valves\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Air cycle machine\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(78,15,'To increase or decrease the conditioned air flow to the pilot\'s foor warmers, use the:','[{\"text\":\"FRESH AIR FAN switch\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"COCKPIT COND AIR knobs\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"TEMPERATURE CONTROL knob\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Mode selector switch\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(79,15,'With the mode selector switch in the ____________ position, the mixing valves close fully, resulting in no hot air entering the conditioned air ducts:','[{\"text\":\"HOT\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"AUTO\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"OFF\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"COLD\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(80,15,'With the FRESH AIR switch in NORM, the blower will circulate air to the cockpit:','[{\"text\":\"If either bleed valve is open\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"If either bleed valve is open and the associated engine is operating\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"When the airplane is on the ground\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Whenever electrical power is available\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(81,16,'One of the functions of the cabin pressure controller is to control cabin pressure to a selected value within the isobaric range of -1000 feet to:','[{\"text\":\"15,000 feet\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"10,000 feet\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"5,000 feet\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"1,000 feet\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(82,16,'The RATE control knob allows the pilot to select a rate-of-cabin pressure change within the limits of approximately:','[{\"text\":\"30 to 2000 fpm\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"40 to 4000 fpm\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"50 to 2000 fpm\",\"answerID\":2,\"fee