D\":0,\"feedback\":\"\"},{\"text\":\"Only in case of engine fire, engine shutdown in flight, or when maintenance is to be performed.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"When a low pressure (L HYD PRESS or R HYD PRESS) warning light illuminates.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"When the reservoir fluid has been depleted.\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(88,17,'A hydraulic shutoff valve (L HYD or R HYD) disagreement light illuminates:','[{\"text\":\"When the valve is fully open\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"When the valve is fully closed\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"When the system pressure is low\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"When the valve is not in the open position selected by the switch\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(89,17,'When the hydraulic reservoir is properly services with fluid:','[{\"text\":\"Both sight glass indicators show a solid mass of fluid\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The lower sight glass indicator shows a solid mass of fluid; no fluid can be seen in the upper indicator\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"No fluid can be seen in either sight glass indicator\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"The fluid level line will be at the FULL mark on the upper sight glass indicator\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(90,18,'At lift-off the nosewheels are centred by:','[{\"text\":\"An internal mechanical centreing device\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"An external mechanical centreing device\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"The nosewheel steering actuator\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Scissors\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(91,18,'The landing gear in maintained down and locked after a normal extension by:','[{\"text\":\"Overcentre drag braces and hydraulic pressure\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Mechanical locks in all gear actuators\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Overcentre drag braces\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Hydraulic pressure only\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(92,18,'The landing gear is maintained down and locked after emergency extension by:','[{\"text\":\"Hydraulic pressure only\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Overcentre drag braces and hydraulic pressure\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Mechanical locks in all gear actuators\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Overcentre drag braces\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(93,18,'The position of the landing gear doors with the gear extended is:','[{\"text\":\"Main gear doors open, nose gear doors closed\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"All doors closed\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"All doors open\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Main gear doors closed, nose gear doors open\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(94,18,'The landing gear warning horn sounds when:','[{\"text\":\"Any gear is not locked and down.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"All gears are not down and locked.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Any gear is not down and locked and flaps are extended beyond 1\\/4 travel.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Any gear is not down and locked and either power lever is retarded to FLT IDLE, or flaps are extended beyond 1\\/2 travel.\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(95,18,'Nosewheel steering authority is increased to 63 degrees by:','[{\"text\":\"Holding the PARK button depressed\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Advancing the right speed level out of the LOW position\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Advancing either power lever forward of the FLT IDLE position\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Momentarily pressing and then releasing the PARK button\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(96,18,'A flashing NWS FAIL light indicates:','[{\"text\":\"The system is armed but not engaged.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"A fault exists but the system is still engaged.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"A fault exists and the system has disengaged.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"The system is engaged and operating properly.\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(97,18,'Nosewheel steering operating after gear retraction is prevented by:','[{\"text\":\"Control circuits being opened by gear retraction\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The nose gear centering device\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Hydraulic pressure being supplied to the actuators\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"The trasmission mechanisim in the strut being disengaged\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(98,18,'In the brake system, the shuttle valves:','[{\"text\":\"Block out the set of master cylinders not being used\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Aid in setting the parking brakes\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Prevent fluid loss in the event a line ruptures\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Shuttle braking pressure from brakes on one gear to brakes on the other gear\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(99,19,'The surfaces classified as primary flight control surfaces are:','[{\"text\":\"Flaps, ailerons, and rudder\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Ailerons, rudder and elevators\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Ailerons, rudder and horizontal stabiliser\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Flaps, rudder, and horizontal stabiliser\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(100,19,'If a control lock cable breaks, control surface lockup is prevented by:','[{\"text\":\"Dual cables in the system\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Oversize cables in the system\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Lockpins which are spring-loaded to disengage\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Nothing prevents control surface lockup due to cable breakage\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(101,19,'In-flight engagement of the control locks is prevented by:','[{\"text\":\"Mechanical obstruction by power lever linkage\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Airload on the control surfaces\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"A squat switch-controlled lockout device\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Nothing prevents in-flight engagement of the gust locks\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(102,19,'Rudder trim is accomplished:','[{\"text\":\"By the yaw damper\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Manually, by rotation of the RUDDER TRIM wheel on the pedestal\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Electrically, by lateral movement of the dual-element trim switches on either control wheel\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Electrically, by rotation of the RUDDER TRIM wheel on the pedestal\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(103,19,'If the trim switch on the left control wheel is inoperative, the pilot can apply pitch trim:','[{\"text\":\"Only by constant pressure on the control column\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Only by instructing the copilot to apply trim\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"By placing the TRIM SELECT switch on the COPILOT position and using the AUX TRIM switch on the centre pedestal\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"He cannot apply pitch trim\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(104,19,'Simultaneous pitch trimming by the pilot and copilot is prevented by:','[{\"text\":\"Positioning of the TRIM SELECT switch\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Pilot inputs overriding those made by the copilot\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Each input canceling the other input\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Nothing prevents it; it is possible\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(105,19,'Assymetrical flap operation is prevented by:','[{\"text\":\"Equal airload on the flaps\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Equal pressure on the flaps actuators\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Mechanial interconnection between the flaps\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Nothing prevents assymetrical operation; it can occur\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(106,19,'The flaps are held in position by:','[{\"text\":\"A liquid lock created by the flap lock valves\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"A liquid lock created by the slector valves\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"A liquid lock created by the selector valve and the flap lock valves\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"A pressure-operated internal locking device within the actuators\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(107,19,'The relationship of airspeed to stall speed when the stick shaker activates is approximately:','[{\"text\":\"1.0 Vs\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"1.1 Vs\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"1.3 Vs\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"1.75 Vs\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(108,19,'The SAS SERVO switch should be placed in the OFF position when:','[{\"text\":\"A forward force on the control column is experienced at an inappropriate airspeed.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The warning horn ceases to sound.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"The warning horn sounds.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Practicing stalls.\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(109,19,'The indication of pusher servo failure is:','[{\"text\":\"The SAS SERVO FAIL light illuminates\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"the ASA FAIL light illuminates\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"A warning horn sounds\",\"answerID\":2,\"feedback\":\"The STALL lights flash\"}]',0,NULL,1),(110,19,'With the right SAS computer inoperative (R SAS FAIL light on):','[{\"text\":\"The stick pusher is inoperative\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The stall horns and stick shakers operate normally\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"The L STALL light in each stall light modual operates normally\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"All of the above\",\"answerID\":3,\"feedback\":\"\"}]',3,'notlast',1),(111,20,'The pitot heads are located:','[{\"text\":\"On the lower half of the nose section\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"On the upper half of the nose section\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"One on top of the nose, one on the bottom\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"One on each side of the nose section\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(112,20,'Besides the copilot\'s airspeed indicator, the other component that receives pitot pressure from the copilot\'s pitot is:','[{\"text\":\"Rate-of-climb indicator\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Altimeter\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Air data computer\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Airspeed switch for the airspeed warning horn\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(113,20,'The nunber of static ports that can supply a static reference to the copilot\'s altimeter is:','[{\"text\":\"One\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Two\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Three\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Four\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(114,20,'The ____________ can be selected by placing the STATIC SELECTOR handle in the ___________ position:','[{\"text\":\"Alternate static port, EMER\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Alternate static port, NORM\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Emergency static port, EMER\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Alternate static port, ALTERNATE\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(115,20,'The cockpit voice recorder can be erased by:','[{\"text\":\"Momentarily pressing the ERASE button at anytime\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Pressing the ERASE button for 3 seconds at anytime\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Pressing the ERASE button for 3 seconds on the ground\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Pulling the CVR circuit breaker on each essential bus\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(116,20,'The Flight Data Recorder:','[{\"text\":\"Can be tested by pressing the FDR PWR FAIL light\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Can be tested by pressing the TEST button on the FDR control panel\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Initiates a self test each time power is supplied to the recorder\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Can only be tested every 25 hours by maintenance\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(117,20,'Pressing the CVR TEST button for five seconds should cause:&nbsp;','[{\"text\":\"Defelction of the test meter needle into the green band\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"An audible tone on the speaker if a headset is plugged into the CVR control panel\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Cycling of the FDR PWR FAIL light\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Both Choice 1 and 2\",\"answerID\":3,\"feedback\":\"\"}]',0,'no',1),(118,21,'Any time the manual shutoff valve is open, oxygen is available at:','[{\"text\":\"Passenger mask compartments\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Oxygen cylinder\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Crew mask outlets\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Crew oxygen masks\",\"