er delegate\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The Chief Pilot\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Yourself\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"A co-worker\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(237,285,'An employee who is required to undertake ground handling tasks must hold an ADA (Authority to Drive Airside) approval within;','[{\"text\":\"12 Months from commencement of employment\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"1 Month &nbsp;\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"6 months from commencement of employment\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Ground Handlers do not require an ADA\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(238,285,'When will the Ground Handling Manager or their delegate conduct internal audit of each aspect of ground handling operations?','[{\"text\":\"Every week\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Yearly\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"On a minimum 6 monthly basis\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Only on public holidays\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(239,285,'What should not be included in the scope of internal auditing?','[{\"text\":\"Interviews or discussions with personnel involved\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Creating short-cuts around the procedures\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"A review of existing procedures relating to the operation being audited\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Examination of an adequate sample of records\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(240,285,'Who must update the Register of Proficiency in the FBO Manager program?','[{\"text\":\"CEO\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Employees\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Reception\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Nominated trainer\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(241,285,'What does internal auditing involve?','[{\"text\":\"Measuring compliance against the policies and procedures detailed in this manual, with particular regard as to how we may better execute our responsibilities. &nbsp;\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Measuring how we can skip costs\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"To Waste paper\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Measuring how long it takes to complete tasks\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(242,286,'Where can you find the Ground Handling Roster?','[{\"text\":\"In the kitchen\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"On the staff website http:\\/\\/www.corporate-air.com.au\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Outside the back operations storage room\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"In individual\'s pigeon holes in the Flight Crew Room\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(243,286,'When should you check the Ground Handling Roster?','[{\"text\":\"Only if you are told there is a change to the roster\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"When ever you feel like checking it\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"After each shift has finished or after speaking to the Ground Handling Manager\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Once a week\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(244,286,'When &amp; why must you complete a fortnightly log sheet?','[{\"text\":\"Tuesday night after pays are processed so you can check they have been paid correctly\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"No later than 8.00am on pay day so that pays can be processed\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"So that pays can be processed.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"No later than end of shift the Sunday prior to pay day so pays can be processed. &nbsp;\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(245,286,'Where should you obtain a copy of the current pay rates?','[{\"text\":\"From fellow workers pay sheets\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"From the ATO\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"From the Ground Handling Manual\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"From the Ground Handling or Operations Manager\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(246,286,'Staff should take note of the current roster date located;','[{\"text\":\"At the top right hand corner of the roster\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"At the bottom right corner of the roster\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"At the bottom left hand corner of the roster\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"At the top left hand corner of the roster\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(247,286,'Roster changes must be requested to the;','[{\"text\":\"Chief Pilot &nbsp;\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Fellow Staff\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Chief Engineer\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Ground Handling or Operations Manager\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(248,286,'A copy of the current Ground Handling roster is kept on which website?','[{\"text\":\"http:\\/\\/roster@staff-corporate-air.com.au\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"http:\\/\\/www.corporate-air.com.au &nbsp;\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"http:\\/\\/rosters.corporate-air.com.au\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"http:\\/\\/corporate-air@staff.com.au\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(249,286,'If a Ground Handler is sick or unable to attend work they must give the Ground Handling Manager&nbsp;_______ _______ so that a&nbsp;replacement can be arranged.','[{\"text\":\"Some Beer\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Post it note\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Maximum notice\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Resignation letter\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(251,287,'What are the limitations for aircraft parking on the General Aviation Apron?','[{\"text\":\"Propeller aircraft only\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Less than a 24m wingspan and\\/or less than 35 tonne Maximum Take Off Weight (MTOW)\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Only commercial airline aircrafts\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Greater than a 24m wingspan and\\/or greater than 35 tonne Maximum Take Off Weight (MTOW)\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(252,287,'What aircraft are usually handled on the Fairbairn Apron?','[{\"text\":\"Only military aircraft that can not be handled on the GA Apron\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Itinerant handling of military and civil registered aircraft that can be handled on the GA Apron\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Itinerant handling of military and civil registered aircraft that can not be handled on the GA Apron\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Any aircraft when there is no room available\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(253,287,'What separates the Fairbairn Apron from the SPA (RAAF) Apron?','[{\"text\":\"A green line\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Armed RAAF security personnel\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"The perimeter fence\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Nothing, it\'s the same apron \",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(254,287,'Who can access the Airline (RPT) apron?','[{\"text\":\"Anyone\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Only staff directly employed by Virgin or Qantas\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Any person that has a valid reason to be there\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Only by persons having a red colour ASIC pass and a valid reason to be there as it is a security restricted area\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(256,287,'If a person approaches you and request airside access what should you do?','[{\"text\":\"Provide access if they have a red colour ASIC pass and you can see the plane they are going to\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Inform them you can\'t give them access and refer them to the Airport Operations Officer\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Tell them to go away politely\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Ring \'000\'\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(257,287,'Where should you not park a Metro 23 on the General Aviation apron? (Refer Technical Library)','[{\"text\":\"Remainder of GA Parking &nbsp;\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Second Row\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Third Row\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"1st Row\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(262,287,'Diagrams of the Airport&nbsp;aprons can be seen in which section of the staff portal?','[{\"text\":\"Technical Library, Canberra Airport - Driving Airside & Aprons &nbsp;\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Training Library, Canberra Airport - Driving Airside & Aprons &nbsp;\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Forms for employees\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Forms for Managers\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(263,287,'Which gate is primarily used for vehicle access to airside?','[{\"text\":\"Gate 4\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Gate P2\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Gate 5 &nbsp;\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Gate P3\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(264,287,'The Airport Operations Office is located where?','[{\"text\":\"Behind gate 4 \",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Adjacent to the fourth line of the General Aviation apron\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"At the entrance to Gate 5\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"At the Hangar 48 Gate\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(265,287,'To drive an airside approved vehicle on the aprons the driver must hold a current;','[{\"text\":\"AUA\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Authority to Drive airside (ADA)\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Airport visitors pass\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"ASIC\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(266,287,'Corporate Air vehicles that are registered with Canberra Airport for airside use must have which sticker displayed on the vehicle exterior?','[{\"text\":\"AUA &nbsp;\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"ADA\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"ASIC\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"CAG\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(267,287,'Gate 5 access airside to roadside can be obtained using which device?','[{\"text\":\"Radio \",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Doorbell\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Keys\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Gate 5 Remote or Airport Operations officer\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(268,287,'After activation of the PAL lighting system the aerodrome lights will remain illuminated for how long?','[{\"text\":\"45 Minutes\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"1 Hour\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"30 Minutes &nbsp;\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"3 Hours\",\"answerID\":3,\"feedback\":\"\"}]',2,'',1),(269,287,'Activation of the PAL lighting system requires how many transmissions on the \"Canberra MBZ\" frequency 118.70 MHZ?','[{\"text\":\"6\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"3 &nbsp; &nbsp;\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"2\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"8\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(273,287,'If the remote for the gate is misplaced or lost what should you do?','[{\"text\":\"Inform the Operations Manager when you next see or speak to him\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Do not inform anyone as you do not want to be blamed for the loss\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Report the loss to the Airport Operations Officer before calling the Corporate Air \'duty\' Manager\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Inform the Corporate Air \'duty\' Ground Handling Manager on (0400 774012) immediately that the loss has occurred so they can deactivate the remote.\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(274,287,'What does AUA stand for?','[{\"text\":\"Authority to Drive Airside\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Authority to Use Airside\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Airside Use Allowed\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Authority Under Advice\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(275,287,'Who must hold an Authority to Drive Airside (ADA)?','[{\"text\":\"Only department managers & supervisors\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Anyone who has airside access\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Anyone who is to operate any vehicle airside\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Anyone who works at Corporate Air as an engineer\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(276,287,'If there was an emergency situation at Canberra Airport after hours what should you do?','[{\"text\":\"Form Available from MGH. This form must not be submitted without CEO or MGH approval.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Do nothing as Canberra Airport have Safety officers on the premises 24 hours a day\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Call the APS to secure the area while dealing with the emergency yourself\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Contact the Corporate Air \'Duty\' Ground Handling Number 0400 774012 and in consultation with them contact CIA using the numbers listed on the After Hours and Emergency Call Out Details sheet\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(278,287,'When should the Pilot Activated Lighting System (PAL) be utilised?','[{\"text\":\"Only during strong wind and\\/or thunderstorm activity which reduces visibility\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Outside Canberra Tower Air Traffic Control hours of operation\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Whenever there is an incoming aircraft\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"On advice from the Chief Pilot or his\\/her delegate\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(279,287,'What would be the method to activate the PAL system using a radio?','[{\"text\":\"Set the frequency to 126.4 MHZ, press and hold for one (1) second maximum and release for one (1) second maximum, repeat two (2) more times. If it works you will hear a reply of \\\"Canberra MBZ, the Canberra PAL has been Activated\\\"\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"You can not set the PAL system, only Pilots can do it from an aircraft\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Set the frequency to 118.7 MGZ, press and hold for one (1) second maximum and release for one (1) second maximum, If it works you will hear a reply of \\\"Canberra MBZ, the Canberra PAL has been Activated\\\"\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Set the frequency to 118.7 MHZ, press and hold for one (1) second maximum and release for one (1) second maximum, repeat two (2) more times. If it works you will hear a reply of \\\"Canberra MBZ, the Canberra PAL has been Activated\\\" &nbsp;\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(280,287,'If the PAL system fails to activate by using a radio how else can you activate the system?','[{\"text\":\"Using the key located in the key cabinet within the white equipment barrow located in the GSE area at Canberra Airport. Insert it into the switch located on the airside exterior wall of the Airport Operations Office (near Gate 5) and follow the directions listed below the switch. \",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Use the key located behind the door in the Flight Crew Room\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Contact the Corporate Air \'Duty\' Manager who will instruct you what to do next\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Calling the AFP - Protective Service and Canberra Airport Technical Services who will sort out the problem\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(281,288,'If you received a call from a Customer requesting information, a charter quote or any other request what should you do?','[{\"text\":\"Give them the information they requested\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Take down their details and inform them you will pass them on to the relevant person who will then contact them\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Take down their details and inform them you will pass them on to the relevant person who will then contact them. If they do not hear from someone in the next 5 minutes ask them to call you back. If you are unable to take the details down give them the 24 hour telephone number for Corporate Air. (02 6249 7044) &nbsp;\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Tell them to call the 24 hour telephone number\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(282,288,'The procedure of placing safety cones under around the Metro 23, Conquest C441 &amp; Titan C404 whilst loading/unloading freight, reconfiguring and cleaning&nbsp;etro 23 is to ensure what?','[{\"text\":\"The company does not waste money on cones that are not being used\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"No barrow or similar equipment travels directly under the nose of the aircraft\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"No barrow or GSE type equipment travels directly under the tail or wings of an aircraft. It also prevents vans, barrows & belt loaders entering the dileneated coned area without the aid of a marshaller.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"The Metro 23 can be seen from a distance\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(283,288,'If an item of Ground Handling Eqipment&nbsp;becomes unserviceable and is required for a movement later that day or the next morning,&nbsp;who and what number should you ring','[{\"text\":\"Operations officer, &nbsp;02 62752219\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Chief Pilot 02 62497044\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Ground Handling Manager 0400 774012\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"MRO Manager 02 62497044\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(284,288,'At the end of the night the Ground Handling Task Form is to be signed and placed where?','[{\"text\":\"In the first aid box\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"In the Ground Handling Managers in Tray\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"In the fax machine to be faxed the next day\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"In the Head Office box located next to the fax machine\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(285,288,'Why must the ground handling mobile phone be switch on while at work?','[{\"text\":\"Customers may call this number requesting information as they do not have Corporate Air\'s 24 hour number\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"This is the first point of contact for the \'Duty\' operations manager to advise changes or alterations to ground handling requirements and also AAE have this number.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"As both AAE and Pel-Air express may need to contact the ground handler\'s handling their aircrafts.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"It saves time in an emergency if you do not have to switch on a mobile phone\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(286,288,'What items should you put in the In-flight Small &amp; Large Snack Baskets?','[{\"text\":\"Portion control chips, portion control nuts, portion control biscuits, mixture of lollies & mints, 3 ear plugs for small basket & 7 ear plugs for large basket.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Portion control chips, portion control nuts\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Portion control nuts, mints, ear plugs\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Portion control chips, mints, ear plugs\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(287,288,'On any occasion whilst handling a Metro 23 aircraft and accessing the rear cargo door to reconfigure, clean load/unload,&nbsp;you must place?','[{\"text\":\"One Safety cone is placed between the nose and main wing tip adjacent to the front door, One Safety cone at the main wing tip & Three safety cones starting at the tail of the aircraft angling out left in line with the rear tail.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"One cone in a line directly under the rear fuselage between the forward edge of the rear cargo door and the tail.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Five cones in a line directly under the rear fuselage between the forward edge of the rear cargo door and the tail.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Three cones in a line directly under the rear fuselage between the forward edge of the rear cargo door and the aircraft nose.\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(288,288,'Where should any catering be stored once it has been collected?','[{\"text\":\"Left on tray you collected it in and out on the ground\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"In the fridge located in the operations store room\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"In the fridge at the Flight Planning office with the order form placed on top of the catering, if there is too much & wont fit in Fridge, leave the catering at Alpha until the aircraft needs to be loaded. &nbsp;\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"In the Van\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(290,288,'Why does Corporate Air use a Ground Handling Task form?','[{\"text\":\"Corporate Air likes to waste paper\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"It provides staff with a summary of the tasks required for that night and confirms that the tasks are completed correctly\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"It provides staff with a summary of the tasks required for that night\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Management do not think ground handling staff are capable of remembering the work they need to complete\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(291,288,'Ground Handlers will often be required to collect catering from which company;','[{\"text\":\"Caltex\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"CIA\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"AAE\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Alpha Flight Services\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(292,288,'In accordance with the detail provided in the FBO scheduler or the Ground Handler Task Form the aircraft must be completely set up no later than?','[{\"text\":\"1 Hour prior to departure time\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"30 minutes prior to departure time\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"10 minutes prior to departure time\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"45 minutes prior to departure time\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(293,288,'Which of the following forms should be used to report the GPU was losing power when starting the Metro?','[{\"text\":\"Abnormality \\/ Incident \\/ Accident Form\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Ground Handling Task Sheet\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Cleaning Products Needed Form\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Ground Handling Equipment Unserviceability Form\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(294,288,'When should you use the Ground Handler Message Sheet?','[{\"text\":\"Only if there is a fault with any ground handling equipment\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Anytime you require other members of staff to complete a shift for you\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"For general communication with other company departments\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"If you are organising a get together for staff members\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(295,288,'What should the Ground Handler do after completing the aircraft setup activities?','[{\"text\":\"Return to the vicinity of the passenger departure gate 30 minutes prior to the aircraft departure time and await the arrival of passengers\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Sign off and go home\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Go back to the office\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Stay at the aircraft until departure\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(296,288,'Once the Pilot confirms that the aircraft is ready to board the Ground Handler should?','[{\"text\":\"Go to the office and check for more flights\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Sign off and go home\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Escort the passengers to the aircraft with Crew assistance\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Go to Alpha and check if there is any more catering for the day\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(297,288,'Arriving flight activities should be completed?','[{\"text\":\"35 minutes prior to the aircraft\'s arrival\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"4 Hours prior to the aircraft\'s arrival\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"25 Minutes prior to the aircraft\'s arrival\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"30 minutes prior to the aircraft\'s arrival\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(298,289,'When re-configuring an aircraft, why is it important to follow the steps as listed in the manual?','[{\"text\":\"It isn\'t important as the aircraft will not need to be re-configured\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"There is only one right way to install and uninstall various interior components of the aircraft\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"There is only one wrong way to install and uninstall various interior components of the aircraft.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Corporate Air operates too many aircraft types for an employee to remember every step in re-configuration per aircraft\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(299,289,'When reporting interior faults, what number do you call the Duty MRO Manager on?','[{\"text\":\"02 62497044\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"02 62497044 press Option 3\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"02 62497044 press Option 2\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"02 62497044 press Option 1\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(300,289,'When re-configuring either of the Metroliners from freight to passenger configuration what are the general steps you need to complete?','[{\"text\":\"There are no steps as the Metroliners will always be in passenger configuration\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Remove the freight liner, boards & nets, installation of the rear bulkhead, installation of cabin seats (and toilet if applicable) and cabin cleaning \\/ carpet installation\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Remove the freight liner, boards & nets, install cabin seats\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Seat and bulkhead removal and then installation of freight liner, boards & nets\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(301,289,'In Passenger to Freight configurations, why is it important to ensure the bolts and jam nuts are loosened adequately before you remove them from the seat tracks?','[{\"text\":\"It can make the seat very difficult to remove\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"So that it takes staff longer to reconfigure the aircraft\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"The bolts and jam nuts do not need to be loosened as they are clipped into the tracks not bolted\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"It can make the seat very difficult to remove and cause damage to both the seat and tracking if not loosened adequately\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(302,289,'When rolling out the centre carpet on a Metroliner why must it be laid straight down the aisle?','[{\"text\":\"It does not need to be laid straight as the carpet is heavy enough to automatically sit correctly\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"When you get to the front of the aircraft it will appear that it wavers slightly from side to side\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"The aisle has slight kinks along it and the carpet has been cut to accommodate the kinks \",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"The width of the carpet is slightly smaller then the aisle and if not laid straight down it is noticeable\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(303,289,'Where can you find all Aircraft configuration change forms?','[{\"text\":\"FBO Scheduler program\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Managers desk\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Groun Handling Manual\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Operations\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(305,289,'Why should you place the seat covers on each seat (especially the VIP seats) before they are removed from an aircraft?','[{\"text\":\"It is the only way to tell which seat is which once their out of the aircraft\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"There are no seat covers to put on the seats as the seats will never be removed\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Management wants to make the staff reconfiguring the aircraft do more work \",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"It protects the seats while other interior fittings are removed\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(307,289,'In what order should the freight liner, boards &amp; nets be installed in?','[{\"text\":\"Freight liner, boards and finally nets\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"There is no particular order\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Freight liner, nets and finally boards\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Freight boards, nets and finally liners\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(309,289,'What is the main difference between freight configurations in the Beech 58 baron to all of the other aircraft operated by Corporate Air?','[{\"text\":\"It does not get used for freight\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The seats are not removable therefore are left in for freight\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"The bubble freight liner can not be interchanged between aircraft types as the Barons have specially made liners\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"It does not have a bubble freight liner installed when in freight configuration\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(310,289,'Where on the aircraft should you place the completed Message to Flight Crew Form?','[{\"text\":\"In the wind locker\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"In the cockpit, on the co-pilots seat\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"In the cockpit, on the control column map holder\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"In the nose locker\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(311,289,'Configuration Change forms must be used?','[{\"text\":\"On any occasion when an aircraft configuration change occurs\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"For VIP configurations only\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"For commuter configurations only\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"For freight configurations only\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(312,289,'Which company aircraft are not fitted with life jackets?','[{\"text\":\"Metro 23, VH-VEU\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"All Cessna 404 Titans\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"All company aircraft are fitted permanently with life jackets.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Beech 58 Baron, VH-VEB\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(313,289,'Where are the life jackets located on all company aircraft?','[{\"text\":\"In the nose locker\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"On the co-pilots seat\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"In the rear cargo hold\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Underneath or behind each seat.\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(314,289,'Which company aircraft when configured to seating are fitted with plastic tracking?','[{\"text\":\"Beech 58 Baron VH-VEB only\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Cessna 404 and Cessna 441 only\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Metro 23, Cessna 441 and Cessna 404 only\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Beech 58 Baron VH-VEG only\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(315,289,'Why should you not over tighten the bolts when installing seats?','[{\"text\":\"It makes it difficult to take the seats back out\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"It takes up to much time\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Over tightening of bolts may cause damage to ramp on fitting and\\/or anti rattle device\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"You can over tighten the bolts if you need\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(316,289,'Over tightening of the Jam nut on a Metro 23 seat may cause the seat track to?','[{\"text\":\"Deform &nbsp;\",\"answerID\":0,\"feedback\":\"Chap 7 Sect 7.2<br \\/>\"},{\"text\":\"Loosen\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Fall off\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Rattele\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(320,289,'What type of Aircraft is a Titan?','[{\"text\":\"Cessna 441\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Metro 23\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Beech 58 Baron\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Cessna 404 &nbsp;\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(321,289,'What should you do after fitting each seat on an aircraft?','[{\"text\":\"Give it a good shake to ensure that is completely locked into the seat tracks\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Place an esky on each seat\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Take everything out of the seat pockets\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Tighten the bolts as much as possible\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(322,289,'What should you not do after fitting each seat on an aircraft?','[{\"text\":\"Make sure no rubbish is left in the seat pockets \",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Make sure you block an emergency exit with one of the seats\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Make sure emergency exits are not blocked\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Check each seat has an emergency oxygen mask and life jacket underneath or behind it.\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(323,290,'What should a ground handler do if they find a fault with any of the GSE?','[{\"text\":\"Try to fix the fault\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Complete form CAFOM020 (Ground Handling Unserviceability Form) and place it in the Ground Handling Managers in tray located at the GAO warehouse.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Report the problem to the Chief Pilot\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Ask other ground handlers to fix the problem\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(324,290,'What is the Duty Ground Handling Managers contact number?','[{\"text\":\"0400 774012 &nbsp;\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"0400 747012\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"0410 771422\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"0440 447022\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(325,290,'Why should maximum care be taken when towing an aircraft?','[{\"text\":\"The aircraft can take off unexpectedly\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Both inexpensive and embarrassing damage can easily occur to aircraft of all sizes\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Both very expensive and embarrassing damage can easily occur to aircraft of all sizes\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"You could spill any drinks left on board the aircraft\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(326,288,'What should you do before towing an aircraft?','[{\"text\":\"Ensure that sufficient room exists for the planned towing\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Ensure there no food or drinks left on the plane as they may spill\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Ensure a Message to Ground Handlers form is fill out\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Ensure the Duty Ground Handling Manager is notified\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(327,290,'At what speed should you tow an aircraft?','[{\"text\":\"15 Km\\/h\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Jogging pace only\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Walking pace only &nbsp;\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"30 Km\\/h\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(328,290,'Why should a towed aircraft be brought to a stop in a steady and slow manner?','[{\"text\":\"You can damage the wing of the aircraft if you stop to fast\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Sudden jerky movements can damage the nose locker of an aircraft severely\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Sudden jerky movements can damage the nose leg of an aircraft severely\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"You can damage the tail of the aircraft if you stop to fast\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(329,290,'What colour are the markings on the aircraft nose legs (Tow turn limit markings)?','[{\"text\":\"Blue\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Red &nbsp;\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Yellow\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Green\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(330,288,'What should you do after attaching the tow bar to an aircraft?','[{\"text\":\"Remove any chocks from under the wheels\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Sign off and go home\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Remove any catering left on the aircraft\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Remove the remote area kit from the aircraft\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(331,288,'On a Metro 23, which doors should be closed prior to towing?','[{\"text\":\"Nose locker\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Cargo door and nose locker door\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Cargo door only\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"All doors &nbsp;\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(332,288,'What does the park break look like on the Cessna 441 Conquest?','[{\"text\":\"Small round black\\/brass knob on the lower left hand side of the pilots instrument panel\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Yellow timber object often referred to as \\\"chocks\\\"\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Small round white\\/silver knob on the lower left hand side of the pilots instrument panel\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Small silver knob on the lower centre console\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(333,288,'Why is it company policy to tow the Cessna 441 Rather than push it?','[{\"text\":\"Pushing it is to hard\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"This aircraft by design has a very strong nose leg and can withstand damage\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"The aircraft can take off unexpectedly\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"This aircraft type by design has a weak nose leg and can be damaged\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(334,288,'What position is the rudder lock switch when the rudder is locked on the Cessna 441 Conquest?','[{\"text\":\"Vertical &nbsp;\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Removed\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Free moving\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Horizontal\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(335,288,'What position should the rudder lock device when towing a Cessna 404 Titan?','[{\"text\":\"Vertical\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Removed &nbsp;\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Free moving\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Horizontal\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(336,288,'Where is the park break located in a Beech 58 Baron?','[{\"text\":\"On the lower left hand side of the pilots instrument panel\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Behind the co-pilots seat\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Directly in front of the pilot at all times\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"In the nose locker\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(337,288,'What colour is the T-Shaped park break knob on a Beech 58 Baron?','[{\"text\":\"Green \",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Silver\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Red\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"White &nbsp;\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(338,288,'Where is the rudder lock (silver rod) located in a Beech 58 Baron?','[{\"text\":\"In the nose locker \",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Behind the pilots seat\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Under the pilots seat\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Between the Pilots rudder pedals &nbsp;\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(339,290,'What is the function of the Ground Power Unit (GPU)?','[{\"text\":\"It is used for starting the Metro 23 and Cessna 441 Conquest and other itinerant turbine powered aircraft as necessary\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"It is used to store drinks and catering in before flights\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"It is used to jump start any GSE that breaks down\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"It is used for starting the vacuum cleaner and lights on the cleaning cart\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(340,290,'Where should the GPU be positioned when assisting with starting an aircraft?','[{\"text\":\"At the rear right hand side of the aircraft &nbsp;\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"At the front right hand side of the aircraft\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"At the front left hand side of the aircraft\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"At the rear left hand side of the aircraft\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(344,290,'What is the average weight of an empty freight barrow?','[{\"text\":\"5000 kg\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"1150 kg\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"500 kg &nbsp;\",\"answerID\":2,\"feedback\":\"Chap 8 Sect 8.6<br \\/>\"},{\"text\":\"150 kg\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(346,290,'What is the Corporate Air Belt loader used for?','[{\"text\":\"Loading and unloading freight on the Beech 58 Baron\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Towing company GSE\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Towing company aircraft\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Loading and unloading of freight aircraft such as the Metro 23 or larger\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(347,290,'Where is the belt loader never to be driven?','[{\"text\":\"Under any wing or rear stabilizer &nbsp;\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"In the GSE parking area\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"In front of any aircraft\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"On the General Aviation Apron\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(353,291,'Which of the following contains all of the services Corporate Air offers to FBO Clients?','[{\"text\":\"Radio, airport fees, apron access, baggage, lounge, kitchen, crew room, customs & AQIS, catering fuel, GPU, GSE, cleaning, car parking and hangarage\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Radio, marshalling, aircraft parking, airport fees, apron access, baggage, lounge, kitchen, crew room and Customs & AQIS\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Radio, marshalling, aircraft parking, apron access, baggage handling, crew room, customs & AQIS, catering, fuel, GPU, GSE, cleaning, toilet (Lavatory & portable water service)\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Radio, marshalling, aircraft parking, airport fees, apron access and baggage\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(354,291,'What does GSE stand for?','[{\"text\":\"Ground Service Equipment &nbsp;\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Ground Supplied Employees\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Ground Supplied Equipment\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Ground Support Employees\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(355,291,'What is the company frequency?','[{\"text\":\"127.45\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"126.40 &nbsp;\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"129.50\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"118.70\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(356,291,'If you require any GSE for aircraft movements what should you do?','[{\"text\":\"Call the first relevant number you can find on the FBO contact Phone list. If they do not answer call the next person down until you get an answer from someone\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Contact the Operations Manager who will contact the relevant person for you\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Nothing - a booking would have been made when the Aircraft Handling Checklist was prepared so the equipment will be there when needed\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Check with the Ground Handling Manger as to the appropriate person to call and then contact them using the numbers on the FBO contact Phone List. This should be done with maximum notice to ensure the equipment is available\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(357,291,'Who must be present for an International Departing flight?','[{\"text\":\"No one, there are never any international flights departing from Canberra Airport\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Customs and Australian Quarantine Inspection Service\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Australian Quarantine Inspection Service\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Customs &nbsp;\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(358,291,'Why is it a requirement that when an aircraft is due&nbsp;internationally you obtain an updated ETA several hours before the aircraft is due?','[{\"text\":\"Aircraft that travel long distances can have their expected time of arrival varied by several hours depending on the weather and you need to communicate any changes to ETA to Customs & AQIS to prevent unnecessary waiting as the charge by the minute\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"It is not a requirement - the departing port would have called you with their time of departure so you are able to calculate their ETA\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Customs & AQIS depend on Corporate Air staff to communicate any changes to the ETA so there is no unnecessary waiting\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Aircraft that travel long distances can have their expected time of arrival varied by several hours depending on the weather\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(359,291,'Which third party can supply a High Loader?','[{\"text\":\"Kennard\'s Hire\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Qantas Airways &nbsp;\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Virgin Blue\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Hertz\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(360,291,'What must staff aim for when providing Itinerant aircraft handling?','[{\"text\":\"To get it done as quickly as possible so you can finish early\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Provide an average service\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"To get a good photo of the aircraft\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Provide a first class service &nbsp;\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(361,291,'What is the aircraft limitation on the General Aviation Apron?','[{\"text\":\"Limited to 25T MTOW and\\/or 12m wingspan\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Limited to 55T MTOW and\\/or 50m wingspan\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Limited to 35T MTOW and\\/or 24m wingspan &nbsp;\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Limited to 45T MTOW and\\/or 30m wingspan\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(362,291,'What does the Ground Handling Manager prepare prior to an Itinerant aircraft movement?','[{\"text\":\"Nothing\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Itinerant Aircraft Movement Form &nbsp;\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Aircraft inbound form\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Meals for the staff\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(363,291,'If a customer notifies you directly that they require handling what information should you obtain from them?','[{\"text\":\"What type of aircraft & the callsign? The ETA including time, date and coming from. The ETD including time, date and departing to. Whether they are dropping off passenger, picking up passengers or both. What transport has been organised for the passengers so directions can be given to General Aviation or Fairbairn locations. Do they require fuel, GPU, toilet service etc. Do the crew need transport or staying with the aircraft? Do they require any GSE or catering ordered? The contact number of the person making the handling request and\\/or the Captain. &nbsp;\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"What type of aircraft & the callsign. The ETA including time, date and coming from. The ETD including time, date and departing to. Do they require fuel, GPU, toilet service etc. Do the crew need transport or staying with the aircraft. Do they require any GSE or catering ordered. The contact number of the person making the handling request and\\/or the Captain.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"What type of aircraft & the callsign. The ETA including time, date and coming from. Whether they are dropping off passenger, picking up passengers or both. Do they require fuel, GPU, toilet service etc. Do the crew need transport or staying with the aircraft. Do they require any GSE or catering ordered. The contact number of the person making the handling request and\\/or the Captain.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"The ETA including time, date and coming from. The ETD including time, date and departing to. Whether they are dropping off passenger, picking up passengers or both. What transport has been organised for the passengers so directions can be given regarding hangar locations. The contact number of the person making the handling request and\\/or the Captain.\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(364,291,'Where should an aircraft arriving domestic park if it weighs 12T MTOW and has a 22m wingspan?','[{\"text\":\"Anywhere\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"On the Airline Apron\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"On the Fairbairn apron at Hangar 48\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"On the General Aviation Apron &nbsp;\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(365,291,'What should you do 45 minutes before the arrival of an itinerant aircraft?','[{\"text\":\"Check to see the apron is clear ready for the aircraft, make sure the radio is switched to 126.40 and at an appropriate volume, If car escorts required meet at vehicle gate, complete vehicle inspection and issue a visitors pass, confirm fuel with the suppliers if requested, have chocks and marshalling bats & greeting carpet ready for arrival and a headset for noise protection. &nbsp;\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Provide tarmac access for cars, inform the crew of where they will park and that you will marshal them in, provide the transport drivers with your mobile number so they can call you when they are returning with the passengers. Wait for the arrival of the aircraft.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Make sure the radio is switched to 126.40 and at an appropriate volume, remind the Airport Operations Officer that you will be providing cars tarmac access if appropriate, confirm fuel with the suppliers if requested, have chocks and marshalling bats ready for arrival and a headset for noise protection.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Check to see the apron is clear ready for the aircraft, the relevant lights are turned on, remind the Airport Operations Officer that you will be providing cars tarmac access if appropriate, have marshalling bats ready for arrival and a headset for noise protection.\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(366,291,'What steps should you follow when the itinerant aircraft arrives?','[{\"text\":\"Make sure the transport vehicle\\/s have been given tarmac access, marshal the aircraft into parking area, after the warning beacon has been switched off and or propellers have stopped, place the chocks under the front nose wheel and inform the crew it has been done, lay greeting carpet at front door, signal the pax transport to drive to the door of the aircraft or indicate to the pax where to proceed to. Have umbrella\'s available for pax if raining, assist crew with unloading any bags from the aircraft, escort the transport out of the airside gate and ensure it is closed. Place high visibility safety cones around aircarft (Minimum of 4, more for larger type airline aircarft, log the aircraft arrival time on the Aircraft Movement Form.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Marshal the aircraft into parking area, place the chocks under the front nose wheel and inform the crew it has been done, signal the transport to drive to the door of the aircraft or the passengers to the lounge - which ever is appropriate for the parking area, if there is transport on the tarmac escort them out the gate otherwise close the sliding door if they proceeded through the lounge. Log the aircraft arrival time on the Aircraft Handling Checklist.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Marshal the aircraft into parking area, after the propellers have stoped turning place the cocks under the front nose wheel and inform the crew it has been done, signal the transport to drive to the door of the aircraft or the passengers to the lounge - which ever is appropriate for the parking area, assist crew with unloading any bags from the aircraft, close the sliding door in the lounge. Log the aircraft arrival time on the Aircraft Handling Checklist.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Make sure the transport have been given tarmac access if appropriate, marshal the aircraft into parking area after the warning beacon has been switched off or the propellers have stoped turning place the chocks under the front nose wheel and inform the crew it has been done, signal the transport to drive to the door of the aircraft or the passengers to the lounge - which ever is appropriate for the parking area, assist crew with unloading any bags from the aircraft, if there is transport on the tarmac escort them out the gate otherwise close the sliding door if they proceeded through the lounge. Log the aircraft arrival time on the Aircraft Handling Checklist.\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(367,291,'What are the key areas of preplanning that have to occur before an aircraft movement can occur on the Fairbairn apron?','[{\"text\":\"Permission to be obtained to use the apron, pre-book any airside escorts that may be required and pre-book any third party equipment required for the arrival and departure\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Pre-book any airside escorts that may be required, pre-book any third party equipment required for the arrival and departure, allocate sufficient staff for the movement communicating where and when they are required - this being a minimum of two (2) ground handlers.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Permission to be obtained to use the apron (obtained by the Ground Handling Manager or delegate), pre-book any airside escorts that may be required, pre-book any third party equipment required for the arrival and departure, allocate sufficient staff for the movement coordinating where and when they are required - this being a minimum of two (2) ground handlers for any arrival\\/departure. &nbsp;\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Permission to be obtained to use the apron, pre-book any airside escorts that may be required, allocate sufficient staff for the movement communicating where and when they are required - this being a minimum of two (2) ground handlers.\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(368,291,'If helping with an aircraft movement on the Fairbairn apron when should you arrive at work?','[{\"text\":\"45 minutes before the ETA\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"At the ETA as the aircraft will be late arriving\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"90 minutes before the ETA\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"70 minutes before the ETA &nbsp;\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(370,291,'If you are handling aircraft on the Fairbairn apron , what equipment as minimum should you take with you?','[{\"text\":\"Clipboard with aircraft handling checklist, up to date phone list and Fairbairn street map, Corporate Air business cards, Tug & barrows & belt loader if required, High visibility vests for each ground handler, marshalling wands, ear muffs for each ground handler, UHF radios x 2, 2 sets aircraft chock, 4 high visibility cones, small or large ladder, weighing scales, dangerous goods picture provided with Aircraft Movement Form, printed boarding passes, stapler x 2, calculator, texta and pens if providing a check-in service. &nbsp;\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Tug, High visibility vests for each ground handler, marshalling wands, ear muffs for each ground handler, UHF radios x 2, 2 sets aircraft chock, 4 high visibility cones, belt loader, small ladder.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Clipboard with aircraft handling checklist, phone list and street map, Corporate Air business cards, Tug, High visibility vests for each ground handler, marshalling wands, ear muffs for each ground handler, UHF radios x 2, 2 sets aircraft chock, 4 high visibility cones.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Clipboard with aircraft handling checklist, phone list and street map, Corporate Air business cards, Tug & barrows, High visibility vests for each ground handler, marshalling wands, ear muffs for each ground handler, UHF radios x 2, 2 sets aircraft chock, 4 high visibility cones.\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(372,291,'If there are vehicles at&nbsp;the General Aviation&nbsp;gate&nbsp;to pick up passengers off an arriving aircraft what should you do?','[{\"text\":\"Brief the drivers on airside escort procedures including following the tug, hazard light on and driver to remain in the vehicle unless they are loading \\/ unloading the vehicle. Provide the drivers with the relevant number to call when they are on their way back to the airport. Escort them from the carpark to the aircraft and back to the carpark.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Identify the driver of the vehicle ensuring you obtain their contact number, drivers licence number, vehicle registration. Brief them on airside escort procedures including following the escort vehicle, hazard lights on and driver to remain in the vehicle unless they are loading \\/ unloading the vehicle & issue the driver\\/s with a Canberra Airport Visitor pass. Provide the drivers with the relevant number to call when they are on their way back to the airport. Escort them from the gate to the aircraft and back to the gate, collectig the Visitor\\/s pass on the way out. &nbsp;\",\"answerID\":1,\"feedback\":\"Chap 9 Sect 9.8\"},{\"text\":\"Identify the driver of the vehicle ensuring you obtain their contact number, drivers licence number, vehicle registration. Brief them on airside escort procedures including following the tug, hazard light on and driver to remain in the vehicle unless they are loading \\/ unloading the vehicle. Escort them from the carpark to the aircraft and back to the carpark.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Identify the driver of the vehicle ensuring you obtain their contact number, drivers licence number, vehicle registration. Provide the drivers with the relevant number to call when they are on their way back to the airport. Escort them from the carpark to the aircraft and back to the carpark.\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(373,291,'What is the preferred parking location for a domestic itinerant Challenger 601 aircraft?','[{\"text\":\"Third line General aviation apron\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"First Line General aviation apron &nbsp;\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"RPT apron\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"SPA apron\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(374,291,'When can the Terminal (RPT) Apron be used?','[{\"text\":\"Only as a last resort and all means used to avoid such a situation.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Only for scheduled aircraft movements which Corporate Air do not currently perform.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"For all aircraft movements regardless of the aircraft size\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"For any aircraft movements when the aircraft is too large to be accommodated on the General Aviation Apron\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(376,292,'Are Corporate Air staff allowed to open freight lockers or baggage doors on Corporate Air freight aircraft?','[{\"text\":\"Yes - once the aircraft has arrived and shut down engines, ensuring that care is taken so no loose freight may injure staff or door opening mechanisms getting damaged.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"No - all access to baggage hold will be through the main cabin and the flight crew are required to open main door to the cabin.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"No - it is company policy that no doors or lockers are ever open or closed by staff other then the flight crew\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Yes - once the aircraft has arrived and shut down engines. &nbsp;\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(377,292,'Why must you ensure that you check all areas of an aircraft for freight?','[{\"text\":\"The flight crew will be trying to trick the ground handling staff into forgetting items that are stowed in the nose lockers of the aircrafts.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The flight crew are not present when the aircraft is loaded and will not know where the freight has been placed.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"The flight crew may have advised the gross weight of the freight carried which can be deceptive in terms of the bulk freight onboard the aircraft. &nbsp;\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Corporate Air is not required to keep an accurate log of freight carried on the aircraft therefore the number of pieces will not be known.\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(378,292,'What is the freight priority order for all AAE freight?','[{\"text\":\"Gold Mail and General Freight have the highest priority while AOG Aircraft Parts have the lowest priority.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Gold Mail and AOG Aircraft Parts have the highest priority while general freight the lowest priority. \",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"First in first served - the parcels that have been waiting the longest have higher priority.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"AGO Aircraft parts have the highest priority, then Gold Mail and finally General Freight with the lowest priority.\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(379,292,'Why must you take notice of the barrow and freight weight when collecting freight from AAE?','[{\"text\":\"Ground handling staff are only allowed to move a certain amount of weight each shift in accordance with Occupational Health and Safety laws\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Corporate Air charges AAE based on the weight of freight carried so accurate figures must be given to Accounts for invoicing.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"It will be needed to determine how to load an aircraft\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"It will be needed to determine how to load an aircraft and if ballast will be required to ensure correct weight and balance.\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(381,292,'Why must the Corporate Air - Freight Handling Log be filled out each night?','[{\"text\":\"It assists the \'Duty\' Operations Manager address any problems with the freight run the next day. &nbsp;\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"It does not have to be completed as the flight crew will already be completing a log of all freight transported.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"It assists the \'Duty\' Operations Manager assess if staff are working efficiently and if more staff are required for any particular day.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"It assists the \'Duty\' Operations Manager to shift the blame to AAE if a freight parcel is lost.\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(382,292,'What approximate time does the Corporate Air Metro Flt # 7063 depart for Melbourne Monday to Thursday nights?','[{\"text\":\"2030\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"1930\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"2230\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"2130 &nbsp;\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(384,292,'If there is no ground handling task sheet completed what General Duties must be completed?','[{\"text\":\"Go home.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Clean kitchen and toilets at Bridabella Airlines. \",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Ensure general cleanliness of Corporate Air aircraft at General Aviation apron and general cleanliness of the General Aviation Airport Office.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Clean & vacuum Canberra Airport lounge and reception areas. \",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(385,292,'If the event that returning flights require a diversion due to poor weather what should ground handling staff do?','[{\"text\":\"Go Home \",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Contact the Corporate Air \'Duty\' Operations Manager who will contact the relevant people that a diversion is required.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Call the Air Traffic Control Tower\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Call AAE to ensure that they are aware of the Diversion.\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(386,292,'If a diversion to Moruya is not possible due to bad weather or low fuel what is it important to obtain from the Flight crew?','[{\"text\":\"Which airport they will divert to and current fuel figures in case of secondary diversions.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Which airport they will divert to and their ETA so this can be communicated to the Corporate Air \'Duty\' Operations Manager and any other relevant personnel so appropriate action can be taken. &nbsp;\",\"answerID\":1,\"feedback\":\"Chap 10 Sect 10.9<br \\/>\"},{\"text\":\"Current fuel figures and load so an appropriate airport for landing can be determined by the Corporate Air \'Duty\' Operations Manager.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Which airport they will divert to and their ETA so you can inform the airport to expect them.\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(387,292,'You have removed ballast from an aircraft, where are they stored?','[{\"text\":\"Inside the Flight Planning room.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"On a freight barrow airside.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Outside the Flight Planning room.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Inside the White equipment barrow located at the GSE area, Canberra Airport. \",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(388,292,'What approximate time does the&nbsp;AAE Flt # 7062 arrive from Sydney Monday to Thursdays?','[{\"text\":\"0511\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"0115 &nbsp;\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"1035\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"1105\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(389,292,'What approximate time does Flt #&nbsp;7064 arrive from Melbourne?','[{\"text\":\"0135\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"0310\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"1310\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"0125 &nbsp;\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(390,292,'What approximate time does Flt # 7061&nbsp;depart from Canberra?','[{\"text\":\"2115 &nbsp;\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"0103\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"0310\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"1310\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(391,292,'What is the allowed time frame for the unloading of freight and delivery to AAE Canberra?','[{\"text\":\"30 Min\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"20 Min &nbsp;\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"10 min\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"1 Hr\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(392,292,'What must Ground Handlers visually check immediately prior to loading freight into an aircraft?','[{\"text\":\"The number of parcels\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The destination of the freight\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"That the barrow has Corporate Air stickers on it\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"That the barrow is clean\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(393,292,'What is the correct name of the form that must be filled out by ground handlers and placed in the Head office box at the end of each night?','[{\"text\":\"Freight movement log\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Freight Handling log &nbsp;\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Handling freight log\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Movement of freight log\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(394,292,'What type aircraft generally operates&nbsp;Flt # 7063&nbsp;departing from Canberra Monday to Thursdays?','[{\"text\":\"Metro\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Baron\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"C441\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"C404\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(395,293,'Who co-ordinates the Australia-wide cabin cleaning requirements of Virgin Blue?','[{\"text\":\"Virgin Blue International\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Corporate Air\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Canberra International Airport\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Inflight Logistics Services (ILS) &nbsp;\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(396,293,'What does Virgin Blue\'s fleet consist of?','[{\"text\":\"Saab 340\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Saab 340 & Boeing 737-800\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Boeing 737-700, 737-800 & E170, E190 Embraer\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Boeing 737-700\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(397,293,'How many economy passengers seats can the Boeing 737-700\'s carry?','[{\"text\":\"144 passengers &nbsp;\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"209 passengers\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"189 passengers\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"169 passengers\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(398,293,'When can Corporate Air Ground Handling staff open the Virgin Blue aircraft doors?','[{\"text\":\"Anytime there is an aircraft requiring cleaning\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Only if there is no Virgin Blue Engineer or their representative available and you must note this fact on the Virgin Blue check sheet for the aircraft\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Never, You must wait for a Virgin Blue engineer or Airline representative\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Only if there is no Virgin Blue Engineer or their representative available\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(399,293,'How many toilets are there on a Virgin Blue B737 aircraft and where are they located?','[{\"text\":\"4 - two at the front and two at the rear of the aircraft\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"None - Virgin Blue aircraft do not have toilets installed\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"3 - one at the front and two at the rear of the aircraft\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"3 - two at the front and one at the rear of the aircraft\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(400,293,'Are crew meals on Virgin Blue aircraft to be counted and included on the Wastage report?','[{\"text\":\"Depends if they are out of date or not.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Yes\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"No &nbsp;\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Crew meals are not provided by Virgin Blue\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(401,293,'What are the three (3) types of hazards that could occur while cleaning a Virgin Blue aircraft?','[{\"text\":\"General, infection and Sharp Object & Needles\",\"answerID\":0,\"feedback\":\" \"},{\"text\":\"Infection, Equipment and Sharp Object & Needles\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"General, Equipment and Sharp Object & Needles\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"General, Infection and Equipment\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(402,293,'Which of the following is not listed in the Corporate Air Ground Handling Manual as a precaution for General Hazards?','[{\"text\":\"Do not observe recommended dilution rates &nbsp;\",\"answerID\":0,\"feedback\":\"Sect 11.2<br \\/>\"},{\"text\":\"Protect open wounds on hands and other exposed and vulnerable areas of skin with waterproof adhesive dressing\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Do not mix two or more products together\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Use approved gloves and face protection when appropriate\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(403,293,'As a preventative measure Corporate Air has provided coloured coded buckets and cloths to clean the Virgin Blue aircraft with, what are the colour codes?','[{\"text\":\"Red- Galley, Blue - Toilets, Disposable cloths - cabin, seats, overhead lockers & windows, Yellow - exterior cleaning\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"There is no colour code\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Blue - Galley, Red - Toilets and Yellow - Cabin, seats, overhead lockers & windows\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Blue - Galley, Red - Toilets, Yellow - cabin, seats, overhead lockers & windows, Disposable Cloths - exterior cleaning &nbsp;\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(404,293,'If you found a small plastic bag containing a powder what should you do?','[{\"text\":\"Leave it where you found it, request all members of staff to exit the aircraft, contact Customs using the numbers listed in the cabin cleaning van informing them of the package, contact the Corporate Air \'Duty Operations Manager\', document the incident while waiting for Customs to arrive.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Do nothing, all aircraft arriving in Canberra get screened by the AFP on arrival and they will find any suspicious packages.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Leave it where you found it, request all members of staff to exit the aircraft, Advise the Virgin Blue Engineer\\/representative (if Present), call the required authorities ASAP (relevant numbers are listed on the Ground Handling notice board, in the cabin cleaning van and the Ground Handling mobile phone), call the Corporate Air \'Duty Ground Handling\' immediately on 0400 774012 and document the incident ASAP with as many details as possible.\",\"answerID\":2,\"feedback\":\" \"},{\"text\":\"Take it back to Corporate Air\'s hanger where you will contact Customs using the numbers listed on the Ground Handling Noticeboard informing them of the package, contact the Corporate Air \'Duty Operations Manager\', document the incident while waiting for Customs to pick up the package.\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(405,293,'If you find passengers belongings left on the aircraft what should you do?','[{\"text\":\"Tag the item using the Virgin Blue Lost and Found Baggage tags located in the Cabin Cleaning Van making sure you log the aircraft registration. Place the bag in the Virgin Blue Engineer\'s office.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Tag the item using the Virgin Blue Lost and Found Baggage tags located in the Cabin Cleaning Van making sure you log the aircraft registration, seat number where it was found and your name. Place the bag in the Virgin Blue Engineer\'s office and if they are present inform them of the baggage. &nbsp;\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Tag the item using the Virgin Blue Lost and Found Baggage tags located in the Cabin Cleaning Van making sure you log the seat number where it was found and your name. Place the bag in the Virgin Blue Engineer\'s office and if they are present inform them of the baggage.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Tag the item using the Virgin Blue Lost and Found Baggage tags located in the Cabin Cleaning Van making sure you log the aircraft registration, seat number where it was found and your name. Place the bag in the reception are of Hangar 2 so administration staff can inform Virgin Blue the next working day.\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(406,293,'There are expired Virgin Blue Muffins in an aircraft, who is allowed to eat them?','[{\"text\":\"No one all left over catering including staff meals must be thrown out.\",\"answerID\":0,\"feedback\":\"Sect 11.6<br \\/>\"},{\"text\":\"Only staff or their immediate family\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Any staff members as long as the muffins stay on company premises\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Any person who is in the vicinity of the aircraft as long as they stay within the airfield\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(407,293,'If you are caught taking Virgin Blue catering (including staff meals) off the company premises and/or providing it to a 3rd party what are the consequences?','[{\"text\":\"You will be dismissed immediately\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"You will be put on a probation lasting a minimum of 3 months and if any other breaches of company policy occurs you will be dismissed\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"There are none, anyone can eat left over catering\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"You shall have your employment status reviewed and will need to show good reason why you should not be dismissed immediately\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(408,293,'When cleaning the tray tables on a Virgin Blue aircraft what should you use?','[{\"text\":\"Ecolab Transclean diluted with water in a 1:50 ratio.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Water only, no chemicals are to be used when cleaning a Virgin Blue aircraft\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Ecolab Top Gun undiluted\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Ecolab Transclean diluted with water in a 1:10 ratio\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(409,293,'Why should you only use products provided by Virgin Blue to clean their aircraft?','[{\"text\":\"These products have been approved by Virgin Blue and are known to not cause damage to their aircraft.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"You can use any products as long as they are known to cause damage to any aircrafts\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"You can use any products as long as they are known to not cause damage to any aircrafts\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"These products have been approved by Virgin Blue and are known to cause damage to their aircraft\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(410,293,'When should you check the Cabin Cleaning Alert folder?','[{\"text\":\"After each shift finishes so you can clarify the changes to procedures the Ground Handling Supervisor will have informed you of at the start of the shift\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Before each shift starts as the ground Handling Manager may place specific new information in the folder for the information of ground handlers.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Once each week as the Operations Manager may place specific new information alerting ground handlers of changes to operations taking place the following week\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Only when you are informed by the Ground Handling Supervisor that there is new information in the pigeon hole\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(411,293,'When should you fill out a Virgin Blue Cabin Cleaning Form?','[{\"text\":\"Once per night regardless of how many aircraft are cleaned. You must make sure you note the aircraft registrations, arrival times, cleaning start and finish times on the sheet.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Each time you clean a Virgin Blue aircraft making sure you note the aircraft registration and arrival time.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Each time you clean a Virgin Blue aircraft making sure you note the aircraft registration, arrival time, cleaning start and finish times. &nbsp;\",\"answerID\":2,\"feedback\":\"Sect 11.8<br \\/>\"},{\"text\":\"Only if it is the first visit to Canberra for an aircrafts registration\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(412,293,'Why is it important to accurately fill in and fax the Wastage Form?','[{\"text\":\"It is used by the next port to know what stock is on the aircraft\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"It proves that staff are not stealing items belonging to Virgin Blue\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"It is used by the next port to know what stock is on the aircraft and for Alpha Flight services to track the stock they provide\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"It is used by In-flight Logistic Services to track the stock they provide\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(413,293,'What is the Stock Record Form used for?','[{\"text\":\"To record any new stock that is received\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"For management to tack the used of products so theft does not occur\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"By ILS to send stock based on the information contained within the form rather then waiting for an order being placed\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"To record any new stock that is received and may be used by ILS to send stock based on the information on this form without an order being placed\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(414,293,'Which areas of a Virgin Blue aircraft need to be cleaned?','[{\"text\":\"Cockpit, overhead lockers roof and side panels, carpets, windows, seats, toilets, galleys, cargo compartment and exterior of aircraft\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Overhead lockers, roof and side panels, carpets, windows, seats, toilets, galleys, cargo compartment.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Overhead lockers, carpets, seats, toilets and galleys\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Galley and toilets only, aircraft crew will clean seat areas\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(415,293,'What must you do between when you arrive for your shift and the first aircraft arrives?','[{\"text\":\"Ensure your ASIC & ADA are clearly visible, you have checked the \'Cabin Cleaning Alert\' pigeon hole and checked the Cabin Cleaning van to ensure it contains enough supplies for all aircrafts being cleaned during the shift.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Ensure your ASIC & ADA are clearly visible outside your high visibility vest or shirt and you have checked the \'Cabin Cleaning Alert\' pigeon hole.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Ensure your ASIC & ADA are clearly visible outside your high visibility vest or shirt, you have checked the \'Cabin Cleaning Alert\' pigeon hole, check the Cabin Cleaning van to ensure it contains enough supplies for all aircrafts being cleaned during the shift.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Check the Cabin Cleaning Van to ensure it contains enough supplies for all aircrafts being cleaned during the shift and you have checked the \'Cabin Cleaning Alert\' pigeon hole.\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(416,293,'What colour is the Toilet Supplies Bag?','[{\"text\":\"Striped &nbsp;\",\"answerID\":0,\"feedback\":\"Sect 11.10<br \\/>\"},{\"text\":\"Blue\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Spotty\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Yellow\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(417,293,'What should be included in the Cleaning Supplies Bag?','[{\"text\":\"6 toilet rolls, 2 packets of paper towels, 3 tissue boxes, 3 soap dispensers and a supply of air sickness bags\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Yellow bucket & cloths, blue bucket & cloths, red bucket & cloths and disposable cloths\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Safety regulation cards, menu cards, in-flight magazines, air sickness bags, 2 clean cloths and 1 bottle of Transclean for hard to remove marks\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"1 bottle Transclean surface cleaner, 1 bottle De-Solv-It cleaner, 1 air freshener for toilets, clean cloths and chuck wipes, disposable gloves, 8 blue garbage bags and 2 large green garbage bags &nbsp;\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(418,293,'What supplies should you take onto an aircraft when commencing the cleaning?','[{\"text\":\"Only the supplies required to do a general tidy up of the aircraft and to remove any rubbish in the bins located throughout the aircraft\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"2 x seat pocket bags, battery bag, toilet supplies bag, cleaning supplies bag, amenity kit, vacuum and 2 boxes of in-flight magazines\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"2 x seat pocket bags, battery bag, amenity kit, vacuum and 2 boxes of in -flight magazines\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Battery bag, toilet supplies bag, cleaning supplies bag, amenity kit and 2 boxes of in-flight magazines\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(419,293,'When should the left over catering be removed from the aircraft?','[{\"text\":\"As you come across it while cleaning the aircraft starting at the front of the aircraft.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The left over catering should be placed in garbage bags and disposed of in the appropriate bins when you first commence cleaning the aircraft.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"The left over catering should be placed in garbage bags and then outside the aircraft doors on the steps when you first commence cleaning the aircraft. Once all cleaning has finished dispose of any garbage bags on the aircraft steps in the appropriate bins. \",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Never, Virgin Blue Crew will have removed any catering that requires disposal of. The only catering left onboard the aircraft is non-perishable.\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(420,293,'What are the steps required to clean each row of seats?','[{\"text\":\"Check ashtrays if present for rubbish, drop tray tables and check\\/restock seat pockets, wipe down tray tables, check walls, overhead panel and any other areas for marks needing to be cleaned, check the floor area for any rubbish\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Check walls, overhead panel and any other are for marks needing cleaning, check the floor area for any rubbish, brush down seats.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Drop tray tables and check\\/restock seat pockets, wipe down tray tables, wipe windows from top to bottom, finally brush down seats\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Check ashtrays if present for rubbish, drop tray tables and check\\/restock seat pockets, wipe down tray tables, wipe windows from top to bottom, brush down seats, arrange seat belts in a crossover pattern, check walls, overhead panel and any other areas for marks needing to be cleaned, finally check the floor area for any rubbish \",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(421,293,'When should the aircraft be vacuumed?','[{\"text\":\"Never, the flight attendants will vacuum after each flight regardless of how dirty the carpets are\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Every time the aircraft is cleaned\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Every time the aircraft is cleaned. It should be done as the first task so it is not forgotten\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Only if the carpets look dirty because there has been a spill during a flight\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(422,293,'What should you do before you clean the Galley?','[{\"text\":\"Wash hands after you clean the toilets but before you clean the Galley\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Nothing, the galley will be cleaned by the flight attendants before they leave the aircraft\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Wash hands before you commence cleaning the Galley making sure you leave the toilets till after the Galley is finished\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Clean the toilets\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(423,293,'How long does Corporate Air allow after the final aircraft is cleaned for staff to complete any paperwork and a general tidy up?','[{\"text\":\"15 minutes &nbsp;\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"As long as it takes\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"30 minutes\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"20 minutes\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(424,293,'Any ILS messages found in the Cabin Cleaning Alert&nbsp;folder are to be?','[{\"text\":\"Read and signed by all cleaning staff and then disposed of\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Read and signed by all staff and then placed on file\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Read by all staff and then filed\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Read and signed by the ground handling co-ordinator and then filed\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(425,293,'On every Virgin Blue aircraft&nbsp;that have&nbsp;onboard vacuums they must replace:','[{\"text\":\"Batteries and filters\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Batteries replaced but not if the vacuum sounds like the battery is still charged\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Both A & B &nbsp;\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Pre filter brushed, and filter replaced &nbsp;with a new one\",\"answerID\":3,\"feedback\":\"\"}]',2,'no',1),(426,293,'Corporate Air cabin cleaners may board a Virgin Blue aircraft when?','[{\"text\":\"All passengers and flight crew have disembarked\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"You think it is an appropriate time\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"The engines have shut down and the anti collision beacon has been switched off\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"The Virgin Blue engineer has given the OK\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(428,293,'After a Virgin Blue aircraft has been cleaned and checked you should?','[{\"text\":\"Move on to the next aircraft or back to the General Aviation office\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Nothing - there will always be someone there from Virgin Blue supervising you\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Advise the ground handling co-ordinator that the task has been completed\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Notify the Virgin Blue engineer if present that you have completed the cleaning\",\"answerID\":3,\"feedback\":\"\"}]',3,'',1),(429,293,'In what order should the Virgin Blue Seat Pocket items be placed in?','[{\"text\":\"Safety card, Menu card, in-flight magazine, sick bag\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Sick bag, safety card, menu card, in-flight magazine\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Safety card, sick bag, menu card, in-flight magazine\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Sick bag, in-flight magazine, menu card, safety card\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(430,293,'Virgin Blue Aircraft cleaning summary sheets are to be faxed to?','[{\"text\":\"IAS\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Caltex\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"ILS\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"ALpha\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(431,293,'When replenishing the Virgin Blue first aid kits onboard aircrafts you should?','[{\"text\":\"Only restock the item when it\'s on it\'s last one\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Restock items according to the used contents sheet and replace with new items\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Restock items accordingly\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Leave it and place a new contents sheet inside the kit\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(432,294,'When could&nbsp;an Aeropelican&nbsp;aircraft be diverted to Canberra?','[{\"text\":\"Only during the winter months and only between 1830 and 2140 each day\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Only if there is poor weather conditions at Cooma or Sydney airport and during the winter months\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Any time there is poor weather conditions at Cooma airport, mainly throughout winter but could be any time of the year\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Any time of the year regardless on weather conditions\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(433,294,'How many ground handlers are required if Corporate Air is reuired to handle a diverted Aeropelican flight?','[{\"text\":\"Six plus three casuals\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"A Minimum of two staff but preferably three.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Four - 1 to marshal in the aircraft, 1 to give airside \\/ lounge access, 1 to make coffees, 1 to help out the other 3\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"None, the flights will return to their departure port if the flight is diverted\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(434,294,'How will the passengers get to Cooma when there is a diversion?','[{\"text\":\"They will wait at Corporate Air until the weather looks like clearing at Cooma and then the flight will recommence\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The passengers will be sent to the main terminal at Canberra Airport where they will be required to book a flight back to Sydney on any available flight\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"A bus will be organised at Canberra to take the passengers to Cooma and return with the passengers on the Cooma - Sydney leg\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"A bus will be sent from Cooma with the passengers flying on the return leg, they will deliver these passengers to a Corporate Air designated meeting point (Gate 4) and then pick up the passengers heading to Cooma from the Terminal.\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(435,294,'How should the passengers and luggage be transferred from the bus to the aircraft on arrival?','[{\"text\":\"1st GH to escort passengers from the bus to Gate 4, Walker Place and then escort the passengers travelling to Cooma onto the bus, confirm with Regional Express that all passengers are on the bus and then escort the passengers travelling to Sydney to the aircraft. \",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Have the airside door open and chocked so passengers can carry their own bags through the lounge and to the aircraft when the bus arrives. Once the passengers are off the bus get the waiting passengers to board the bus.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Passengers from the Cooma to Canberra bus will be escorted from Gate 4 Walker Place to the aircraft on foot or the bus, pending Airport Opertaions approval.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"1st GH to escort passengers from the bus to the aircraft, then escort the passengers waiting at Gate 4, Walker place to the bus, 2nd GH to unload the bus on to barrows and take them to the aircraft then return with the bags from the aircraft and load onto the bus.\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(436,294,'What should you do once the aircraft has departed?','[{\"text\":\"Call Aeropelican Network Operations and Gate 45 Sydney Airport to advise them of taxi and airborne time. &nbsp;\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Call Regional Express Network Operations and advise them of airborne time\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Call Virgin Blue Network Operations and advise them of taxi time.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Turn off all lights, turn off air-conditioning\\/heating, check all doors including the Hangar doors are locked.\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(437,294,'Where can the Aeropelican Cooma Schedule be found?','[{\"text\":\"www.rex.com.au\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"www.duck.com.au\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"www.aeropelican.com.au &nbsp; &nbsp;\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"www.pelican.com.au\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(438,294,'What procedures should be carried out prior to diverted aircraft arriving at Canberra?','[{\"text\":\"VHF radio tuned to 124.60, tugs and barrows parked at Gate 4, marshalling equipment ready, wearing correct PPE, ensure 2nd line GA is available & ASIC pass is clearly displayed\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"VHF radio tuned to 124.60, tugs and barrows parked at Gate 4, marshalling equipment ready, wearing correct PPE, ensure 4th line GA is available & ASIC pass is clearly displayed \",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"VHF radio tuned to 129.65, tugs and barrows parked at Gate 4, marshalling equipment ready, wearing correct PPE, ensure 3rd line GA is available & ASIC pass is clearly displayed \",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"VHF radio tuned to 126.40, tugs and barrows parked at Gate 4, marshalling equipment ready, red cones x 3 for wingtips and tail, wearing correct PPE, ensure 1st or second line GA is available & ASIC pass is clearly displayed\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(439,294,'What aircraft does Aeropelican operate and what is the passenger capacity?','[{\"text\":\"Saab 340, 34 passengers\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Jetstream 32, 19 passengers &nbsp;\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Jetstream 41, 19 passengers\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Metro 23, 19 passengers\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(440,294,'What is the&nbsp;Aeropelican network Operations phone number?','[{\"text\":\"02 4928 9605 &nbsp;\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"02 4298 9605\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"02 4892 9506\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"02 4298 9560\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(441,294,'Where can you take the passengers arriving on the aircraft should they be waiting for an extended time for the bus from Cooma?','[{\"text\":\"Hungry Jacks in Fyshwick\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"General Aviation Office\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"The Aiport Terminal to remain as a group.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Barton Head Office\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(443,295,'Air Support Services Operates?','[{\"text\":\"5 days a week, 10 hours a day\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Only on Defence aircraft\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"24 hours a day 7 days a week &nbsp;\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"4 days a week 3 hours per day\",\"answerID\":3,\"feedback\":\"\"}]',2,'',1),(444,295,'What is the operational notice period outside normal operating hours?','[{\"text\":\"4 Hours\",\"answe