 batteries if the aircraft is parked more than?','[{\"text\":\"Four days\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Three days\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Two days\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"One day\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(514,39,'After disconnecting the batteries, equipment with frequency memory circuits must be?','[{\"text\":\"Reset\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Disconnected\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Turned off\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Left activated\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(515,39,'The minimum voltage for a battery start is?','[{\"text\":\"12 volts\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"14 volts\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"22 volts\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"24 volts\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(516,39,'The left or right GEN OFF light illuminates whenever;','[{\"text\":\"The line contactor for that generator is open\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The firewall shutoff button for that engine is pushed\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Engine speed is below 60% RPM\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"All of the above\",\"answerID\":3,\"feedback\":\"\"}]',3,'no',1),(517,39,'With the engines running and the generators on normal bus voltage is?','[{\"text\":\"28.5 volts\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"24.5 volts\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"22 volts\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"14 volts\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(518,39,'The avionics frequency memory, cabin lights and nose baggage lights are on the?','[{\"text\":\"Left main bus\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Right main bus\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Hot battery bus\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Utility bus\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(519,40,'The baggage area illuminates when the?','[{\"text\":\"Left nose baggage door is open\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Left nose baggage door is closed\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Right nose baggage door is open\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Either A or C\",\"answerID\":3,\"feedback\":\"\"}]',3,'no',1),(520,40,'If fitted, the switch located immidiately inside the cabin doorway controls?','[{\"text\":\"The cabin doorway and instrument panel lights\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The cabin reading lights\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"The baggage compartment lights\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"The cockpit floodlight and cabin doorway light\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(521,40,'The DAY / NIGHT switch is utilised to?','[{\"text\":\"Vary the intensity of the instrument panel lights\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Supply operating power to all panel lights\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Vary the intensity of the instrument lights\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"All of the above\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(522,40,'The cockpit floodlight mounted in the overhead console is?','[{\"text\":\"Controlled by individual rheostats\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Used for illumnination of the aisle\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Controlled by a single rheostat\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Both B and C\",\"answerID\":3,\"feedback\":\"\"}]',3,'no',1),(523,40,'The two map lights located in the centre portion of the overhead console are?','[{\"text\":\"Connected to the hot battery bus\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Controlled by individual rheostats\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Connected to an emergency battery pack\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Controlled by co-located rheostats\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(524,40,'Passenger compartment reading lights are illuminated when?','[{\"text\":\"When the engines are started\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Using the switch locatd just forward of the entrance door\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Depressing the switch located between the passenger air outlets and the reading lights\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Using a switch located on the overhead console in the cockpit\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(525,40,'Proper opertaion of the navigation lights can be checked by?','[{\"text\":\"Checking reflections on the ground below the tail and each wingtip\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Verifying that the in-operation light is illuminated\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Looking at the observation mirror\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Observing the NAV annunciator is illuminated\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(526,40,'Because of their intensity and reflection, anti-collision lights should not be used?','[{\"text\":\"When in fog, cloud or haze\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"During night flights with clear skies\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"During ground operations at night\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Both A and C\",\"answerID\":3,\"feedback\":\"\"}]',3,'no',1),(527,40,'When the LDG LIGHT switch is positioned to OFF, the landing lights?','[{\"text\":\"Retract flush with the respective wingtip\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Remain illuminated if in the extended position\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Extinguish, and remain at their existing position\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Retract flush but remain illuminated\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(528,40,'After takeoff, the landing lights are extinguished?','[{\