text\":\"The left fuel tank has failed to cross feed\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(533,41,'Illumination of the R OIL PRESS light?','[{\"text\":\"Indicates the right oil pressure is below 25psi\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Indicates the right oil pressure gauge has failed\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Will trigger the master warning lights\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Will not trigger the master warning lights\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(534,41,'Illumination of the AIR DUCT O/HEAT light?','[{\"text\":\"Illuminates when the janitrol cabin heater is turned ON\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Illuminates when the windscreen distribution dict is above 157 degrees C\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Indicates the emergency cabin pressurisation duct is above 149 degrees C\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Indicates the cabin air distribution duct is above 157 degrees C\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(535,41,'The L BETA light?','[{\"text\":\"Indicates that the condition lever needs to be advanced to a higher RPM\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Is normally illuminated during ground operations\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Will illuminate the master warning lights\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Means that the left hand engine is about to fail\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(536,41,'The L FUEL PRESS LOW light illuminates?','[{\"text\":\"When there is less than 80lbs of fuel in the left tank\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"When the main or aux boost pump has failed or is switched OFF\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"With the L BETA light\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"The entire cockpit because all is about to go pear shaped\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(537,41,'The L HYD FLOW LOW light indicates?','[{\"text\":\"There is insufucient hydraulic pressure for normal system operation\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"That the hydraulic fluid has been directed to the low point in the system\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"The hydraulic fluid is the wrong specification and may easily be ignited\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Low altitide system operation\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(538,41,'Illumintaion of the L FUEL LEVEL LOW light indicates?','[{\"text\":\"There is less than 80lbs of fuel in the fuel tank with the main boost pump operating\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The left main boost pump has failed and the left aux boost pump is now operating\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"There is between 150-250lbs of fuel in the left tank\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"The left fuel tank has failed to cross feed\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(539,42,'With both fuel boost pump switches positioned to MAIN the L AUX BOOST light?','[{\"text\":\"Indicates that both boost pumps in the right tank are now operating\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Indicates the left aux boost pump must now be switched ON\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Indicates the left main boost pump has failed and the left aux boost pump is now ON\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Both B and C\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(540,42,'With the left boost pump switch to MAIN, illumination of the L X-FER PUMP FAIL light?','[{\"text\":\"Will cause the L AUX BOOST light to illuminate\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Will cause the L FUEL PRESS LOW light to illuminate\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Will cause the left aux boost pump to be automatically be turned ON\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"May result in a possible flameout of the left engine if co-ordinated flight is not maintained\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(541,42,'The auxillary boost pumps?','[{\"text\":\"Come on automatically if the main boost pump fails\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Are used for fuel transfer and crossfeed operations only\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Must be turned on manually when the main boost pump fails\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Operate continuously regardless of the boost pump position\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(542,42,'Failure of both the main and auxillary boost pumps will result in?','[{\"text\":\"Automatic crossfeed of fuel from the side with the failed boost pumps\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"An increase in unusable fuel\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"A flameout of the engine with the failed boost pumps\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Both A and B\",\"answerID\":3,\"feedback\":\"\"}]',1,'no',1),(543,42,'With the crossfeed selector switched to the L/H ENG position, the following occurs?','[{\"text\":\"Left tank to left engine, right tank to right engine\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Left tank to right engine, right tank to left engine\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Right tank to both engines\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Left tank to both engines\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(544,42,'The minimum allowable fuel in each main tank for takeoff is?','[{\"text\":\"108lbs\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"188lbs\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"208lbs\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"288lbs\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(545,42,'Due to possible fuel starvation with the L X-FER PUMP FAIL light illuminated?','[{\"text\":\"Maximum uncoordinated flight time is 30 seconds\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Maximum uncoordinated flight time is 60 seconds\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Minimum uncoordinated flight time is 30 seconds\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Minimum uncoordinated flight time is 60 seconds\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(546,42,'The function of the jet pumps is to?','[{\"text\":\"Transfer fuel to the opposite wing during crossfeed operations\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Provide fuel at low pressure to the engine driven fuel pump\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Provide fuel at high pressure to the main and auxillary boost pumps\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Transfer fuel to the hopper tank to ensure the boost pumps are submerged\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(547,42,'With the main and auxillary boost pumps failed, crossfeeding should begin?','[{\"text\":\"Before 100lbs imbalance in level flight and 250lbs at other attitudes\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Before 150lbs imbalance in level flight and 300lbs at other attitudes\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Before 200lbs imbalance in level flight and 350lbs at other attitudes\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Before 250lbs imbalance in level flight and 400lbs at other attitudes\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(548,42,'The left and right FUEL LEVEL LOW lights are activated by?','[{\"text\":\"Fuel quantity float transmitters\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Fuel totaliser readings\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Fuel quantity gauge readings\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"The left and right main boost pumps\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(549,42,'The crossfeed system utilises two crossfeed valves because?','[{\"text\":\"Crossfeeding can still continue through the jet pumps with the crossfeed selected OFF\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Fuel can be lost oberboard if the jet pumps are not shutoff by the crossfeed valves\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"With both main and aux boost pumps operating one crossfeed valve is not enough\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"This provides system redundancy should one valve become jammed open\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(550,42,'During crossfeed operations, the main and auxillary boost pumps?','[{\"text\":\"Are both on in the tank providing fuel and are both off in the tank receiving fuel\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Are manually selected by the pilot to the appropriate posiions during crossfeed\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Are both on in the tank receiving fuel and are both off in the tank providing fuel\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Are not required during crossfeed operations\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(551,43,'The TPE331&nbsp;engine is best described as?','[{\"text\":\"Twin shaft, two spool engine\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Fixed shaft engine\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Twin spool axial flow engine\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Free spin turbine engine\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(552,43,'Which RPM range should the TPE331 avoid continious operation?','[{\"text\":\"10-60% rpm\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"10-28% rpm\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"70-97% rpm\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"96-98% rpm\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(553,43,'The maximum EGT for a normal mode start is?','[{\"text\":\"450 degrees C for five seconds\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"450 degrees C for one second\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"770 degrees C for one second\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"770 degrees C for five seconds\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(554,43,'The function of the oil vent valve is to?','[{\"text\":\"Vent the reduction gearcase to the atmosphere\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Maintain specific gearcase operating pressure\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Provide for oil\\/air seperation\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Reduve cranking loads during the start cycle\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(555,43,'Calculated EGT is indicated to the pilot?','[{\"text\":\"In normal mode above 80% RPM\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"From light off to 80% RPM\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"When the fuel computer fails or when it is switched off\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"In normal mode at all times\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(556,43,'The negative torque sensing system (NTS) functions to?','[{\"text\":\"Prevent the propellor from reversing in flight\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Establish a flight idle stop\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Automatically feather the propellor when the engine fails\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Reduce propeller drag when the engine fails\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(557,43,'The function of the underspeed governor during ground operations is to?','[{\"text\":\"Control fuel flow when the power lever is forward of the flight idle detent\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Maintain a minimum RPM relative to the setting of the condition lever\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Prevent the NTS operation after landing\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Determine the blade angle relative to the condition lever position\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(558,43,'During a normal ground start, ignition is initiated when?','[{\"text\":\"The 10% speed switch closes\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The 10% speed switch opens\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"The power lever is positioned to start, taxi\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"The start button is pushed\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(559,43,'In normal mode, the 60% speed switch','[{\"text\":\"Terminates the starter function and engages the generator function\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Opens the oil vent valve\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Closes the primary nozzles only solenoid\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Enables the automatic enrichment function\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(560,43,'In flight, the BETA follow-up system?','[{\"text\":\"Increases blade angle when the power lever position is advanced if the NTS system fails\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Feathers the propeller when the NTS system fails\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Limits engine torque to a preset value\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Premits RPM control when the computer fails and trips to manual mode\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(561,43,'The overspeed governor is an integral part of the?','[{\"text\":\"Fuel computers\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Fuel control unit\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Propeller hub\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Propeller governor\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(562,43,'The electronic fuel valve opens when the?','[{\"text\":\"Start switch is pushed\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Condition lever is pushed to start, taxi\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"10% speed switch closes\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"10% speed switch opens\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(563,43,'The manual fuel shutoff valve is controlled by the?','[{\"text\":\"Stop switch\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Associated engine fire bottle switch\",\"answerID\":1,\"feedback\":\