nswerID\":2,\"feedback\":\"\"},{\"text\":\"Renders both nacelle fire detection systems inoperative\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(568,44,'After an engine overheat condition has existed?','[{\"text\":\"The fire sensors are still capable of detecting the outbreak of fire\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The particular fire sensor which senses the overheat condition must be replaced\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"All fire sensors in that engine nacelle should be replaced\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"The FIRE switchlight will not extinguish until the activated fire sensor is replaced\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(569,44,'The fire extinguishing bottle pressure gauge is checked?','[{\"text\":\"Before each flight\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"During the preflight inspection\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Only when the ambient temperature exceeds 115 degrees F\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"By maintenance personnel only\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(570,44,'Between bottle recharges, each fire extinguishing system can be fired?','[{\"text\":\"Once\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Twice\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Three times\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Four times\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(571,44,'A left engine fire is persisting after the left extinguisher was fired. The right system?','[{\"text\":\"Can be used to extinguish the left engine fire\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Cannot be crossfed to the left hand side\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Can be used to extinguish the left side but only after resetting the system\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Now has half of its original chemical agent\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(572,44,'Pusing the LH or RH FIRE switchlight?','[{