ngines\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"The air cycle machine\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(577,45,'The flow limiting valves provide extra bleed air during ground operations?','[{\"text\":\"Only below 3000 ft airfield elevation\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Only below 5000 ft airfield elevation\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Below 80% engine RPM\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Below 96% engine RPM\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(578,45,'Pressing the F/W SHUTOFF PUSH button will \'NOT\' terminate bleed air to the?','[{\"text\":\"Engine inlet anti-ice valve\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Air cycle machine\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Windscreen anti-ice valve\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Surface de-ice boots\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(579,45,'Positioning the pressurisation source selector to OFF will?','[{\"text\":\"Close the electrical circuit to the cabin fan switch and cabin temperature control knob\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Close all bleed air valves terminating bleed air to all systems\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Close all environmental bleed air valves terminating bleed air to the ACM and cabin\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Close all bleed air valves terminating bleed air to all systems except the engine anti-ice\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(580,45,'The BLEED AIR GROUND function of the pressurisation source selector is unavailable?','[{\"text\":\"During cold weather operations\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"During hot weather operations\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"During manual mode operations\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"During normal mode operations\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(581,45,'If electrical power is lost during flight the 