onds\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"12 seconds\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(586,46,'To prevent radio interference a special boot coating is used?&nbsp;','[{\"text\":\"To bleed off static electrical charges\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"To refelct invisible light\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"As an antennae\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"As a lightning rod\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(587,46,'Anti-ice systems are designed to?','[{\"text\":\"Prevent ice forming and should be switched on after entering icing conditions\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Prevent ice forming and must be switched on prior to entering icing conditions\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Remove accreted ice and should be switched on after entering icing conditions\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Remove accreted ice and should be switched on before entering icing conditions\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(588,46,'The surface de-ice boots must not be operated with an OAT below?','[{\"text\":\"+4 degrees C\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"-10 degrees C\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"-20 degrees C\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"-40 degrees C\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(589,46,'If the prop de-ice ammeter reads below the green arc it may cause?','[{\"text\":\"The propeller blades to not heat uniformly\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Ice to accumulate unevenly on the propeller baldes\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"The propeller de-ice system to fail\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"All of the above\",\"answerID\":3,\"feedback\":\"\"}]',3,'notlast',1),(591,46,'If the propeller de-ice needle fluctuates within the green arc it indicates?','[{\"text\":\"Normal system operation\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"That the system could fail\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Ice accretion on the propeller blades\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"There is insuffucient air moisture for ice accretion\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(592,46,'After actuating the STALL VANE switch the stall vane is too hot to touch, why?','[{\"text\":\"The system is still powered\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The stall switch has malfunctioned\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"The stall switch is in a high nose attitude\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"The left squat switch may have failed\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(593,46,'If the ambient temperature is above +4 degrees C the windscreen heat should?','[{\"text\":\"Not be operated for more than 5 seconds\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Not be operated for more than 10 seconds\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Not be operated for more than 15 seconds\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Not be operated for more than 20 seconds\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(594,46,'When the W/S AIR O\'HEAT annunciator illuminates?','[{\"text\":\"The sensor closes, stopping the flow of bleed air to the windscreen\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The heat exchanger opens, allowing more cooling ram air to flow past the windscreen\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Bleed air will continue to flow past the windshield through the control valve\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"The solenoid valve closes, terminating the flow of bleed air to the windscreen\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(595,46,'If the SURFACE DE-ICE annunciator illuminates for more than 30 seconds?','[{\"text\":\"Position the SURFACE DE-ICE switch to RESET\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Leave icing conditons as soon as possible\",\"answerID\":1,\"feedback\":\"\