e temperature control function will be lost during?','[{\"text\":\"Manual mode operations\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Flight in known icing conditions\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Flight with a total electrical failure\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"All of the above\",\"answerID\":3,\"feedback\":\"\"}]',2,'no',1),(601,47,'The EMER PRESS ON annunciator will immuniate when?','[{\"text\":\"The W\\/S AIR O\'HEAT annunicator also illuminates\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The AIR DUCT O\'HEAT annunciator also illuminates\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"The pressurisation source selector has been selected to the EMER position\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"The ACM has failed and the emergency pressurisation has been automatically activated\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(602,48,'Pressurisation of the Conquest is normally maintained by?','[{\"text\":\"Controlling the amount of air entering the cabin\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Controlling the amount of air escaping from from the cabin\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Modulating the bleed air into the ACM\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Manipulating the power levers\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(603,48,'If vacumn to the pressurisation controller is lost the pressure differential will?','[{\"text\":\"Decrease to zero as cabin pressure is lost\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Increase to maximum limits as allowed by the outflow valves\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Stabilise at approximately 13,500 ft as controlled by the altitude limit valve\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Cause the passenger oxygen system to activate\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(604,48,'The emergency dump toggle valve?','[{\"text\":\"Fails in the open position if electrical power is lost\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Is effective whether vacumn is available or unavailable\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Is intended for ground use only and in the event of a vacumn failure\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Relies upon vacumn to have any effect on pressurisation\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(605,48,'The right main landing gear squat switch will depressurise the cabin by?','[{\"text\":\"Opening a solenoid valve routing vacumn to both outflow valves\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Opening a solenoid valve directing vacumn to the pressure controller\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Opening a solenoid valve directing vacumn to the cabin altitude limit valve\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Opening a solenoid valve directing vacumn to the emergency dump valve\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(606,48,'If the vacumn system failed at FL350 the cabin altitude would?','[{\"text\":\"Immediately go to 13,500 ft\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Immediately go to 35,500 ft\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Remain at 10,000 ft as set by the cabin altitude limiters\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Vary to a value depending on the maximum differential pressure set by the outflow valves.\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(607,49,'The hydraulic system is classed as?','[{\"text\":\"Open relay system\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Open centre system\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Over centre system\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Over balanced system\",\"answerID\":3,\"feedback\":\"\"}]',1,'yes',1),(608,49,'The Conquest hydraulic system, by design, means that when a sub-system is not in use?','[{\"text\":\"Hydraulic fluid bypasses pump output to return to the reservior\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Hydraulic fluid bypasses the reservoir to maintain sub-system pressure\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Hydraulic system pressure remains constantly high\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Hydraulic fluid leaks out of the system\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(609,49,'Should the hydraulic pump filter become blocked?','[{\"text\":\"The system becomes inoperative and is indicated by a HYD FAIL annunciator\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The hydraulic filters will be bypassed and is indicated by a HYD FAIL annunciator\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"The hydraulic filters will be bypassed allowing normal system operation\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"The hydraulic pumps will also be bypassed\",\"answerID\":3,\"feedback\":\"\"}]',2,'yes',1),(610,49,'If one engine fails, which if any, hydraulic sub-systems will be unusable?','[{\"text\":\"The flap sub-system\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The landing gear sub-system\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Both sub-systems will become unusable\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Both sub-systems will still be usable\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(611,49,'The hydraulic fluid that is to be used the Conquest hydraulic system is?','[{\"text\":\"MIL-H 5606\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"MIL-H 7886\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"MIL-H 6606\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"MIL-H 5886\",\"answerID\":3,\"feedback\":\"\"}]',0,'yes',1),(612,49,'If electrical power is lost the hydraulic sub-systems will?','[{\"text\":\"Be usable but only for one cycle each\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Be usable but only below 140 knots\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Be unaffected so normal operations can prevail\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Be unusable\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(613,50,'If the gear switch is placed in the UP position with the aircraft on the ground?','[{\"text\":\"The landing gear will retract\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The warning horn will sound, but the gear will not retract\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"The warning horn will sound only if the gear begins to retract\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"The warning horn will not sound and the gear will not retract\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(614,50,'All Conquest landing gear doors are actuated?','[{\"text\":\"Electrically\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Hydraulically\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Electrically or hydraulically\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Mechanically by gear movement and\\/or the retraction linkage\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(615,50,'As the gear downlocks disengage during the gear retraction cycle?','[{\"text\":\"The green LH, RH and NOSE positon lights come on\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The green LH, RH and NOSE position lights go out\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"The red GEAR UNLOCKED light comes on\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Both 2 and 3\",\"answerID\":3,\"feedback\":\"\"}]',3,'no',1),(616,50,'Emergency extension of the landing gear is accomplished with?','[{\"text\":\"Hydraulic pressure\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"A manual handcrank\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"An electric motor\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Nitrogen pressure\",\"answerID\":3,\"feedback\":\"\"}]',3,'yes',1),(617,50,'Illumination of the HYD FLOW LOW annunciator indicates?','[{\"text\":\"Flow from the hydraulic pump is abnormally high\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The pump may have malfunctioned\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Flow from the pump is abnormally low\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Both B and C\",\"answerID\":3,\"feedback\":\"\"}]',3,'no',1),(618,50,'Minimum turning radius is achived by?','[{\"text\":\"Application of the inboard brake\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Full rudder deflection in the direction of the turn\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Differential power in the direction of the turn\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"All of the above\",\"answerID\":3,\"feedback\":\"\"}]',3,'no',1),(619,50,'Parking brakes are set by?','[{\"text\":\"Depressing and holding the brake pedals and pulling the park brake knob\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Pulling the park brake knob then depressing the pedals\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Pulling the park brake knob\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Depressing and holding the brake pedals\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(620,50,'Gear down locking is accomplished by?','[{\"text\":\"Hydraulic pressure\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Internal downlocks in the gear actuators\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"An overcentre side brace\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Installation of the ground safety pins\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(621,50,'The nose gear shimmy damper is?','[{\"text\":\"Pressurised by the aircraft hydraulic system\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"A spring loaded unit\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"A hydraulic unit\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Charged with nitrogen\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(622,50,'The brakes?','[{\"text\":\"Can only be applied by the pilot or co-pilot\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Can only be applied by the pilot because there is only one set of master cylinders\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Are pressurised by the aircraft hydraulic system\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Can be applied only be the co-pilot\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(623,51,'The primary flight controls are actuated?','[{\"text\":\"Hydraulically\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Manually\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"By servo tabs\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"None of the above\",\"answerID\":3,\"feedback\":\"\"}]',1,'notlast',1),(624,51,'When the yaw damper switch is positioned to YD, the system?','[{\"text\":\"Engages, but only the yaw damper operates\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Enages with the autopilot also engaging for full autopilot operation\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Disengages as indicated by an annunciator light or annunciator flag on the T\\/B face\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"None of the above\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(625,51,'While the flaps are in transit?','[{\"text\":\"The HYD PRESS ON light illuminates\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The bypass valve in the hydraulic system is energised closed\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"The flap control valve is energised to the appropriate postiion\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"All of the above\",\"answerID\":3,\"feedback\":\"\"}]',3,'notlast',1),(626,51,'When the flaps reach the fully extended position;','[{\"text\":\"The flap control valve de-energises and return to neutral\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The bypass valve in the hydraulic system de-energises and returns to the open position\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Trapped fluid maintains the flaps in the down position\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"All of the above\",\"answerID\":3,\"feedback\":\"\"}]',3,'notlast',1),(627,51,'On the ground, proper operation of the stall warning system?','[{\"text\":\"Can be tested manually by moving the stall vane with the battery switches on\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Cannot be tested for proper operation\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Can be tested with the STALL VANE switch in the cockpit\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Can be tested manually by moving the stall vane with the battery switches OFF\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(628,51,'If the HYD PRESS ON light remains illuminated after the flaps have finished moving?','[{\"text\":\"The hydraulic bypass valve failed to open\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The hydraulic bypass valve failed to close\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Refer to the Abnormal Procedures section of the Flight Manual\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Both A and C\",\"answerID\":3,\"feedback\":\"\"}]',3,'no',1),(629,52,'The pitot-static system supplies static and dynamic pressure to the?','[{\"text\":\"Airspeed indicators\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Vertical speed indicators\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Altimteters\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"All of the above\",\"answerID\":3,\"feedback\":\"\"}]',0,'notlast',1),(630,52,'The static system ports for the flight instruments are located?','[{\"text\":\"On the top and bottom of the pitot tubes\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"On both sides of the aft fuselage\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"On both sides of the forward fuselage\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Inside the unpressurised nose area\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(631,52,'Should the Captain\'s pitot-static instruments fail?','[{\"text\":\"Select the co-pilots alternate static source\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Select the Captains alternate static source\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Select the standby alternate static source\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Use the copilots pitot-static instruments\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(632,52,'The OAT gauge indication?','[{\"text\":\"Is corrected for temperature rise due to ram recovery\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Must be corrected for temperature rise due to ram recovery\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Must be converted to degrees farenheit\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Must be converted to degrees celcius\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(633,52,'The instrument air system uses the following air source to drive the air drive gyro\'s?','[{\"text\":\"Engine driven positive pressure pumps\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Engine driven vacumn pumps\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Regulated bleed air from the engines\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Pressurised cabin flow\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(634,52,'The Captain\'s attitude reference gyro is energised when?','[{\"text\":\"The gyro inverter switch is turned on\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The Flight Director button is pressed\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Any operational mode of the autopilot mode selector panel is selected\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"The battery switches are turned ON and the engines are running\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(635,52,'The autopilot may be engaged?','[{\"text\":\"Only before the flight director mode is enagaged\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Only after the flight director mode is enagaged\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Only after the gyros have spun up and the gyro failure flags have been removed\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Anytime the battery switches are turned on\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(636,52,'When intending to use the back course function of the autopilot?','[{\"text\":\"Always set the back course radial on the HSI\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Always set the front course radial on the HSI\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"The flight director must be coupled to the autopilot\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"The autopilot must be on\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(637,52,'Operation of the autopilot on the ground?','[{\"text\":\"Is impossible as it will not engage whilst there is weight on the squat switches\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Will cause serious damage to the system\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Is possible only with the flight director off\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"May cause the autotrim to run after 4-5 seconds\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(638,52,'Engagement of the ALT HOLD function must be accomplished in?','[{\"text\":\"A climb\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"In level flight\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"A descent\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Any of the above\",\"answerID\":3,\"feedback\":\"\"}]',3,'notlast',1),(639,52,'The autopilot is powered by?','[{\"text\":\"The left avionics bus\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The right avionics bus\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Through the L AVIONICS BUS switch\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Both A and C\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(640,52,'The autopilot should automatically disengage if the aircraft rolls more than?','[{\"text\":\"25 degrees angle of bank\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"30 degrees angle of bank\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"45 degrees angle of bank\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"75 degrees angle of bank\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(641,52,'Prior to engaging the autopilot the pilot must ensure that?','[{\"text\":\"The flight director is off\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The flight director command bars are satisfied\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"The aircraft is straight and level\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"All of the above\",\"answerID\":3,\"feedback\":\"\"}]',1,'notlast',1),(642,52,'The function of the static wicks is to?','[{\"text\":\"Collect static electrical charges\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Act as an aerdynamic aid\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Dissipate lightning strikes\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Dissipate static electricity\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(643,52,'The avionics frequency memory are on the?','[{\"text\":\"Left main bus\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Right main bus\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Hot battery bus\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Utility bus\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(644,53,'Passenger oxygen masks are stowed?','[{\"text\":\"Under the seats\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"On the sidewalls of the cabin\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"In the overhead compartments\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"In the armrests of the seats\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(645,53,'Passenger oxygen masks are deployed?','[{\"text\":\"By placing the mask deploy switch to DEPLOY\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Automatically by a barometric switch when the cabin altitude reaches 14,500 ft\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Manually by inserting a sharp object in the storage compartment flap\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"All of the above\",\"answerID\":3,\"feedback\":\"\"}]',3,'notlast',1),(646,53,'The cockpit oxygen pressure gauge reads?','[{\"text\":\"Direct system high pressure\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Direct system low pressure\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Electrically derived system high pressure\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Electrically derived system low pressure\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(647,53,'Oxygen to the quick donning masks?','[{\"text\":\"Is supplied to the mask at full system operating pressure\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Flows through the altitude compensating regulator\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Bypasses the altitude compensating regulator\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Is electrically compensated through a barometric switch\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(648,53,'The green disc located on the bottom skin of the rear fusleage indiactes?','[{\"text\":\"If the oxygen system has been subjected to an overpressure situation if it is gone\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"That the oxygen system needs replenishing if it is coloured green\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"That the oxygen bottle has been overfilled if it turns red\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"That the oxygen system is unserviceable if it is green\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(649,53,'Average time of useful consciousness at 30,000 ft is closest to?','[{\"text\":\"5-10 seconds\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"30-45 seconds\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"1-2 minutes\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"4-5 minutes\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(650,38,'The ELT','[{\"text\":\"Is self contained and battery powered\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Is activated by an intertia switch\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Transmits on an emergency frequency\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"All of the above\",\"answerID\":3,\"feedback\":\"\"}]',3,'notlast',1),(652,333,'A Red ASIC&nbsp;is required to be worn at all times:\r\n\r\n&nbsp;','[{\"text\":\"While in the airside area, including the security restricted area\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Whenever inside any airport\'s boundary\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Whilst in the airside area, but not in the security restricted area\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"All of the above\",\"answerID\":3,\"feedback\":\"\"}]',0,'notlast',1),(653,333,'You may enter the airside area at a security controlled airport whenever:\r\n&nbsp;','[{\"text\":\"You wear your ASIC\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"You wear your ASIC and have a lawful excuse for entry\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"You wear a VIC pass, and are accompanied by an ASIC holder, and have a lawful excuse for entry\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Both b and c\",\"answerID\":3,\"feedback\":\"\"}]',3,'no',1),(654,333,'You have left your ASIC at home and need to access the airside area. How do you do this;','[{\"text\":\"You wear a VIC pass\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"You display your airside driver\'s licence\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"You report to the airport police\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"You wear a VIC pass and are escorted at all times by a person wearing their ASIC\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(655,333,'If you see an aviation security incident taking place, you would:','[{\"text\":\"Forget about it, as it didn\'t happen to you\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Report it to management and\\/or the airport police, and ensure that it is then reported to the Office of Transport Security\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Report it only to the Office of Transport Security\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Report it to the Transport Minister\'s office\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(657,247,'Being a prescribed aircraft, what must not be taken into the passenger cabin on the Metroliner:\r\n&nbsp;\r\n&nbsp;','[{\"text\":\"Weapons, not including replicas (fakes)\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Anything illegal under the applicable state laws, including fruit and other plant material\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Weapons and prohibited items\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Only prohibited items\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(658,247,'A prescribed air service is a service where the aircraft used is:\r\n&nbsp;\r\n&nbsp;','[{\"text\":\"MTOW above 5,700kg\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"MTOW above 5,700kg and a jet\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"MTOW above 5,700kg or a jet or an RPT service\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"MTOW above 5,700kg and a jet and a RPT service\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(659,333,'If you have a grey ASIC, you are permitted, with a lawful excuse, to enter:\r\n&nbsp;','[{\"text\":\"The airside area, but not the security restricted area\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The airside area including the security restricted area\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"The control tower\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"The control tower and the airport operations office\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(660,333,'If an unidentified person asks you for specific information about a Corporate Air passenger or crew member:','[{\"text\":\"You will give them the information they want without further question because it may be important\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"You will immediately call the police\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"You will give them the information they want after seeing photographic identification\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"You will not give them the information, and will refer them to management\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(662,333,'If you see an unattended object in the airside area or onboard an aircraft, you will;','[{\"text\":\"Report it immediately to the Office of Transport Security\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Report it within 24 hours to ASIO\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Report it immediately to management or the airport police\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Take it home because it might be valuable\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(663,247,'You are a pilot on a Corporate Air flight from Goulburn to Canberra, and you do not have your ASIC with you.&nbsp; After landing, you will:\r\n&nbsp;','[{\"text\":\"Have to stay on the aircraft as you cannot access the apron without your ASIC\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Wait until somebody with an ASIC gets you a VIC pass and escorts you off the airside area\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Walk from the aircraft reasonably directly off the airside area without your ASIC or VIC\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Call the police and wait for them to escort you off the airport\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(664,246,'Name 3 criteria for the production of a thunderstorm?','[{\"text\":\"Stable atmosphere, high moisture content and a trigger mechanisim\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Unstable atmposphere, high moisture content and a trigger mechanisim\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Unstable atmosphere, low moisture content and a trigger mechanisim\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Stable atmosphere, low moisture content and a hair trigger\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(665,246,'Which 2 factors determine the severity of a storm?','[{\"text\":\"Size and colour\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Size and shape\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Atmospheric moisture content and atmospheric instability\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"None of the above\",\"answerID\":3,\"feedback\":\"\"}]',2,'notlast',1),(666,246,'Which classification of thunderstorm generally poses the greatest threat to aviation?','[{\"text\":\"Frontal and squall line thunderstorms\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Air mass thunderstorms\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Orographic thunderstorms\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Nocturnal thunderstorms\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(667,246,'Air mass thunderstorms tend to be?','[{\"text\":\"Well seperated and less organised than frontal and squall line thunderstorms\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Less seperated and more organised than frontal and squall line thunderstorms\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Less likely to produce rain and lightning\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"None of the above\",\"answerID\":3,\"feedback\":\"\"}]',0,'no',1),(668,246,'The mountains surrounding Canberra are capable of triggering thunderstorms?','[{\"text\":\"False, trigger mechanisims are purely meterological in nature\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"True, because the iron ferrite in the mountains causes static electricity\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"False, triggers are only found in guns\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"True, due to orographic effects with right atmospheric conditions\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(669,246,'From the list below, correctely identify the 3 stages of a thunderstorm?','[{\"text\":\"Cumulus stage, mature stage and the dissipating stage\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Cumulus stage, building stage and the dying stage\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Mature stage, dissipating stage and the anvil stage\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"None of the above\",\"answerID\":3,\"feedback\":\"\"}]',0,'notlast',1),(670,246,'High rates of precipation visually observed from the base of a thunderstorm?','[{\"text\":\"Indicate that the storm has reached at least the mature stage of development\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Can indicate areas of downdraft and turbulence\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Should be avoided in case of microburst activity\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"All of the above\",\"answerID\":3,\"feedback\":\"\"}]',3,'notlast',1),(671,246,'Microbursts are not common in Australia but have been known to have up to?','[{\"text\":\"2000ft\\/min rates of descent\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"4000ft\\/min rates of descent\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"6000ft\\/min rates of descent\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"12000ft\\/min rates of descent\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(672,246,'If diverting around a thunderstorm on the downwind side it is advisable to divert?','[{\"text\":\"At least 10nm-20nm on the downwind side\",\"answerID\":0,\"feedback\":\"Slide 83 of the Thunderstorms presentation.\"},{\"text\":\"At least 40nm on the downwind side\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"At least 60nm on the downwind side\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"At least 100nm on the downwind side\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(673,246,'The most severe part of a thunderstorm tend to be at levels where the temperature is?','[{\"text\":\"between 0 degrees C and minus 10 degrees C\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"between minus 10 degrees C and minus 25 degrees C\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"between minus 15 degrees C and minus 25 degrees C\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"None of the above\",\"answerID\":3,\"feedback\":\"\"}]',0,'notlast',1),(674,249,'Weather radar basically uses the same principles as Primary radar?','[{\"text\":\"Yes\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"No\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Maybe\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"None of the above\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(675,249,'The 3 goals of a weather radar system are, to calculate;','[{\"text\":\"The amount of turbulence, the moisture content and the size of cloud\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The end of daylight, the doppler effect and the rate of rainfall\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"The distance to target, the direction of target and the reflection characteristics of the cloud\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"The distance to target, the direction of aircraft over the ground and the tilt angle\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(676,249,'The time taken for a radar signal to travel to and from a target is close to;','[{\"text\":\"12.34 nano seconds per nautical mile\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"12.34 micro seconds per nautical mile\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"12.34 pico seconds per nautical mile\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"12.34 hecto seconds per nautical mile\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(677,249,'A weather radar targets direction is calculated by the;','[{\"text\":\"receiver using a continious antenna sweeping action\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"receiver utilising the flight management system input\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"antenna utilising the flight management system input\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"antenna utilising the GPS input\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(678,249,'The size and density of the volumetric radar targets encountered in cloud determine;','[{\"text\":\"style of ground returns\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"the continious sweeping action of the antennae\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"the reflection characteristics and displayed colours on the radar display\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"the size of the emitted radar beam\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(679,249,'For correct operation, the weather radar\'s beam should be directed to the;','[{\"text\":\"most reflective portion of the storm cell\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"most reflective item on the horizon be it a ground return or weather return\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"least reflective portion of the cell\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"least reflective item on the horizon be it a ground return or a weather return\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(680,249,'A calibrated weather presentation will give flight crew;','[{\"text\":\"the least information for inflight decision making purposes\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"the most information for inflight decision making purposes\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"no information at all because it is a system operation performed by the receiver\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"no information at all becuse it is a system operation performed by the antennae\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(681,249,'The most reflective part of a storm cell is called the;','[{\"text\":\"bright band region\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"brightest spark\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"highest point in the cloud\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"dim band region\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(682,249,'Sensitive Time Control (S.T.C) allows for;','[{\"text\":\"space loss and antennae faults\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"space loss and receiver faults\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"space loss and dim band region effects\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"space loss and beam filling effect\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(683,249,'A given degree of ground return in weather mode is necessary to observe;','[{\"text\":\"the dim band effects\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"the weather attenuation phenomenon\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"the beam filling effects\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"space loss phenomenon\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(684,249,'Set at its minimum setting, antennae gain will;','[{\"text\":\"tighten the focus of the radar beam towards one particular point\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"focus the beam far less than at its maximum setting\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"provide the greatest amount of ground return\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"not do anything because there is only one gain setting\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(685,249,'Gain is only usually used in GND/MAP mode;','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(686,249,'Weather attenuation leaves a blank area in the ground return behind a storm;','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(687,249,'Weather attenuation can be verified against a ground return by changing the;','[{\"text\":\"lateral sweep angle of the antenna\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"tilt angle of the antenna\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"receivers S.T.C timing\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"receivers algorithm\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(688,193,'How does fog form;','[{\"text\":\"Moist air cooled above saturation point, or, moisture removed from a parcel of air\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Mosit air cooled below saturation point, or, moisture added to a parcel of air\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Dry air cooled above saturation point, or, moisture removed from a parcel of air\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Dry air cooled below melting point and moisture removed and put elsewhere\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(689,193,'What are two common types of fog that form at Canberra;','[{\"text\":\"Radiation fog and advocated fog\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Radio active fog and advected fog\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Atomic fog and advected fog\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Advection fog and radiation fog\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(690,193,'What 3 conditions must exist for radiation fog to form;','[{\"text\":\"High cloud base, high temperature and high atmosphere\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"High humidity, cloudless sky and a light breeze\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"High humidity, stable conditions and high temperature\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"High humdity, cloudless sky and a strong breeze\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(691,193,'What is the main difference between fog and mist;','[{\"text\":\"They are basically the same but mist has a minimum of 1000m visibility\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"They are basically the same but mist has a minimum of 10,000m visibility\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"They are basically the same but fog has a minimum of 1000m visibility\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Mist is really spooky like on the movies whereas fog is too thick for movie cameras\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(692,193,'What are the 3 basic types of airframe icing;','[{\"text\":\"Rime ice, clear ice and black ice\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Rime ice, clear ice and hoar frost\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Really think ice, really thin ice and no ice\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Thick, thin and sticky ice\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(693,193,'Rime ice is most common;','[{\"text\":\"In stratus cloud between 10 degrees C and 20 degrees C\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"In cumulus cloud between 10 degrees C and 20 degrees C\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"In cumulus cloud between 10 degrees C and minus 10 degrees C\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"In Stratus cloud between minus 10 degrees C and minus 20 degrees C\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(694,193,'Cloud bases and cloud tops are forecast in Area Forecasts;','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(695,193,'When planning a flight in icing conditions it is best to;','[{\"text\":\"Flight plan a route that will take you along the highest LSALT\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Flight plan a route that will take you along the lowest LSALT\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Flight plan a route that will take you into the icing conditions and into the mountains\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Flight plan a route that will take you into icing conditions and over the mountains\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(696,193,'It is advisable to slow down, use the autopilot and change configuration in icing conditions;','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',1,NULL,1),(697,193,'Anti-ice systems are designed to be turned on;','[{\"text\":\"Prior to entering a hangar\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Prior to entering a runway\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Prior to entering a taxiway\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Prior to entering icing conditions\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(698,165,'The Definition of a CFIT accident is;','[{\"text\":\"A mechanically normally functioning airplane is inadvertantly flown into the ground, water or obstacle\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"An airplane impacts the ground, water or an obstacle during descent, approach, or arrival phase of flight\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"An airplane is inadvertantly flown into the ground, water or an obstacle because of malfuntioning navigation aids\",\"answerID\":2,\"feedback\":\"\"}]',0,NULL,1),(699,165,'The basic causes of CFIT accidents are;','[{\"text\":\"Fight crew complacency and visual illusions\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The lack of flight crew vertical and horizontal situational awareness\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Altimeter anomolies and complex instrument procedures\",\"answerID\":2,\"feedback\":\"\"}]',1,NULL,1),(701,165,'Is there an international standard for the altimeter setting unit of measurement;','[{\"text\":\"Yes and it is inches of mercury\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"No\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Yes, but it is not adhered to by all member states\",\"answerID\":2,\"feedback\":\"\"}]',2,NULL,1),(702,165,'If you incorrectly use a QNE altimeter setting instead of a QNH altimeter setting, the airplane\'s altitude above ground will be;','[{\"text\":\"Higher or lower, depending on the QNH setting\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Higher than required\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Lower than required\",\"answerID\":2,\"feedback\":\"\"}]',0,NULL,1),(703,165,'When pilots accept an ATC enroute clearance to proceed off airway direct to a point;','[{\"text\":\"The clearance ensures safe terrain clearance\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"ATC must also include an altitude that ensures safe terrain clearance\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"The pilot is responsible for determining a safe altitude and flying at or above it\",\"answerID\":2,\"feedback\":\"\"}]',2,NULL,1),(704,165,'The best way(s) for flight crews to overcome communication errors with ATC that contribute to CFIT is to;','[{\"text\":\"Know the height of the highest terrain or obstacle in the operating area and their position in relation to it\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Challenge or refuse ATC instructions when they are not clearly understood, are questionable, or conflict with their assessment of airplane position relative to the terrain\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"All of the above\",\"answerID\":2,\"feedback\":\"\"}]',2,'notlast',1),(705,165,'A good way(s) for flight crews to overcome complacency is to;','[{\"text\":\"Adhere to procedures and know that familiarity can lead to complacency\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Not assume that this flight will be like the last flight\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"All of the above\",\"answerID\":2,\"feedback\":\"\"}]',2,'notlast',1),(706,165,'The majority of CFIT accidents occur during which phase(s) of flight?','[{\"text\":\"Departure and enroute\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Departure, Descent, approach and landing\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Enroute and descent\",\"answerID\":2,\"feedback\":\"\"}]',1,NULL,1),(707,165,'In the approach phase of flight, most CFIT accidents occur during;','[{\"text\":\"ILS approaches\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"ADF approaches\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"VOR and VOR\\/DME approaches\",\"answerID\":2,\"feedback\":\"\"}]',2,NULL,1),(708,165,'Which of the following recommendations will mitigate the hazards associated with flying a nonprecision instrument approach?','[{\"text\":\"Study the anticipated approach procedure(s) before departure and identify unique gradient and step-down requirements\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Review approach procedures during the approach briefing\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"All of the above\",\"answerID\":2,\"feedback\":\"\"}]',2,'notlast',1),(709,165,'The autoflight system will sometimes do things that the flight crew did not intend for it to do;','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Not sure\",\"answerID\":2,\"feedback\":\"\"}]',0,NULL,1),(710,165,'When using an autoflight system, flight crews should;','[{\"text\":\"Cross-check raw navigation information and monitor the system for desired operation\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Follow procedures but leave the autoflight systems unattended once engaged\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Cross-check navigation data only from the GPS and monitor the system for desired operation\",\"answerID\":2,\"feedback\":\"\"}]',0,NULL,1),(711,165,'One of the best ways to let the nonflying pilot know what to expect is to conduct a briefing before each takeoff and each approach;','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Sometimes\",\"answerID\":2,\"feedback\":\"\"}]',0,NULL,1),(712,165,'Route and destination familiarization will assist in preventing CFIT accidents and incidents;','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Perhaps\",\"answerID\":2,\"feedback\":\"\"}]',0,NULL,1),(713,165,'It is essential that flight crews always appreciate the altitude of their airplane relative to terrain and obstacles and the assigned or desired flight path;','[{\"text\":\"Only if the airplane is not equipped with a GPWS\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Only during darkness or reduced visibility\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Always true\",\"answerID\":2,\"feedback\":\"\"}]',2,NULL,1),(714,168,'A GPWS escape maneuver performed by flight crew should be;','[{\"text\":\"Conducted until the GPWS warning ceases\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Continued until the airplane has reached the sector safe altitude or until visual verification can be made that the airplane will clear the terrain or obstacle\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"undertaken only for real GPWS warnings\",\"answerID\":2,\"feedback\":\"\"}]',1,NULL,1),(715,165,'Flight crews should use adequate navigation and approach charts that accurately depict hazardous terrain and obstacles;','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Sometimes\",\"answerID\":2,\"feedback\":\"\"}]',0,NULL,1),(716,165,'CFIT accidents and incidents happen insidiously; flight crews fall into common traps;','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(717,168,'Which is the most appropriate flight crew response to a GPWS warning during IMC?','[{\"text\":\"Quickly verify that the warning is valid and execute the escape maneuver, if the warning is Valid\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Recheck the barometric altimeter setting and execute the escape maneuver, if the setting is in error\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Immediately execute the escape maneuver\",\"answerID\":2,\"feedback\":\"\"}]',2,NULL,1),(722,23,'Scenario: charter YSBK to YORG departure at 14:00 local time.\r\n\r\nVH-VEU\r\n\r\n Forecast;\r\n\r\n\r\nTAF YSBK 162246Z 170024\r\n    VRB03KT 9999 BKN010\r\n    FM01 VRB03KT 9999 SCT020\r\n    FM02 14010KT 9999 SCT035\r\n    FM07 17015KT 9999 LIGHT SHOWERS OF RAIN SCT030 SCT100\r\n    FM12 18025KT 9999 LIGHT SHOWERS OF RAIN SCT020 SCT025 BKN100\r\n    INTER 1218 6000 SHOWERS OF RAIN BKN020\r\n    RMK FM12 MOD TURB BLW 5000FT\r\n    T 25 30 29 29 Q 1017 1014 1012 1013\r\n\r\nWhat will be the maximum possible Take Off weight at YSBK under the forecast conditions?','[{\"text\":\"6327 kg\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"6554 kg\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"6339 kg\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"6803 kg\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(723,23,'Scenario: charter YS