2,NULL,1),(738,23,'Scenario: Metro 23 - Operating Weight in passenger configuration is 4523kg, Operating Weight in cargo configuration is 4517kg;\r\n\r\nWhat is the minimum flight time (approximately) to be at the MLW if you departed at MTOW?','[{\"text\":\"30 minutes\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"70 minutes\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"100 minutes\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"120 minutes\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(739,23,'What is the weight of one US Gallon of AWI (water methanol)?','[{\"text\":\"3 kg\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"3.6 kg\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"4 kg\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"4.6 kg\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(740,23,'What is the maximum permissable load aft of the rear spar?','[{\"text\":\"1281kg\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"1423kg\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"1821kg\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"2013kg\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(741,23,'What is the maximum floor loading?','[{\"text\":\"227kg \\/ m2\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"272kg \\/ m2\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"732kg \\/ m2\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"782kg \\/ m2\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(742,333,'You are provided an airport gate code to access the Airside Area. You must;','[{\"text\":\"Not disclose the code to any organisation, group or third party\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Record it in an obvious place so other people can understand it\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Scratch it onto the back of the airside gate so only people airside can see it\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Only distribute the code by email as this is a secure method\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(743,333,'If a company employee breaches their security obligations with regard to an airside access code what could happen;','[{\"text\":\"The employee will be banned from airside access\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The company could be banned from airside access\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"The employee will need to undergo counselling\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Both A and B\",\"answerID\":3,\"feedback\":\"\"}]',3,'no',1),(744,247,'You are rostered to operate an international flight for Air Caledonie from Brisbane to Noumea in a Cessna 441. You will only carry an A320 cockpit display (for a broken aircraft). You will depart from an apron no where near the airline terminal. Do you need to be screened before departure from Brisbane;','[{\"text\":\"Yes, this flight constitutes a Screened Air Service becuase it is an \'open charter operation\'\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"No, this flight does not constitute a Screened Air Service and it is not an \'open charter operation\'\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Only if cargo is DG\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Only if we have a passenger accompanying the cargo\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(745,247,'You are opertaing the Metro 23 from a remote airport that is not a Security Controlled Airport. What are you required to do before departure;','[{\"text\":\"Ask the passengers if they are carrying Prohibited items and conduct passenger \\/ baggage reconcilliation\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Ask the passengers if they are carrying weapons only\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Passenger and baggage reconcilliation only\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Nothing because the airport is not a Security Controlled Airport\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(746,247,'How can you confirm if any airport is a Security Controlled Airport?','[{\"text\":\"The number of policer patrols\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The \'Remarks column\' in the airport\'s ERSA listing\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"The airport has a gate code to get airside so it must be\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"The airport has regular jet flights so it must be\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(747,333,'When must you report a security incident to the Office of Transport Security (OTS);','[{\"text\":\"Only if the incident caused an issue in an Airside Area\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Only if the incident involved a company aircraft with passengers\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"You must report any security incident to OTS, regardless of the circumstances\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Only if the incident happened at a Security Controlled Airport\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(748,247,'You are due to operate an ad-hoc cargo flight from a remote mining site to Sydney. Before departure;','[{\"text\":\"You must inspect the cargo to ensure their is no explosive device\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"You do not need to inspect the cargo as this is a charter flight\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"You only need to inspect the cargo if you are operating a Prescribed Aircraft\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"You do not need to inspect the cargo if the client is known to the company\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(749,247,'You load bags belonging to 4 passengers into the Baron 58 on a charter flight departing Moruya. Just before departure one passenger returns to town (and will not travel) but his bags remain onboard. The other passengers say it is ok to depart and can you take his bag. You must;','[{\"text\":\"Depart as that is the wish of the client and the Baron 58 is not a Prescribed Aircraft\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Because this is not a Screened Air Service you can treat the bags as Cargo. You must identify the bag(s), personally ensure their is no explosive device in the bag, and if found okay, can then depart with them onboard\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"This is a charter flight, the bag would only have to be unloaded and inspected if this was a RPT flight\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Identify the bag(s) belonging to the \'no-show\' and remove from aircraft. The bags cannot travel.\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(750,247,'You left your ASIC at home and are due to operate a single pilot night cargo flight to Melbourne. Can you still operate this flight;','[{\"text\":\"Yes, I have my pilot\'s license on me\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"No, Melbourne is a Security Controlled Airport\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Yes, as long as I take another pilot who has an ASIC\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Yes, as long as I dont get out of the aircraft\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(751,247,'The Metro 23 is required to carry two(2) restraining devices;','[{\"text\":\"On any passenger flight\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Only on an RPT substitution flight\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Only if the passengers include a Person In Custody\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Only during a heightened security alert period\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(752,247,'A preflight security check must be completed for the following aircraft type(s);','[{\"text\":\"Metro 23, but only before a passenger flight\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Cessna 441 and Metro 23\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Metro 23, before any flight\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Beech 58, Cessna 404, Cessna 441 and Metro 23\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(753,333,'You see a person in an Airside Area who does not have an ASIC. You have a responsibility to;','[{\"text\":\"Challenge the person\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Only challenge the person if you do not know them\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Avoid their attention in case they are a terrorist\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Not your problem, keep out of their way\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(754,333,'It is okay to be in the Airside Area if;','[{\"text\":\"You have an ASIC or VIC and work related \\/legitiate reason to be there\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"You have an ASIC and need to catch up with a mate who is working a different shift\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"You like plane spotting and taking photos\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"You have an ASIC and were bored\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(755,333,'The penalties for being caught in an Airside Area without the correct ASIC or VIC are as follows;','[{\"text\":\"$ 550.00 to the individual and $ 5500.00 to the employer\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"$ 22000.00 to the employer\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"$ 55.00 to the individual and $ 550.00 to the employer\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"2 weeks off work\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(756,296,'You are rostered for a shift at Canberra Airport and you forgot your ASIC. You must;','[{\"text\":\"Cancel the shift and go home\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Have an ASIC pass holder issue me a VIC pass for the shift and accompany mefor the entire shift\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Work as usual, I can prove I have an ASIC pass, just not on me\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Work as usual and hope that I do not get caught\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(757,333,'Whilst you are waiting at an airside gate you are approached by a person seeking access. They claim they own an aircraft you can see and show you their pilot\'s license. Can you let them airside;','[{\"text\":\"No, I dont know them and cannot provide airside access to any third party\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Yes, as long as they show me an ASIC\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Yes, as long as they show me a VIC pass\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"No, it is not my job\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(758,333,'You are rostered for a shift during which you will operate in an Enhanced Inspection Area (EIA). Do you need to be screened;','[{\"text\":\"Yes, at the end of my shift to ensure I didn\'t take anything by mistake\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Yes, at the beginining of my shift or immidiately prior to commencing work in the EIA\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"No, my scheduled work in the EIA does not take me into the terminal\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"No, the EIA is for airline employees only, I am not affected\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(759,296,'Your have been working on the GA apron at Canberra Airport and need to go around to the Virgin Blue terminal via the airside road. Do you need to be screened;','[{\"text\":\"Yes, I will enter the EIA so need to be screened\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Yes, but only as I leave the EIA\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Yes, but only if there are Virgin Blue aircraft on the ground\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"No, I will not be entering the terminal, so no need\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(760,333,'Where should you ASIC be when in an Airside Area;','[{\"text\":\"Clearly visible to any person who approaches me, without them having to ask to see it\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Anywhere on my person, as long as I can produce it if requested\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Hidden, it is a security pass so should be protected\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"In my pocket so that I dont loose it\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(761,296,'You only have a grey ASIC but need to go onto the RPT apron at Canberra Airport. Is this okay;','[{\"text\":\"Yes, a grey ASIC is okay for this\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Yes, as long as I stay on the apron and dont go into the terminal\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"No, it is not the correct type of ASIC\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Yes, as long as I make sure I am screened first\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(762,333,'Is Canberra Airport a Security Controlled Airport;','[{\"text\":\"Yes\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"No\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Yes, but only on the RPT apron\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Yes, but only on the GA apron\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(763,38,'Random question','[]',0,NULL,0),(764,39,'Random question','[]',0,NULL,0),(765,40,'Random question','[]',0,NULL,0),(766,41,'Random question','[]',0,NULL,0),(767,42,'Random question','[]',0,NULL,0),(768,43,'Random question','[]',0,NULL,0),(769,44,'Random question','[]',0,NULL,0),(770,45,'Random question','[]',0,NULL,0),(771,46,'Random question','[]',0,NULL,0),(772,47,'Random question','[]',0,NULL,0),(773,48,'Random question','[]',0,NULL,0),(774,49,'Random question','[]',0,NULL,0),(775,50,'Random question','[]',0,NULL,0),(776,51,'Random question','[]',0,NULL,0),(777,52,'Random question','[]',0,NULL,0),(778,53,'Random question','[]',0,NULL,0),(779,54,'Random question','[]',0,NULL,0),(782,23,'Random question','[]',0,NULL,0),(784,24,'Random question','[]',0,NULL,0),(785,25,'Random question','[]',0,NULL,0),(786,26,'Random question','[]',0,NULL,0),(787,27,'Random question','[]',0,NULL,0),(788,28,'Random question','[]',0,NULL,0),(789,29,'Random question','[]',