estion','[]',0,NULL,0),(948,1,'Random question','[]',0,NULL,0),(949,1,'Random question','[]',0,NULL,0),(950,1,'Random question','[]',0,NULL,0),(951,1,'Random question','[]',0,NULL,0),(952,1,'Random question','[]',0,NULL,0),(954,239,'Random question','[]',0,NULL,0),(955,240,'Random question','[]',0,NULL,0),(956,241,'Random question','[]',0,NULL,0),(957,242,'Random question','[]',0,NULL,0),(958,1,'Random question','[]',0,NULL,0),(959,1,'Random question','[]',0,NULL,0),(960,245,'Random question','[]',0,NULL,0),(961,246,'Random question','[]',0,NULL,0),(962,247,'Random question','[]',0,NULL,0),(963,1,'Random question','[]',0,NULL,0),(964,249,'Random question','[]',0,NULL,0),(966,296,'Random question','[]',0,NULL,0),(967,172,'Crew Resource Management is applicable to single pilot operations?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(968,171,'What does current generation Crew Resource Management focus on:','[{\"text\":\"Error management\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Developing a culture that traps errors, and promotes good leadership.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Accepting that errors are a part of every day life.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"All of the above.\",\"answerID\":3,\"feedback\":\"\"}]',3,'notlast',1),(969,172,'The only debriefing and evaluation available to a single pilot during normal operations is self-evaluation.','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(970,171,'Situational Awareness can be defined as:','[{\"text\":\"the accurate perception of the factors and conditions affecting the safe operation of the aircraft and flight crew.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"the accurate perception of the factors that are affecting the flight crew but only inside the aircraft.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"the accurate perception of the factors that are affecting the flight crew but only outside the aircraft.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"the perception that all is well.\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(971,171,'Focused attention is the skill of focusing one\'s attention upon a single source and avoiding distraction. What is the negative side of focused attention?','[{\"text\":\"Focusing on the Attitude indicator in VMC.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Focusing on the Horizontal Situation Indicator in VMC.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Focusing on the horizon in IMC.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Focusing on a single task to the detriment of all other tasks.\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(972,245,'There are ten operational clues that are pieces of the error chain. Three of them are:','[{\"text\":\"Departure from SOP\'s, fixation on one item to the exclusion of all others and failure to plan the night before a flight.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"No one flying the aircraft, Confusion and Ambiguity.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Unresolved discrepancy, failure to meet targets and use of correctly documented procedures.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Violation of minima\'s, departure from SOP\'s and failure to flight plan the night before.\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(973,245,'The difference between Active errors and Latent errors is that latent errors have immediate affects and felt straight away:','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',1,NULL,1),(974,245,'Is it true that being under worked can lead to a reduction in human performance:','[{\"text\":\"Yes\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"No\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(975,245,'Is it true that being over worked can lead to a reduction in human performance: