ack\":\"\"},{\"text\":\"The cartridge wiring has failed\",\"answerID\":2,\"feedback\":\"\"}]',1,NULL,1),(1134,91,'At around 50 deg C the recommended operating pressure in PSIG in the extinguisher bottles is;','[{\"text\":\"532 to 582\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"442 to 492\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"367 to 417\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"304 to 354\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(1135,91,'If a left fire persists after the left fire extinguishing system has been discharged. The right system:','[{\"text\":\"Cannot be crossfed to the left side.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Can be used to extinguish the the left fire\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Now has half the original chemical agent\",\"answerID\":2,\"feedback\":\"\"}]',0,NULL,1),(1136,91,'The autopilot disengage switch is located on the control wheel;','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(1137,172,'Communication with Air Traffic Control is important during single pilot operations because?','[{\"text\":\"The correct use of Radio terminology minimises the risk of human error.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"A cross check of instructions is unavailable during single pilot operations.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"It increases situational awareness.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"All of the above.\",\"answerID\":3,\"feedback\":\"\"}]',3,'no',1),(1138,172,'Single pilot Crew Resource Management can be recognised as?','[{\"text\":\"Airmanship which has developed into technical skill.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Airmanship which has developed into non technical skill.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Airmanship.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Hard to do.\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(1139,172,'Single pilot Crew Resource Management can be less complex with respect to CRM because?','[{\"text\":\"There is no crew communication problems and no issues relating to authority and leadership.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"There is no communication.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"There is no commercial pressure as there are with multi crew operations.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"There are no problems.\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(1140,172,'The single pilot does not?','[{\"text\":\"Have any benefits like multi crew operations do.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Have the benefit of wisdom.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Have the benefit of learning from the experience of other crew members.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Have the benefit of learning.\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(1141,172,'Factors which may impede the communication process during single pilot operations are?','[{\"text\":\"Good situational awareness.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"High work load, Fatigue, Distractions and Interruptions and Pre-conceived ideas.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Use of Standard Operating Procedures.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Use of check lists.\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(1142,172,'Incapacitation procedures have reduced the accident statistics for single pilot operations.','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',1,NULL,1),(1143,172,'Workload management is probably the most important item of single pilot Crew Resource Management.','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(1144,172,'Correct use of Standard Operating Procedures can reduce single pilot workload.','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(1145,172,'A pilot who can work very effectively in a single pilot operation can?','[{\"text\":\"Prioritise workload, maintain a good level of situational awareness and plans for inflight abnormal operations.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Plan the night before and turn up to work early.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Prioritise workload to the detriment of situational awareness.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Plan for contingencies but lose some levels of prioritising workload in order to maintain a high level of situational awareness.\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(1146,172,'Part of the error management process is the?','[{\"text\":\"Correct use of Standard Operating Procedures.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Correct use Checklists.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Correct use of Standard Terminology when using the radio.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"All of the above\",\"answerID\":3,\"feedback\":\"\"}]',3,'no',1),(1147,173,'Creating a cockpit environment that is open to discussion, disciplined, teaching and safety conscious is an example of what type of leadership?','[{\"text\":\"Aggressive\\/assertive.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Assertive\\/submissive\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Assertive\\/supportive.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Supportive\\/submissive.\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(1148,173,'A good leader will?','[{\"text\":\"Listen well to comments from other crew members.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Put themselves in their subordinates shoes.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Put themselves first.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Both A and B.\",\"answerID\":3,\"feedback\":\"\"}]',3,'no',1),(1149,173,'A leader will display poor leader ship skills by?','[{\"text\":\"Adopting a theory early when making decisions.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Displaying a given level of pessimism.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Ignoring Ambiguity.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Both A and C.\",\"answerID\":3,\"feedback\":\"\"}]',3,'no',1),(1150,173,'Which types of errors are easier for a captain to manage in the cockpit environment?','[{\"text\":\"Variable errors.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Constant errors.\",\"answerID\":1,\"feedback\":\"\"}]',1,NULL,1),(1151,173,'The multi crew environment is far better equipped to deal with threats and errors than the single pilot environment.','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(1152,173,'The challenge and response technique is an error management tool for the multi crew environment.','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(1153,171,'\"The non specific response of a human being to any demands for change\" best describes?','[{\"text\":\"Leadership.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"An error.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Stress.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Fatigue.\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(1154,171,'Signs of stress can manifest themselves as?','[{\"text\":\"Poor stature, Fatigue, Good concentration and Low energy levels.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Pathological symptoms, Anxiety, Narcisistic tendancies and high volume speech patterns.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Poor concentration, Nervous shaking, Narcisistic tendancies and High energy levels.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Physiological symptoms, Behavioural symptoms, Poor concentration and Anxiety.\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(1155,171,'Recognising and accepting that we are stressed is one of the first steps in the stress management process.','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(1156,171,'Napping during long work shifts has no effect on improving mental performance.','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',1,NULL,1),(1157,171,'If an individual develops a sleep deficit due to successive long work days, this sleep deficit will need to be paid back. This sleep deficit will not impede on the individuals performance at work however!','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',1,NULL,1),(1158,171,'The formula STRESS x TIME = best describes?','[{\"text\":\"Stress.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Fatigue.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Leadership.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Learning.\",\"answerID\":3,\"feedback\":\"\"},{\"text\":\"Captains upgrade formula.\",\"answerID\":4,\"feedback\":\"\"}]',1,NULL,1),(1159,171,'The difference between Physiological Fatigue and Subjective Fatigue is?','[{\"text\":\"Physiological fatigue reflects the bodies need for replenishment and restoration, whereas subjective fatigue is a persons perception of how fatigued they feel.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Physiological fatigue is a persons perception of how fatigued they feel, whereas subjective fatigue reflects the bodies need\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Physiological fatigue can be corrected, whereas subjective fatigue cannot.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Physiological fatigue cannot be corrected but subjective fatigue can.\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(1160,171,'What is the difference between a Violation and an Error?','[{\"text\":\"An error is is an external influence and a violation is an internal influence.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"An error is an internal influence and a violation is an external influence that is forced.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"An error is a human error issue whereas a violation is not.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"They are both human errors but a violation is a deliberate error.\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(1161,171,'Current generation Crew Resource Management focusses on several areas of error management. One of these items is accepting that human error doesn\'t exist on the flight deck.','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',1,NULL,1),(1162,171,'With regard to Attention, the human brain can only deal with one item at a time.','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(1163,171,'Arousal level and Stress both affect a persons attention span.','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(1164,171,'A good decision cannot be improvised, it must be prepared by considering all of the options available.','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(1165,171,'Short term memory is more prone to errors than long term memory because sort term memory is more more prone to Perception error.','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',1,NULL,1),(1166,171,'If a physical task is performed often enough , it will become automatic. This is known as a Motor Program','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(1168,171,'To make effective decisions you must consider?','[{\"text\":\"How the decision is to be made.\",\"answerID\":0,\