ed to when you are well rested\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"You wake up naturally as compared to being woken by an alarm clock\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"When you are napping during the daytime\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"When you are woken from deep sleep\",\"answerID\":3,\"feedback\":\"\"},{\"text\":\"None of the above\",\"answerID\":4,\"feedback\":\"\"}]',3,'notlast',1),(1734,337,'In order to provide measurable benefits to alertness, performance and communication, a nap can be as short as:','[{\"text\":\"25 minutes\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"5 minutes\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"10 minutes\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"40 minutes\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(1735,338,'Many workplaces have food and drink vending machines. These machines generally offer a wide range of nutritionally balanced products that are suitable for eating whilst on shift?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',1,NULL,1),(1736,338,'Pick the statement that you think best describes one strategy for using food to your advantage when you are on night shift and feeling tired;','[{\"text\":\"At all costs, try to avoid eating high fat foods\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Eat low fat protein foods and also some fruit\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Eat only protein-rich foods such as ham steaks or cheese and bacon pizza\",\"answerID\":2,\"feedback\":\"\"}]',0,NULL,1),(1737,338,'Digesting food becomes slower and more difficult on night shift because your body is not programmed to be processing food at this time;','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(1738,338,'Sweet pastries, cakes and biscuits tend to make your blood sugar rise quite soon after you eat them. Drinks that are high in sugar make\r\nyour blood sugar rise quickly too. Is it true or false that these sorts of foods and drinks can help you stay awake for long periods because of the fast \'sugar hit\' that they give?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',1,NULL,1),(1739,338,'Regardless of how much sleep you have had before a particular shift, if you get sleepy on that\r\nshift will eating low fat protein-rich foods help you feel more alert?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(1740,339,'What is the minimum recommended amount of water that you should drink every 24 hours?','[{\"text\":\"Four litres\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"One litre\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Two litres\",\"answerID\":2,\"feedback\":\"\"}]',2,NULL,1),(1741,339,'If you are working in a hot environment your body will regulate its temperature by making you relax and slow down?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(1742,340,'How many standard drinks do most people have to drink in the hours before bedtime to contribute to disturbed sleep?','[{\"text\":\"One\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Two\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Four or five\",\"answerID\":2,\"feedback\":\"\"}]',2,NULL,1),(1743,340,'Normal tea bags do not have anywhere near the amount of caffeine as a cup of instant coffee. Therefore we do not need to worry about how much tea we drink?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',1,NULL,1),(1744,341,'It is important to keep your family fully informed of your shift starts and when you should be returning?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(1