ctures and fire hoses.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Gas, structures and fire alarms.\",\"answerID\":2,\"feedback\":\"\"}]',0,'yes',1),(1756,350,'What is fire?','[{\"text\":\"Fire is a chemical reation that produces light and heat.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Fire is a biological reaction that produes heat.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Fire is neurological reaction that produces light and heat.\",\"answerID\":2,\"feedback\":\"\"}]',0,'yes',1),(1757,350,'Which 3 elements are required to produce a fire?','[{\"text\":\"Oxygen, Heat and a fuel source.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Heat, light and shade.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Fuel source, heat and ignition.\",\"answerID\":2,\"feedback\":\"\"}]',0,'yes',1),(1758,350,'Which of the following best describes a Class A fire?','[{\"text\":\"Wood, paper, upholstery and plastics.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Natural gas, LPG, acetylene and hydrogen.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Magnesium, sodium and potassium.\",\"answerID\":2,\"feedback\":\"\"}]',0,'yes',1),(1759,350,'Which of the following best describes a Class B fire?','[{\"text\":\"Petrol, oil, thinners and paints.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Natural gas, LPG, acetylene and hydrogen.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Household appliances, wiring, electric motors and switch boards.\",\"answerID\":2,\"feedback\":\"\"}]',0,'yes',1),(1760,350,'Which of the following best describes a Class C fire?','[{\"text\":\"Natural gas, LPG, acetylene and hydrogen.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Wood, paper, upholstery and plastics.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Commercial kitchens and fast food outlets.\",\"answerID\":2,\"feedback\":\"\"}]',0,'yes',1),(1761,350,'Which of the following best describes a Class D fire?','[{\"text\":\"Magnesium, sodium and potassium.\",\"answerID\":0,\"feedb