,(1861,592,'HF transmissions split into two different waves when they leave the transmitter, these waves are known as?','[{\"text\":\"Big waves and little waves\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Earth waves and wind waves\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Sky waves and ground waves\",\"answerID\":2,\"feedback\":\"\"}]',2,NULL,1),(1862,592,'HF transmissions that are sent skywards are reflected back to the earths surface by the?','[{\"text\":\"Troposphere\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Stratosphere\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Ionosphere\",\"answerID\":2,\"feedback\":\"\"}]',2,NULL,1),(1863,592,'The principles of HF propagation require that lower HF frequencies are used during the night and early hours of the morning, and higher frequencies are used through the middle of the day?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(1864,592,'Thunderstorms can increase the background static and even block out HF transmissions?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(1865,592,'Channel selection on the Barrett 2050 HF\'s fitted in Corporate Air aircraft is achieved by using the channel UP/Down buttons located on the face of the radio?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(1866,592,'Pressing the press-to-talk button with HF selected on the Comms selector panel will not autotune the Barrett 2050 HF radio?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',1,NULL,1),(1867,592,'Pressing the TUNE button on the face of the Barrett 2050 HF will tune the selected HF frequency?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(1868,592,'The volume controls on the face of the Barrett 2050 HF have been disabled in Corporate Air aircraft. The volume control is now adjusted via the comm selector panel and your headset controls?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(1869,593,'Three functional areas of the EGPWS system are the:','[{\"text\":\"Ground Proximity Warning, Terrain awareness and Terrain clearance floor.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Ground Proximity Warning, Terrain following and Terrain clearance floor.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Ground Proximity Warning, Terrain following and Terrain display.\",\"answerID\":2,\"feedback\":\"\"}]',0,'no',1),(1870,593,'Two levels of alert are computed by the Terrain Awareness Display (T.A.D.) using the terrain clearance floor as a baseline, these are:&nbsp;','[{\"text\":\"The Caution level and the Alert level.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The Caution level and the Warning level.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"The Warning level and the Alert level.\",\"answerID\":2,\"feedback\":\"\"}]',1,'no',1),(1871,593,'The \"Yellow\" terrain envelope shown on the Terrain Awareness Display (T.A.D.) is the:','[{\"text\":\"Alert envelope.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Warning envelope.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Caution envelope.\",\"answerID\":2,\"feedback\":\"\"}]',2,'no',1),(1872,593,'The \"Peaks\" function of the Terrain Awareness Display (T.A.D.) shows the highest and lowest terrain elevation on the T.A.D. display as?','[{\"text\":\"Two lots of Two digit numbers.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Two lots of Three digit numbers.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Two lots of Four digit numbers.\",\"answerID\":2,\"feedback\":\"\"}]',1,'no',1),(1873,593,'When an \"AURAL WARNING\" alert occurs, flight crew are to immediately commence a go-around procedure and climb to the area Lowest Safe Altitude.','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(1874,593,'The EGPWS uses inputs from various sensors to calculate algorithms that determine if the predicted fligth path will exceed the boundary of an acceptable flight envelope.','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(1875,593,'An enhanced GPWS (E.G.P.W.S.) is more susceptible to false alerts than GPWS?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',1,NULL,1),(1876,593,'EGPWS envelope modulation requires input from the crew during certain phases of flight, e.g. en-route, approach, etc.','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',1,NULL,1),(1877,593,'Terrain Awareness Display functions to compute terrain clearance envelopes ahead of the aircraft.','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(1878,593,'If the aircraft penetrates the red terrain envelope a \"TERRAIN TERRAIN\" aural alert will be issued?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(1879,238,'A category C item is endorsed on the maintenance release on the 1st November shall be repaired by midnight the:','[{\"text\":\"4th November\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"10th November\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"11th November\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"12th November\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(1880,238,'Where do you find the operational&nbsp;procedures for an MEL item?','[{\"text\":\"In the operations manual\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"In the FCOM\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"At the back of the MEL Book\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"In the maintenance manual\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(1881,238,'Where do you find the maintenance requirements for an MEL?','[{\"text\":\"In the operations manual\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"In the maintenance manual\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"At the back of the MEL Book\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"In the FCOM\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(1882,176,'When are life jackets required to be carried on board a multi-engine&nbsp;aircraft during charter operations?','[{\"text\":\"When the aircraft is over water and at a distance from land greater than 50 miles.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"On all flights where the take-off or approach path is so disposed over water that in the event of a mishap occurring during the departure or the arrival it is reasonably possible that the aircraft would be forced to land onto water.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"All of the above.\",\"answerID\":2,\"feedback\":\"\"}]',2,'no',1),(1883,176,'When must a life jacket be worn?','[{\"text\":\"Each occupant shall wear a life jacket during flight over water. However, occupants of aeroplanes need not wear life jackets during flight above 500 feet above the water.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Each occupant shall wear a life jacket during flight over water. However, occupants of aeroplanes need not wear life jackets during flight above 1 000 feet above the water.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Each occupant shall wear a life jacket during flight over water. However, occupants of aeroplanes need not wear life jackets during flight above 2 000 feet above the water.\",\"answerID\":2,\"feedback\":\"\"}]',2,'no',1),(1884,176,'An aircraft that is flown over water at a distance from land greater than the permitted distance must carry, as part of its emergency and lifesaving equipment, sufficient life rafts to provide a place in a life raft for each person on board the aircraft.\r\nIn the case of&nbsp;a turbine powered&nbsp;aeroplane above 5700kgs&nbsp;that complies with CAO 20.7.1B this is,','[{\"text\":\"Beyond gliding distance in the event of a double engine failure\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"A distance equal to 30 minutes at normal cruising speed, or 100 miles, whichever is the less.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"A distance equal to 120 minutes at normal cruising speed, or 400 miles, whichever is the less; or\",\"answerID\":2,\"feedback\":\"\"}]',2,'no',1),(1885,176,'An aircraft that is flown over water at a distance from land greater than the permitted distance must carry, as part of its emergency and lifesaving equipment, sufficient life rafts to provide a place in a life raft for each person on board the aircraft.\r\nIn the case of&nbsp;a twin engined aircraft below 5700kgs&nbsp;this is:','[{\"text\":\"Beyond gliding distance in the event of a double engine failure\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"A distance equal to 30 minutes at normal cruising speed, or 100 miles, whichever is the less.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"A distance equal to 120 minutes at normal cruising speed, or 400 miles, whichever is the less;\",\"answerID\":2,\"feedback\":\"\"}]',1,NULL,1),(1887,583,'RTLT stands for?','[{\"text\":\"Real Time Label Tracing\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Real Time Labour Tracking\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Reliable Task Labour Trace\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Nothing it is made up.\",\"answerID\":3,\"feedback\":\"\"}]',1,'yes',1),(1888,583,'Your should log off WinAir RTLT for all Breaks?','[{\"text\":\"False\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"True\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"True, but only for Lunch, not Morning or Afternoon Smoko\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"True, but only at the end of the day\",\"answerID\":3,\"feedback\":\"\"}]',1,'yes',1),(1889,583,'You access WinAir RTLT through a Web browser such as Internet Explorer?&nbsp;','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,'yes',1),(1890,583,'If you don\'t have your Employee Bar Code, you can log onto the WinAir RTLT by typing in your user name?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False, you dont need to account for your time if you forgot your bar code.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"False, you can use someone elses Bar Code.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":3,\"feedback\":\"\"}]',3,'yes',1),(1891,583,'When you have finished a task or go on a break you scan the Away bar code','[{\"text\":\"No\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Yes\",\"answerID\":1,\"feedback\":\"\"}]',0,'yes',1),(1892,583,'MRO Staff can take stock from the following Goulburn Store locations without the Store Managers approval?','[{\"text\":\"A & B Only\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"E, F, G, H & I Only\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"All of the Above\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"None of the Above\",\"answerID\":3,\"feedback\":\"\"}]',3,'no',1),(1893,583,'An Alternate Part is a real part that can be fitted to an Aircraft in place of another part.&nbsp;','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False, it is a real part but cannot be fitted inplace of another part.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"True, however it must be approved by the MRO Manager\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"False, an Alternate Part is a \\\"Nick Name\\\" not a real part\",\"answerID\":3,\"feedback\":\"\"}]',3,'notlast',1),(1894,583,'A&nbsp;Substitute Part is a real part that can be fitted to an Aircraft in place of another part.&nbsp;','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False, A substitute part is a \\\"Nick Name\\\" and is not a real part\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"False, A substitute part can only be fitted to C441\'s\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"True, but only with Stores Approval.\",\"answerID\":3,\"feedback\":\"\"}]',0,'yes',1),(1895,583,'When searching for a Part you can look up the following information?','[{\"text\":\"Part Number\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Description\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Classification\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"All of the above\",\"answerID\":3,\"feedback\":\"\"}]',3,'notlast',1),(1896,583,'From the Parts search you can see the following Information','[{\"text\":\"Part History and Part Summary\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Part Location and Part Summary\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Part Location, All Parts on Order and Part Summary\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Part Summary, Part Location and Part History\",\"answerID\":3,\"feedback\":\"\"}]',3,'yes',1),(1897,583,'The Quantity of Substitute Parts available for a Part is listed on the Part Summary page?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,'yes',1),(1898,583,'Any&nbsp;Staff member can Open&nbsp;or Close a Task in WinAir','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False, Only the MRO Manager can open and close a Tasks\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"False, Only Store Staff can open and close a Task\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"False, Only LAME\'s can open and close a Task\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(1899,583,'New non component related Tasks must be associated to an Aircraft?','[{\"text\":\"False, Tasks can be opened against a Staff Member.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False, Task can be opened for anything.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"False, Tasks can be opened against a Part.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"True\",\"answerID\":3,\"feedback\":\"\"}]',3,'notlast',1),(1900,583,'You can view a Task Card from the WinAir Web Main Menu by scanning the Task Card&nbsp;','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,'yes',1),(1901,583,'As soon as a Task is completed by the MRO Staff&nbsp;it should be marked as Maintenance Complete in WinAir Web?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,'yes',1),(1902,583,'When doing an Engine Change, all component information taken on and off must be recorded on the Task Card','[{\"text\":\"True, but only for the information listed on the Task Card\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"True, for all components including ones not listed on the Task Card\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"False, Only the Engine Serial number is needed\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"False, WinAir is smart enough to pick up the data by itself\",\"answerID\":3,\"feedback\":\"\"}]',0,'yes',1),(1903,583,'Stock can be taken from Location H, with the approval of the Store Manager and put straight on an Aircraft','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',1,'yes',1),(1904,583,'Engines can be stored in any area on the Top Level, no matter the weight','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False, Engines can only be stored in Location E\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"False, Engines can be stored in Location E & C\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"False, Engines cannot be stored more than 2 metres off the ground\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(1905,176,'An aircraft that is flown over water at a distance from land greater than the permitted distance must carry, as part of its emergency and lifesaving equipment, sufficient life rafts to provide a place in a life raft for each person on board the aircraft.\r\nIn the case of the Titan and Baron this is:','[{\"text\":\"Beyond gliding distance in the event of a double engine failure \",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"A distance equal to 30 minutes at normal cruising speed, or 100 miles, whichever is the less.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"A distance equal to 120 minutes at normal cruising speed, or 400 miles, whichever is the less \",\"answerID\":2,\"feedback\":\"\"}]',1,'no',1),(1906,176,'When ditching the aircraft when is the correct time to inflate your life jacket?&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;','[{\"text\":\"Prior to impact with the water so that the life jacket can act as an air bag.  \",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"After ditching and before leaving your seat to ensure it works before jumping into the water. \",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Only once you have exited the aircraft.\",\"answerID\":2,\"feedback\":\"\"}]',2,'no',1),(1908,176,'Aircraft on flights where the carriage of 2 life rafts is required shall carry:&nbsp;','[{\"text\":\"One (1) approved emergency locator transmitter provided the two rafts are tied together and shall be stowed so as to facilitate their ready use in an emergency; \",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"At least 2 emergency locator transmitters and shall be stowed so as to facilitate their ready use in an emergency. \",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Not required to be carried in the raft as long as the aircraft has it fitted in the tail with an automatic \\\"G\\\" switch which activates on impact \",\"answerID\":2,\"feedback\":\"\"}]',1,'no',1),(1909,176,'A supply of pyrotechnic distress signals are required to be fitted in a raft fitted with an emergency locator transmitter?\r\n&nbsp;\r\n&nbsp;','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(1910,176,'On which flight would you be required to carry survival equipment?\r\n&nbsp;\r\n&nbsp;','[{\"text\":\"Canberra DCT Bourke and then DCT Townsville \",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Perth DCT Kalgoolie\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Canberra DCT Latrobe Valley \",\"answerID\":2,\"feedback\":\"\"}]',2,NULL,1),(1915,176,'When extinguishing an electrical&nbsp;fire the best method is?\r\n&nbsp;','[{\"text\":\"Smother the fire by pointing the fire extinguisher at the top of the flames\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Point the fire extinguisher at the base of the fire and sweep vertically from the base to the tips of the flames.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Point the fire extinguisher at the base of the fire and sweep horizontally from side to side\",\"answerID\":2,\"feedback\":\"\"}]',2,'no',1),(1916,176,'Where&nbsp;is the Emergency Locator Transmitter fitted in the aircraft?','[{\"text\":\"On the avionics rack in the nose of the aircraft\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"At the rear of aircraft \",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Under the floor\",\"answerID\":2,\"feedback\":\"\"}]',1,'no',1),(1917,176,'The emergency locator transmitter cannot be activated from the cockpit?\r\n&nbsp;','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',1,NULL,1),(1918,176,'Where are the first aid kits in the Conquest, Titan and Baron?\r\n&nbsp;\r\n&nbsp;\r\n&nbsp;','[{\"text\":\"Behind the pilots seat \",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"At the rear of the cabin\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"In the nose locker\",\"answerID\":2,\"feedback\":\"\"}]',1,'no',1),(1920,176,'After a successful forced landing in a remote area the best course of action is to:\r\n&nbsp;\r\n&nbsp;','[{\"text\":\"Leave the aircraft and search for help.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Stay with the aircraft as long as possible.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Set fire to the aircraft in the hope that someone will see the smoke\",\"answerID\":2,\"feedback\":\"\"}]',1,'no',1),(1925,176,'When suffering from hypoxia at high level in an unpressurised aircraft, the pilot or passengers feel no unpleasant suffocating\r\nsensation because?','[{\"text\":\"In the absence of physical exertion, there is no change in the carbon dioxide level in the blood sothe brain does not respond\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"There is a subconscious increase in breathing rate to compensate for the dropping ambientatmospheric pressure\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"The heart rate rises to increase the blood flow to the brain to compensate for the droppingambient atmospheric pressure\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"The drop in partial pressure of oxygen is accompanied by a similar drop in the partial pressure of carbon dioxide\",\"answerID\":3,\"feedback\":\"\"}]',0,'no',1),(1926,176,'If a pilot suspects that he/she is suffering the effects of hypoxia, the most appropriate remedy would be?','[{\"text\":\"Voluntarily increase the breathing rate to increase the oxygen uptake\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Voluntarily increase the depth of breathing to induce more oxygen into the lungs\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Voluntarily increase both the rate and depth of breathing\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Use supplemental oxygen or descend immediately to a lower level \",\"answerID\":3,\"feedback\":\"\"}]',3,'no',1),(1927,176,'In the event of a sudden loss of cabin pressure at 30000 ft, the Effective Performance Time [EPT] for a pilot without supplemental \r\noxygen would be closest to?\r\n&nbsp;','[{\"text\":\"5-10 minutes\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"1-2 minutes\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"45 seconds\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"15 seconds\",\"answerID\":3,\"feedback\":\"\"}]',1,'no',1),(1928,176,'Which of the following is NOT a symptom of Hypoxia?','[{\"text\":\"CYANOSIS\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"A FEELING OF EUPHORIA\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"SEVERE HEADACHE\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"ERRATIC BEHAVIOUR\",\"answerID\":3,\"feedback\":\"\"}]',2,'no',1),(1929,176,'CAO 20.4.7 requires that supplemental oxygen be provided and used by the pilot at all times during flight above?','[{\"text\":\"20,000 feet\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"10,000 feet\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"14,000 feet\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"8,000 feet \",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(1930,176,'Each passenger must be provided with supplemental oxygen for all of the time at which an unpressurised aircraft\r\nis operating above?\r\n&nbsp;','[{\"text\":\"20,000 feet\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"10,000 feet\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"14,000 feet\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"8,000 feet\",\"answerID\":3,\"feedback\":\"\"}]',2,'no',1),(1931,176,'Which of the following will increase susceptibility to hypoxia?\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;','[{\"text\":\"Smoking and alcohol\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Anaemia\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Cold and fatigue\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"All of the above \",\"answerID\":3,\"feedback\":\"\"}]',3,'no',1),(1932,176,'The average time of useful consciousness following a rapid decompression at 35 000 feet is closest to?','[{\"text\":\"15 Seconds\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"30-60 Seconds\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"90-120 Seconds\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"3 minutes\",\"answerID\":3,\"feedback\":\"\"}]',1,'no',1),(1933,176,'A heavy smoker will suffer the effects of hypoxia at a lower altitude than a non-smoker. Whilst flying at an altitude of 5,000 feet, a heavy smoker could be experiencing the same degree of hypoxia as a non-smoker at 20 000ft.','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(1934,176,'Hypoxia may be caused by :-\r\n&nbsp;','[{\"text\":\"Flying with a head cold\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Flying at an altitude where the partial pressure of oxygen is too low\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Breathing too quickly and\\/or too deeply for the requirements of the body\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Flying after a period of underwater diving\",\"answerID\":3,\"feedback\":\"\"}]',1,'no',1),(1935,176,'Hypoxia is always accompanied by :-\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;','[{\"text\":\"High temperature and vomiting\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Dizziness\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Profuse sweating\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"A degradation in the performance of a pilot\",\"answerID\":3,\"feedback\":\"\"}]',3,'no',1),(1936,176,'Which of the following would&nbsp;NOT increase the likelihood of suffering the effects of hypoxia at a relatively low altitude?\r\n&nbsp;','[{\"text\":\"Flying at night\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Flying with an elevated blood alcohol level\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Flying in a poor state of physical fitness\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Smoking heavily\",\"answerID\":3,\"feedback\":\"\"}]',0,'no',1),(1937,176,'The time of useful consciousness [Effective Performance Time - EPT] while cruising at an altitude of 20 000 feet and sitting quietly would be&nbsp;closest to?','[{\"text\":\"1 minute\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"10 minutes\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"25 minutes\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"30 minutes or more.\",\"answerID\":3,\"feedback\":\"\"}]',1,'no',1),(1938,176,'The symptoms of hyperventilation are:-','[{\"text\":\"Quite similar to those of hypoxia\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Quite different to those of hypoxia\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"A blue colouring of the lips and fingernails (cyanosis)\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Profuse sweating\",\"answerID\":3,\"feedback\":\"\"}]',0,'no',1),(1939,176,'Above which altitude does it first become necessary for the pilot of an unpressurised aircraft to breathe pure [100%] oxygen?','[{\"text\":\"10,000 feet\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"33,700 feet\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"40,000 feet\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"45,000 feet\",\"answerID\":3,\"feedback\":\"\"}]',1,'no',1),(1940,176,'Above which altitude does it first become necessary for the pilot of an unpressurised aircraft to breathe pure [100%] oxygen under pressure?\r\n[a]&nbsp;&nbsp;&nbsp;&nbsp; 10 000 feet\r\n[b]&nbsp;&nbsp; 20 000 feet\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; lc] 40 000 feet\r\n[d]&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 45 000 feet','[{\"text\":\"10,000 feet\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"20,000 feet\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"40,000 feet\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"45,000 feet\",\"answerID\":3,\"feedback\":\"\"}]',2,'no',1),(1941,176,'Cyanosis can be indentified by?','[{\"text\":\"Rapid breathing\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"A blue coloration of the finger-nail beds and lips\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Slurred speech\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Difficulty in maintaining balance\",\"answerID\":3,\"feedback\":\"\"}]',1,'no',1),(1942,176,'Compared to sitting quietly in a normal cockpit environment, the uptake of oxygen when under stress of coping with a life threatening emergency can be increased by a factor of :-\r\n&nbsp;','[{\"text\":\"2 (double)\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"10 times\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"20 times\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"5 times\",\"answerID\":3,\"feedback\":\"\"}]',2,'no',1),(1943,176,'The most likely immediate effect of a sudden decompression at 35 000 feet would be\r\n&nbsp;','[{\"text\":\"Pains in the stomach\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The forced exhalation of breath\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Gasping for air\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Dizziness\",\"answerID\":3,\"feedback\":\"\"}]',1,'no',1),(1944,176,'A regularr smoker at sea-level can be assumed to be at an effective altitude of :-\r\n&nbsp;','[{\"text\":\"2,000 feet\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"5,000 feet\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"8,000 feet\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"10,000 feet\",\"answerID\":3,\"feedback\":\"\"}]',2,'no',1),(1945,176,'The average time of useful consciousness when engaged in moderate activity following a rapid decompression at 45000 ft is closest to :-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;','[{\"text\":\"15 Seconds\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"30 Seconds\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"60 Seconds\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"90 Seconds\",\"answerID\":3,\"feedback\":\"\"}]',0,'no',1),(1946,176,'&nbsp;The average time of useful consciousness when engaged in moderate activity following a decompression at 35,000 feet is :-\r\n&nbsp;','[{\"text\":\"15 Seconds\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"30 Seconds\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"60 Seconds\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"90 Seconds\",\"answerID\":3,\"feedback\":\"\"}]',1,'no',1),(1947,176,'A smoker who has an elevated level of carbon monoxide in the blood stream may suffer a greater reduction in performance as altitude increases compared to a non smoker. This is because at a cabin altitude of 5000 ft, the physiological altitude of a smoker with a 5% carboxyhaemoglobin saturation can be up to : -\r\n&nbsp;','[{\"text\":\"7,000 feet\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"10,000 feet\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"15,000 feet\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"20.000 feet\",\"answerID\":3,\"feedback\":\"\"}]',1,'no',1),(1948,176,'Hypoxia may be caused by :-','[{\"text\":\"Flying with a head cold\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Flying at an altitude where the partial pressure of oxygen is too low\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Breathing too quickly for the amount of activity\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Flying after scuba diving\",\"answerID\":3,\"feedback\":\"\"}]',1,'no',1),(1949,176,'Hypoxia is always accompanied by : -','[{\"text\":\"Unconsciousness\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Dizziness\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"A deterioration in flying performance\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Perspiration\",\"answerID\":3,\"feedback\":\"\"}]',2,'no',1),(1950,176,'Susceptibility to hypoxia will not be increased by : -','[{\"text\":\"Flying at night\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Flying with a hangover\",\"answerID\":1,\"feedback\