583,'Man Hours need to be entered into the new task?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(2017,583,'The Original Task\'s status&nbsp;can stay as Deferred?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',1,NULL,1),(2018,238,'Some maintenance tasks or defects may be deferred under a system of maintenance. At Corporate Air we use the following&nbsp; method to defer maintenance to a later date;','[{\"text\":\"The application of an approved Minimum Equipment List (M.E.L.) or Permissible Unserviceability (P.U.S.),\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Making the determination that a defect is a Non Safety of Flight Defect (N.S.O.F.D.)\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Both of the above.\",\"answerID\":2,\"feedback\":\"\"}]',2,NULL,1),(2019,238,'If a pilot undertakes any pilot approved maintenance on an aircraft, he/she must certify for that maintenance on the Maintenance Release or other documentation approved for that purpose under C.A.R. 42ZE.','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(2021,238,'The&nbsp;Minimum Equipment List (MEL) does what?','[{\"text\":\"The minimum list of equipment fitted to an IFR aircraft in line with the issued Certificate of Airworthiness.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The minimum list of equipment required to be seviceable for IFR flight.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"The list of approved unserviceable items an aircraft can fly with.\",\"answerID\":2,\"feedback\":\"\"}]',2,NULL,1),(2023,238,'The purpose of an M.E.L. or an N.O.S.F.D. is to change an unscheduled defect into a scheduled maintenance item.','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(2024,238,'The Air Transport Association (ATA) number for a defect can be found in the AML booklet.','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(2028,238,'A Non Safety Of Flight Defect is a defect that is not covered under an MEL,&nbsp; is not an item required for flight under C.A.O. 20.18 and will not affect the safety of the flight about to be undertaken.','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(2030,238,'The expiry limit for all Non Safety of Flight Defects is;','[{\"text\":\"10 days\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"30 days\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"120 days\",\"answerID\":2,\"feedback\":\"\"}]',2,NULL,1),(2031,238,'If a defect is not covered by an MEL or cannot be determined to be a Non Safety of Flight Defect, the defect may be deferred as a Permissible Unserviceability (PUS) or, it may not be deferrable in which case the defect will Ground the aircraft.','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(2032,238,'If a defect cannot be deferred the aircraft must be grounded until the defect can be cleared by an appropriately licenced engineer. How would you as the pilot enact the grounding?','[{\"text\":\"Endorse the AML\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Report the fault to the 24 hour Engineering help line\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Circle item 1 in the Defect Report followed by a statement describing the defect\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"All of the above\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(2034,295,'All associated risks and treatments&nbsp;in Air Support Services duties can be found in which section of the Employee web Portal?','[{\"text\":\"Training Library, Manual- Environmental Management, Risk Register by Department & Risk Register Traeatments\",\"answerID\":0