 Traeatments\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Technical Library, Manual- Safety Management & Quality, Risk Register by Department & Risk Register Traeatments\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(2043,287,'All associated risks and treatments&nbsp;can be found in which section of the Employee web Portal?','[{\"text\":\"Training Library, Manual- Environmental Management, Risk Register by Department & Risk Register Treatments\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Training Library, Manual- Transport Security Program, Risk Register by Department & Risk Register Treatments\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Training Library, Manual- General Policy, Risk Register by Department & Risk Register Treatments\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Technical Library, Manual- Safety Management & Quality, Risk Register by Department & Risk Register Treatments\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(2044,288,'All associated risks and treatments&nbsp;can be found in which section of the Employee web Portal?','[{\"text\":\"Training Library, Manual- Environmental Management, Risk Register by Department & Risk Register Traeatments\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Training Library, Manual- Transport Security Program, Risk Register by Department & Risk Register Traeatments\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Training Library, Manual- General Policy, Risk Register by Department & Risk Register Traeatments\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Technical Library, Manual- Safety Management & Quality, Risk Register by Department & Risk Register Traeatments\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(2045,290,'When using a company radio you should always pronounce Multiple numbers as?','[{\"text\":\"Multiples\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Singular\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Dont say numbers\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Spell the number words\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(2046,290,'The phonetic alphabet is made up of particular words to denote what?','[{\"text\":\"Numbers\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Colours\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Letters\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Call Signs\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(2047,290,'What&nbsp;are the phonetic alphabet words that denote the letters A, H, U, J, C, D','[{\"text\":\"Alpha, Hotel, Umbrella, Junk, Copy, Dragon\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Apple, Hungry, Uniform, Juliet, Charlie, Delta\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Aplha, Hotel, Uniform, Juliet, Charlie, Delicious\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Aplha, Hotel, Uniform, Juliet, Charlie, Delta\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(2048,290,'What are the correct common phrases used for Yes, Repeat, No &amp; Understand?','[{\"text\":\"Yeah, Say Again, Nah, Ok Doki\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Affirmative, Say Agian, Negative, Understood\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Affirmative, Say Agian, Negative, Roger\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Affirmative, Say Agian, No Thanks, Roger\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(2049,290,'The efficient use of radio communication depends largely on ?','[{\"text\":\"Microphone technique, the level of volume and choice of words\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Microphone technique, the method of speaking and choice of words\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Sitting technique, the method of speaking and choice of words\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Microphone technique, the method of speaking and choice of nicknames\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(2050,274,'Studies have shown that most mid-air collisions occur during:\r\n(a)&nbsp; Daylight hours\r\n(b)&nbsp; VFR conditions\r\n(c)&nbsp; Between the hours of 10AM and 5PM\r\n(d)&nbsp; On the weekend\r\n(e)&nbsp; During the warmer months of the year\r\n(f)&nbsp; In the terminal area\r\n(g)&nbsp; Within 5NM of a Non-Towered aerodrome\r\n&nbsp;','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(2051,274,'ATC is ultimately responsible for the separation of aircraft in any airspace?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',1,NULL,1),(2053,274,'Pre-occupation with cockpit duties is NOT a limitation of See and Avoid techniques?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',1,NULL,1),(2054,274,'TCAS was created to Augment proper See and Avoid techniques?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(2055,274,'Passive TCAS will not work outside of ATC Radar Coverage Areas?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(2056,274,'Active TCAS works independently of ground based ATC Radar systems?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(2057,274,'TCAS 1 systems are capable of providing the crew with a Resolution Advisory (RA)?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',1,NULL,1),(2058,274,'TCAS 2 systems are capable of providing the crew with a Resolution Advisory (RA)?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(2059,274,'Closest Point of Approach (CPA) is calculated so as to provide the crew with a Traffic Alert (TA) or a Resolution Advisory (RA)?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(2060,274,'If fitted to the aircraft, a TAWS warning will always override a TCAS warning because a traffic collision might be possible but a collision with the ground is certain?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(2061,267,'What is the area between parallel approach paths on adjacent ILS approaches known as?','[{\"text\":\"No Go Zone (NGZ)\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Non-Aggression Zone (NAZ)\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Controlled Separation Zone (CSZ)\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"No Transgression Zone (NTZ)\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(2062,267,'How is separation assured during conduct of a ILS/PRM approach?','[{\"text\":\"By use of high resolution radar\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Pilot monitoring\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Issue of Breakout Alerts by ATC when an aircraft deviates significantly from the approach path.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"All of the above\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(2063,267,'Breakout Procedures should be flown manually because?','[{\"text\":\"It is more accurate than using automated systems\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Hand flying will ensure the quickest response in a situation of minimal lateral separation\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Crew may need to respond to climbing or descending breakout instructions\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"You may be given a Breakout Alert instruction below minimum vectoring altitude (MVA)\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(2064,267,'You are conducting a flight into YSSY and are on a right circuit for a PRM approach to runway 16R. ATC will not turn you onto a base leg until you are at, or approaching 3000ft?','[{\"text\":\"To ensure a constant descent profile is maintained\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"To assist separation from other traffic\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"To annoy constituents in the Transport Ministers electorate\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Due to environmental considerations\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(2065,267,'During the conduct of a PRM approach you are issued an advisory by ATC that you are deviating to the left of the localiser course. You should:','[{\"text\":\"Immediately breakoff the approach\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Immediately breakoff the approach and acknowledge the deviation advice\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Immediately correct your track and regain the localiser course\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Immediately acknowledge the advisory and regain the localiser\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(2066,267,'ILS/PRM approaches are&nbsp;likely to be utilized at YSSY in conjunction with Independent Visual Approaches&nbsp;when weather conditions permit?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',1,NULL,1),(2067,267,'If issued a Breakout Alert, flight crew must?','[{\"text\":\"Immediately commence the assigned Breakout Procedure and acknowledge the Instruction on Tower Frequency\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Immediately commence the assigned Breakout Procedure and acknowledge the Instruction on PRM Frequency\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Not acknowledge the Instruction but immediately commence the assigned Breakout Procedure\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Immediately commence the assigned Breakout Procedure and contact Director for further instructions\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(2068,267,'If you are unable to conduct a ILS/PRM Approach and you become aware that ILS/PRM Approaches are in operation at your proposed destination,&nbsp; you should?','[{\"text\":\"Advise ATC prior to 120 DME Sydney or on first contact if flight less than 120nm\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Advise Approach Controller on first contact\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Notify Tower Controller on first contact\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Divert to another Airport that does not require ILS\\/PRM Approaches\",\"answerID\":3,\"feedback\":\"\"}]',0,NULL,1),(2069,268,'Crew can expect unrestricted use of a designated runway if conducting an \'Active\' LAHSO runway approach?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',1,NULL,1),(2070,268,'LAHSO operations are conducted at Darwin in the Northern Territory&nbsp;(&nbsp;use either the Jeppesen airways manual or the En-route Supplement Australia to find your answer)?&nbsp;','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(2071,268,'It is a requirement that Flight Crew&nbsp;read back an ATC instruction to \'Hold Short\" ?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(2072,268,'Landing distances for aircraft less than 5700kgs require factoring for Dry, Wet or Downwind conditions?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(2073,268,'To participate in Passive LAHSO operations, Crew of Australian civil aircraft registered in Category A,B or C?','[{\"text\":\"require prior CASA authorization\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"must have completed LAHSO training under CAR 217 System of Training\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"May do so at the pilot\'s discretion\",\"answerID\":2,\"feedback\":\"\"}]',2,NULL,1),(2074,268,'Ceiling and visibility minima for conduct of LAHSO is?','[{\"text\":\"1000 ft \\/ 500 meters\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"500 ft \\/ 5000 meters\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"1000 ft \\/ 5000 meters\",\"answerID\":2,\"feedback\":\"\"}]',2,NULL,1),(2075,268,'Pilots will be alerted that LAHSO are currently in use by?','[{\"text\":\"Approach Controller\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"ATIS\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"NOTAM\",\"answerID\":2,\"feedback\":\"\"}]',1,NULL,1),(2076,268,'Crew of aircraft &gt;5700kgs can obtain LDR information for LAHSO from?','[{\"text\":\"FCOM\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"FOM\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Approved Performance Charts\",\"answerID\":2,\"feedback\":\"\"}]',2,NULL,1),(2077,268,'In conducting LAHSO, crew must ensure that aircraft manufacturer\'s landing distance figures are factored for?','[{\"text\":\"Dry runway conditions\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Downwind conditions\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Wet runway conditions\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"All of the above\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(2078,268,'You are approaching YMML in an aircraft &gt;5700kgs and have been cleared the STAR for Runway 34, having accepted an \'Active\' LAHSO requirement based on a dry runway. The Tower advise a late wind change resulting in a 10kt downwind for your proposed landing. You should?','[{\"text\":\"Continue approach as planned\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Factor the Dry Runway LDR by 1.96\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Factor the Wet Runway LDR by 1.96\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Use the Wet Runway LDR\",\"answerID\":3,\"feedback\":\"\"}]',3,NULL,1),(2080,271,'The maximum limit values for the altimeters of an aircraft involved in RVSM operations is?','[{\"text\":\"5 ft\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"50 ft\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"75 ft\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"150 ft\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(2081,271,'You are cruising within RVSM airspace in an RVSM approved aircraft, when you become aware of a failure in your altitude alert system. Your immediate action should be to?','[{\"text\":\"Request a clearance to vacate RVSM airspace\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Advise ATC you are \'Negative RVSM\'\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Press your Transponder IDENT button\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"Continue flight whilst closely monitoring your height\",\"answerID\":3,\"feedback\":\"\"}]',1,NULL,1),(2082,271,'To fly the North Atlantic within MNPS airspace pilots must be in possession of?','[{\"text\":\"Appropriate MNPS Approval\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Appropriate RVSM Approval\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Appropriate MNPS and RVSM approvals\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"None of the above\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(2083,271,'The following 4 items below represent the minimum equipment that must be operating normally for entry into RVSM airspace;\r\n\r\n(a)&nbsp;&nbsp;&nbsp; An automatic altitude-control system\r\n(b)&nbsp;&nbsp; An altitude alerting device\r\n(c)&nbsp;&nbsp;&nbsp; An operating transponder\r\n(d)&nbsp;&nbsp; A primary altitude measuring system','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',1,NULL,1),(2084,271,'Flight Crew advise ATS of the RVSM status of their aircraft by inserting X in item 10 of their Flight Plan?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',1,NULL,1),(2086,286,'Where can you find the Ground Handling Leave request form?','[{\"text\":\"In the Pigeon holes at Pialligo\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"On the staff portal www.corporate-air.com.au, in