&amp; in which direction must the tug be facing?','[{\"text\":\"9.6.1.4 & Tug facing sideways at 90 degrees to the tail.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"9.2.6 & Tug facing forwards & adjacent to the tail.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"9.6.2 & Tug facing rearwards & away from the tail.\",\"answerID\":2,\"feedback\":\"\"},{\"text\":\"9.6.1.3 & Tug under the aircraft wing\",\"answerID\":3,\"feedback\":\"\"}]',2,NULL,1),(2156,286,'Can a ground handler close an aircraft door or locker before an aircraft is about to depart?\r\n&nbsp;\r\n&nbsp;','[{\"text\":\"No. Flight crew only are to close doors and lockers on an aircraft before it departs.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Yes as the flight crew maybe busy with other tasks.\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(2157,157,'According to the Corporate Air Metro 23 FCOM the maximum distance that the Metro 23 can be operated from an adequate aerodrome is?','[{\"text\":\"491 NM\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"591 NM\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"691 NM\",\"answerID\":2,\"feedback\":\"\"}]',1,NULL,1),(2158,157,'The three islands that are classed as remote islands in Australian territory are?','[{\"text\":\"Christmas Island, Norfolk Island and Lord Howe Island.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Deal Island, Norfolk Island and Lord Howe Island.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Christmas Island, Norfolk Island and Cocos Island.\",\"answerID\":2,\"feedback\":\"\"}]',0,'yes',1),(2159,157,'You are required to conduct a long range passenger carrying operation in a Cessna 441 Conquest that proceeds more than 600nm from an adequate aerodrome. Before the company can accept this charter a written EDTO approval from CASA must be received?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',1,NULL,1),(2160,157,'When calculating the maximum distance that an aircraft may be operated from an adequate aerodrome, CAO 82.0 requires that the captain must allow for wind during the calculation?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',1,NULL,1),(2161,157,'An aircraft that is subject to an EDTO approval is required to be maintained to an approved system of maintenance and must be configured for an EDTO operation before departing on an EDTO flight?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(2162,157,'In Australian territory, when planning a flight to a remote island, the captain must plan for an alternate which must be another remote island?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',1,NULL,1),(2163,157,'When calculating fuel requirements for an EDTO operation, flight crew are not required to make Critical Point or Point of No Return calculations because EDTO calculations will be far more restrictive and will more than cover these requirements?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',1,NULL,1),(2164,157,'To correctly calculate a Critical Point or a Point of No Return the flight crew are required to have a thorough understanding of the company fuel policy?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(2165,270,'Can a corporate Air aircraft be flight planned above FL245 between Australia and New Zealand?','[{\"text\":\"Yes so long as the aircraft carries a life raft.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"No but it can expect to enter RNP airspace (FL245 and above) if ATC allow it.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Yes it can there are no restrictions because all aircraft can comply with the TSO C146a GPS requirement.\",\"answerID\":2,\"feedback\":\"\"}]',1,NULL,1),(2166,270,'TSO C146a GPS will satisfy the requirement for an RNP 10 approval if two independent systems are fitted and the operator applies for an RNP 10 approval.','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(2167,270,'In procedurally controlled airspace, separation minima and route spacing based on RNP specifications are not expected to provide a greater benefit than those based on RNAV specifications?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',1,NULL,1),(2168,270,'An RNP 10 specification currently requires the operator to have on-board performance monitoring of its navigation system?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',1,NULL,1),(2169,270,'An RNP 10 approval requires the operator to remain within 1.0 nm of the flight planned track at least 95% of the time?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',1,NULL,1),(2170,270,'RNP AR approaches not only provide for increased efficiency of traffic separation and handling, but also provide for a decrease in carbon emissions providing a benefit to the environment?\r\n&nbsp;\r\n&nbsp;','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(2171,270,'An RNP AR approach may be designed to include curved paths for obstacle clearance separation?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(2172,270,'If a navigation specification for a specific aircraft navigation installation does not include a requirement for on-board navigation performance monitoring, it will only be able to be classed as an RNAV installation.','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(2173,270,'RNAV and RNP systems are fundamentally similar, the key difference between them is the requirement for on-board performance monitoring and alerting.','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(2174,270,'Required Navigation Performance (RNP) is a type of Performance Based Navigation (PBN) that allows an aircraft to fly a specific path between two 3-dimensionally defined points in space.','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(2175,272,'The use of technical jargon or similar aviation&nbsp; phrases are useful during flight instruction when?','[{\"text\":\"The instructor cannot think of anything else to say\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The student understands the jargon, term or phrase being used by the instructor\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"The use of such terms sound better and make the instructor sound like he knows what he is talking about.\",\"answerID\":2,\"feedback\":\"\"}]',1,NULL,1),(2176,272,'At the end of a lesson the instructor concludes with the statement \"Are there any questions\".&nbsp; Which statement best describes this form of evaluation by the instructor?','[{\"text\":\"The instructor is displaying poor instructional technique because there is no positive confirmation from the student that he\\/she understands what has been taught during the lesson\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The instructor is displaying good instructional technique because the student knows that the lesson is finished\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"The instructor is displaying good instructional technique because it ensures that the student knows everything about the subject if they do not ask any questions\",\"answerID\":2,\"feedback\":\"\"}]',0,NULL,1),(2177,272,'Which form of teaching method affords the MOST opportunity for active student participation?','[{\"text\":\"Skill lesson\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Programmed instruction\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Guided discussion\",\"answerID\":2,\"feedback\":\"\"}]',2,NULL,1),(2178,272,'Instruction is successful when the student?','[{\"text\":\"Exhibits a desired change in behavior\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Has completed all of the sections of the specified syllabus\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Asks no questions at the end of a lesson\",\"answerID\":2,\"feedback\":\"\"}]',0,NULL,1),(2179,272,'When using a model aircraft as a training aid during a pre-flight briefing it is VITAL that the instructor?','[{\"text\":\"Has the model prominently displayed at all times during the briefing\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Only uses an exact replica of the aircraft about to be flown by the student\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Orientates the model so that the student always sees it from the pilots point of view\",\"answerID\":2,\"feedback\":\"\"}]',2,NULL,1),(2180,272,'An overhead projector is particularly useful as a teaching aid because?','[{\"text\":\"It applies the principle of multiple sense learning\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"It is less distracting than a whiteboard\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"It can be used by the students to teach themselves how to fly\",\"answerID\":2,\"feedback\":\"\"}]',0,NULL,1),(2181,272,'A lesson plan, when used properly, should?','[{\"text\":\"Not be used more th2\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Be committed to memory by the instructor\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Aid the instructor in presenting a lesson in a logical sequence\",\"answerID\":2,\"feedback\":\"\"}]',2,'',1),(2182,272,'The major advantage of guided discussion over a formal lecture technique is?','[{\"text\":\"It encourages active student participation therefore maintaining the students level of interest\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"It requires no instructor preparation\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"It dispenses with the need to check the attainment of an objective\",\"answerID\":2,\"feedback\":\"\"}]',0,NULL,1),(2183,272,'The term&nbsp; \"TRANSFER\"&nbsp; in relation to learning refers to which of the following conditions?','[{\"text\":\"The ability to be able to proceed to the next learning task even though the more simple tasks are performed incorrectly\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The effect that materials or skills previously learnt by the student have on his\\/her ability to learn new subject matters or skills\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"The ability to transfer the verbal descriptions of the instructor in a flying sequence, to the correct manipulative actions of flying the aircraft\",\"answerID\":2,\"feedback\":\"\"}]',1,NULL,1),(2184,272,'A properly constructed behavioural objective for a lesson would result in which of the following?','[{\"text\":\"Using a suitable model to correctly identify the control surfaces of an aeroplane\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Without the aid of any reference material, be able to identify all of the ancillary controls of the aircraft\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Be able to list all of the internal parts of an Attitude Indicator\",\"answerID\":2,\"feedback\":\"\"}]',0,NULL,1),(2185,272,'Positive reinforcement involves which of the following instructor characteristics?','[{\"text\":\"No form of praise or criticism is positive reinforcement because nothing bad is ever said to the student\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Praise for the elements of a lesson that the student is doing correctly and no criticism at all\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Praise for the elements of a lesson that the student is doing correctly and constructive criticism for the elements which need improvement\",\"answerID\":2,\"feedback\":\"\"}]',2,NULL,1),(2186,272,'When conducting a practice VMCA demonstration at altitude which of the following is a major consideration of aircraft safety?','[{\"text\":\"The stall speed of the aircraft remains the same at all heights, however VMCA decreases with height, therefore if the aircraft stalls during a practice VMCA demonstration it will consequently enter a spin into the direction of the failed engine.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The engine may overheat at altitude due to the lack of airflow due to a decrease in air density\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Practice VMCA demonstrations should only be carried out at low level as VMCA is demonstrated at rotation after takeoff due to certification requirements\",\"answerID\":2,\"feedback\":\"\"}]',0,NULL,1),(2187,272,'When conducting Asymmetric circuit operations an instructor must be confident that the student understands what?','[{\"text\":\"The continuation below decision height on one engine is for a landing to the runway. Any attempt of a single engine go-around must be initiated above decision height\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"The loss of one engine only decreases aircraft performance by 50%\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"The aircraft will have priority over all other aircraft because it is a twin engine aircraft\",\"answerID\":2,\"feedback\":\"\"}]',0,NULL,1),(2188,272,'List 3 barriers to effective communication?','[{\"text\":\"Lack of experience, lack of knowledge and the age of the individual\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Lack of common experience, overuse of abstractions and interference\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Lack of use of abstractions, perception and interference\",\"answerID\":2,\"feedback\":\"\"}]',1,NULL,1),(2189,272,'The 4 levels of learning are:\r\n&nbsp;\r\n(a) Rote learning\r\n(b) Understanding\r\n(c) Application\r\n(d) Correlation','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(2190,224,'3 nominated personnel positions listed in the company Flight Operations Manual are?','[{\"text\":\"Chief Executive Officer, Chief pilot and Fleet Manager\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Chief Executive Officer, Manager of Flight Operations and Senior Base pilot\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Safety and Quality Manager, Security manager and Simulator Manager\",\"answerID\":2,\"feedback\":\"\"}]',1,NULL,1),(2191,224,'The Responsibilities of the Pilot In Command are listed at Paragraph?','[{\"text\":\"A1.4\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"A2.1.1\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"A4.3.2.1\",\"answerID\":2,\"feedback\":\"\"}]',0,NULL,1),(2192,224,'It is true that the Manager of Flight Operations can approve a company formation flight for promotional purposes by suitably qualified company pilots?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(2193,224,'How long must Weight and Balance and passenger manifest documents be retained for an international flight?&nbsp; \r\n&nbsp;','[{\"text\":\"3 Months\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"6 Months\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"12 Months\",\"answerID\":2,\"feedback\":\"\"}]',1,NULL,1),(2194,224,'A4.5 refers to incapacitation of pilots. The correct technique for handling the aircraft after a flight crew incapacitation in a multi crew environment is?','[{\"text\":\"1 - The fit pilot shall return the aircraft to a safe flight path.2 - The fit pilot shall take the necessary steps to prevent the incapacitated pilot from interfering with the controls.3 - The fit pilot shall continue the flight to the planned destination and inform operations as soon as possible.\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"1 - The fit pilot shall return the aircraft to a safe flight path.2 - The fit pilot shall take the necessary steps to have the incapacitated pilot resume control of the aircraft ASAP.3 - The PIC shall land the aircraft as soon as possible.\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"1 - The fit pilot shall return the aircraft to a safe flight path.2 - The fit pilot shall take the necessary steps to prevent the incapacitated pilot from interfering with the controls.3 - The fit pilot shall land the aircraft as soon as possible.\",\"answerID\":2,\"feedback\":\"\"}]',2,NULL,1),(2195,224,'For Regular Public Transport operations in aircraft below 5700kgs, what is the minimum night experience requirements for the pilot to operate as the pilot in command on a single pilot operation?','[{\"text\":\"10 hrs night\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"50 hrs night\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"100 hrs night\",\"answerID\":2,\"feedback\":\"\"}]',1,NULL,1),(2196,224,'The Flight Operations Manual&nbsp; reference that specifies for a multi crew instrument approach to be flown BOTH pilots must be endorsed and be current is?','[{\"text\":\"A4.5.5\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"A5.5.5\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"A6.5.5\",\"answerID\":2,\"feedback\":\"\"}]',1,NULL,1),(2197,224,'The Flight Operations Manual section that relates specifically to Flight and Duty Time Limitations is section?','[{\"text\":\"A5\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"A6\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"A7\",\"answerID\":2,\"feedback\":\"\"}]',2,NULL,1),(2198,224,'Flight crew members must not operate an aircraft within 72 hrs if they have given a blood donation?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(2199,224,'According to section A8.1.7.2 the minimum fuel required to be carried on board an aircraft is:\r\n&nbsp;\r\nFlight fuel + Alternate fuel + Variable reserve fuel + Fixed reserve fuel + Holding fuel + Contingency fuel.\r\n&nbsp;','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(2200,224,'According to section A8, Corporate Air allows passengers to be on board during refueling operations when the fuel being loaded is AVGAS?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',1,NULL,1),(2201,224,'The minimum documents to be carried on board a flight are listed at section?','[{\"text\":\"A8.1.12\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"A9.12\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"A7.2\",\"answerID\":2,\"feedback\":\"\"}]',0,NULL,1),(2202,224,'The section of the Flight Operations Manual that relates to Dangerous Goods is?','[{\"text\":\"A7\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"A8\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"A9\",\"answerID\":2,\"feedback\":\"\"}]',2,NULL,1),(2203,225,'Normal operating procedures are located in section?','[{\"text\":\"B1\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"B2\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"B3\",\"answerID\":2,\"feedback\":\"\"}]',1,NULL,1),(2204,225,'If flight crew are required to conduct a flight in a Metro from an airfield where no performance data has been obtained, the Pilot in Command should ensure that procedures are followed from which section of the Flight Operations Manual?','[{\"text\":\"B4.3.2\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"B1.2.3\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"B3.2.3\",\"answerID\":2,\"feedback\":\"\"}]',0,NULL,1),(2205,225,'What section of the Flight Operations Manual specifies the procedures for emergency evacuation of an aircraft?','[{\"text\":\"B9\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"B10\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"B11\",\"answerID\":2,\"feedback\":\"\"}]',2,NULL,1),(2206,225,'Section B8 specifies the procedures for the loading of company aircraft?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',1,NULL,1),(2207,225,'The flight situations that require flight crew to declare an emergency are specified in section B3.1.1.1','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(2208,226,'Category A, B and C aerodromes are described in Section C2 of the Flight Operations Manual?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(2209,226,'The company may provide flight crew with a route guide for specific operations as listed in section C3?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(2210,227,'Part D of the Flight Operations Manual specifies the procedures for?','[{\"text\":\"Normal Operations\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Check and Training Procedures\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"RPT operations\",\"answerID\":2,\"feedback\":\"\"}]',1,NULL,1),(2211,228,'Part E of the Flight Operations Manual specifies the procedures for?','[{\"text\":\"Special Procedures relating to Aerial Work Operations\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Check and Training Procedures\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"RPT operations\",\"answerID\":2,\"feedback\":\"\"}]',0,NULL,1),(2212,227,'In accordance with section D1, the Head of Training and Checking is not required to report to anyone?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',1,NULL,1),(2213,173,'Is GROUPTHINK is an aspect of teamwork?','[{\"text\":\"Yes, it is a very positive aspect\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"No, it has nothing to do with it\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Yes, but is a very negative aspect\",\"answerID\":2,\"feedback\":\"\"}]',2,NULL,1),(2214,272,'What are the 4 essential skill groups of CRM assessment?','[{\"text\":\"Communication and teamwork, leadership and management, situation awareness and TEM, decision making\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"Communication, teamwork, leadership and management\",\"answerID\":1,\"feedback\":\"\"},{\"text\":\"Leadership, management, situation awareness and TEM\",\"answerID\":2,\"feedback\":\"\"}]',0,'yes',1),(2215,272,'The assessment of CRM (including TEM, HF and NTS) is a critcal part of supervisory, training and checking functions?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(2216,272,'A grading of 1 or 2 in a CRM (including TEM, HF and NTS) assessment must be brought to the attention of the HoTC and Safety Manager?','[{\"text\":\"True\",\"answerID\":0,\"feedback\":\"\"},{\"text\":\"False\",\"answerID\":1,\"feedback\":\"\"}]',0,NULL,1),(2235,383,'How many fingers am I holding up? All but last','[{\"text\":\"16\",\"feedback\":\"\",\"answerID\":0},{\"text\":\"52\",\"feedback\":\"\",\"answerID\":1},{\"text\":\"A million\",\"feedback\":\"\",\"answerID\":2},{\"text\":\"5\",\"feedback\":\"\",\"answerID\":3},{\"text\":\"All of the above\",\"feedback\":\"\",\"answerID\":4}]',4,'notlast',5),(2237,383,'Fish are what colour','[{\"text\":\"Blue\",\"feedback\":\"\",\"answerID\":0},{\"text\":\"Green\",\"feedback\":\"\",\"answerID\":1},{\"text\":\"Red\",\"feedback\":\"\",\"answerID\":2}]',-1,'',0),(2238,383,'Never shuffle','[{\"text\":\"1\",\"feedback\":\"\",\"answerID\":0},{\"text\":\"2\",\"feedback\":\"\",\"answerID\":1},{\"text\":\"3\",\"feedback\":\"\",\"answerID\":2}]',0,'no',3),(2239,275,'What Categroy of aircraft does C.A.O.20.7.1b apply to in relation to aircraft performance?','[{\"text\":\"Charter aircraft below 5700 kgs MTOW.\",\"feedback\":\"\",\"answerID\":0},{\"text\":\"All RPT aircraft.\",\"feedback\":\"\",\"answerID\":1},{\"text\":\"All turbine aircraft above 5700 kgs and piston engne aircraft registered after 1 June 1963 which are also above 5700 kgs.\",\"feedback\":\"\",\"answerID\":2}]',2,'',1),(2240,275,'Accelerate-stop distance:','[{\"text\":\"Is the length of the takeoff run available and includes the length of any stopway available.\",\"feedback\":\"\",\"answerID\":0},{\"text\":\"Is the length of the takeoff run available but does not include the length of any stopway available.\",\"feedback\":\"\",\"answerID\":1},{\"text\":\"None of the above.\",\"feedback\":\"\",\"answerID\":2}]',0,'notlast',1),(2241,275,'V1 means?','[{\"text\":\"The initial climbout speed of the aircraft after takeoff.\",\"feedback\":\"\",\"answerID\":0},{\"text\":\"The Takeoff safety speed.\",\"feedback\":\"\",\"answerID\":1},{\"text\":\"The Takeoff decision speed.\",\"feedback\":\"\",\"answerID\":2}]',2,'',1),(2242,275,'A Suitable aerodrome is an aerodrome approved for normal operations and?','[{\"text\":\"which is not forecast to require an alternate aerodrome during the period of its possible use.\",\"feedback\":\"\",\"answerID\":0},{\"text\":\"which is forecast to require an alternate aerodrome during the period of its possible use but has forecast weather to be above the instrument approach minima.\",\"feedback\":\"\",\"answerID\":1},{\"text\":\"which has a category 5 TAF service.\",\"feedback\":\"\",\"answerID\":2}]',-1,'',1),(2243,275,'In the takeoff configuration, the Metro 23 aircraft would require a .......... % climb gradient after suffering an engine failure at V1 and climbing with the gear extended immediately after rotation?','[{\"text\":\"positive climb gradient%\",\"feedback\":\"\",\"answerID\":0},{\"text\":\"0.3%\",\"feedback\":\"\",\"answerID\":1},{\"text\":\"0.5%\",\"feedback\":\"\",\"answerID\":2}]',0,'no',1),(2244,275,'In the takeoff configuration with the landing gear retracted and at an airspeed of V2, the Metro 23 must be capable of climbing at a gross climb gradient of .......% to acceleration altitude?','[{\"text\":\"1.2%\",\"feedback\":\"\",\"answerID\":0},{\"text\":\"1.8%\",\"feedback\":\"\",\"answerID\":1},{\"text\":\"2.0%\",\"feedback\":\"\",\"answerID\":2}]',2,'',1),(2245,275,'Acceleration altitude for a commuter category aircraft must not be less than?','[{\"text\":\"400 ft AGL.\",\"feedback\":\"\",\"answerID\":0},{\"text\":\"500 ft AGL.\",\"feedback\":\"\",\"answerID\":1},{\"text\":\"600 ft AGL.\",\"feedback\":\"\",\"answerID\":2}]',0,'',1),(2246,275,'To comply with Obstacle clearance requirements, a commuter category aircraft must be capable of maintaining an altitude of 1000ft above the heighest obstacle en-route with the critical engine failed in the en-route configuration. If this cannot be complied with, the operator may employ?','[{\"text\":\"A drift down procedure.\",\"feedback\":\"\",\"answerID\":0},{\"text\":\"Another pilot who can make it work.\",\"feedback\":\"\",\"answerID\":1},{\"text\":\"None of the above.\",\"feedback\":\"\",\"answerID\":2}]',-1,'notlast',1),(2247,275,'The operator of an aircraft above 5700 kgs must provide emergency procedures for the aircraft in the \"Operations Manual\".','[{\"text\":\"True\",\"feedback\":\"\",\"answerID\":0},{\"text\":\"False\",\"feedback\":\"\",\"answerID\":1}]',0,'',1),(2248,275,'If an operator provides procedures for dealing with emergency procedures in an aircraft, those procedures must be such that a pilot of \"Average Skill\" level would competently complete those procedures?','[{\"text\":\"True\",\"feedback\":\"\",\"answerID\":0},{\"text\":\"False\",\"feedback\":\"\",\"answerID\":1}]',-1,'',1);
