afety you should phone the Safety Manager as soon as possible (Bill McIntyre - 0407 930717). This reporting requirement is separate and additional to any reporting requirements required by legislation, clients or other company manuals. By submitting this information you allow the Safety Manager to;&nbsp;Establish the facts, Draw conclusions from those facts, Establish causes, and make recommendations and take action to prevent a recurrence.</p>\n<p>The purpose is not to allocate blame. The short-term expediency of finding someone to blame is detrimental to the long term goal of preventing accidents or incidents.</p>\n</div>\";}s:4:\"type\";s:7:\"default\";s:11:\"custom_type\";s:4:\"html\";}i:1;O:8:\"stdClass\":4:{s:6:\"module\";s:5:\"forms\";s:9:\"arguments\";O:8:\"stdClass\":1:{s:4:\"form\";s:2:\"18\";}s:4:\"type\";s:4:\"Form\";s:11:\"custom_type\";s:4:\"form\";}}}}}',0,NULL,''),(12,20,'2011-06-03 11:20:38','2011-06-03 14:37:39',2,2,2,0,'3 June 2011','a:1:{s:10:\"containers\";a:1:{s:4:\"main\";a:1:{s:7:\"content\";a:1:{i:0;O:8:\"stdClass\":4:{s:6:\"module\";s:5:\"forms\";s:9:\"arguments\";O:8:\"stdClass\":1:{s:4:\"form\";s:2:\"15\";}s:4:\"type\";s:4:\"Form\";s:11:\"custom_type\";s:4:\"form\";}}}}}',0,NULL,''),(10,18,'2011-06-03 11:19:29','2011-06-03 11:21:46',2,2,2,0,'3 June 2011','a:1:{s:10:\"containers\";a:1:{s:4:\"main\";a:1:{s:7:\"content\";a:1:{i:0;O:8:\"stdClass\":4:{s:6:\"module\";s:5:\"forms\";s:9:\"arguments\";O:8:\"stdClass\":1:{s:4:\"form\";s:2:\"13\";}s:4:\"type\";s:4:\"Form\";s:11:\"custom_type\";s:4:\"form\";}}}}}',0,NULL,''),(6,12,'2011-05-24 17:35:21','2011-06-20 12:51:51',2,2,2,0,'24 May 2011','a:1:{s:10:\"containers\";a:1:{s:4:\"main\";a:1:{s:7:\"content\";a:1:{i:0;O:8:\"stdClass\":4:{s:6:\"module\";s:8:\"advanced\";s:9:\"arguments\";O:8:\"stdClass\":3:{s:7:\"content\";N;s:11:\"custom_type\";s:14:\"template_block\";s:4:\"data\";O:8:\"stdClass\":1:{s:8:\"template\";s:14:\"importantroles\";}}s:4:\"type\";s:8:\"template\";s:11:\"custom_type\";s:14:\"