INSERT INTO `SafetyMinutes` VALUES (17,'2011-09-06 07:11:31','2011-10-04 06:11:31',39600,58500,'John Paul, Bill McIntyre (Chair), Albert Stewardson, 	Rob Boyes, Andrew Major, Darren King, Andrew Webb','Marshall Ross','<p><strong>Rob - </strong>presented the GS and audit statistics.&nbsp; The Company is still behind in its audit program but is improving.&nbsp; There are still a number of open audits.&nbsp; Testing for alcohol and other drugs and also issues relating to induction were discussed</p>',NULL),(13,'2011-06-14 02:02:58','2009-12-31 13:00:00',48600,69600,'-- this entry is to provide the first Meeting Minutes item with approx 20 items --','','<p>Maecenas sed diam eget risus varius blandit sit amet non magna. Duis mollis, est non commodo luctus, nisi erat porttitor ligula, eget lacinia odio sem nec elit. Aenean eu leo quam. Pellentesque ornare sem lacinia quam venenatis vestibulum. Nullam quis risus eget urna mollis ornare vel eu leo. Praesent commodo cursus magna, vel scelerisque nisl consectetur et. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Donec sed odio dui.</p>\n<p>Nulla vitae elit libero, a pharetra augue. Integer posuere erat a ante venenatis dapibus posuere velit aliquet. Maecenas sed diam eget risus varius blandit sit amet non magna. Integer posuere erat a ante venenatis dapibus posuere velit aliquet.</p>',NULL),(18,'2011-10-06 01:45:27','2011-11-01 01:45:27',56400,59400,'John Paul\nBill McIntyre (Chair)\nDamon Banks\nAlbert Stewardson\nAndrew Major\nDarren King\nAndrew Webb\n','Marshall Ross\nRob Boyes\n','<p><strong>Bill </strong>presented the GS and audit statistics in <strong>Rob&rsquo;s </strong>absence.&nbsp; Flight Ops will be conducting more audits.&nbsp; The Company is still behind in its audit<br />program but is improving.&nbsp;</p>',NULL),(19,'2011-11-01 04:32:06','2011-11-06 04:32:06',55920,60660,'Marshall Ross, Darren King, Andrew Major, Albert Stewardson, Andrew Webb, John Paul, Rob Boyes, Bill McIntyre (Chair)','','<p>1. SM had issues with the training of Pilots.</p>',NULL);
