ng will look into issues of training and quality control to prevent a re-occurrence.   Closed.'),(364,17,918,'report','The Manager Ground Handling will look into issues of training and quality control to prevent a re-occurrence.  Closed.'),(365,17,917,'report','The lead was replaced and the item will be placed on the inspection list for the equipment.  It is not possible to fit an RCD to this installation.  Closed.'),(640,18,1222,'report','Closed at previous meeting'),(641,18,1223,'report','Closed at previous meeting.'),(642,18,1224,'report','The cause for the loss of oil pressure was failure of the scavenge pump because the oil return line and the vent line were reversed.  The Maintenance Manual shows this incorrect configuration.  The manufacturer is aware of the problem and CASA has been informed.'),(643,18,1226,'report',''),(644,18,1227,'report','MRO believe that the problem is to do with the height adjustment in the particular aircraft involved.  This will be checked when the aircraft is next serviced.  '),(645,18,1230,'report','The shelf will be replaced during the week ending the 7th of October.  '),(646,18,1229,'report','The Safety Manager has written to the client.'),(647,18,1231,'report','A new retractable rear ladder is being custom made to fit the vehicle.  The front steps will be permanently removed.  The Ground Handling Manger will raise a NOTGH advising personnel of the safe ingress procedure.  '),(648,18,1232,'report','This matter will be kept under consideration until the SOPs for Catering Services have been finalised.  '),(649,18,1234,'report','The Manager Ground Handling will investigate painting of the ramp for better visual effect.  A NOTGH will be issued.\n'),(650,18,1235,'report','The Manager Ground Handling will issue a NOTGH to staff to be extra vigilant in checking that stairs are correctly locked in place.  Virgin Australia have escalated this matter to Aerocare.  \n'),(998,19,1231,'report',''),(999,19,1236,'report','NOTGH13-2011 has been issued.'),(1000,19,1237,'report','GHM will speak to the responsible staff member to discuss the issue.'),(1001,19,1238,'report','The SM discussed the issue with the Pilot. There was no issue from an Ops point of view.'),(1002,19,1239,'report','An unexpected cold snap occured which was unknown to GH.  Policy is covers go on when Daylight savings is on active.'),(1003,19,1240,'report','Sideshift switch has been disabled in \'Droopy\"'),(1004,19,1241,'report','The switch in the control tower malfunctioned causing an issue with the lights.  Airservices have advised they will rectify the problem. '),(1005,19,1242,'report','As per GS00328'),(1006,19,1243,'report','No airleak just faulty gauge'),(1007,19,1244,'report','Crown maintenance repaired the issue under warranty'),(1008,19,1245,'report','The issue was a faulty microswitch, which was adjusted and lubricated.  New policy will be replace switch if there are any issues in the future.  Aircraft test flown.\nNo AML was entered which caused problems for Ops.\nAircraft was not grounded on return.\nNo safety report was entered until ATSB called.  The SM will review the process and report.'),(1009,19,1246,'report','The CP will speak to the pilot to dicover what the Pilot counted as \"Blocking\".\nCorrect Seat positions will be marked on the rails.'),(1010,19,1247,'report','No AML entered about this issue.\nRob P is speaking with the Pilot re this issue. CP to speak to pilots re managing the issue for a resolution of the issue.\nMRO is troubleshooting the issue.\nCP to issue a NOTAC reminding Pilots of requirement to enter an AML for all Aircraft issues, but ALWAYS when a related GS item is raised.'),(1011,19,1248,'report','GH to be re-trained in fitting seats.\nGH Supervisor, GHM and CP to meet with Ops manager to work through the issues.\nSeats to be marked as per previous seat item.');
