INSERT INTO `SafetyReports_backup` VALUES (917,309,'group','','1','2011-09-04 23:59:00','2011-09-04 14:00:00','2011-09-03 14:00:00','0000-00-00 00:00:00','David Barbalet','[\"9\"]','Not applicable','Not applicable','Canberra','','ACT',0,0,0,'[\"FBOCO\"]','[]','Worn Insulation on Generator Lead','\"The vacuum cleaner in the XM cleaning van has a badly damaged power lead. Without trying to find faults, an employee noticed 3 sections of lead that had conductor poking through the insulation. The employee asks should the generator be fitted with an RCD?\"','','','',NULL),(918,308,'group','','1','2011-08-26 03:03:00','2011-08-25 14:00:00','2011-08-01 14:00:00','0000-00-00 00:00:00','Richard Bennet','[\"10\",\"8\",\"9\"]','Cessna 441 Conquest','VH-VEY','Brisbane','','QLD',0,0,0,'[\"FBOCO\",\"FLTOPS01\"]','[\"EQUIP\"]','Bulkheads Incorrectly Installed','The pilot observed that both forward executive configuration bulk heads fitted to the aircraft for a passenger charter were incorrectly installed. The pilot wrote an AML for the items and verbally informed engineering and ground handling.','','','',NULL),(919,307,'group','','1','2011-08-26 02:58:00','2011-08-25 14:00:00','2011-08-21 14:00:00','0000-00-00 00:00:00','Richard Bennet','[\"10\",\"8\",\"9\"]','Cessna 441 Conquest','VH-VEH','Canberra','','ACT',0,0,0,'[\"FBOCO\",\"FLTOPS01\"]','[\"EQUIP\"]','Seat not Secured','\"During the pre flight of the aircradt for a passenger charter, the pilot noticed that the left hand passenger seat directly forward of the cabin door had not been installed properly. The seat had not been attached to the right hand seat rail and was only secured on the left seat rail. The ground handler looking after the movement was informed and the pilot requested the seat be fitted properly before departure.\"','','','',NULL),(920,306,'group','','1','2011-08-22 06:37:00','2011-08-21 14:00:00','2011-08-15 08:00:00','0000-00-00 00:00:00','Richard Bennet','[\"10\"]','Metro 23','VH-VEK','Canberra','','ACT',0,0,0,'[\"FLTOPS06\"]','[\"INDIV\"]','Descent Through Assigned Altitude','\"During descent into CB from GLB, the crew were cleared to descend to 5000ft. The co-pilot was the PF and the captain, the PNF. The captain set 5000ft in the Altitude Alerter, called for cross check from the PF and called 1000ft to run as per the FCOM. Due to the high workload and short sector, during the descent the captain made the mistake of trying to record the ATIS and prepare landing speeds rather than monitoring the descent. During this time the PF failed to level off at 5000ft and descended to 4600ft on the Captains altimeter (4700ft on Co-Pilots altimeter). The captain recognised the descent and called for the PF to climb immediately. Shortly after CB approach asked for confirmation of descent to 5000ft but then cleared the aircraft to descend to 4500ft LSALT as the aircraft had already left 5000ft. The incident occurred at approx as last light was approaching. The crew still had visual contact with the ground at the time.\"','','','',NULL),(921,305,'group','','1','2011-08-22 06:28:00','2011-08-21 14:00:00','2011-08-14 14:00:00','0000-00-00 00:00:00','Richard Bennet','[\"10\",\"8\"]','Metro 23','VH-VEK','Canberra','','ACT',0,0,0,'[\"ENGCO\",\"FLTOPS01\"]','[\"EQUIP\"]','Main Passenger Door Jammed','\"The aircraft had previously been configured into passenger configuration by ground crew. When both flight crew and ground handlers arrived at the aircraft to preflight and reconfigure to freight for freight, neither crew could open main passenger door from the outside. The door seamed to be jammed closed. Access through the rear bulkhead was difficult as the bolts to remove the bulkhead were on the inside of the aircraft. Ground crew were able to remove one bolt and shift the bulkhead enough to allow the captain to climb through and over the rear seats to access the door from the inside. The main passenger door was jammed closed as a result of one screw from the wooden panel along the door trim protruding from the door frame and restricting the operation of the door.\"','','','',NULL),(922,304,'group','','1','2011-08-22 06:21:00','2011-08-21 14:00:00','2011-08-18 14:00:00','0000-00-00 00:00:00','Richard Bennet','[\"10\",\"8\"]','Metro 23','VH-VEK','Canberra','','ACT',0,0,0,'[\"ENGCO\",\"FLTOPS06\"]','[\"EQUIP\"]','Sparks From L/H Circuit Breaker Panel','\"The aircraft was enroute between ML and CB on a freight run. The crew observed sparks coming from the left hand circuit breaker panel. Following the sparks, power was lost to the left pilots flight instrument lights, altitude alerter light and the left circuit breaker panel lights. Fault diagnosis indicated that the left essential bus still had power. The left essential bus was turned off as a precaution to prevent possible loss of other items and selected back on for landing. A normal approach and landing was conducted into CB.\"','','','',NULL),(923,303,'group','','2','2011-08-13 07:54:00','2011-08-12 14:00:00','2011-08-10 14:00:00','2011-08-13 07:55:00','Damon Banks','[\"10\",\"8\",\"9\",\"7\",\"6\"]','Cessna 404 Titan','VH-VEA','Birdsville','','QLD',0,1,0,'[\"FLTOPS10\"]','[\"INDIV\"]','Cut Wrist','The pilot was completing post-flight actions and preparing the aircraft for a flight the following morning. He had retrieved some items stored in the right hand wing locker and held the items in his left hand while he unlatched the locker lid with his right hand. He allowed the lid to drop onto his arm to stop it from slamming down and then pulled his hand away to allow the lid to close so that he could latch it shut. As he pulled his hand away from under the lid he realised he had cut the back of his wrist on a sharp edge at the inboard aft edge of the locker lid. He deemed that the cut was bad enough to seek medical assistance and so walked the couple of blocks to the Birdsville Medical Centre where the cut was treated. After treatment he resumed the interrupted activity.','','','',NULL),(924,302,'group','','2','2011-08-08 08:11:00','2011-08-07 14:00:00','2011-08-07 14:00:00','2011-08-08 08:11:00','Rob Boyes','[\"10\",\"8\"]','Not applicable','Not applicable','Canberra','','ACT',0,0,0,'[\"ENGCO\"]','[\"INFO\"]','Due Maintenance Not in Date Order','The Quality Manager has been advised that the M/R notices are not listed in the correct date order. This could lead to items being missed as they are listed at the bottom of the report. The IT Manager has been alerted and will arrange a fix ASAP. The IT Manager will advise Safety Manager once fix has been completed.','','','',NULL),(925,301,'group','','2','2011-08-05 03:05:00','2011-08-02 14:00:00','2011-07-14 14:00:00','2011-08-05 03:05:00','John Paul','[\"8\"]','Cessna 441 Conquest','VH-VEY','Goolwa','','SA',0,0,0,'[]','[\"INDIV\"]','Battery Explosion','\"The aircraft had been in a paint shed undergoing a repaint. The aircraft was being prepared to move back to Goulburn after extended ground time. After servicing battery number 2, the charger was turned off and moved to battery number 1, when connected a small spark was seen from the attaching clip followed shortly by a loud noise and the lid blowing off battery number 2. This damaged caused the engineer to jump backwards shorting the leads of battery 1 together causing further damage. Both batteries were replaced.\"','The engineer involved has been reminded to follow correct procedures when charging aircraft batteries.','','',NULL),(926,300,'group','','2','2011-08-05 03:03:00','2011-07-24 14:00:00','2011-07-24 14:00:00','2011-08-05 03:03:00','Antony Springer','[\"10\"]','Cessna 441 Conquest','VH-VED','Brisbane','','QLD',0,0,0,'[\"FLTOPS06\"]','[\"INDIV\"]','Descent Through Assigned Altitude','\"The aircraft was approaching Brisbane on descent to FL120 when it descended through the assigned altitude by several hundred feet. Due to an altimeter error the crew were not unable to determine the actual excedence, but they think is was a little over 300 feet. After landing a phone call was made to BN Center to ascertain the actual figure based on their data, however in this instance they were unable to supply specific details. However, they did note that the aircraft had descended through the level whilst handing over between Center and Approach. Although the assigned altitude was entered and armed in the assigned altitude indicator, the unit failed to arrest the rate of descent from 1000 feet/min and did not provide an audible warning. At the time there was a discussion taking place on the flight deck about a beacon in the area and there was traffic following close behind. This may have contributed to this error.\"','This error occurred because Company sterile cockpit procedures within 1000 feet of assigned altitude were not followed and the pilotÕs false assumption that the altitude capture of the Cessna 400 autopilot would arrest the high rate of descent.','','',NULL),(927,299,'group','','2','2011-08-05 02:58:00','2011-07-19 14:00:00','2011-07-18 14:00:00','2011-08-05 02:58:00','Nick Faulks','[\"10\",\"8\"]','Metro 23','VH-VEK','Canberra','','ACT',0,0,0,'[]','[\"EQUIP\"]','Windscreen Cracks','\"The right hand windscreen cracked whilst cruising at FL240 in cloud. The windscreen heats were on low. There was a mild amount of Saint Elmo\'s fire evident just prior to the screen cracking. The cabin altitude was raised to give a minimum diff for FL240. Consideration was given to descending, however, there were sigmets issued for both severe icing below FL185 and for severe turbulence below 7000 between SY and CB. Descent was conducted into CB at a reduced speed and a normal approach and landing followed.\"','This is a common problem on the Metroliner. The Manager MRO will seek to make a cracked windscreen and item on the aircraft MEL.','','',NULL),(928,298,'group','','2','2011-07-18 08:23:00','2011-07-17 14:00:00','2011-07-18 01:09:00','2011-07-18 08:23:00','Scott Lemon','[\"10\"]','Cessna 441 Conquest','VH-VEJ','Ballera','','QLD',0,0,0,'[\"FLTOPS07\"]','[\"ENVIRO\"]','Birds at Ballera','The aircraft had to conduct a go around from approx 60 feet because of kite hawks. Deviations from flight path were required 3 times to avoid birdstrike. The birds were lifting from ponded water the length of the strip. Extended (normal) circuit and landing followed bird fright operations and shutdown at 1109 local time.','','','',NULL),(929,297,'group','','2','2011-07-20 08:10:00','2011-07-17 14:00:00','2011-07-12 11:50:00','2011-07-20 08:10:00','Timo Hemminki','[\"10\",\"8\"]','Cessna 404 Titan','VH-VEA','Sydney','','NSW',0,0,0,'[\"ENGCO\",\"FLTOPS06\"]','[\"EQUIP\"]','Door Opens on Approach','The pilot was asked to expedite descent into Sydney. The aircraft was on descent to through 5000-4000ft in turbulent air when the top cargo door opened and caused a loud banging noise. The DOOR WARNING light came on and the noise continued until the speed was reduced. Sydney approach was notified and approach and landing to RWY 25 continued normally. The door was extensively damaged and required significant repair. Another door was fitted to the aircraft before further flight.','It is thought that the door latching mechanism was not overcentered which would mean that the door warning light would extinguish but the door would not be fully latched. NOTAC 18/2011 has been issued to highlight the problem and a training video has been posted on the portal','','',NULL),(930,296,'group','','2','2011-07-06 07:07:00','2011-07-05 14:00:00','2011-07-05 14:00:00','2011-07-06 07:07:00','Nick Faulks','[\"10\",\"8\"]','Cessna 441 Conquest','VH-VEJ','Ballera','','QLD',0,0,0,'[\"ENGCO\",\"FLTOPS01\"]','[]','Nose Gear Attachment Broken','On a preflight inspection it was noticed that one of the attach points for the RH nose gear mechanical linkage was sheared off. The matter was reported to the HAAMC and the Ops Manager.','The is a common fault on Cessna 400 series aircraft and is highlighted in the Company\'s documentation and training material.','A gear door and engineer were dispatched immediately to return the aircraft to service.','',NULL),(931,295,'group','','2','2011-07-05 07:25:00','2011-06-30 14:00:00','2011-06-29 14:00:00','2011-07-05 07:27:00','Bill McIntyre','[\"10\",\"8\"]','Cessna 441 Conquest','VH-VEZ','PEAKE waypoint','','NSW',0,0,0,'[\"ENGCO\",\"FLTOPS05\"]','[\"EQUIP\",\"TECH\"]','Engine Unable to be Unfeathered','\"The aircraft was being used to endorse a new pilot on the type in the area of the PEAKE waypoint. As part of the endorsement there is a requirement for the candidate to shut down an engine. The trainer and candidate closed the engine down in accordance with the QRH preplanned shutdown procedure, but noticed that the propeller stopped very quickly instead of windmilling and slowly moving to the course position. Attempts to keep the engine rotating using the unfeathering pump were unsuccessful with the propeller not unfeathering at all. Suspecting that the engine had bow lock, the crew flew the aircraft for 10 minutes hoping the engine would free itself by using the unfeathering pump. An unsuccessful attempt was made to start the engine using the preplanned engine start procedure in the QRH. Having exhausted all options to restart the engine, the engine securing checklist was performed and the training pilot informed ATC of the problem and requested a return to land at Canberra. Clearance was given and the aircraft returned to Canberra via the RWY 35 ILS. The training pilot landed the aircraft and noticed that the engine started to windmill in the feathered position the instant the main wheels touched the runway. As it was the right engine that was feathered the aircraft vacated RWY 35 to the right at taxiway D and on coming to halt the training pilot noticed that there was a small amount of smoke coming out of the right hand engine cowl. All engines were secured and propellers hand swung. It was noticed that there was engine oil dripping from the right hand engine cowl. Later examination by engineers showed that the engine oil level was very low and two tins of turbine oil were added to bring the oil to the minimum level. The unfeathering pump was activated but was slow to bring the propeller back onto the start locks and had to be helped manually by an engineer. It is suspected that the unfeathering pump was unserviceable and in securing the engine before landing the stop button had not been pushed again by the crew which meant that on touchdown the starter/generator had started motoring the engine. The smoke that was coming from the cowl on shutdown was the insulation burning on the starter generator lead.\"','Later examination by engineers showed that the engine oil level was very low and two tins of turbine oil were added to bring the oil to the minimum level. The unfeathering pump was activated but was slow to bring the propeller back onto the start locks and had to be helped manually by an engineer. It is suspected that the unfeathering pump was unserviceable and in securing the engine before landing the stop button had not been pushed again by the crew which meant that on touchdown the starter/generator had started motoring the engine. The smoke that was coming from the cowl on shutdown was the insulation burning on the starter generator lead. The starter/generator and unfeathering pump were replaced and the aircraft was returned to service.','\"Training and Checking pilots will be informed of the requirement that, if an engine cannot be restarted after a preplanned shutdown, the stop button must be pressed again before landing to prevent the starter motor engaging on touchdown.\"','',NULL),(932,294,'group','','2','2011-07-05 07:21:00','2011-06-30 14:00:00','2011-06-27 14:00:00','2011-07-05 07:21:00','Tom Menogue','[\"10\",\"8\"]','Cessna 404 Titan','VH-VEA','Sydney','','NSW',0,0,0,'[\"FLTOPS05\"]','[\"EQUIP\"]','Partial Engine Failure','On departure from Sydney on a night freight flight the right hand engine was not producing full power. This was indicated by a low fuel flow on the EDM and rough running. Cylinder 5 was not reading at all and all other cylinder and EGT temperatures on the EDM were abnormal. The analog Fuel pressure and EGT had a large split whilst the analog temperature and pressure gauges were all reading normal. The aircraft returned for a landing at Sydney and after trouble shooting with the HAAMC and the chief pilot the aircraft was subsequently grounded.','The pilot followed the correct procedures in FCOM. Maintenance personnel found a small piece of swarf in the injector.','','',NULL),(933,293,'group','','2','2011-06-20 02:45:00','2011-06-19 14:00:00','2011-06-18 14:00:00','2011-06-20 02:45:00','Antony Springer','[\"10\",\"8\"]','Cessna 441 Conquest','VH-VED','Brisbane','','QLD',0,1,0,'[\"FLTOPS10\"]','[\"INDIV\"]','Finger Jammed in Door','\"When closing the top hatch on the main door, the operators hand inadvertently became lodged between the surface of the upper and lower door resulting in local bruising and swelling of the right ring finger with a blood blister underneath the nail.\"','','','',NULL),(934,292,'group','','2','2011-06-19 00:31:00','2011-06-18 14:00:00','2011-06-16 14:00:00','2011-06-19 00:34:00','Denis Gailey','[\"10\",\"8\"]','Cessna 441 Conquest','VH-VEZ','Birdsville','','QLD',0,0,0,'[\"FLTOPS07\"]','[\"ENVIRO\"]','Birdstrike at Birdsville','\"After touchdown on R/Way 21 a large flock of galahs previously unseen, became airborne slightly to the right of the centreline. The aircraft was just slower than touchdown speed ~85 - 90 knots and the aircraft was hit a minimum of six birds by counting the carcasses on the backtrack. After shutdown, a complete and thorough inspection was carried out including the sensitive areas. There were 3 hits on the wing, one on each prop and one on the nose wheel. Bone fragments entered the starboard propeller de-ice boot on one blade at the outer end. The landing lights were on as well as the nose wheel light and strobes. The event was witnessed by the aerodrome operator who was at the holding point near the intersecting runways in his vehicle who then proceeded to clear birds for the impending arrival of \"\"Skytans 11\"\" 7 minutes after the landing.\"','','','',NULL),(935,291,'group','','2','2011-11-01 04:56:17','2011-10-25 06:27:06','2011-06-09 14:00:00','2011-07-06 07:13:00','Damon Banks','[\"10\",\"8\"]','Cessna 441 Conquest','VH-VEY','Moree','','NSW',0,0,0,'[\"FLTOPS05\"]','[\"EQUIP\"]','Undercarriage Not Locking Up','\"After takeoff from Moree on the second sector for the day in, the aircraft gear was selected up however the cycle did not complete with Ôgear unlockedÕ, Ôhydraulic pressure onÕ and Ôleft hyd low flowÕ lights all remaining on. The gear was selected down and three greens were indicated with all other system lights off. A recycle resulted in the same outcome and the gear was reselected down, three greens indicated with all other system annunciator lights off. QRH was consulted and actioned with the same outcome. The gear was again selected down and three greens were indicated with all other system lights off. The aircraft was returned for a normal landing at Moree. Full flap was available for the landing and was able to be reset to takeoff position after landing, but both Ôhydr low flowÕ lights illuminated during system operation. The MRO was advised by phone of the unserviceability. The hydraulic reservoir fluid level was replenished (one quart added) and aircraft dispatched without further anomalies albeit 20 minutes behind schedule. For the next four sectors the hydraulic system operated normally. After the second sector since the hydraulic event above, an additional _ quart of hydraulic oil was added to the reservoir. Thorough post flight inspections were carried out to identify a hydraulic leak but none was found. After takeoff on the sixth sector of the day, the gear was selected up and the Ôhydraulic pressureÕ and Ôgear unlockedÕ light remained on however the Ôhydr low flowÕ lights did not illuminate. This fault was identified as being with the uplocks, rather than the hydraulic reservoir quantity. The gear was selected down and three greens were obtained with all other system annunciator lights off. Gear retraction was attempted again with the same result and the landing gear was again returned to the down and locked position. The aircraft made a normal landing.\"','The uplock microswitch was adjusted by Maintenance staff and this corrected the problem. The aircraft returned to service.','','',NULL),(936,290,'group','','2','2011-10-25 06:44:26','2011-10-25 06:34:00','2011-06-05 14:00:00','2011-06-14 06:13:00','Damon Banks','[\"10\",\"8\"]','Cessna 441 Conquest','VH-VEY','Coffs Harbour','','NSW',0,0,0,'[\"FLTOPS06\"]','[\"EQUIP\"]','Manual Extension of Undercarriage','\"The aircraft was about to commence a sector from Williamtown to Coffs Harbour. During after start action flow at Williamtown the hydraulic flow low light flickered/ illuminated but extinguished after the flaps had completed their cycle. After start the aircraft was running normally and all checks complete; all relevant annunciator panel lights were clear. After T/O and with gear and flap up all lights were off. In the climb the LH Hydraulic flow low light illuminated steady and remained on. The light was noted by the pilots and the QRH was consulted. The requirement in the QRH (LAND... As soon as practical) was discussed. A return to Williamtown would result in an overweight landing and there would be a possible flapless landing and possible requirement to actuate the emergency landing gear extension system; as such a decision was made to continue to Coffs Harbour. On arrival to Coffs Harbour, in the circuit, the pilot selected T/O flap (with the Hydraulic low flow light still illuminated) the flap travelled to T/O. The gear was then selected down but failed to extend. After an attempted recycle the Hydraulic pressure light remained illuminated along with the Hydraulic flow low light and the gear unlocked light illuminated. The pilot called for the Landing gear will not extend normally checklist which was read by the PNF. After manually blowing down the landing gear; the gear was confirmed down with three greens and a normal landing was carried out. After passengers disembarked and escorted off the apron the appropriate authorities were notified of the incident.\"','Maintenance personnel found a pin hole in a hydraulic line which was repaired and the aircraft returned to service.','','',NULL),(937,289,'group','','2','2011-10-25 21:57:14','2011-05-31 14:00:00','2011-05-30 14:00:00','2011-07-06 05:31:00','Eva Bakos','[\"9\"]','Other aircraft type','Not applicable','Canberra','','ACT',0,1,0,'[\"FBOCO\"]','[\"DESIGN\"]','Heavy Rubbish Bags Pose OHS Issues','\"The large green rubbish bags removed from the rear galley as part of cabin cleaning duties to Virgin Australia aircraft at Canberra Airport are becoming increasingly heavy, sometimes in excess of 30kg. This produces two hazards that need to be addressed primarily through Inflight Logistic Services (ILS) and Virgin Australia. The first hazard concerns manual handling for staff whilst the second hazard concerns FOD on the RPT apron should the bag break whilst being carried from aircraft to vehicle. The Cabin Cleaning Team Leader rang and spoke with the BNE Port Coordinator for ILS who has advised that this hazard is primarily the result of the introduction of Virgin AustraliaÕs Fare Family Program. This program is producing a lot more waste including bottles etc. The BNE Port Coordinator has asked that this hazard is submitted through Corporate AirÕs Safety System.\"','The hazard report has been submitted to ILS.','The procedures in the Ground Handling Manual cover this hazard and should be followed by staff.','',NULL),(938,288,'group','','2','2011-06-07 04:04:00','2011-05-31 14:00:00','2011-05-29 14:00:00','2011-06-07 04:04:00','Antony Springer','[\"10\"]','Cessna 441 Conquest','VH-VED','Newlands','','QLD',0,0,0,'[\"FLTOPS07\"]','[\"EQUIP\"]','Dragline Infringes Approach Path at Newlands','\"On approach and landing at Newlands Mine a dragline was observed to be parked within 1/2 a mile from the end of the 17 Runway. After landing it was estimated that the dragline would have infringed the extended runway centreline by a minimum of 100 feet, because of the raised boom. In consultation with the team leader for the movement of the machine, the crew were advised that they had suffered a breakdown during the night and it was expected that the equipment would be walked out the next day/shift.\"','\"The Brisbane Aircraft Manager will be forwarding a report to XCQ Management about the hazard with a request that in the future, information about obstructions and other hazards are forwarded to the flight crew before their departure wherever possible, or by radio if ground contact is possible\"','\"The client has advised that, in future, the Airport Manager will consider the airfield closed until the danger is assessed in consultation with XCQ management and Corporate Air.\"','',NULL),(939,287,'group','','2','2011-07-06 05:28:00','2011-05-29 14:00:00','2011-05-24 14:00:00','2011-07-06 05:28:00','Tim White','[\"10\",\"8\"]','Not applicable','VH-VEK','Goulburn','','NSW',0,1,0,'[\"ENGCO\"]','[\"TECH\"]','Inappropriate Use of Electric Screwdriver','\"It has been reported that on a recent job an engineer was observed removing underwing fuel panels with an electric screwdriver. The engineer was asked by a fellow engineer to use a normal hand screw driver when opening fuel panels but the engineer continued to remove the underwing fuel panel with the electric screwdriver. A few days later the hanger supervisor was told of the incident. The supervisor approached the engineer about the incident. The engineer assured the supervisor that it would not happen again. The Supervisor was satisfied with this and no further action was taken. At a later time when working on a conquest, the same engineer was observed removing an underwing fuel panel with an electric screwdriver. The engineer was told by the Supervisor to stop and use a normal non-electric screwdriver to remove and install the panel. The engineer asked why three times before following the direction.\"','The Manager MRO will ensure that the risk is in the Risk Register and issue a NOTMRO The MOE will be amended to prevent the use of electric screwdrivers on fuel panels.','NOTMRO 14/11 has been issued to address this issue.','',NULL),(940,286,'group','','2','2011-06-07 03:47:00','2011-05-19 14:00:00','2011-05-19 08:00:00','2011-06-07 03:47:00','Tom Menogue','[\"10\",\"8\"]','Beech 58 Baron','VH-VEB','Bankstown','','NSW',0,0,0,'[\"FLTOPS06\"]','[\"ENVIRO\"]','Birdstrike at Bankstown','\"On late finals into YSBK at approximately 500 ft, a large dense thud was heard on the left hand side of the fuselage. The pilot knew that he had been struck by a bird. The bird hit the aircraft between the LH engine and the fuselage but did not appear to affect performance. The pilot thought that the bird may have hit the landing gear and, with the tower being open, the pilot conducted a go-around and asked the tower to visually inspect any abnormality of the gear. The tower advised that they could not see any issue with the landing gear and confirmed the gear was down. The pilot conducted a normal landing with no issue. After shut down the passengers were walked to the exit and had thanked the pilot for the flight. In a post flight inspection the damage made it very clear that the bird had a solid impact. The bird hit oneflush with the wing (Between the fuselage and the LH engine) A dent 1 foot long and two inches deep was the result of the strike and metal of the wing had been pulled back exposing a fuel line. The pilot subsequently grounded the aircraft and notified the appropriate authorities.\"','No further action can be taken.','','',NULL),(941,285,'group','','2','2011-07-06 05:27:00','2011-05-15 14:00:00','2011-05-10 14:00:00','2011-07-06 05:27:00','Rob Boyes','[\"8\",\"7\"]','Not applicable','Not applicable','Goulburn','','NSW',0,0,0,'[\"ENGCO\",\"COYGEN\"]','[\"LEADER\"]','Goulburn Audit Findings','\"During a recent audit of the Goulburn facility the following non compliances were observed. Storage Area \"\"Hangar Floor\"\" There were a number of items on the Hangar floor that were marked with either Red or Green tags, but did not have a WinAir batch label on them. These items were not allocated to an aircraft job and were considered under Quarantine, however they were not in a restricted area, so were not in fact quarantine. Storage Area I, H, G, F and E All of these areas contained stock that were not labelled with WinAir labels, some had not labels at all. Some stock was not stored in the area noted on the batch label. Stock was stored in aras with no reference None inventory items were also stored in area \"\"E\"\" All areas on the top floor need a complete Stock take. This has been mentioned to the Stores Manager and staff resources have been allocarted to him to have this started by the 18th of May and finished as soon as practical after that time.\"','All items have been addressed.','','',NULL),(942,284,'group','','2','2011-06-07 03:43:00','2011-05-12 14:00:00','2011-05-11 14:00:00','2011-06-07 03:43:00','Tom Menogue','[\"10\"]','Cessna 404 Titan','VH-VEC','Scone','','NSW',0,0,0,'[]','[\"INDIV\"]','Penetration of R580C','\"On approach to Scone the weather on the TAF read cloud F015. The 25 MSA to the south is 4400 ft (which is 1100 ft lower than the 10 MSA) The aircraft was tracking for the airfield when at 4400 ft the aircraft was in BKN cloud. The pilot saw a few small holes but hills in the vicinity and unfamiliar with the area the pilot decided to discontinue direct to the field and conduct the RWY 29 RNAV approach. The pilot called Brisbane Centre (BC) on 133.05 with no response both with squelch enabled and disabled. The pilot noted that BC had not transferred VEC over to 124.8 (which is the frequency for the Scone area) as such the pilot switched frequencies and called on 124.8 with no response, the pilot tried again with squelch disabled and was able to raise BC. BC responded that VEC had just penetrated R580C within Williamtown airspace. On arrival the pilot contacted BC to discuss the issue. They noted the events in their report.\"','The pilot involved has been counselled.','','',NULL),(943,283,'group','','2','2011-05-09 01:57:00','2011-04-19 14:00:00','2011-04-15 05:50:00','2011-05-09 01:57:00','Denis Gailey','[\"10\",\"8\"]','Cessna 441 Conquest','VH-VEJ','Ballera','','QLD',0,0,0,'[\"FLTOPS06\"]','[]','Loud Noise From ACM','\"On descent into Ballera a loud \"\"Pop\"\"/backfire like a compressor stall was heard. A quick check of engine and pressurisation indicated all was normal. On the ground the pilot asked two of the passengers (one was a Northpoint mechanic, the other was an engineer) if they did hear a pop or backfire. They did hear the noise and advised it was assosciated with a visible vapour discharge from the ACM floor flood vent. This seemed in line with a compressor stall from ice build-up and melt on the ACM.\"','This is a not uncommon problem and no further action needs to be taken.','','',NULL),(944,282,'group','','2','2011-05-09 01:54:00','2011-04-19 14:00:00','2011-04-14 14:00:00','2011-05-09 01:54:00','Mark Norriss','[\"10\",\"9\"]','Metro 23','VH-VEU','Canberra','','ACT',0,0,0,'[\"FLTOPS06\"]','[\"EQUIP\"]','AFRU Failure','\"On approach to Canberra, numerous attempts to activate runway lighting were made. Each attempt resulted in the airport identifier being transmitted but without conformation of runway lighting being activated. Ground staff were contacted through AAE to conduct a manual activation of the runway lights. Runway lighting and associated markings were sighted by the flight crew at approx 15DME Canberra. The approach was continued and followed by a safe landing. Upon landing the Crew were informed that no manual activation was required as the runway lights were already activated. Melbourne centre were informed of the issue with the AFRU.\"','The problem was discussed with airport management. It appears that the receiver had jumped a digit for the confirmation announcement. The airport has rectified the problem.','','',NULL),(945,281,'group','','2','2011-05-09 01:52:00','2011-04-11 14:00:00','2011-04-10 14:00:00','2011-05-09 01:52:00','Mark Norriss','[\"10\",\"9\"]','Metro 23','VH-VEU','Melbourne','','VIC',0,1,0,'[\"FLTOPS01\"]','[\"ENVIRO\"]','Inappropriate Dangerous Goods','\"The Captain was informed by the leading hand in Melbourne that an item on the last barrow required attention, as the leading hand had just been informed by personnel in uplift that this item should be checked by the crew. The item in question was Class 8 ÒHypochlorite SolutionÓ and clearly marked ÒDo not load on aircraft road freight onlyÓ. The freight was rejected for travel by the Captain. In this instance the system worked as the uplift personal brought the issue to light. The concern is that these dangerous goods were loaded on a freight barrow and brought to the aircraft prior to this being brought to the crewÕs attention. In addition, if this issue had not been raised by astute uplift personal there was potential for this item to have been loaded onto the aircraft. The Captain is concerned that the sticker for ÒDo not load on aircraft road freight onlyÓ and the sticker for ÒCargo aircraft onlyÓ are very similar. He believes that this could have contributed to the incident.\"','\"AAE have been informed of this event to prevent a re-occurrence. After examination it was found that the item was incorrectly labelled and should have been labelled \"\"Freight aircraft only\"\" and could have been carried on the flight.\"','','',NULL),(946,280,'group','','2','2011-05-09 01:47:00','2011-04-06 14:00:00','2011-04-05 14:00:00','2011-05-09 01:47:00','Mark Norriss','[]','Metro 23','VH-VEU','Melbourne','','VIC',0,0,0,'[\"FLTOPS06\"]','[\"ENVIRO\"]','Laser Illumination','The aircraft was approximately 5nm east of Essendon Airport on approach to Melbourne RWY 34. The right hand side of the cockpit was illuminated by a green laser. This event was reported to Melbourne approach.','No further action can be taken.','','',NULL),(947,279,'group','','2','2011-07-05 07:10:00','2011-04-05 14:00:00','2011-04-04 06:00:00','2011-07-05 07:10:00','Albert Stewardson','[\"10\"]','Beech 58 Baron','VH-VEB','Port Macquarie','','NSW',0,0,0,'[\"FLTOPS04\"]','[\"INDIV\"]','Fuel Pump in High Postion on Take-off','\"The aircraft was on a charter flight from YPMQ to YSBK. The take-off on RWY 21 was aborted due to the L/H engine not developing full power. The aircraft was taxied back to the apron where it was discovered that the L/H ÒAUX FUEL PUMPÓ was on high resulting in an excessively rich mixture. The pilot under supervision aborted the take-off shortly after advancing the throttles to full power and only required minor braking to stop the aircraft within half the length of the runway strip (1600m). The training pilot did not notice AUX FUEL PUMP on HIGH (it is difficult to see the switch position due to the control column obscuring the switches when the column is in the forward position) and suspect that it was inadvertently bumped on after priming the right hand engine (the left engine was started first). Unlike the C404 which the supervisory pilot was familiar with, the AUX FUEL PUMP switches on the Baron do not have a gate preventing accidental activation. To prevent a similar occurrence the FCOM is being amended to include a check in the line-up drill where the AUX FUEL PUMP is turned on low if the temperature is above 32¡C to check that the pumps are not on HIGH.\"','The FCOM for the aircraft has been amended to prevent a re-occurrence and will soon be printed.','The FCOM has been re-issued.','',NULL),(948,278,'group','','2','2011-05-09 00:27:00','2011-04-04 14:00:00','2011-04-04 07:58:00','2011-05-09 00:27:00','Antony Springer','[\"10\"]','Cessna 441 Conquest','VH-VEZ','Shute Harbour','','QLD',0,0,0,'[\"FLTOPS05\"]','[\"INDIV\"]','VCA of Hamilton Island Airspace','\"The aircraft penetrated Hamilton Island Airspace shortly after departure from Shute Harbour Airfield during IMC conditions en-route Mackay with nil passengers on board. Prior to arrival at Shute Harbour the relevant TAC chart for the area was referenced with particular focus on the surrounding terrain and the control steps for Hamilton Island. The ATIS was checked and noted that the tower was closed and the airspace had reverted to class G. A normal approach and landing was conducted in legal yet less than ideal conditions. After shutdown and passenger disembarkation, the crew briefly retired to the terminal to conduct payment of landing fees, during which time the surrounding conditions deteriorated considerably. Take-off was not possible for a period approaching 30 minutes, during which time the crew discussed in detail the various options for a safe departure to Mackay. It should be noted that Shute Harbour Airfield is surrounded by high terrain in most directions, with effectively only one route available to the crew at the time of departure. When conditions had improved to a point where the Captain determined that a safe departure was possible, the aircraft was taxied to the end of runway 32 for a takeoff to the North West. Owing to the position of the runway and surrounding terrain, line of sight was reduced to 2500-3000m with a cloud base of 500-1000 feet which at the time appeared to be sufficient to safely depart visually to the North West over open ocean. Note that VHF contact with BN Centre (and Hamilton Island VOR for the ATIS) was blocked by high terrain and the taxi call was not received by Center. Soon after take-off the prevailing conditions were deemed to unsuitable to maintain visual flight and the aircraft was subsequently climbed at best rate over the ocean to ensure terrain clearance. During this time a departure call was made to BN Center, where a squawk code was received and activated. The aircraft was at approximately 4000 feet when the transponder was activated. The aircraft was climbed through the Grid LSALT of 5200 feet, at 7000 feet Center advised that the aircraft had penetrated controlled airspace without a clearance. Subsequent re-examination of the airspace indicated that the departure track of 340 degrees which was selected by the crew positioned the aircraft directly into the 2500 foot control step of Hamilton Island. The captain acknowledges that he became fixated with the ambient weather conditions, terrain and escape routes whilst failing to consider the possibility of re-activated airspace directly overhead.\"','\"The crew involved have been counseled regarding this matter, particularly the two crew issues involved.\"','','',NULL),(949,277,'group','','2','2011-07-05 07:03:00','2011-03-30 13:00:00','2011-03-30 13:00:00','2011-07-05 07:03:00','Timo Hemminki','[\"10\"]','Cessna 404 Titan','VH-VEA','Sydney','','NSW',0,0,0,'[\"FLTOPS05\"]','[\"INDIV\"]','Altitude Exceeded','\"On departure from Sydney on a night freight flight the aircraft was cleared to climb initially to 3000. Passing 2000 the acraft was cleared to climb to 8000 The pilot, who was under supervision, correctly read back the assigned altitude but inadvertently set 9000 in the assigned indicator through 8000 crew was distracted by weather avoidance. At 8500 ATC called to confirm the altitude and aircaft was decended to 8000 ft.\"','The Chief Pilot will issue a NOTAC.','NOTAC 14/2011 has been issued.','',NULL),(950,276,'group','','2','2011-04-21 02:25:00','2011-03-30 13:00:00','2011-03-28 13:00:00','2011-04-21 02:25:00','Scott Lemon','[\"10\"]','Cessna 441 Conquest','VH-VEJ','Ballera','','QLD',0,0,0,'[\"FLTOPS04\"]','[]','Birds at Ballera','\"After bird fright operations had been completed the aircraft departed rwy 21 Ballera for Moomba. At approx 300\' AGL the right wing had to be lifted twice, quickly, in an effort to avoid multiple birdstrikes. Approx 30 deg angle of bank was reached before wings were levelled and the aircraft departed to the left of centreline. Normal departure then continued to Moomba. More black kite hawks were encountered on approach to Moomba but flight path deviation was not required. The aircraft was operating NC73 with 6 passengers.\"','See GS263','','',NULL),(951,275,'group','','2','2011-05-09 01:59:00','2011-03-29 13:00:00','2011-03-28 13:00:00','2011-05-09 01:59:00','Timo Hemminki','[]','Cessna 404 Titan','VH-VEA','Canberra','','ACT',0,0,0,'[\"FLTOPS01\"]','[\"INDIV\"]','Oil Filler Cap Left Off','\"After adding oil in Canberra prior to a Sydney freight flight the pilot, who was under supervision, failed to properly secure the right hand engine oil cap. En route to Sydney there was a loss of oil which coated the nacelle which requiring cleaning in Sydney.\"','A NOTAC is to be issued to address this problem.','NOTAC 13/2011 has been issued.','',NULL),(952,274,'group','','2','2011-04-20 23:29:00','2011-03-29 13:00:00','2011-03-28 13:00:00','2011-04-20 23:29:00','Mark Norriss','[\"10\"]','Metro 23','VH-VEU','Melbourne','','VIC',0,0,0,'[\"FLTOPS06\"]','[\"ENVIRO\"]','Laser Illumination','The aircraft was approximately 5nm east of Essendon Airport on approach to Melbourne RWY 34. The right hand side of the cockpit was illuminated by a green laser. This event was reported to Melbourne approach. Shortly afterwards Pacfic Airlines also reported laser illumination in the same area.','No further action can be taken.','','',NULL),(953,273,'group','','2','2011-04-20 23:29:00','2011-03-28 13:00:00','2011-03-01 13:00:00','2011-04-20 23:29:00','','[\"10\",\"8\",\"6\"]','Metro 23','VH-VEU','Near Nowra','','NSW',0,1,0,'[\"ENGEXT\"]','[\"ENVIRO\"]','Fumes in Metro Cabin','\"On descent into the the Naval Air Station at Nowra, some of the passengers in the rear of the aircraft noticed a smell consistent with burning Mobil Jet II oil. The smell appeared worse in the rear of the cabin. The client (Department of Defence) is dealing with this as an OHS incident.\"','NOTMRO 05/11 has been issued regarding servicing of ACMs.','','',NULL),(954,272,'group','','2','2011-04-20 23:24:00','2011-03-28 13:00:00','2011-03-24 13:00:00','2011-04-20 23:24:00','Antony Springer','[\"10\",\"6\"]','Cessna 441 Conquest','VH-VEZ','Rolleston','','QLD',0,0,0,'[\"FLTOPS08\"]','[\"DESIGN\"]','Insufficient Clearance Between Cone Markers','\"Whilst taxying to the apron at Rolleston airfield, the crew became aware of the yellow taxi cones placed too near the runway and taxiway. As propellor clearance was likely to be an issue, a decision was made to taxi across the packed earth directly adjacent the parking bay. After shutdown, both pilots paced the distance between the cones and it was ascertained that little clearance for the propellers was available. They subsequently moved several cones that were fixed with pins to relatively loose earth, however there were quite a few which had been pinned to bitumen areas that could not be readily moved. Whilst taxying for take-off the crew applied maximum vigilance when passing the cones with a positive outcome. On Monday 28/03/11 a telephone call was placed to the person responsible for the maintenance at Rolleston airfield. A detailed description of the issues were conveyed with an agreement that the cones should be at a minimum distance of eight feet from either side of the taxi way. The maintenance person committed to rectification of the problem later that day.\"','\"The aircraft will be positioned to Rolleston on Friday 01/04/11 as per the usual schedule and the crew will make a detailed assessment of the rectification works. If the results are not satisfactory, further contact will be made resolve the issue/s.\"','All issues have been rectified.','',NULL),(955,271,'group','','2','2011-05-09 00:51:00','2011-03-22 13:00:00','2011-03-22 13:00:00','2011-05-09 02:01:00','Tom Menogue','[\"10\",\"8\"]','Metro 23','VH-VEU','Canberra','','ACT',0,0,0,'[\"FLTOPS06\"]','[\"EQUIP\"]','Screen Failure on Metro Radio','During the cruise (returning from Melbourne- night freight) the First officer (PNF) noticed that the VHF comm 2 screen had gone blank. VHF comm 1 was selected and a radio check was carried out with Melbourne centre and radio contact was established. At top of desent the PNF notified Melbourne centre that VH-VEU was transferring to Canberra C-TAF due to a failure of the second VHF radio and they would report ops normal and cancellation of SAR watch on the ground. Effective communication was established with inbound company traffic on Comm 1 during the approach.','No further action can be taken.','Crew need to be vigilant to ensure that previous items in the AML are thoroughly checked before flight.','',NULL),(956,270,'group','','2','2011-04-20 23:21:00','2011-03-22 13:00:00','2011-03-22 13:00:00','2011-05-09 00:25:00','Timo Hemminki','[\"10\"]','Cessna 404 Titan','VH-VEA','Sydney','','NSW',0,0,0,'[\"FLTOPS01\"]','[\"INDIV\"]','Failure To Secure Nose Locker','During the walk around in Sydney before the departure back to Canberra the pilot under supervision forgot to close and lock the right hand nose locker. During the take-off from rwy 16R the locker opened and the aircraft had to return to Sydney landing on rwy 34L. The locker was properly secured and the aircraft returned to Canberra without further incident. There was no damage caused to the aircraft and none of the contents of the nose locker escaped.','The Chief Pilot will issue a NOTAC to remind pilots that they must check all lockers and doors as a last inspection regardless of any circumstance.','Notac 13/2011 has been issued.','',NULL),(957,269,'group','','2','2011-04-20 23:13:00','2011-03-20 13:00:00','2011-03-19 13:00:00','2011-04-20 23:13:00','Darren King','[\"10\",\"8\",\"9\",\"7\",\"6\"]','Not applicable','Not applicable','Pialligo','','ACT',0,1,0,'[\"FBOCO\"]','[\"DESIGN\"]','Hazard at Pialligo','A hazard exists at the rear of Pialligo office outside kitchen door. When the building was completed no back fill etc was put in place to level off from concrete pathway. Over time water has eroded the ground away to make the step from path to ground a trip hazard. Ground Handling Manger to organise road base or similar fill hazard and level off.','The Ground Handling Manger is to organise road base or similar to fill the hazard and level off the area.','Works are in progress to illuminate the hazard area.','',NULL),(958,268,'group','','2','2011-04-20 23:11:00','2011-03-18 13:00:00','2011-03-17 13:00:00','2011-04-20 23:11:00','John Christensen','[\"10\",\"8\",\"9\"]','Not applicable','Not applicable','Goulburn','','NSW',0,1,0,'[\"ENGCO\"]','[\"INDIV\"]','Worker Strikes Head','\"Whilst working on the right hand landing gear, the employee struck the engine inlet cowl with his head causing a cut and associated blood loss. He was taken to hospital for attention, returning to work approximately 90 minutes later.\"','No further action can be taken.','','',NULL),(959,267,'group','','2','2011-04-20 23:09:00','2011-03-08 13:00:00','2011-03-08 21:44:00','2011-04-20 23:09:00','Nick Faulks','[\"10\",\"8\"]','Cessna 441 Conquest','VH-VEW','Ballera','','QLD',0,0,0,'[\"FLTOPS04\"]','[]','Birdstrike at Ballera','A kite-hawk was struck by the RH prop on the take-off roll at Moomba at 08:44 local time. Take-off was aborted and passengers disembarked. Bird was recovered and after consultation with the Company Maintenance Controller and a thorough inspection of the affected area the pilot was happy that no significant damage had been done. After a 30 minute delay the pilot resumed the original planned flight.','See GS 263 for client action.','','',NULL),(960,266,'group','','2','2011-04-20 23:05:00','2011-02-10 13:00:00','2011-02-09 13:00:00','2011-04-20 23:08:00','Mark Norriss','[\"10\"]','Metro 23','VH-VEU','Melbourne','','VIC',0,0,0,'[\"FLTOPS06\"]','[\"ENVIRO\"]','Laser Illumination','\"The aircraft was approx 5nm East Essendon Airport on approach to Melbourne RWY 34. Approx 5nm east of Essendon airport, the right hand side of the cockpit was illuminated by a green laser. This event was reported to Melbourne approach\"','The matter will be reported at the next airport safety meeting.','','',NULL),(961,265,'group','','2','2011-04-20 23:04:00','2011-02-10 13:00:00','2011-02-08 14:08:00','2011-04-20 23:04:00','Damon Banks','[\"10\"]','Cessna 404 Titan','VH-VEA','Canberra','','ACT',0,0,0,'[\"FLTOPS06\"]','[\"EQUIP\"]','Navaids On Battery Backup','\"The aircraft was in IMC and tracking towards waypoint TALAG (ETA 1411Z) to commence the Canberra runway 17 VOR approach in conclusion of a freight flight from Sydney. With about 7 nautical miles to run to TALAG, Melbourne Centre called to advise that mains power to the VOR had just failed, that the aid was broadcasting on battery power only and that it was operating on a pilot monitored basis. Centre further advised that it was unknown how long the batteries would continue to provide power. The pilot quickly assessed his options and decided to continue via TALAG and the 17 VOR approach, monitoring the VOR and being prepared to execute a missed approach should it cease transmitting before he was in a position to conduct a visual approach (in about five more minutes). This had the benefit of being exactly what he was intending to do anyway, so was a lesser risk than altering his intentions at a late stage. It would also be the most expeditious option and if a missed approach was required due to failure of the ground-based navaids, space-based approaches (GPS) would still be available for further approach attempts. VEU was also inbound from Melbourne, planning to track via the runway 35 ILS to Canberra, although the estimated arrival times at Canberra were far enough apart that they hadnÕt been provided as IFR traffic to each other. Moments after the initial call to VEA, Melbourne Centre advised VEU that they also had the same issue Ð mains power to the ILS had also failed and it was also operating on battery power. The flight crew elected to alter their intentions and made an approach via the runway 35 RNAV(GNSS) approach instead. The VOR continued to transmit normally and VEA completed its approach and landing without further incident. VEU also landed safely. On arrival at Pialligo to complete post-flight actions, it was noted that there was an ongoing electrical failure affecting the area. Street lights were off and only emergency lighting was available inside the Corporate Air Pialligo facility Ð computers etc were all unavailable.\"','The Ground Handling Manager will contact the Canberra International Airport to ask if the generator comes on automatically in the event of a power failure.','','',NULL),(962,264,'group','','2','2011-04-20 23:07:00','2011-02-09 13:00:00','2011-02-07 10:00:00','2011-04-20 23:07:00','Damon Banks','[\"10\",\"8\"]','Metro 23','VH-VEU','Canberra','','ACT',0,0,0,'[\"FLTOPS01\"]','[\"DESIGN\"]','Trim Sheet Arrows','\"During pre-flight preparations for a freight flight the co-pilot noticed that the current trim sheet (SA227DC ÒCargoÓ) is missing an arrow on the cargo zone 3 row. The arrow shows the direction a load carried in cargo zone 3 will affect the trim of the aircraft. Neither of the flight crew had previously noticed that the arrow was missing Ð although it has likely been that way since the trim sheet was issued on the 7th July 2005. The co-pilot doubts that the issue has ever contributed to a loading incident, however he feels that it warrants raising a hazard report so that it can be addressed as the latent risk of an incident is present.\"','The Chief Pilot will have the trim sheets corrected.','','',NULL),(963,263,'group','','2','2011-05-09 01:38:00','2011-02-08 13:00:00','2011-02-08 18:30:00','2011-05-09 01:38:00','Gerry Hanstede','[\"10\",\"8\"]','Cessna 441 Conquest','VH-VED','Ballera','','QLD',0,0,0,'[\"FLTOPS03\"]','[\"ENVIRO\"]','Birdstrike at Ballera','The aircraft was departing YLLE for YMMT rwy 21. A plumber bird was hit on rotation by the nosewheel. It then bounced off and hit the leading edge of the wing between the engine and the fuselage. There appeared to be no damage to the aircraft and the flight continued to YMMT. After returning to YLLE the pilot was informed by the airport manager he had found two birds on the runway that morning after the aircraft had departed','\"Santos has requested that Cobham (the Airport Manager) put in place a bird mitigation strategy. This includes culling birds, noise cannons and pulsing lights on the aircraft.\"','Measures to control birds in the Cooper Basin have been put in place and the situation will be monitored.','',NULL),(964,262,'group','','2','2011-02-06 01:38:00','2011-01-19 13:00:00','2011-01-18 14:15:00','2011-02-06 01:38:00','Karl Paton','[\"10\",\"9\"]','Cessna 404 Titan','VH-VEA','Canberra','','ACT',0,0,0,'[\"FLTOPS07\"]','[\"INDIV\"]','Landing Without Runway Lighting','\"The aircraft was tracking to Canberra from Sydney. At approximately 1346 UTC the pilot copied the CB AWIS (090/02 OVC015 T15 1011). The pilot decided that he would conduct the VOR17 approach via TALAG. He then tracked direct to TALAG for a 10 mile final RWY 17. He also started his descent to be at TALAG at 5100Õ. He had self briefed the approach and also considered conducting the ILS 35 approach via the arc. He obtained an ETA of 1422UTC on VEU inbound to CB from ML.. By selecting the ILS via the arc the aircraft would have been touching down at 1419UTC. The pilot believed that this was too close for separation with VEU so elected to conduct the VOR 17 approach via TALAG. Having selected COM2 he keyed 3 times for the PAL to be activated. The pilot reported that at approx 20DME Canberra he heard both transmissions that the Canberra Aerodrome Lighting had been activated. He continued the approach, and descended to the minima of 3250Õ, breaking visual at around 3.9 DME and at a height of 3400Õ. From this point he continued the descent to the MDA. During the descent and in IMC, he could hear clicks attempting to activate the PAL, having already selected it and hearing a response he deemed it to be activated. Once visual he remained clear of cloud, in sight of the ground, and was within 5nm on the T-VASI and on slope. His tracking on the VOR was within tolerance and he didnÕt require any flight maneuvers or excessive rates of descent to intercept a position on final to affect a safe landing. He was visual with the T- VASI at all times, and could see the apron lights and also the illuminated windsock at the threshold end of the runway. He confirmed that he was still tracking on the VOR and that the GPS map mode was selected and confirmed that the runway was in front of him. He maintained visual contact with the red flashing beacon on Mt Ainslie, and also he could see the T-VASI and was on slope, the illuminated windsock was visual as were the lead in lights and runway threshold later in the approach. He made the decision to continue with the approach as he believed that the landing could be affected safely with all risks associated identified and assessed. He tried to contact VEK who was taxiing for runway 35. This was done on COM2. He heard no response from that aircraft. Melbourne Center advised VEK that VEA was on short finals to land on runway 17. The pilot felt the major contributing factor at the time to continue with the approach was his concern for a conflict with VEU inbound from Melbourne. As the published missed approach states to track to the CB VOR thence 168 at 6 DME and not below 3600Õ turn left and track 020 and continue the climb to 5100Õ. At the time he believed that by conducting the missed approach this could pose a conflict from the inbound traffic from Melbourne. He feels his decision to remain visual at all times with the runway, the illuminated windsock and its other identifiable markings, also cross referencing with the Map mode of the GPS allowed him to complete the landing. At the time he believed this posed a much better scenario. He had heard the AFRU state that the aerodrome lighting had been activated. He feels he would not have begun the VOR approach had he known the runway lighting was in fact not activated. He feels he would have held at TALAG, contacted the Company and requested that the lights be turned on manually. He believed that he could have communicated with VEU on COM 1 (being the stronger radio) and worked out a plan of attack. He feels that he should have told ML Center that he would be using one com and that he would report again ops normal in a period of time, this being enough time to formulate a plan and hopefully have the lights on. He feels that failing this he would have held for a short time then would have diverted back to Sydney. The pilot feels that he made a monumental error of judgment, and accepts that this could not only have endangered his career with the Company, but in aviation as a whole. He realizes the mistake he made by choosing to land without runway lights even though he was filled with 100% confidence in his ability to land the aircraft safely due to visually being able to see the runway markings. On reflection he is shocked that he actually thought this was the right thing to do. On reflection, he wholeheartedly accepts that there is no excuse for not completing the missed approach and climbing to a safe altitude and reassessing the situation.\"','The pilot was counseled about the inappropriate judgement in landing without runway lights. He has since resigned from the Company.','','',NULL),(965,261,'group','','2','2011-02-06 01:33:00','2011-01-19 13:00:00','2011-01-18 14:15:00','2011-02-06 01:33:00','Mark Norriss','[\"10\",\"9\"]','Metro 23','VH-VEU','Canberra','','ACT',0,0,0,'[\"FLTOPS07\"]','[\"EQUIP\"]','Canberra Aerodrome Lighting Failure','\"The aircraft was tracking from Melbourne to Canberra. Shortly after top of descent at 30nm from Canberra, the crew were informed by a company aircraft that the Canberra PAL was inoperative and that ground crew were attempting a manual override which was unsuccessful. A holding pattern was made until prudent limit of endurance was reached for a diversion to Sydney. The aircraft was then diverted to Sydney where the crew were informed the problem had been resolved. After refuelling, the aircraft returned to Canberra.\"','Investigation showed that electricals on the ground were at fault which were fixed by Canberra Airport technicians. Correct procedures were used by Flight crew and Ground crew. No further action required.','','',NULL),(966,260,'group','','2','2011-02-06 01:28:00','2011-01-11 13:00:00','2011-01-05 03:00:00','2011-02-06 01:28:00','Richard Bennet','[\"10\"]','Cessna 441 Conquest','VH-VEZ','Springsure YSPI','','QLD',0,0,0,'[\"FLTOPS07\"]','[\"ENVIRO\"]','Kangaroo Hazard','\"During final approach onto RWY 13 approx 10-15 kangaroos were sighted by the flight crew along the full length of the runway on the centreline and in the grass within the strip. A standard missed approach was conducted from approx 100ft AGL. Following the missed approach, a low level pass in the approach configuration was conducted in the RWY 31 direction along the length of the runway to try to clear the kangaroos. Phone contact was made by the co-pilot with the client to organise a vehicle to clear the strip. The aircraft held above the field for approx 10 mins while a vehicle entered the strip and cleared the kangaroos. During the second approach to RWY 13 one kangaroo was sighted on the threshold and the remainder of the runway was clear. The aircraft was light with no pax and approx 1600lbs fuel on board, the decision was made to land long. A normal landing was conducted with more than sufficient runway remaining to stop using only minimal reverse thrust. There had been recent rain in the area with the runway damp and the weather was CAVOK. Several trips to and from airfield had been completed in the previous days without incident including one trip earlier that day. Both crew members were familiar and comfortable with the aerodrome and the aircraft.\"','The client is away of animal problems on their airfields.','','',NULL),(967,259,'group','','2','2011-02-06 01:25:00','2010-12-30 13:00:00','2010-12-27 22:04:00','2011-02-06 01:25:00','Scott Lemon','[\"10\"]','Cessna 441 Conquest','VH-VEJ','Moomba','','SA',0,0,0,'[\"FLTOPS06\"]','[\"COMMS\"]','Vehicular Runway Incursion','The pilot had to carry out a go-around from below 500\' on final approach rwy 12 Moomba due to a vehicle entering the runway strip via twy B. After establishing all clear a normal approach and landing (rwy 12) was made at 1007. The Moomba airport manager was advised of VEJ arrival on 126.4 at 0850 local including a circuit time of 0900 and blocks at 0905. All calls made on CTAF 126.7 were standard including a circuit join and left base rwy 12. The white vehicle with yellow flashing light was seen driving across the apron down twy B (without stopping at the hold point) and continue onto the runway centerline hdg NW. No calls were heard and no advice given re possible vehicle movement. Due to the vehicle\'s unknown intention an immediate go around was commenced from approx 350\' on final rwy 12. the vehicle then spotted the go-around and vacated the gable markers to the south. A safe approach could not be commenced at this time and the go-around continued. This is not the first incident of this type at Moomba. Previous incidents involving the same pilot include 06 May 2010 and 25 may 2010. Pilot comment: The vehicle continued onto the runway without stopping at holding point B and was not aware of my approach until the go-around commenced.','The matter has been reported to the client by their internal safety reporting system.','The senior base pilot will investigate and inform the Safety Committee of what safety measures are in place to prevent vehicle movements on the runways at Moomba.','',NULL),(968,258,'group','','2','2011-02-06 01:16:00','2010-12-23 13:00:00','2010-12-22 12:59:00','2011-02-06 01:16:00','Nick Faulks','[\"10\",\"8\"]','Metro 23','VH-VEK','50nm West of Sydney','','NSW',0,0,0,'[\"FLTOPS05\"]','[\"EQUIP\"]','Metro Engine Failure','\"The aircraft was 50nm WSW of SY enroute to AD at FL120 when the RH engine stopped without warning. There were no signs of poor performance or low oil pressure/high oil temp preceding the event. The First Officer was the PF at the time, and he inputed rudder as was required to maintain heading. After the Captain determined that there had been an engine failure, and was unaware of the cause,he elected to shutdown the engine in accordance with the company procedures. A PAN was then declared with intentions to return to land in SY. The crew were offered RWY 07, but advised that RWY 34L would be more suitable due to the wind and RWY length available. All checklists were completed and with 15nm to run the Captain took over as PF to carry out the landing. The aircraft landed and taxied uneventfully to the Domestic 5 apron, albeit approx 40KG overweight.\"','\"The R/H Engine driven fuel pump was found to have failed internally. A serviceable fuel pump was installed IAW the TPE 331-12 Maintenance Manual Chapter 73-20-01. Engine ground runs were carried out and adjustments carried out to the max power adjustments IAW TPE331-12 Maintenance Manual Chapter 72-00-00 Page 580 and 581 Defective Engine Driven Fuel Pump Details were: Pump P/No 897400-7 Pump S/no P6485 TSO 2,880.4 Hrs CSO 2297 cycles A SDR was submitted to CASA on the 23rd December 2010 - SDR Receipt # 210033506. The Honeywell Field Service Representative for the TPE331 Engines in Australia was informed of the pump failure and was provided with the pump details. CASA was informed of the cause of the Engine un-commanded shutdown through the Corporate Air CASA Airworthiness Inspector.\"','','',NULL),(969,257,'group','','2','2011-02-06 01:11:00','2010-12-16 13:00:00','2010-12-14 13:00:00','2011-02-06 01:11:00','','[\"10\",\"8\",\"9\",\"7\",\"6\"]','Not applicable','Not applicable','Goulburn','','NSW',0,0,0,'[\"ENGCO\"]','[\"COMMS\"]','Incorrect Mezzanine Gate Used.','\"Staff were observed moving stock from the upper mezzanine level of the Goulburn Hangar using forklift through the original central gateway not the new OHS approved gate located in Area E. The reason was that stock could not be moved through the correct gate due to the new heating units blocking pallet access from Area E to Area F. Inquiries with staff present at the time determined that none of the staff were aware the old gate was not to be used. A check of the Group Safety minutes showed the new gate being installed and the case closed but no notice that the old gates were not to be used. The current MRO Manager was not present at the time of this case. A further check of the Risk Register shows the risk of falling from open gates as acceptable, this would assume the use of the new OHS gate not the other old gate. It is considered that an urgent notice is required to ensure the old gate is not used unless in cases of extreme emergencies.\"','The gate has been chained and locked and the only two keys are kept by management for emergency use.','','',NULL),(970,256,'group','','2','2010-12-17 01:56:00','2010-12-04 13:00:00','2010-11-30 13:00:00','2010-12-17 01:56:00','Scott Lemon','[\"10\",\"8\"]','Metro 23','VH-VEJ','Ballera','','QLD',0,0,0,'[]','[\"DESIGN\"]','Door Stay Covers Not Attached Properly','The aircraft has new covers for the main door cable stays. They are approx 400 mm long or about half the cable length. The forward cable cover was detached at the start of the pilot\'s shift shift. He retied the cover back in place with the supplied velcro fittings bu it was not enough to stop the cover from detatching. Not until the pilot lost his balance exiting the aircraft on an empty sector did he observe all exiting passengers grasping the cable stay in the exact same place. All such cable covers should be removed and modified to prevent a potential slip and fall accident. Wed 01 dec 2010','The pilot recommends that all such cable covers should be removed and modified to prevent a potential slip and fall accident. The Safety Manager put the pilot in contact with the acting MRO Manager and a temporary fix was initiated.','','',NULL),(971,255,'group','','2','2010-12-17 01:56:00','2010-11-30 13:00:00','2010-11-30 13:00:00','2010-12-17 01:56:00','Denis Gailey','[\"10\",\"8\"]','Cessna 441 Conquest','VH-VEJ','Mt Margaret','','QLD',0,0,0,'[]','[\"EQUIP\"]','Intermittent Radio Failure','\"The aircraft experienced an intermittent radio failure between Ballera and Mt. Margaret. A radio technician with a hand held transceiver on the ground was used to check the radios and all systems were functioning normally. After take-off for Charleville, hash was heard in the pilots headset. He was unable to rectify this after trouble shooting. He elected to remain below controlled airspace (FL180), followed ERSA procedures and squawked 7600. He changed headsets, used both PTT\'s and could only receive by turning the Com selector to \"\"CABIN\"\". He suspected there was an open mic. He switched to 126.7 and acivated AFRU\'s close by The hand mic. was removed from l/h/s jack to r/h/s and the fault cleared. He was unable to replicate the fault later on the ground at Ballera.\"','A common cause for this fault is the microphone plug not being inserted fully into the jack.','','',NULL),(972,254,'group','','2','2010-12-17 01:55:00','2010-11-30 13:00:00','2010-11-30 05:00:00','2010-12-17 01:55:00','Scott Lemon','[\"10\"]','Cessna 441 Conquest','VH-VEJ','Ballera','','QLD',0,0,0,'[\"FLTOPS07\"]','[\"ENVIRO\"]','Kite Hawks at Ballera','\"The aircraft was landing on runway 03. The pilot had to carry out go-around because of kite hawks on the approach path, touch down point and mid strip preventing a long landing option. Normal approach and landing was then performed on rwy 21.\"','','','',NULL),(973,253,'group','','2','2010-12-17 01:54:00','2010-11-30 13:00:00','2010-11-24 13:00:00','2010-12-17 01:54:00','Karl Paton','[\"10\",\"8\"]','Cessna 404 Titan','VH-VEA','Canberra','','ACT',0,0,0,'[\"FLTOPS01\"]','[\"ENVIRO\"]','Bird Nest in Tail Plane','\"During pre flight on the pilot found what looked like a birds nest inside the vertical fine. He attempted to remove most of the nest until it looked clear. Arriving in YSSY he checked again to find more nesting products still visible. He tried to remove as much as possible, but on return to YSCB he noticed that there was still some evidence of the birds nest.\"','','With the recent mowing of the grass at Canberra Airport it has given the birds ample nesting materials to build their nests. Evidence was also found of bird droppings towards the rear of this aircraft. Thorough diligence in pre-flighting the aircraft is paramount because of the ability of the birds to quickly nest in an enclosed area such as the tailplane. The only recommendations to alleviate this is proper pre- flight and if a nest is found the pilot should attempt to remove any product left by the birds.','',NULL),(974,252,'group','','2','2010-12-17 01:32:00','2010-11-28 13:00:00','2010-11-23 13:00:00','2010-12-17 01:32:00','Antony Springer','[\"10\"]','Cessna 441 Conquest','VH-VEZ','Newlands','','QLD',0,0,0,'[\"FLTOPS07\"]','[\"ENVIRO\"]','Kangaroo Hazard','\"The aircraft was tasked with a flight: BN-OAY-NEW-EML-BN. During the landing phase of the OAY-NEW leg, two Western Grey Kangaroo\'s entered the runway 400 metres from the threshold when the aircraft was on very late final at approximately 30 - 50 feet. TOGA power was applied with the aircraft flying a complete circuit. Upon touchdown of the completed go-around circuit, the afore-mentioned macropods re-enterd the runway from grass and bush at the side of the strip and proceeded to cross in front of the aircraft. Maximum reverse thrust and braking was applied to avoid a collision, with one of the animals being cleared by less than 30 metres. During the subsequent taxi two Plain Turkeys also entered the strip and flew directly in front of the aircraft. When the aircraft was parked a brief conversation with the client was undertaken to brief them on the occurrence. As this was not the first instance of a go-around they were relatively unperturbed. The client may investigate animal reduction measures as a result of this hazard.\"','','','',NULL),(975,251,'group','','2','2010-12-17 01:51:00','2010-11-22 13:00:00','2010-11-19 23:45:00','2010-12-17 01:51:00','Nick Faulks','[\"10\",\"8\"]','Metro 23','VH-VEU','Moree','','NSW',0,0,0,'[\"FLTOPS03\"]','[\"ENVIRO\"]','Metroliner Becomes Bogged','\"As the aircraft commenced taxying from the parking area adjacent to windsock, and had covered approximately 2 metres, both main gear tyres sank into the pavement. The aircraft mass was about 7000 Kg. The passengers were offloaded and escorted into the terminal building, both engines were then started and the aircraft moved forward. The landing gear was inspected with no damage observed. The flight resumed normally albeit 30 minutes late.\"','','','',NULL),(976,250,'group','','2','2010-12-17 01:51:00','2010-11-18 13:00:00','2010-11-18 13:00:00','2010-12-17 01:51:00','Bill McIntyre','[\"10\",\"8\",\"9\",\"7\",\"6\"]','Not applicable','Not applicable','Canberra','','ACT',0,0,0,'[\"ENGEXT\"]','[\"EQUIP\",\"TECH\"]','Flight Safety Audit Results','\"As a result of a recent audit by Flight Safety, the following was found: Finding: The current version of the COA mandates that maintenance carried out at a temporary location must be carried out in accordance with the provisions of para 6.4 of the Vee H Aviation Pty Ltd Maintenance Procedures Manual. The manual used to capture CAR30 requirements is actually titled ÒMRO Organisation ExpositionÓ Procedures relating to maintenance at temporary locations is detailed in 2.4.4.3. Before any maintenance is carried out at a temporary location, the current procedures must be approved by CASA and Schedule 2 of the COA amended accordingly. Finding: Hardware was found stored in Ògrab traysÓ in the Goulburn hangar. Whilkst it is industry practice to have Ògrab traysÓ in the hangar to store commonly used hardware, it is not acceptable to not have traceability documentation for each batch. Parts without conformance documentation must not be fitted to aircraft. Observation: The front of the tyre storage racks was covered with an appropriate cover however the sides are not. The entire rack should be covered to minimise the risk of degradation to the tyres. Observation: All personnel who conduct internal audits should receive internal auditor training (the two day course is sufficient)\"','The Company will address the findings and observations','All items have been addressed.','',NULL),(977,249,'group','','2','2010-12-17 01:50:00','2010-11-18 13:00:00','2010-11-17 13:00:00','2010-12-17 01:50:00','','[\"10\",\"8\"]','Not applicable','Not applicable','Canberra','','ACT',0,0,0,'[\"ENGCO\"]','[\"EQUIP\"]','Out of Date Hydraulic Fluid','During an inspection of the pilots cupboard in the Pialligo store room the tins of hydraulic fluid were found to be time expired. The tins were quarantined & returned to the Goulburn store.','The manufacturerÕs data shows the shelf life is totally different to the Inspection time limit and in fact is the Inspection date and not the shelf life that appears on the can.','','',NULL),(978,248,'group','','2','2010-12-17 01:48:00','2010-11-10 13:00:00','2010-11-11 02:00:00','2010-12-17 01:48:00','Paul Kell','[\"8\"]','Not applicable','Not applicable','Canberra','','ACT',0,1,0,'[\"ENGCO\"]','[]','Employee Strikes Head','As he was getting into the drivers seat of the VW truck the employee hit his head on the top of the doorway causing a light graze on the top of his head. He heard a crack as a result of the compression of his neck. He is monitoring the situation and will seek medical treatment if required.','','','',NULL),(979,247,'group','','2','2010-12-17 01:48:00','2010-11-07 13:00:00','2010-11-05 13:00:00','2010-12-17 01:48:00','','[\"10\",\"8\",\"9\",\"7\",\"6\"]','Not applicable','Not applicable','Canberra','','ACT',0,1,0,'[\"COYGEN\"]','[\"EQUIP\"]','Potential Knee Injury','When opening the rear door of the cabin cleaning van the yellow crate containing the aircraft vacuum cleaner slipped out and hit a Ground Handling employee on the knee. The employee was in some discomfort but no action or medical treatment was required. The Ground Handling Manager was not notified of the accident until 0900 Monday 8th Nov 2010. An Early Notification of injury form has been completed.','The Manager GH will generate a NOTGH regarding storage in the van and replacement of the van in the new year is under consideration.','','',NULL),(980,246,'group','','2','2010-12-17 01:47:00','2010-11-03 13:00:00','2010-11-01 23:00:00','2010-12-17 01:47:00','Scott Lemon','[\"10\",\"8\",\"9\",\"6\"]','Cessna 441 Conquest','VH-VEJ','Moomba','','SA',0,1,0,'[\"COYGEN\"]','[\"INDIV\"]','First Aid Kit Inadequate','The pilot was loading baggage and freight when he lifted a finger nail off its bed. The aircraft first aid kit did not contain any bandaids. Further inspection revealed empty saline solution vials (x2) and after opening the alcohol wipe (1 only!) found it had dried up. The pilot was able to seek treatment from the terminal before returning to work.','When the aircraft returned to Goulburn for servicing the first aid kit was inspected and found to be properly stocked. It is suspected that there may have been two first aid kits in the aircraft.','','',NULL),(981,245,'group','','2','2010-11-03 02:58:00','2010-10-28 13:00:00','2010-10-25 13:00:00','2010-11-03 02:58:00','Scott Lemon','[\"10\"]','Cessna 441 Conquest','VH-VEJ','Ballera','','QLD',0,0,0,'[\"FLTOPS07\"]','[\"ENVIRO\"]','Kite Hawks at Ballera','A go-around on arrival at Ballera had to be performed owing to Kite hawks at both the 03 threshold (12 birds) and mid-strip (15 birds). Despite attempts by Cobham to clear the strip the birds are returning and settling once the vehicle is clear.','The matter has been reported to the Cobham Safety Department. The Safety Manager will email Flight Safety (auditors for Santos) and inform them of the issue for the upcoming audit and send an advice to Cobham for information. Albert will develop guidance for Cooper Basin pilots on dealing with birds.','','',NULL),(982,244,'group','','2','2010-11-03 02:55:00','2010-10-18 13:00:00','2010-10-17 23:00:00','2010-11-03 02:57:00','Scott Lemon','[\"10\"]','Cessna 441 Conquest','VH-VEJ','Ballera','','QLD',0,0,0,'[\"FLTOPS07\"]','[\"ENVIRO\"]','Kite Hawks at Ballera','The aircraft had to perform two go arounds at Ballera owing to kite hawks on the length of the runway. Cobham were not immediately available due to SAR ops preventing the airport manager from bird fright duties but when the vehicle was used it was very ineffective for the second approach causing another go around.','The Safety Manager will email Flight Safety (auditors for Santos) and inform them of the issue for the upcoming audit and send an advice to Cobham for information. Albert will develop guidance for Cooper Basin pilots on dealing with birds.','','',NULL),(983,243,'group','','2','2010-10-13 04:28:00','2010-10-10 13:00:00','2010-10-10 13:00:00','2010-10-13 04:28:00','Denis Gailey','[\"10\",\"8\"]','Cessna 441 Conquest','VH-VEJ','Mt Margaret','','QLD',0,0,0,'[\"ENGCO\"]','[\"EQUIP\"]','VEJ Tyre Defaltion','\"The R/H tyre partially deflated whist on the ground for 3.5 hours at Mt. Margaret. Pressure checked and was 50 psi (normal = 95). Nitrogen cylinder, tools and pressure gauge from Santos stores Mt. Margaret was sourced and tyre inflated to 97 psi. The tyre pressure is continuing to be monitored.\"','','','',NULL),(984,242,'group','','2','2010-10-13 04:26:00','2010-10-10 13:00:00','2010-10-07 06:29:00','2010-10-13 04:26:00','Mark Norriss','[\"10\",\"8\"]','Metro 23','VH-VEK','Launceston','','TAS',0,0,0,'[\"ENGCO\",\"FLTOPS07\"]','[\"EQUIP\"]','Landing Gear Indicator Bulbs Blown','The aircraft was approaching YMLT for a landing. Upon commencing the RWY 32 ILS approach the right hand main gear indicator did not show any green lights. During the approach the gear was recycled a number of times and a missed approach was conducted at the minima. The tower controller informed the crew that the gear appeared to be down as view by him and the fire controller. The bulb test indicated that both green lights on the right hand gear indicator bulbs had blown and both red lights were functioning normally. Due to the moderate to severe turbulence it was considered impractical by the crew to attempt to change the light bulbs. Both crew were certain that the gear was down and locked and that the cause of the problem was due to the blown globes. As an additional precaution a manual extension procedure was conducted and the aircraft was circled to land for RWY 32 with airport fire services on standby. The landing was conducted without incident and the aircraft taxied to the parking bay. The Chief Pilot will be counseling the crew about this incident.','The crew have been counselled about the correct procedure to be followed.','','',NULL),(985,241,'group','','2','2010-10-13 04:22:00','2010-09-27 14:00:00','2010-09-28 00:59:00','2010-10-13 04:22:00','Scott Lemon','[\"10\",\"8\"]','Cessna 441 Conquest','VH-VEJ','Ballera','','QLD',0,0,0,'[\"FLTOPS07\"]','[\"ENVIRO\"]','Birdstrike at Ballera','The aircraft was operating on flight NC41 from Moomba to Ballera. On landing at Ballera the aircraft struck a kite hawk on the top of the left spinner and engine cowl just after touchdown. There was no observed damage to the aircraft. An intact kite hawk carcass was removed from centerline of runway 03 at approximately the 1200 foot mark. The Chief Pilot is addressing this matter.','The increased bird hazard risk in the Cooper Basin will be raised with Cobham.','','',NULL),(986,240,'group','','2','2010-10-13 04:25:00','2010-09-23 14:00:00','2010-09-23 14:00:00','2010-10-13 04:25:00','Scott Lemon','[\"10\"]','Cessna 441 Conquest','VH-VEJ','Mooba','','SA',0,0,0,'[\"FLTOPS01\"]','[\"COMMS\"]','Aircraft Load Incorrect','\"The aircraft was operating on flight NC41 between Moomba and Ballera. The freight loaded in Moomba was later found to be 45 kg less than what was shown on the paper work. As a safety measure the pilot prepared two loadsheets before departure for both the estimated load and paperwork certified loads. The aircraft was then dispatched with all parameters in relation to C of G and structural limits observed. There was no possibility of an overload situation. The error (although questioned as a discrepancy several times in Moomba) was discovered after unloading at Ballera. The consignment paperwork appeared to be in order and the labeling correct. However, one consignment of 6 different items totaling 46 kg appears to have been included twice. The original consignment note appeared on a small AAE envelope (1 kg)\"','The matter will be raised with Cobham.','','',NULL),(987,239,'group','','2','2010-09-22 00:35:00','2010-09-21 14:00:00','2010-09-20 14:00:00','2010-10-13 04:21:00','Gerry Hanstede','[\"10\"]','Cessna 441 Conquest','VH-VEJ','Ballera','','QLD',0,0,0,'[\"FLTOPS04\"]','[\"ENVIRO\"]','Birds at Ballera','\"On take-off, two kite hawks were sitting on the runway just past the 1000\' markers. They flew off when the aircraft started to get close to them. The birds did not impact the aircraft, but were most likely to be affected by wake turbulence of the aircraft. The aircraft was inspected after landing in Moomba and no bird strike damage was found.\"','An Air Safety Incident Report was submitted to Cobham.','The increased bird hazard risk in the Cooper Basin will be raised with Cobham.','',NULL),(988,238,'group','','2','2010-10-13 04:24:00','2010-09-14 14:00:00','2010-09-14 14:00:00','2010-10-13 04:24:00','Paul Kell','[\"10\",\"8\",\"9\"]','Metro 23','Not applicable','Canberra','','ACT',0,0,0,'[\"ENGCO\"]','[\"EQUIP\"]','Toilets in M23s','\"The reporter commented that the risk register did not contain anything about the risk of handling the toilets for the M23 aircraft. This included installation and removal, spillage and use of PPE. The Manager Ground Handling will address this risk.\"','The risk register has been updated to address this risk and NOTGH 13/2010 was issued as well as PPE equipment.','','',NULL),(989,237,'group','','2','2010-09-14 04:36:00','2010-09-13 14:00:00','2010-09-13 14:00:00','2010-10-13 04:21:00','Senis Gailey','[\"10\",\"8\"]','Cessna 441 Conquest','VH-VEJ','Moomba','','SA',0,0,0,'[\"FLTOPS04\"]','[\"ENVIRO\"]','Bird Strike','The aircraft had a bird strike event at Moomba airport. Reports were submitted to the ATSB and Cobham. NIL damage to aircraft. Fatal injuries to Kite Hawk. Scott Lemon later reported blood and guts UNDER the L/H stabiliser. No blood or guts on the leading edge or boots and no indentations. Normal operation continued.','The increased bird hazard risk in the Cooper Basin will be raised with Cobham.','','',NULL),(990,236,'group','','2','2010-10-13 04:20:00','2010-09-08 14:00:00','2010-09-07 14:00:00','2010-10-13 04:20:00','Brad Rule','[\"10\",\"8\"]','Cessna 441 Conquest','VH-VEY','Canberra','','ACT',0,0,0,'[]','[\"EQUIP\"]','Cabin Heat Not Working','On departure the pilot tried to introduce heat into the cabin with out success. On landing at the destination he rang and spoke to MRO who suggested looking at The ACM. One of the leads was not connected. When reconnected the system worked correctly.','There was no systemic failure with this event.','','',NULL),(991,235,'group','','2','2010-10-13 04:18:00','2010-08-31 14:00:00','2010-08-30 14:00:00','2010-10-13 04:18:00','Allister Polkinghorne','[\"10\",\"8\"]','Cessna 441 Conquest','VH-VEJ','Canberra','','ACT',0,0,0,'[\"ENGCO\",\"FLTOPS01\"]','[\"DESIGN\"]','Engine Bungs','\"There are a number of aircraft that have engine bungs without \'tails\'. The pilot arrived at the aircraft to find one of the inlet bungs was stuffed up against the first compressor stage and not visible from outside. The risk is obvious, if someone misses removing the bung and goes to start the engine. \'Tails\' on all the bungs, preferably with a prop loop will fix the the problem.\"','The matter will be discussed at the next Safety Committee meeting. Then Manager MRO will source and replace bungs as necessary.','All bungs have now been repaired.','',NULL),(992,234,'group','','2','2010-09-09 04:39:00','2010-08-31 14:00:00','2010-08-24 14:00:00','2010-09-09 04:39:00','Mike Bird','[\"10\",\"8\"]','Metro 23','VH-VEU','Roma','','QLD',0,0,0,'[\"ENGCO\"]','[\"EQUIP\"]','Fuel Leak','\"A significant fuel leak was noted during the daily inspection on the aircraft whilst on a charter in Roma QLD. The aircraft was deemed to be unserviceable and the operations and Maintenance departments were notified. An alternative aircraft was organised from Brisbane to facilitate the requirements of the passenger movements from Roma whilst a second aircraft was organised to transport engineers to Roma to conduct repairs. By 1600 the same afternoon the fuel leak had been repaired and the aircraft was put back into service. Due to the amount of fuel lost from the aircraft overnight, the tarmac area underneath the aircraft was damaged, requiring an inspection from the Roma councils resident engineer. A hazard report form was completed and given to the Airport Reporting Officer, no other comments were made by council staff. The clients were happy with the handling of the fuel leak and the charter was completed in VEU the next day.\"','Investigation found a phenolic plate had not adhered to sealant. The sealant and plate were replaced and the leak stopped.','The speed at which this incident was handled by both Operations and Engineering is to be commended.','',NULL),(993,233,'group','','2','2010-10-13 04:17:00','2010-08-27 14:00:00','2010-08-25 14:00:00','2010-10-13 04:17:00','Andrew Major','[\"10\",\"9\"]','Cessna 441 Conquest','VH-VEJ','Canberra','','ACT',0,0,0,'[\"FLTOPS01\"]','[]','Innappropriate Ground Handling','\"A staff member was observed to transfer freight from the main door of a freight configured Conquest to a location adjacent to the nose locker by lobbing fully laden mail bags over the wing, inboard of the nacelle. This had a real potential to damage the aircraft. A Company tug, when delivering freight to a Conquest, manouvered under the horizontal stabiser and very close to the flap. Whilst this manoeuvre was conducted at a reasonable speed and with care, it also posed the real risk of damaging the aircraft. The cones were in place at the time. A Company tug, was observed to reposition from an aircraft at unreasonable speed whilst conducting a tight turn. The matter is being investigated.\"','NOTGH 10/2010 has been issued.','','',NULL),(994,232,'group','','2','2010-12-17 01:45:00','2010-08-27 14:00:00','2010-08-24 07:37:00','2010-12-17 01:45:00','Allister Polkinghorne','[\"10\",\"8\"]','Beech 58 Baron','VH-VEG','18 nm SSE Katoomba','','NSW',0,0,0,'[\"FLTOPS05\"]','[\"EQUIP\"]','Catostrophic Engine Failure','\"OCCURRENCE While in the cruise at 6000 feet with the autopilot engaged, there was a loud thump followed by light vibration. With light to moderate turbulence and the autopilot engaged, there was limited immediately detectable yaw. The turn balance indicator ball moved to the right about quarter scale. A quick oil pressure check showed oil pressure at the bottom of the green arc. With the continuing vibration and low oil pressure, the left engine was identified as having failed . It was feathered within 5 seconds of identification of failure. By this stage, a small amount of oil was visible of the front of the cowl and there was visible damage to the top of the cowl. The propeller feathered fully and propeller stopped. The aircraft was re-trimmed with 5¡ angle of bank towards live engine and the balance ball at a quarter scale deflection towards live engine. The aircraft flew at about 125 knots and maintained 6000 feet. No emergency was declared but ATS was advised that there was an engine failure. There was no acknowledgement from ATS except for the change of flight plan and landing point. LANDING SITE SELECTION Given the choices of landing at Bankstown, Bathurst or Goulburn, Goulburn was the choice for the following reasons: ¥ there was high ground between aircraft position and Bathurst; ¥ there were very limited forced landing areas available between the aircraft position and Bankstown; ¥ there were very limited forced landing areas available between the aircraft position and Bathurst; ¥ the flight time difference between the three alternatives was within five minutes; ¥ the pilot was reasonably familiar with Goulburn and less familiar with Bathurst and Bankstown; and ¥ Company ground staff at Goulburn had been contacted by phone and were standing by for the arrival ready to assist the pilot LANDING Goulburn township lights were visible from approximately 20 nautical miles. At about 12 miles from the airport the pilot activated aerodrome lights and the aircraft was manoeuvred to a long final for runway 22. A steady rate of descent of about 600 feet a minute was set up in the clean configuration at 120 knots. At about 2 miles from touchdown 15¡ of flap was extended. At about 1.5 miles from touchdown the landing gear was extended. Full flap was selected about 300 feet AGL. Touchdown and landing was uneventful. The aircraft was kept rolling, taxied to the right-hand side of the runway and turned left. Speed was maintained for the backtrack and as a result was possible to reduce the power and a roll off the runway with another left-hand turn to park the aircraft on the edge of the parking area. SAR was cancelled by telephone after shutdown. The failed engine had 534.1 hours to run. The reason for the engine failure is being investigated\"','Examination of the engine shows that a conrod became detached from the crankshaft of number 6 cyclinder. CASA has been sent materials for examination.','CASA seems unable to provide advice on the cause of the failure.','',NULL),(995,231,'group','','2','2010-09-09 02:42:00','2010-08-22 14:00:00','2010-08-22 21:29:00','2010-09-09 02:46:00','Brad Rule','[\"10\",\"8\"]','Cessna 441 Conquest','VH-VEJ','Canberra','','ACT',0,0,0,'[\"FLTOPS03\"]','[\"DESIGN\"]','Main Wheel Deflation','Once cleared to taxi onto runway 35 at Canberra the pilot heard a vibration from the right main wheel. He stopped about 20m inside the runway as there was a flat tyre. The tower and ground handling was informed and the aircraft was removed from the runway.','\"Inspection of the tyre has found an obvious puncture mark which can be attributed to Foreign Object Damage. With regard to previous tyre deflations on VEJ, this incident is believed to be totally co-incidental.\"','Tyre pressures are now being checked in all aircraft on a weekly basis. Tyre gauges will be sent to the Cooper Basin to keep track of tyre pressures.','',NULL),(996,230,'group','','2','2010-08-23 13:56:00','2010-08-22 14:00:00','2010-08-18 12:00:00','2010-08-23 13:56:00','Mark Norriss','[\"10\"]','Metro 23','VH-VEK','Melbourne','','VIC',0,0,0,'[\"FLTOPS06\"]','[]','Laser Illumination','\"Whilst conducting the Boyse 3 Victor arrival into Melbourne, the aircraft was illuminated by a green laser at a point roughly 20nm N/E of the field. This matter was reported to ATC. No injuries to the crew occurred.\"','','','',NULL),(997,229,'group','','2','2010-07-26 06:19:00','2010-07-24 14:00:00','2010-07-22 04:52:00','2010-07-26 06:19:00','Scott Lemon','[\"10\",\"8\"]','Cessna 441 Conquest','VH-VEJ','Moomba','','SA',0,0,0,'[\"FLTOPS08\"]','[\"EQUIP\"]','Main Wheel Deflation','The aircraft landed on RWY 12 at Moomba with a deflated RH main tyre. An external inspection by another taxiing aircraft confirmed the RH main (not the nose) had deflated. The aircraft was taxied clear of the runway at taxiway Bravo then shutdown and secured at the holding point. Post flight inspection of the aircraft revealed nil aircraft damage and an intact main tyre loose on the wheel. Post flight inspection of both the Moomba and Ballera runway strips showed no associated debris and markings at Moomba confirm the tyre was deflated before touchdown.','\"Background The aircraft departed Ballera Airport in Queensland at 14:58 EST to Moomba in South Australia as part of the regular shuttle service in support of Santos operations in the Cooper Basin. There were four passengers and one pilot on board the flight. The take-off was normal with a slight left crosswind during the take-off roll. The aircraft set course for Moomba and climbed to 16,000 feet. Upon arrival at Moomba the aircraft was positioned for a left downwind leg for runway 12. The approach was normal and the aircraft touched down gently on its main wheels at the 1,000 foot marker with no wheel braking and using the braking action of the propellers to slow the aircraft. After about 200 metres of the landing roll the pilot noticed that the aircraft was gradually diverging to the right and applied left rudder to correct this and keep the aircraft on the runway centre line. The pilot suspected that he had a flat tyre and the aircraft was slowed to a halt adjacent to taxiway B (the first taxiway on the right). A Rossair aircraft was holding at this taxiway for take-off and the two pilots discussed the situation. The pilot of the Rossair aircraft was able to confirm that the right hand main wheel tyre was deflated, that the tyre was still on the rim and there appeared to be no damage to the aircraft. The Rossair aircraft taxied out onto the runway for take-off and VH-VEJ was taxied clear of runway 12 onto taxiway B and shut down to prevent any damage to the main wheel or the taxiway surface and to allow the aerodrome to remain open for other aircraft operations. The passengers exited the aircraft and were escorted to the terminal and the aircraft was secured. Company Action The pilot, accompanied by a Santos employee, went out and inspected the runway to determine if there was anything that may have punctured the tyre. They found nothing on the runway. The airport manager at Ballera was alerted to the situation and he conducted a check of that runway to ensure that it was also clear. He found nothing on the runway. Another Company aircraft was flown to Moomba to continue normal Cooper Basin operations. A Company engineer replaced the main wheel on VEJ and the aircraft was repositioned back to Canberra. On return to Canberra, the tyre was removed from the rim and inspected. It was apparent from the inspection that the tyre had been punctured by a foreign object where the tyre comes in contact with the runway. The foreign object had not remained in the tyre casing. The attached photographs show the hole in the tyre projecting from the outside surface through to the inner surface of the tyre Findings The tyre had been punctured by a foreign object at Ballera and the tyre had deflated during the flight to Moomba. The pilot had down everything to minimise the control difficulties presented by the deflated tyre and had correctly cleared the runway at Moomba and then shut the aircraft down on the taxiway to prevent further damage to either the aircraft or the taxiway and apron surface. Safety Action There is no safety action that the Company can take to prevent a reoccurrence of this incident.\"','','',NULL),(998,228,'group','','2','2010-08-09 06:42:00','2010-07-15 14:00:00','2010-07-15 14:10:00','2010-08-09 06:42:00','Mark Norriss','[\"10\",\"9\"]','Metro 23','VH-VEU','Melbourne','','VIC',0,0,0,'[\"FLTOPS01\"]','[\"INDIV\"]','Loader Strikes Aircraft','After completion of aircraft loading the belt loader safety guard was not retracted before the belt loader was reversed from the aircraft. This resulted in the safety guard making contact with the cargo door. This incident was witnessed by the First Officer whom saw the aircraftÕs tail move and then noticed the safety guard in contact with the cargo door. The aircraft Captain was in the cockpit at the time of the incident and did not notice any abnormal aircraft movement. The cargo door was then inspected by both the Captain and First Officer. No damage or abnormality was observed. It was determined that the amount of movement of the aircraft tail was similar to that of pulling on the door or entering the cargo bay. It was determined by the crew that no safety of flight risk existed and the decision to conduct the return flight was made. The remainder of the flight occurred without incident. On return to Canberra a notice to engineering form was completed (green slip) and the Chief Pilot was informed of the incident later in the day during Business hours.','\"Recommendations: Ensure that ground staff in Melbourne receive sufficient training, to ensure that the safety guard is retracted before reversing the belt loader. The matter has been reported to AAE management.\"','Australian Air Express were notified of the event.','',NULL),(999,227,'group','','2','2010-07-13 04:45:00','2010-07-12 14:00:00','2010-07-03 14:00:00','2010-07-13 04:45:00','Scott Lemon','[\"10\",\"8\"]','Cessna 441 Conquest','VH-VED','Ballera','','QLD',0,0,0,'[\"FLTOPS01\"]','[\"EQUIP\"]','Bird\'s Nest in Spinner','A Zebra finch bird\'s nest (including egg) was removed from the left spinner of the aircraft during cleaning. There was evidence of nesting work in progress in the RH spinner. The aircraft had been idle for less than 48 hours. Finches had been spotted in nacelles and the interior of the aircraft during turnarounds up to a week earlier.','','','',NULL),(1000,226,'group','','2','2010-08-02 22:18:00','2010-06-29 14:00:00','2010-06-29 14:00:00','2010-08-02 22:18:00','Rob Boyes','[\"7\",\"6\"]','Not applicable','Not applicable','Canberra','','ACT',0,0,0,'[\"COYGEN\"]','[]','Findings from Santos Audit conducted on the 27/5/10','\"Reference Observations: 1 - Consider amending the ERP Team Leaders Checklist to ensure confirmation that Emergency Services agencies have been contacted. 2 - To ensure continuity of normal business activities in the event of an emergency response, consider appointing a person responsible for normal company operations while other management personnel are involved with the emergency situation. The Role and Functions should be included within the ERP. OUTSTANDING ISSUES CARRIED OVER FROM PREVIOUS AUDIT/S: All of the outstanding findings carried over from the audit conducted on behalf of Santos Limited on Corporate Air, dated 16th November 2009, reference FS_Santos_Corporate Air_16092009, have been satisfactorily closed out.\"','Santos Audit recommendation taken and added to ERP','','',NULL),(1001,225,'group','','2','2010-08-12 01:17:00','2010-06-29 14:00:00','2010-06-29 14:00:00','2010-08-12 01:17:00','Rob Boyes','[\"8\"]','Not applicable','Not applicable','Goulburn','','NSW',0,0,0,'[\"COYGEN\"]','[\"COMMS\"]','Items arising from ISO Audit on 29/6/10','1. Testing and tagging of portable electrical equipment has not been fully addressed at the Goulburn site. 2. WinAir & Stores Manuals were scheduled to be current by the 30th of June. This is was not acheived. 3. Heads of Department meeting minutes are not reviewing progress of action items.','','JimÕs Test and Tag is to test and tag at all facilities and consideration will be given to training a staff member for future testing and tagging.','',NULL),(1002,224,'group','','2','2010-08-12 01:18:00','2010-06-08 14:00:00','2010-06-08 14:00:00','2010-08-12 01:18:00','','[\"10\",\"8\"]','Cessna 441 Conquest','VH-VEZ','Oakey Creek','','QLD',0,0,0,'[\"FLTOPS08\"]','[\"EQUIP\"]','Engine Bogs Down','\"After a normal landing on runway 15, the pilot pulled the condition leavers to the start and taxi position at about 60kts. No reverse thrust had been used for the landing. Both pilots noticed that the right engine was bogging down to about 27% and the engine was shut down on the runway to prevent over temping. The pilots did not think that the EGT had gone through 770 deg. The pilot motored the engine to lower the internal temperature. The engine was then restarted normally and the aircraft taxied in to the parking area. The matter is being investigated.\"','AAMC & MRO have monitored the bogged down engine for a month and cannot find a fault.','','',NULL),(1003,223,'group','','2','2010-06-04 07:15:00','2010-06-03 14:00:00','2010-06-03 12:30:00','2010-06-04 07:15:00','Mark Norriss','[\"10\"]','Metro 23','VH-VEK','Melbourne','','VIC',0,0,0,'[\"FLTOPS07\"]','[\"ORGAN\"]','Go Around at Melbourne','The aircraft was on final approach for RWY 16. An Ethiad A340 aircraft aborted its and the pilot of the Company aircraft was instructed to conduct a missed approach. The missed approach was conducted in accordance with the published missed approach procedure. The aircraft was then vectored for an ILS on RWY 27 where a normal approach and landing followed.','','','',NULL),(1004,222,'group','','2','2010-08-02 22:17:00','2010-06-03 14:00:00','2010-06-02 14:00:00','2010-08-02 22:17:00','Brad Rule','[\"10\",\"8\"]','Beech 58 Baron','VH-VEB','Wagga Wagga','','NSW',0,0,0,'[\"ENGCO\",\"FLTOPS03\"]','[\"EQUIP\"]','Leaking Fuel Cap','\"While taxiing onto Runway 05 the pilot noticed fuel coming out of the tank cap. He turned around, vacated the runway, shut down and removed and replaced the cap. Further taxiing did not cause fuel to escape from the cap.\"','NOTAC previously issued','','',NULL),(1005,221,'group','','2','2010-06-01 05:34:00','2010-05-31 14:00:00','2010-05-31 14:00:00','2010-06-01 05:34:00','','[\"10\",\"8\",\"9\",\"7\",\"6\"]','Not applicable','Not applicable','Canberra','','ACT',0,1,0,'[\"ENGCO\"]','[\"EQUIP\",\"INDIV\"]','Back Injury','\"An AAMC staff member injured his back whilst sitting down in his office chair. He has been placed on Workers Compensation sick leave until cleared by a Doctor to return to work. Admin are organising a replacing chair, as this may have caused the problem.\"','','','',NULL),(1006,220,'group','','2','2010-08-02 22:17:00','2010-05-28 14:00:00','2010-05-26 12:30:00','2010-08-02 22:17:00','','[\"10\",\"8\",\"9\"]','Cessna 441 Conquest','VH-VEJ','Canberra','','ACT',0,0,0,'[\"FBOCO\"]','[\"INDIV\"]','Aircraft Tail Struck by GSE','Whislt moving the tug and cleaning cart forward one of the open doors on the cleaning cart came into contact with the underside of the tailplane causing a 5cm scratch. The Ground Handlers involved completed a Blue unserviceable form but did not make contact with anyone regarding the incident. The aircraft departed with passengers early the next morning. The Pilot nor the Ground Handler seeing the aircraft out were aware of the incident. This incident is very serious and could have resulted in a disaster had the aircraft have suffered internal damage from the collision. A full review of training and aircraft cleaning/loading procedures to be reviewed and audited. GHM completing immediately.','An immediate full review of training and aircraft cleaning/loading procedures is to be conducted and audited by the Ground Handling Manager.','\"NOTGH issued and all staff trained, AAE advised of policy\"','',NULL),(1007,219,'group','','2','2010-05-29 01:22:00','2010-05-28 14:00:00','2010-05-24 23:10:00','2010-05-29 01:22:00','Scott Lemon','[\"10\"]','Metro 23','VH-VED','Moomba','','SA',0,0,0,'[\"FLTOPS07\"]','[\"INDIV\"]','Vehicle on Runway at Moomba','The aircraft was on approach at Moomba. A Go-around had to made because a vehicle was on the runway. It was later identified that the vehicle (a spotless vehicle driven by Moomba security) was engaged in bird fright operations. No calls on 126.7 and 126.4 were answered once vehicle was spotted on the runway when the aircraft was at 500\' on final to runway 30 at Moomba.','','The matter has been reported to the Flight Safety auditors during a recent audit on behalf of Santos. They will report the matter to Santos management.','',NULL),(1008,218,'group','','2','2010-08-02 22:16:00','2010-05-28 14:00:00','2010-05-24 14:00:00','2010-08-02 22:16:00','','[\"10\",\"8\",\"9\"]','Not applicable','Not applicable','Canberra','','ACT',0,0,0,'[]','[\"INDIV\"]','Vehicles and Equipment Around Aircraft','\"It has been noticed recently that personnel have not been taking care when passing around aircraft with ground equipment, particularly between wing tips.\"','\"NOTGH issued and all staff trained, AAE advised of policy\"','','',NULL),(1009,217,'group','','2','2010-09-09 02:38:00','2010-05-28 14:00:00','2010-05-24 14:00:00','2010-09-09 02:38:00','','[\"10\",\"8\",\"9\"]','Not applicable','Not applicable','Pialligo','','ACT',0,0,0,'[]','[\"TECH\"]','Pialligo Gates','On two recent occasions (18:45 monday 17-5-2010 & 20:00 wednesday 19-5-2010) the gate at Pialligo has been left open contrary to Company policy. It was noticed that ground staff were in the Pialligo facility at time. The matter has been raised with the Manager Ground Handling who will take corrective action.','MGH is to investigate cost of automatic gates and light. Quotes obtained and issue is being discussed with other tenants. The lighting is to be installed ASAP','The lighting is now installed.','',NULL),(1010,216,'group','','2','2010-08-02 22:16:00','2010-05-28 14:00:00','2010-05-24 14:00:00','2010-08-02 22:16:00','','[\"8\"]','Not applicable','Not applicable','Goulburn','','NSW',0,0,0,'[\"ENGCO\"]','[\"EQUIP\"]','Safety Footwear at Goulburn','It has been noticed recently that not all personnel in the Goulburn Hangar are wearing safety footwear.','MRO staff have been reminded to wear appropriate footwear and be vigilant with non CA staff working in the Hangar to ensure compliance with Footwear policies','','',NULL),(1011,215,'group','','2','2010-08-02 22:16:00','2010-05-28 14:00:00','2010-05-11 14:00:00','2010-08-02 22:16:00','Rob Boyes','[\"8\"]','Not applicable','Not applicable','Goulburn','','NSW',0,0,0,'[\"COYGEN\"]','[\"INFO\"]','CASA Audit','As a result of the CASA Audit conducted at the MRO Hangar in Goulburn on the 12th of May 2010 6 Corrective Actions and 2 Observations were recorded. RCA - Tooling & Equipment x 2 RCA - Stores & Distribution x 3 RCA - Maintenance Activity x 1 OBS - Maintenance Activity x 1 OBS - Data & Documents x 1','All items from the CASA audit were cleared','','',NULL),(1012,214,'group','','2','2010-08-02 22:15:00','2010-05-28 14:00:00','2010-04-28 14:00:00','2010-08-02 22:15:00','Rob Boyes','[\"8\"]','Not applicable','Not applicable','Goulburn','','NSW',0,0,0,'[\"COYGEN\"]','[\"TECH\"]','HART Aviation Audit Findings','\"Following is the Management Summary of the HART Aviation Audit. The overall finding of this assessment is that the Corporate Air maintenance facility at Goulburn Airport has the required regulatory approvals and is appropriately equipped to provide satisfactory engineering and maintenance support for the Corporate Air fleet of aircraft to a professional standard in accordance with CASA regulations and consistent with its own company standards and manuals. This assessment is valid for 12 months, until 31 May 2011, subject to the following issues being addressed: ¥ storage of tyres needs to be monitored on a regular basis to ensure proper storage in accordance with recommended practices, ¥ Greater attention to HSE issues needs to be paid when using Òcherry pickersÓ for cleaning purposes, ¥ current procedures within the MPM are not being followed by the Stores, o (Revised procedures need to be agreed by the QA Manager, approved by CASA and incorporated into the MPM.) ¥ the use of discrete Corporate Air (AV) part numbers as opposed to manufacturer part numbers complicates traceability and is not preferred and, indeed, could possibly be interpreted as contrary to CASA regulations. This practice should be discouraged. o (At the very least, a cross reference of the AV and manufacturersÕ part numbers should appear on all documents.) ¥ two pitot static testers, listed under calibrated tools, could not be located, o (These tools should be found and calibrated or declared redundant and not to be used.) ¥ hearing protection in the vicinity of the standby generator should be mandatory when it is running, ¥ action should be taken to approve the current componentsÕ LAME for complete maintenance of all components, and ¥ some improvements are believed to be warranted within the components shop. o Old stove should be replaced, and o The need for tidiness is at a premium in view of the available restricted space.\"','All items from the HART Aviation audit were cleared','','',NULL),(1013,213,'group','','2','2010-08-02 22:15:00','2010-05-28 14:00:00','2010-05-10 14:00:00','2010-08-02 22:15:00','Rob Boyes','[\"10\",\"8\"]','Not applicable','Not applicable','Goulburn','','NSW',0,0,0,'[\"COYGEN\"]','[\"INFO\"]','Stores Audit Findings','\"A Stores Audit was conducted which found a number of non compliances, these have been forwarded to the relevant Department Heads for investigation. The major non conformances (Scores or 1 or 2) were: i. EA8.10 - Not all staff are acknowledging NOTMRO\'s. ii. EA10.31 - Stock inspection and stock take not being carried out. iii. EA11.5 - Calibrated tools held by staff not accounted for in CA system. iv. EA13.9 - Staff are working before they have completed the induction. v. EA2.6 - GSE Equipment maintenance reports are not available.\"','All items from the Stores audit were cleared','','',NULL),(1014,212,'group','','2','2010-05-17 08:07:00','2010-05-16 14:00:00','2010-05-04 14:00:00','2010-05-17 08:08:00','Nick FAulks','[\"10\",\"8\"]','Metro 23','VH-VEK','Sydney','','NSW',0,0,0,'[\"FLTOPS06\"]','[\"EQUIP\"]','Windscreen Cracks','When descending through FL140 the flight crew heard a loud crack and the Captain noticed a crack in his windscreen. The crack was accompanied by a large fork of St Elmos Fire. The aircraft had descended from F230 in cloud with icing conditions and St Elmos Fire. The aircraft was reduced to minimum safe speed and the cabin was depressurised. ATC was informed and minimum track miles were was requested. A normal visual approach and landing was conducted.','','','',NULL),(1015,211,'group','','2','2010-05-17 07:47:00','2010-05-16 14:00:00','2010-05-06 14:00:00','2010-05-17 07:47:00','Andrew Major','[\"10\",\"9\"]','Cessna 441 Conquest','VH-VEH','Melbourne','','VIC',1,0,0,'[\"FLTOPS10\"]','[\"EQUIP\"]','Leaking Freight','On arrival ML on a freight flight a gold mail bag was found to be leaking an unidentified liquid. AAE staff were alerted and quarantined the bag from rest of the freight. No leakage was apparent in nose locker where bag had been carried.','','','',NULL),(1016,210,'group','','2','2010-05-17 07:41:00','2010-05-16 14:00:00','2010-05-02 14:00:00','2010-05-17 07:48:00','Denis Gailey','[\"10\"]','Cessna 404 Titan','VH-VEC','Canberra','','ACT',0,0,0,'[]','[\"EQUIP\"]','NOTAC Not Complied With','\"With an early morning 0515 (dark) departure planned in for a 2 day charter, the pilot took the opportunity in the afternoon prior to check over the aircraft. There were no spare bottles of engine oils in the aircraft contrary to Notac 05/10. As there was ~ 8.5 hours flying involved, the pilot had to return to the office to collect 6 bottles of oil, 2 were required immediately and 4 extra for spares. There was no mention on the whiteboard of any requirements to this aircraft.\"','','','',NULL),(1017,209,'group','','2','2010-05-17 07:38:00','2010-05-16 14:00:00','2010-04-27 21:00:00','2010-05-17 07:38:00','Albert Stewardson','[\"10\"]','Cessna 404 Titan','VH-VEC','Warnervale','','NSW',0,0,0,'[\"FLTOPS07\"]','[\"ENVIRO\"]','Kangaroos at Warnervale','A pilot had to execute a missed approach because of Kangaroos feeding at the edge of the runway. The missed approach over the kangaroos caused them to vacate into the bush and an uneventful landing was carried out','','','',NULL),(1018,208,'group','','2','2010-05-10 06:27:00','2010-05-09 14:00:00','2010-05-09 14:00:00','2010-05-10 06:27:00','Darren King','[\"10\",\"8\",\"9\",\"7\",\"6\"]','Not applicable','Not applicable','Canberra','','ACT',0,1,0,'[\"FBOCO\"]','[\"ENVIRO\"]','Employee Stung by Wasp','A Ground Handler was out on the 34 Sqn tarmac seeing out an aircraft when he was stung by what looked like a wasp. He removed the stinger and applied an ice pack to the affected area. He rested in the staff area for at least half an hour before heading home for the day. He was told to closely monitor the sting area and if pain or symptons became worse to seek medical treatment asap and to keep the Manager Ground Handling up to date with any issues. He was advised by the Manager Ground Handling to seek medical treatment as a precaution regardless of any further developments from the sting.','','','',NULL),(1019,207,'group','','2','2010-08-02 22:15:00','2010-05-06 14:00:00','2010-05-05 14:00:00','2010-08-02 22:15:00','Bill McIntyre','[\"10\",\"8\",\"9\"]','Not applicable','Not applicable','Canberra','','ACT',0,0,0,'[\"FLTOPS10\"]','[\"EQUIP\"]','Difficulty Securing Portable Coolers','There is an ongoing problem with the portable coolers used in Company aircraft. They are difficult to secure to the seat rails or to the seats and in turbulence the lids can open and the contents can come out. The Manager Ground Handling is investigating better options for portable coolers in Company aircraft.','A sample portable cooler was displayed and all agreed it would alleviate the issue. DK will source the required number of coolers.','','',NULL),(1020,206,'group','','2','2010-05-05 02:12:00','2010-04-22 14:00:00','2010-04-21 14:00:00','2010-05-05 02:12:00','Scott Lemon','[\"10\",\"8\"]','Cessna 441 Conquest','VH-VEJ','Ballera','','QLD',0,0,0,'[]','[]','Different Nitrogen Gauge Fitted','\"The aircraft recently came out of maintenance with a different nitrogen bottle gauge. The gauge is different to the original and others in the C441 fleet in that it is, 1. smaller 2. set back from usual position 3. has a different gauge face. Any light condition including normal daylight requires a torch to see the gauge. There appears to be a full and empty mark, but there is no green band or scale.\"','Engineering will look at making the gauge easier to read.','','',NULL),(1021,205,'group','','2','2010-06-01 03:15:00','2010-04-22 14:00:00','2010-04-20 05:00:00','2010-06-01 03:15:00','Scott Lemon','[\"10\"]','Cessna 441 Conquest','VH-VEJ','Moomba','','SA',0,0,0,'[\"FLTOPS06\"]','[\"ENVIRO\"]','Bird Hazard At Moomba','The finals approach path to runway 12 had to be flown out of tolerance whilst avoiding kite-hawk. A go-around was performed and the subsequent landing on rwy 12 was uneventful after bird fright operations were conducted.','The Company will contact Cobham to try getting bird clearing operations conducted for C441 arrivals.','The Cooper Basin Senior Base Pilot has reported that bird fright operations are now being conducted for C441 aircraft as well as for BAe 146 Operations.','',NULL),(1022,204,'group','','2','2010-05-05 02:06:00','2010-04-18 14:00:00','2010-04-13 14:00:00','2010-05-05 02:06:00','Mark Norris','[\"10\",\"8\",\"9\"]','Metro 23','VH-VEU','Canberra','','ACT',0,0,0,'[\"FBOCO\"]','[\"INDIV\"]','GPU Plug Damaged','\"The aircraft Captain asked ground staff to arrange for the Ground Power Unit for a an engine start. The GPU was plugged in and the staff attempted to drive the tug away while the GPU was attached to the tug. This resulted in the GPU aircraft receptacle being damaged, the pins in the GPU receptacle were bent and the micro switch was rendered unserviceable.\"','Procedures will be put in place to ensure that the tug remains with the GPU unit at all times. Ground handling staff will be briefed on the safety critical nature of ground starts and GPU use and that this is to be their highest priority from a safety perspective. The leads on the GPU will be wound with reflective tape.','','',NULL),(1023,203,'group','','2','2010-03-31 05:30:00','2010-03-30 13:00:00','2010-03-29 13:00:00','2010-03-31 05:30:00','Bill McIntyre','[\"10\",\"8\",\"9\",\"7\",\"6\"]','Not applicable','Not applicable','Goulburn','','NSW',0,0,0,'[\"COYGEN\"]','[\"INFO\"]','EMERGENCY RESPONSE EXERCISE 2','\"Background At 13:18 EDST the Safety Manager (SM) notified one of the Goulburn hangar staff that, for exercise purposes, one of the CompanyÕs aircraft, Metroliner VH-VEU, had fallen from one of its jacks and the jack had punctured the port fuel tank of the aircraft causing fuel to spill on the hangar floor. Company Action At 13:19 EDST the Acting Manager MRO had been informed of the incident and had made his way down to the hangar floor to take charge. The Acting Manager MRO had a copy of the MRO ManagerÕs checklist to work from as a member of the Investigation Team but did not have a copy of the Team Leader Check List from the Emergency Response Manual as he was unaware that he could print it from the Company website. At 13:21 EDST engineers on the hangar floor had located the spill kit container and fire extinguishers and placed them near the wing of the aircraft. Unfortunately they did not know that the spill kit contained bunding material that would have contained the spill until one of the engineers discovered it some minutes later when looking through the contents of the container. At 13:24 EDST the Operations Manager in Barton was contacted an informed of the incident. At 13:26 EDST a simulated call was made to the Goulburn Fire Brigade to attend the hangar. At 13:28 EDST a decision was taken to turn off the hangar power at the switchboard and evacuate the building because of the spread of fuel to adjacent rooms. The Acting Manager MRO stated that he could not make a call on the public address system to evacuate the hangar as he didnÕt have the activation code. At 13:31 EDST the Safety Manager was informed of the incident. At 13:32 EDST a simulated phone call was received by the Acting Manager MRO from a local radio station seeking to confirm information they had that there was a major emergency at the Goulburn hangar complex. The exercise was terminated by the SM at 13:35 as he felt that the aim of the exercise had been achieved.\"','\"This exercise was aimed at determining how the staff working at the Goulburn hangar complex would react to an emergency situation likely to happen in their work place. It was the first practical emergency exercise conducted at the Goulburn hangar and there was no warning given beforehand. In general the staff, once realising that they had to deal with the emergency in a practical rather than theoretical manner, reacted well and with enthusiasm and started to work as a group to solve the problem of the fuel spilling from the wing of the aircraft. However, there was some confusion about what to do next once each task had been completed. A checklist of some kind may have been beneficial in this situation. The remote location of the Goulburn hangar means that the Manager MRO, or his deputy, has to be self reliant to deal with any emergency as the Company representative on the spot. The Team Leader Check List may have been more helpful for the Acting Manager MRO in dealing with this incident. For example, the call from the radio station could have been handled better if the Acting Manager MRO had the standard Company response available to him as outlined in the checklist. The various checklists from the Emergency Response Manual deal mostly with aircraft accidents, it would be beneficial to also consider incidents in the preparation of checklists for the various managers in future. The public address system is a vital piece of equipment to communicate with the workers in a complex as large as the Goulburn hangar. The activation code to use the PA needs to be near each phone so that if an emergency announcement is required, it can be made without delay. In this case there were people in the stores area and upstairs in the mezzanine area that had no idea that the building was being flooded with aviation fuel and was to be evacuated. These workers could have been trapped in the hangar if the fuel had ignited. While fire extinguishers were placed near the spill for use if necessary, hangar staff commented that the computer training that they had on their use was deficient as the computers on which they had viewed the training videos had no sound card and they couldnÕt listen to the audio. Enquiries made with central office indicate that sound cards are available on rrequest for the computers used for training purposes. It was highlighted to the Acting Manager MRO by the SM that all staff need to be fully trained and competent in the use of all safety equipment in the Goulburn hangar complex.\"','','',NULL),(1024,202,'group','','2','2010-03-31 05:27:00','2010-03-30 13:00:00','2009-11-29 13:00:00','2010-03-31 05:32:00','Bill McIntyre','[\"10\",\"8\",\"9\",\"7\",\"6\"]','Not applicable','Not applicable','Canberra','','ACT',0,0,0,'[\"COYGEN\"]','[\"INFO\"]','EMERGENCY RESPONSE EXERCISE 1','\"Background At 11:53am the Safety Manager (SM) called the Corporate Air switchboard and told the person answering the phone that, for exercise purposes, one of the CompanyÕs aircraft VH-VEK had been stolen at the Canberra Airport and that it had crashed into the center of the city in Canberra. Further calls were made during the course of the exercise representing the media and family members in an effort to try to elicit information from the company personnel who answered the telephone. Company Action At 11:55 EDST the master copy of the Emergency Response Manual (ERM) had been located, the Operations Control Centre (OCC) had been established and the checklists in the ERM were being followed (see attachment 1). The exercise was terminated by the SM at 13:00 as he felt that the aims of the exercise had been achieved.\"','\"This exercise was principally aimed at determining if the processes in the ERM would work in an emergency situation. It was the first emergency exercise that the company has had, and there was no specific warning given beforehand. In general, the processes outlined in the ERM were closely followed in a very timely manner and the required personnel were assembled to perform their duties as outlined in the ERM without delay. The first company member who took the original call, failed to establish who was reporting the occurrence and to obtain details that would have made the work of the various teams a little easier at the start. However, once the staff started to work according to the ERM, subsequent calls made by the SM were handled very well.\"','','',NULL),(1025,201,'group','','2','2010-03-30 22:30:00','2010-03-30 13:00:00','2010-03-29 13:00:00','2010-03-30 22:30:00','Mike Bird','[\"10\",\"6\"]','Not applicable','Not applicable','Pialligo','','ACT',0,0,0,'[\"COYGEN\"]','[\"INFO\"]','Incorrect Tracking of Approvals','A recent audit has discovered that some CASA approvals for Check and Training pilots have had errors which required corrections. The chief pilot is undertaking to have these issues corrected as soon as possible.','\"Crew Manager, the IT application used by the Company to track approvals, was found to be inadequate and has been modified and updated so that this problem should not occur again.\"','','',NULL),(1026,200,'group','','2','2010-06-01 05:09:00','2010-03-30 13:00:00','2010-03-23 18:30:00','2010-06-01 05:09:00','Tom Menogue','[\"10\"]','Beech 58 Baron','VH-VEB','Bankstown','','NSW',0,0,0,'[\"FLTOPS06\"]','[\"INDIV\"]','Orientation Difficulties at Bankstown','\"The aircraft was on a positioning flight from Canberra to Bankstown in the early morning. Sydney radar delayed the descent of the aircraft because of outbound traffic from Bankstown. As a result the aircraft was passing 4000 ft at 2RN. The TWR cleared the aircraft for a left downwind for RWY 29 but the pilot, who was not familiar with the airfield, had difficulty orienting himself because of his altitude, high work load on descent and not being able to make out the aerodrome lights. Once past the field to the east the aircraft turned away from Sydney control zone to remain clear of Sydney and back to the airfield where the aircraft overflew and a landing was conducted on RWY 11. After landing the pilot called the TWR who stated that a combination of height, lack of familiarity and the bright lights on Milperra road can make the aerodrome difficult to identify. The matter is being investigated.\"','The pilot involved has had a base check and has returned to line.','CASA is satisfied with the action taken by the Company.','',NULL),(1027,199,'group','','2','2010-04-29 08:23:00','2010-03-28 13:00:00','2010-03-24 13:00:00','2010-05-18 04:47:00','Nick Walsh','[\"10\",\"8\",\"9\"]','Metro 23','Not applicable','Melbourne','','VIC',0,1,0,'[\"FLTOPS01\"]','[\"COMMS\",\"DESIGN\"]','Freight Incorrectly Loaded','\"There have been several instances on Metro 23 freight flights where the loading of cargo in bay 1 has interfered with the closing of the main entrance door. Cases range from freight protruding through the freight net and fouling the rear gas strut, the cargo net being displaced to a point where articles then occupy the space required by the inbuilt air-stair with the door in the closed position, to two events where the freight boards had moved forward and jammed against the rear gas strut. In most cases the problem was noticed early, however one occasion it was necessary for the bay to be completely unloaded to facilitate re-positioning of the freight board. This problem seems to be endemic with loading operations in Melbourne however there have been occasions when the Metro was in Sydney and freight was loaded incorrectly. There appears to be too much play in the forward restraint net which allows loading personnel to push cargo into the entrance void.\"','NOTAC 04/10 has been issued to remind pilots to supervise loading.','','',NULL),(1028,198,'group','','2','2010-04-29 08:19:00','2010-03-22 13:00:00','2010-03-15 13:00:00','2010-05-18 04:47:00','','[\"10\",\"8\"]','Metro 23','VH-VEU','Goulburn','','NSW',1,1,0,'[\"ENGCO\"]','[\"EQUIP\"]','Aircraft Refuelled in Hangar','\"It was noticed that the aircraft was undergoing refuelling operations inside the hangar. All hangar doors were open, the fuel truck (Jet A1) was parked adjacent to the doorway threshold and the aircraft was being refuelled via the overwing filling points. The matter is being investigated.\"','NOTMRO 03/10 has been issued.','','',NULL),(1029,197,'group','','2','2010-04-29 08:15:00','2010-03-22 13:00:00','2010-03-20 13:00:00','2010-04-29 08:15:00','Andrew Duma','[\"10\",\"8\"]','Cessna 441 Conquest','VH-VEH','Canberra','','ACT',0,0,0,'[\"FLTOPS05\"]','[\"EQUIP\"]','EGT Excursion in Flight','\"The aircraft was flying enroute from Canberra to Leongatha. The aircraft was set up in cruise, in smooth non-icing conditions. Upon completion of the aircraft Trend in the Flight Record book, the pilot under supervision and supervisory pilot were in discussion about a few of the aircraft systems. Moments later the supervisory pilot noticed the the Right Engine EGT jumped to 475 degrees and a higher fuel Flow. When reducing the right power lever to get the indication to within limits the right power lever had quite a large split in comparison to the left. The rest of the flight went along smoothly. On descent with reduction of the power levers, the pilot under supervision noticed that the levers had returned to normal with no longer a split being indicated. Operations later in the day were normal with no power lever split.\"','','Engineering believe that water in the cannon plug may have caused the high EGT indication and that no overtemp occurred.','',NULL),(1030,196,'group','','2','2010-03-22 20:59:00','2010-03-22 13:00:00','2010-02-02 13:00:00','2010-03-22 21:00:00','','[\"10\"]','Beech 58 Baron','VH-VEB','Casino','','NSW',0,0,0,'[\"FLTOPS08\"]','[\"INFO\"]','Baron Becomes Bogged','\"The aircraft was tasked to fly from Bankstown to Casino. There were no Notams or abnormal weather indicated in pre-flight planning. The Jeppesen Airport Directory indicated the airport was suitable for landing, showing runway lengths, and taxi-ways. Upon arriving in the Casino area and flying overhead the field the pilot observed the runway length had been shortened considerably with a fence cutting off part of the runway and a caravan park being put in the area. The pilot determined the runway was still suitable for landing. After landing the pilot tried to determine a suitable area to taxi as the taxiways that were in the Jeps were no longer there. He decided to taxi on the grass over to the concrete blocks and park there. Upon leaving the runway onto the grassed area the aircraft became bogged and became immobile due to soft grass from recent rainfall. (Not NOTAMed). The passengers were taken off the aircraft. The pilot called the local council to inform them of what happened as the aircraft may have been potentially blocking the approach for other aircraft. A council worker came out and helped move the aircraft back onto the runway for take-off. The aircraft was repositioned to Lismore airport (10nm) away. The council at Casino were not aware that they had an obligation to maintain the airport and arrange for Notams. The airport is no longer registered.\"','','\"When the pilot cannot ascertain the condition of the Casino airport, operations advise using Lismore as it is only a 20 minute drive to Lismore.\"','',NULL),(1031,195,'group','','2','2010-06-01 03:14:00','2010-03-03 13:00:00','2010-03-03 13:00:00','2010-06-01 03:14:00','Scott Lemon','[\"10\"]','Not applicable','Not applicable','Ballera','','QLD',0,0,0,'[\"FLTOPS10\"]','[\"ENVIRO\"]','Bird Hazard in the Cooper Basin','A significant bird hazard exists at Ballera. Santos via the Cobham Airport Manager have been contacted directly and bird fright operations have commenced over and above pre-arrival and pre-departure runway sweeps.','The bird problem was observed by Cobham during a recent surveillance flight. Santos have raised an IMS regarding the bird problem at Ballera which should see prompt action taken soon. The Company will contact Cobham to try getting bird clearing operations conducted for C441 arrivals.','The Cooper Basin Senior Base Pilot has reported that bird fright operations are now being conducted for C441 aircraft as well as for BAe 146 Operations.','',NULL),(1032,194,'group','','2','2010-04-29 08:06:00','2010-03-03 13:00:00','2010-03-03 13:00:00','2010-04-29 08:06:00','Rob Boyes','[\"10\",\"8\",\"9\"]','Not applicable','Not applicable','Goulburn','','NSW',0,0,0,'[\"COYGEN\"]','[\"INDIV\"]','Inappropriate Parking at Goulburn','\"MRO Staff are failing to park motor vehicles in the appropriate spaces. Company vehicles are constantly using the handicapped parking spot, the garbage skip is in the car park and staff and company vehicles are parking on non Corporate Air land next to the car park. Staff have already been reminded twice about the Car Parking Policy via NOTMRO 17-09.\"','','The neighbouring block will be fenced off.','',NULL),(1033,193,'group','','2','2010-02-25 20:17:00','2010-02-25 13:00:00','2010-02-24 13:00:00','2010-05-18 04:48:00','Mark Norris','[\"10\"]','Metro 23','VH-VEU','Melbourne','','VIC',0,1,0,'[\"FLTOPS06\"]','[\"ENVIRO\"]','Laser Illumination','Whilst conducting the runway 27 ILS at Melbourne at 3.4 DME the left hand side of the cockpit was illuminated by a green laser. Bearing around 180 degree at 2 - 3 miles in the area of the Essendon shopping center. This event lasted around 3 seconds. No crew members were injured nor did any adverse effects to the flight occur. This event was reported to the Melbourne ground controller.','','This one of a number of laser illumination events that have occurred to Company aircraft. Pilots are reminded to read NOTAC 05/08 on procedures to be followed in the event of laser illumination.','',NULL),(1034,192,'group','','2','2010-04-29 08:02:00','2010-02-22 13:00:00','2010-02-21 13:00:00','2010-05-18 04:48:00','Mark Norris','[\"10\"]','Metro 23','VH-VEU','Canberra','','ACT',0,1,0,'[\"FLTOPS04\"]','[\"COMMS\",\"INFO\"]','Metroliner Incorrectly Loaded','\"The trim sheet and take-off performance were calculated in accordance with the load sheet supplied by the client. After passing 10,000 feet on departure from Canberra the Captain gave a departure call on the client company frequency. The client\'s staff informed the Captain that the load in bay four was actually 145kg rather than the 80kg listed on the load sheet. The crew calculated that, even with the additional 65kg load in bay 4, the aircraft remained within both weight and balance. V speeds for take-off were also within acceptable limits as the quick reference card V speeds had been rounded up to the next weight. The captain was satisfied that no safety risk was present and continued the remainder of the flight without incident. At no time was the aircraft flown over weight or out of trim. The matter is being investigated.\"','','The client has been contacted and the matter is being investigated. The client has asked that matters similar to this are reported immediately in future so that rectification measures can be taken.','',NULL),(1035,191,'group','','2','2010-02-22 05:03:00','2010-02-21 13:00:00','2010-02-11 13:00:00','2010-02-22 05:07:00','Darren King','[\"10\",\"8\",\"9\"]','Not applicable','Not applicable','Pialligo','','ACT',0,0,0,'[\"COYGEN\"]','[\"INDIV\"]','Car Parked Incorrectly at Pialligo','\"The Company Ford station wagon found parked in front of Pialligo shed in the area that stipulates \"\"No Parking, Do not block Entrance\"\". Blocking this entrance causes significant safety issues for Engineers and Ground Handlers storing and removing 44 Gallon Meth Mix drums. Blocking the entrance also poses a risk in damaging company vehicles. In another measure to stop this happening a notice re Pialligo parking has been on the portal for sometime.\"','','The Safety Manager is the person who parked incorrectly at Pialligo. He has given an undertaking to be more careful about the parking of company vehicles at Pialligo. A parking bollard has been placed in front of the shed to discourage parking in front of the door.','',NULL),(1036,190,'group','','2','2010-03-02 02:34:00','2010-02-10 13:00:00','2010-02-08 13:00:00','2010-05-18 04:48:00','Rob Piggott','[]','Not applicable','Not applicable','Goulburn','','NSW',0,1,0,'[\"ENGCO\"]','[\"ENVIRO\"]','Spiders at Goulburn','When opening the control box for the hangar doors at the Goulburn hangar five redback spiders were observed in the box. The spiders were sprayed with flyspray. There is concern that staff may become accidentally bitten by spiders in the hangar.','The hangar has now been sprayed for spiders.','','',NULL),(1037,189,'group','','2','2010-05-05 04:34:00','2010-02-10 13:00:00','2010-02-09 13:00:00','2010-05-05 04:34:00','Mark Norris','[\"10\"]','Metro 23','VH-VEU','Melbourne','','VIC',0,0,0,'[\"FLTOPS08\"]','[\"TECH\"]','Taxying to Closed Taxiway','\"In the pre-flight briefing the Captain observed a NOTAM stating that taxiway F at Melbourne was not available. En-route between Canberra and Melbourne the Melbourne ATIS X-ray was received. The ATIS stated that taxiway F was not available. The Captain was flying the aircraft. Upon landing on RWY 34 at YMML, the crew were told to expedite their departure from the runway. Approaching the high speed taxiway F the Captain followed the lead out lights to the taxiway. As the aircraft approached the runway edge the Captain noticed that marker cones were placed just inside the taxiway and started to bring the aircraft to a stop. At the same time the tower controller told said \"\"stop\"\". The aircraft was brought to a complete stop on the runway prior to entering the taxiway. A Virgin Airlines aircraft was told to \"\"go-round\"\". The aircraft was then taxied off the runway at taxiway E on the towerÕs instructions. After parking the aircraft the Captain contacted the Melbourne Operations Supervisor by telephone and recounted the incident from his point of view and the Supervisor informed the Captain that the matter would be investigated. On the return trip to Canberra when obtaining an airways clearance, the Melbourne Tower Controller stated: \"\" You\'ll be happy to know that the lights that were once illuminated have now been taped over. I did not know they were illuminated at the time\"\". The Captain believes that the incident would not have occurred if the lead out lights for taxiway F were off. The matter is being investigated.\"','\"This incident has occurred due to the following circumstances: (1) the crew failed to establish a firm course of action for the landing and rollout phase of the arrival taking into account the following traffic, (2) the time pressure that was created by the following aircraft caused the pilot in command to react instinctively with an incorrect course of action due to the incorrect landing brief, (3) ATC at Melbourne incorrectly perceived that because taxiway Foxtrot was NOTAM\'d closed that the lead out lights for that taxiway had been switched OFF, (4) the dark environmental conditions prevented the crew from being able to physically sight the Cone Markers that were blocking the closed taxiway. Had anyone of these circumstances been removed from the chain of events, this incident could quite possibly not have happened.\"','\"This incident highlights the need for Flight crew to work to a definite plan of action. The plan of action also needs to be completely understood by both crew members in a multi crew environment. If there is any question about the plan of action First Officers and Captains must raise those questions so that they can be discussed in full prior to the aircraft being committed to the discussed plan of action. This incident was exacerbated by the perceived time pressure placed on the crew by ATC juggling the traffic sequence, and that the lead out lights had not been turned OFF to the closed taxiway. A NOTAC has been issued to flight crew indicating the need for a thorough Approach and Landing brief to establish a definite plan of action.\"','',NULL),(1038,188,'group','','2','2010-02-04 03:04:00','2010-02-03 13:00:00','2010-02-03 13:00:00','2010-05-18 04:49:00','Paul Kell','[\"10\",\"8\"]','Not applicable','Not applicable','Goulburn','','NSW',0,1,0,'[\"ENGCO\"]','[\"ENVIRO\"]','Tiger Snake at Goulburn Facility','A small tiger snake was found in the Goulburn MRO facility near the door way to the paint room snake was relocated outside.','','','',NULL),(1039,187,'group','','2','2010-03-02 03:00:00','2010-01-28 13:00:00','2010-01-28 13:00:00','2010-05-18 04:49:00','','[\"8\"]','Not applicable','Not applicable','Goulburn','','NSW',0,1,0,'[]','[]','Hangar Door Stops Left In','The door stops for the hangar doors are being left in place on a regular basis when the doors are in the up position. The stops are meant to be put down when the doors are up so that people don\'t trip or drive a vehicle/aircraft over them and cause an accident.','A NOTMRO will be issued.','NOTMRO 18/09 has been re-issued.','',NULL),(1040,186,'group','','2','2010-05-05 01:54:00','2010-01-28 13:00:00','2010-01-28 13:00:00','2010-05-21 05:30:00','','[\"8\"]','Not applicable','Not applicable','Goulburn','','NSW',0,1,0,'[\"ENGCO\"]','[\"EQUIP\"]','Gate Safety on Goulburn Hangar Mezzanine Floor','Staff appear to be opening the mezzanine floor gate that is used when stock is lifted onto the floor using forklift by just pulling the gate open and not unlocking the padlock that secures the gate. The padlock is provided to prevent inadvertent opening of the gate. This practice has the potential to cause injury.','New gates have been ordered and should be delivered soon.','The gates have now been fitted.','',NULL),(1041,185,'group','','2','2010-02-04 03:01:00','2010-01-28 13:00:00','2010-01-28 13:00:00','2010-02-04 03:01:00','','[\"8\"]','Not applicable','Not applicable','Goulburn','','NSW',0,0,0,'[\"ENGCO\"]','[\"COMMS\",\"LEADER\"]','Lack of Security at Goulburn Hangar','It has been observed that vistors are not signing in when attending the Goulburn facility. People appear to be walking in and out as they please and doing what ever they like. Staff appear reluctant to stop them as they don\'t want the vistors to take offence. There are significant security issues arising from this practice.','','Signage and barriers will be erected at the hangar entrances and the situation will be monitored.','',NULL),(1042,184,'group','Flight Safety Nov 2009 Audit','2','2010-05-05 01:51:00','2010-01-17 13:00:00','2009-11-15 13:00:00','2010-05-21 05:31:00','','[\"8\",\"7\"]','Not applicable','Not applicable','Goulburn','','NSW',0,1,0,'[\"ENGCO\"]','[\"EQUIP\"]','Audit Findings','The following issues were identified during the Flight Safety audit; (1) Warning signs not readily sighted in the battery room of the Goulburn maintenance facility. (2) Scheduled reviews of contractors and suppliers should be introduced via questionnaire proforma. (3) Ensure that the aircraft starting battery charger is plugged into the hangar mains power outlet. (4) Suggest reviewing a possible collision hazard of the Metro tail and raised outer hangar doors during towing of Metro into and out of the hangar. (5) Follow up ERP exercise with Goulburn based maintenance facilities/personnel is required.','\"All findings have been closed out, the questionnaire is now in use and about 30% of suppliers have responded.\"','','',NULL),(1043,183,'group','','2','2010-01-13 02:36:00','2010-01-12 13:00:00','2010-01-11 13:00:00','2010-01-13 02:36:00','Mark Norris','[\"10\",\"8\"]','Metro 23','VH-VEU','Melbourne','','VIC',0,0,0,'[\"ENGCO\",\"FLTOPS05\"]','[\"EQUIP\"]','Pitot Heat Failure','\"Whilst tracking from Canberra to ELW en route to Melbourne a descent was commenced from non standard F190 due heavy icing. The Captain\'s ASI failed and indicated zero kts. Outside air temperature was approx -10 degrees, flight conditions were IMC. The Co-pilots ASI operated normally. Descent was maintained to FL140 where OAT was just above zero, flight conditions were IMC. The Captain\'s ASI resumed normal indications. Further checks were conducted on the ground at Melbourne confirming that the Captain\'s pitot heat had failed. Pre-flight checks at Canberra indicated that the system was operating normally.\"','','','',NULL),(1044,182,'group','','2','2010-01-07 04:18:00','2010-01-06 13:00:00','2010-01-06 13:00:00','2010-01-07 04:18:00','Scott Lemon','[\"10\"]','Cessna 441 Conquest','Not applicable','Moomba','','SA',0,0,0,'[\"FLTOPS04\",\"FLTOPS05\",\"FLTOPS06\",\"FLTOPS07\"]','[\"ENVIRO\"]','Bird Hazard in the Cooper Basin','\"A seasonal bird hazard at Moomba has started. The birds are mainly Kites but Corellas and Magpies have been observed within the runway strip at Moomba. In general within the Cooper Basin migrating Lorikeets, Budgies, Pelicans, Kites and Corellas have been observed at levels up to 9000\' in large numbers.\"','','','',NULL),(1045,181,'group','','2','2010-02-04 02:51:00','2009-12-15 13:00:00','2009-12-14 13:00:00','2010-02-04 02:51:00','Rob Boyes','[\"10\",\"8\"]','Not applicable','Not applicable','Canberra','','ACT',0,0,0,'[\"ENGCO\"]','[\"EQUIP\"]','Audit Results','\"During a recent audit, VEG, VEC, VEY, VEB, VEH were found to have inadequate placarding. The MRO Manager and the Chief Pilot have been tasked to rectify this.\"','','HAAMC will add placard checking to the work packs.','',NULL),(1046,180,'group','','2','2009-12-04 04:33:00','2009-12-03 13:00:00','2009-11-30 13:00:00','2010-05-21 05:32:00','Paul Kell','[\"8\",\"9\"]','Not applicable','Not applicable','Goulburn','','NSW',0,1,0,'[\"ENGCO\"]','[\"EQUIP\"]','Tyre Blows on GPU Cart','The LAME was inflating a flat tyre on the GPU cart. Without warning the tyre exploded. The tyre was worn through to the canvas and the tube had burst through the tyre and had exploded.','More thorough inspections of GSE will be carried out to prevent a re-occurrence of this event.','','',NULL),(1047,179,'group','','2','2009-12-04 04:26:00','2009-12-01 13:00:00','2009-11-30 22:00:00','2010-05-21 05:33:00','Denis Gailey','[\"10\",\"8\",\"9\"]','Cessna 404 Titan','VH-VEA','Sydney','','NSW',0,1,0,'[\"FLTOPS01\"]','[\"DESIGN\"]','Incorrect Seat Fitting','\"Prior to the flight the seats were inspected to ensure they were secured properly into the seat rails. After 9 passengers had embarked the aircraft, it was found that 2 of the 7 single Cessna seats had their seat belt webbing jammed in the folding leg mechanism. This was embarrassing and time consuming to fix as the passengers had to be asked to vacate their seats so as to remove the seats from their tracks and activate the unlocking mechanism to release the strap. It would appear that the belts have been clasped before installation and catch when seats are unfolded during installation. Damage is being done to the seat belt webbing due to this clamping and chaffing process.\"','A NOTGH will be issued to emphasise the requirement to check seat belts after installing seats.','','',NULL),(1048,178,'group','','2','2009-11-23 06:14:00','2009-11-22 13:00:00','2009-11-22 13:00:00','2010-05-21 05:36:00','Andrew Major','[\"10\",\"8\",\"9\"]','Cessna 441 Conquest','VH-VEH','Canberra','','ACT',0,1,0,'[\"FLTOPS01\"]','[\"EQUIP\"]','Seat Not Properly Secured','The front legs on a Vcommuter seat fitted to the aircraft came out from the track whilst the seat was occupied. The passenger relocated to an alternate (free) seat. The seats were given the \'standard\' shake during the preflight inspection. It appears that the seat locking pins may not have been fully locked into the track on the seat in question as it was difficult for GH staff to get them to locate into the track subsequent to the flight. Highlights a need to check security of the seat locking pins.','This incident highlights the need for a thorough security check of the seat locking pins.','','',NULL),(1049,177,'group','','2','2009-12-04 04:18:00','2009-11-18 13:00:00','2009-10-01 04:00:00','2009-12-04 04:20:00','Brad Rule','[\"10\"]','Cessna 404 Titan','VH-VEA','Near Tamworth','','NSW',0,0,0,'[\"FLTOPS05\"]','[\"INFO\"]','Aircraft Not Following Airways Clearance','The aircraft was cleared to track IVL-TW-SGT. ATC called the pilot who said that he thought that his cleared route was IVL-TW-SCO-SGT. The ATC audio tape was replayed which confirmed that the pilot was told to track IVL-TW-SGT. The aircraft was recleared to SGT without further incident. The matter is being investigated.','The pilot involved was counseled on taking more care on writing down airways clearances. NOTAC 34/09 was issued reminding pilots to write down all airways clearances.','','',NULL),(1050,176,'group','','2','2009-12-04 03:56:00','2009-11-18 13:00:00','2009-11-17 19:40:00','2010-05-21 05:37:00','Richard Bennet','[\"10\",\"8\"]','Beech 58 Baron','VH-VEB','Canberra','','ACT',1,0,0,'[\"ENGCO\"]','[\"DESIGN\"]','Leaking Fuel Cap on Baron','\"The aircraft was in the line up phase for runway 35. After calling \"\"ready\"\" to the tower, there was evidence of fuel leaking from the RH fuel cap. The pilot had been given clearance for take off but requested a clearance to vacate the runway to inspect the fuel cap near the RAAF hangar on the western side of taxyway B. Inspection indicated that the cap was in fact secured properly suggesting mechanical problem with the cap itself. The aircraft was taxied back to the GA apron where the chief pilot also inspected the cap and a serviceable fuel cap was taken from VEG as a replacement. The flight continued then as normal.\"','New fuel caps have been ordered for the Barons.','','',NULL),(1051,175,'group','','2','2009-11-19 05:28:00','2009-11-18 13:00:00','2009-11-16 13:00:00','2009-11-19 05:28:00','Brad Rule','[\"10\",\"8\"]','Cessna 441 Conquest','VH-VEW','Canberra','','ACT',0,0,0,'[\"FLTOPS04\"]','[\"ENVIRO\"]','Bird Strike at Canberra','As the aircraft was taking off it hit a bird with the left propellor. The aircraft returned to land and a Company engineer inspected the propeller. As the propeller was undamaged it was cleaned and the aircraft returned to service. The birdstrike was reported to the Australian Transport Safety Bureau.','','','',NULL),(1052,174,'group','','2','2009-12-04 04:04:00','2009-11-13 13:00:00','2009-11-09 07:50:00','2010-05-21 05:38:00','Ryan Mallard','[\"10\",\"8\",\"9\",\"7\",\"6\"]','Metro 23','VH-VEK','Canberra','','ACT',0,1,0,'[\"FBOCO\"]','[\"INDIV\"]','Worker Injured in Metroliner','\"On completion of loading the freight boards into the Metroliner the employee suffered from severe back pain whilst attempting to install the freight net. He brought this to the attention of his night supervisor who then contacted the GHM. The GHM instructed the night supervisor to take the employee to Pialligo and wait for GHM to arrive from home to take him to hospital. The GHM made an appointment with CALMS at Canberra Hospital, which he and the employee attended. Immediate prognosis was that some fibre damage had occurred between the discs in the lower back. Consequently the employee has been given time off and is receiving physiotherapy until fit for return to work. The matter will be further investigated.\"','The Chief Pilot and Ground Handling Manager are investigating ways of reducing the weight of the freight boards in the M23.','','',NULL),(1053,173,'group','','2','2009-11-19 04:34:00','2009-11-12 13:00:00','2009-11-12 13:00:00','2009-11-19 05:15:00','Andrew Webb','[\"10\",\"8\",\"9\",\"7\",\"6\"]','Not applicable','Not applicable','Canberra','','ACT',0,0,0,'[\"COYGEN\"]','[\"INFO\"]','ISO 9001 Audit Findings','\"During a recent audit for ISO 9001 accreditation the following observations were made: Minor CAR 1: The system has not ensured that the Safety and Quality Policy includes a commitment to continually improve the effectiveness of the quality management system. Whilst commitment to continual improvement is evident throughout the documentation and business practices, the ISO9001 standard requires this commitment to be included in the policy. Minor CAR 2: Whilst the company has clearly identified the statutory requirements/regulations specific to the provision of services in the aviation industry, other legislation and codes of practice relating to the management of occupational health and safety and environmental matters is has not been defined within the documentation. The organisation will now take measures to rectify these issues.\"','CAR 1 A commitment to continual improvement included in Safety & Quality Policy. CAR 2 A list of pertinent legal and other obligations complied with and put on portal in technical library > General > Forms for Managers.','Congratulations Corporate Air on achieving ISO 9001 approval. Well done.','',NULL),(1054,171,'group','','2','2010-03-02 02:58:00','2009-11-09 13:00:00','2009-11-09 13:00:00','2010-03-07 21:37:00','Scott Lemon','[\"10\"]','Not applicable','Not applicable','Moomba','','SA',0,0,0,'[\"FLTOPS07\"]','[\"ENVIRO\"]','Moomba PAPI Unreliable in Low Visibility','\"It has been reported that the daytime intensity of the Moomba precision approach path indicator (PAPI) does not allow the lights to show correct approach path until within 2nm (3700m) of the threshold of the runway....in the best of conditions. This is true for both ends of the runway. Sunglare, dust and the runway surface and environment are factors that reduce this distance making the installation unfit for its purpose. One pilot believes that without local knowledge the intensity being low gives a false impression of being further away from the runway than would normally be the case with other normal insatllations including Ballera. This may make a pilot question his position during a critical phase of approach. The chance of missing a landing is also increased with low visibiltiy because this valuable aid is not available at the distance it should be. This issue has been raised with the Moomba Airport Manager(s) several times over the last months of dusty conditions and the issue remains unchanged since last reported on Tuesday 03 November 2009. In fact the overall intensity of the system has never been the same since the change to Pilot Activated Lighting (PAL) some time ago. Another noted factor maybe that the whole runway lighting system illuminates during daylight hours when activated by PAL. This is not normally the case. With continued runway works (surface sealing) to be done, a lack of rain and continued dusty conditions this will remain an issue.\"','The client has cleaned the lenses of the lights and placed bitumen around them to give better contrast.','','',NULL),(1055,170,'group','','2','2010-05-05 01:52:00','2009-11-09 13:00:00','2009-11-08 13:00:00','2010-05-21 05:39:00','Rob Boyes','[\"8\"]','Not applicable','Not applicable','Goulburn','','NSW',0,1,0,'[\"ENGCO\"]','[\"EQUIP\"]','Upper Level Gates','The Quality Manager reported on the safety risk of the gates on the upper level of the Goulburn hangar. The use of safety harnesses and clear SOPs when the gates are open was recommended and will be adopted. The QM is working on this and will have the matter resolved soon.','New gates have been ordered and should be delivered soon.','The gates have now been fitted.','',NULL),(1056,169,'group','','2','2010-06-01 03:07:00','2009-11-08 13:00:00','2009-10-26 13:00:00','2010-06-01 03:07:00','Bill McIntyre','[\"10\",\"8\",\"6\"]','Not applicable','Not applicable','Various','','Oth',0,0,0,'[\"ENGEXT\",\"FLTOPS10\",\"COYGEN\"]','[\"COMMS\",\"DESIGN\",\"ENVIRO\",\"EQUIP\",\"TECH\"]','External Audit Findings','\"As a result of an audit conducted by a client, the following observations were made: 1. It was found that there is no specific induction training given for machine equipment that has potential to harm. It is falsely assumed that, as an engineer, the individual should already be aware of how to use equipment. It is the responsibility of the organisation to provide, as far as reasonable practicable, training on equipment. It would be advantageous for the organisation to include, in its induction process for engineers, a brief training session on hangar equipment. 2. It would be beneficial for Company representatives who sit on the Safety Committee and drive the safety culture to receive some form of Safety System training. This would highlight not only regulatory requirements but local, State and Federal laws relating to this. 3. As part of the thorough induction process and ongoing pilot check and training program employees are subjected to a variety of testing to ensure they meet company requirements. Although this system is in good shape, it may offer some benefit for the poor results of such test to be entered back into the system. This would allow internal checking of the organisations Safety System by identifying trends and possible gaps within the system. It may also identify shortcomings in an individuals performance and allows the organisation to better direct the training this person may need in the future. 4. It was identified in two separate locations the poor storage of critical documents (Aircraft log books and Stores original tracking data (GRN). If damage occurred to these documents severe penalties would exist for the organisation, namely financial. It was suggested that protection of these documents take the highest priority. 5. It was difficult to establish the currency of some controlled aircraft manuals and identify who in the organisation is directly responsible for ensuring critical aircraft data is current.\"','1. The MRO Manager will ensure that all hangar personnel are trained on all equipment that they have to use during their duties in the hangar. 2. The Safety Manager will investigate appropriate training. 3. The Chief Pilot will include data from the Check and Training system into the Safety Management System. 4. The Manager MRO and the HAAMC will investigate appropriate storage for these documents. 5. Procedures are already in place for the updating this documentation. The HAAMC will ensure that relevant staff are made familiar with who is responsible. The matter is now in hand with a responsible person in charge of ensuring that controlled documents are current. Changes have been made to the updating process for computers by rationalising the number of machines.','Training proposals are being considered by the Managing Director.','',NULL),(1057,168,'group','','2','2009-11-09 01:24:00','2009-11-02 13:00:00','2009-11-02 10:47:00','2009-11-09 01:24:00','Mark Norris','[\"10\"]','Metro 23','VH-VEK','Melbourne','','VIC',0,0,0,'[\"FLTOPS06\"]','[\"ENVIRO\"]','Laser Illumination','\"Whilst approaching Melboune at 20 nm and passing 8000 feet on descent, the aircraft was illuminated by a green laser bearing 180 at around 2nm. This event lasted no more than 5 seconds and was reported to Melbourne approach. A following Jetstar aircraft was informed but they did not report sighting any laser.\"','\"This is one of many such illuminations of Company aircraft. NOTAC 05/08 was generated to advise pilots on the correct procedure when encountering LASER illumination. It states that if a laser beam is directed at the aircraft, do not look out of the window at the beam. Continue the approach or departure on instruments and if too low on approach with the laser beam still illuminating the cockpit, consider a missed approach. When time permits advise ATC of the occurrence.\"','','',NULL),(1058,167,'group','','2','2009-11-09 02:23:00','2009-10-29 13:00:00','2009-10-28 19:00:00','2010-05-21 05:40:00','Sam Moore','[\"10\",\"8\"]','Beech 58 Baron','VH-VEG','Canberra','','ACT',1,0,0,'[\"FLTOPS04\"]','[\"EQUIP\"]','Leaking Fuel Cap on Take-off','\"Just after takeoff in the passenger alerted the pilot that fuel was leaking out of the right wing fuel cap. After sighting it, the pilot called the tower and requested a return to land. The aircraft was then cleared for a left downwind for rwy 17. After landing the fuel cap was replaced with a servicable cap from VEB and the flight then departed without incident.\"','The aircraft tip tanks had been filled before the flight which means that the inboard caps are flooded under pressure. Inspection of the fuel cap revealed that the o ring had rolled and allowed fuel to escape past the latching mechanism.','\"Whilst there is no inspection period for fuel caps, work packs in future will call for fuel cap inspections.\"','',NULL),(1059,166,'group','','2','2009-10-30 04:37:00','2009-10-29 13:00:00','2009-10-22 13:00:00','2010-05-21 05:40:00','','[\"10\",\"8\",\"9\",\"6\"]','Not applicable','Not applicable','Canberra','','ACT',0,1,0,'[\"FBOCO\"]','[\"INDIV\"]','Inability to Report Incident','\"Whilst sorting out the Cabin Cleaning van, a Ground Handler hit her chest quite hard on the door frame of the sliding door. This was because she lost her balance when leaning in towards the back. Two other workers told the employee to complete an incident report but could not find any hard copy forms. The employee reported this matter to the GHM three days after the event via e-mail. The employee states that the pain caused from the incident had subsided and she is back to normal. All employees have been made aware of this reporting format and the QBE incident register should medical attention be needed. This is an extract from the employees e-mail. \"\"I couldn\'t find any incident reports (i didn\'t think it was a safety hazard hence not filling in the red one) though so i just wanted to let you know. For future reference if something happens while airside can you please advise there location\"\" Employee has been told of this reporting method and the location of QBE incident register with instructions. The GHM suggests that the Hazard Report on the Company portal be changed to read Incident/Hazard report and reporting methods be placed on the \"\"Forms for employees\"\" portion on the portal.\"','\"The Safety Manager discussed the mandatory Company reporting requirements with the GHM. In particular, it was stressed that all hazards/incidents be reported electronically in the hazards area of the Company portal as the hard copy red hazard forms had been withdrawn. The next Safety Committee meeting will discuss changing the name of the report.\"','','',NULL),(1060,165,'group','','2','2009-12-04 04:02:00','2009-10-29 13:00:00','2009-10-15 13:00:00','2009-12-04 04:02:00','Lynette Lennon','[\"10\",\"8\",\"9\",\"7\",\"6\"]','Not applicable','Not applicable','Canberra','','ACT',0,0,0,'[\"COYGEN\"]','[\"DESIGN\"]','General Audit','As a result of a recent general audit a rectifications request was issued to Admin Manager. All items are 3 or above (not safety critical). The Admin Manager have been tasked by QM to rectify all noted items ASAP.','All items have been rectified.','','',NULL),(1061,164,'group','','2','2009-12-04 04:02:00','2009-10-29 13:00:00','2009-10-15 13:00:00','2009-12-04 04:02:00','Lynette Lennon','[\"10\",\"8\",\"9\",\"7\",\"6\"]','Not applicable','Not applicable','Canberra','','ACT',0,0,0,'[\"COYGEN\"]','[\"DESIGN\"]','Administration Audit','As a result of a recent audit of the Admin area a rectifications request was issued to the Admin. Manager & Stores Manager. There weres two Non compliance / Procedure failures for having no procedures in place. The remaining items were all 3 or above (not safety critical). The Admin Manager has been tasked by QM to rectify all noted items ASAP.','All items have been rectified.','','',NULL),(1062,163,'group','MRO Audit','2','2009-12-04 04:01:00','2009-10-29 13:00:00','2009-10-13 13:00:00','2009-12-04 04:01:00','Derek Hoffmeister','[\"10\",\"8\",\"9\",\"7\",\"6\"]','Not applicable','Not applicable','Goulburn','','NSW',0,0,0,'[\"ENGCO\"]','[\"DESIGN\"]','MRO Audit','As a result of a recent audit of MRO a rectifications request was issued to MRO Manager & Stores Manager. There was only one Non compliance / Procedure failure for having no procedure in place. The remaining items were all 3 or above (not safety critical). MRO Manager and Stores Manager have been tasked by QM to rectify all noted items ASAP.','All items have been rectified.','','',NULL),(1063,162,'group','','2','2009-12-04 04:13:00','2009-10-15 13:00:00','2009-10-13 13:00:00','2009-12-04 04:13:00','Mark Norris','[\"10\",\"6\"]','Metro 23','VH-VEU','Glen Innes','','NSW',0,0,0,'[\"FLTOPS07\"]','[\"TECH\"]','Runway Excursion on Landing','\"The First Officer was performing the landing on RWY 32 with reported wind of 240/20G35kts. On the landing roll and passing through 60-70kts the Captain took over and called for ÒSpeeds LowÓ. This procedure was conducted and the aircraft remained on the runway center line. As the aircraft slowed to around 20kts it started a gentle veer to the left. The Captain engaged full opposite rudder/steering and ensured that the speed levers were firmly on the stops. The aircraft exited the runway by about 4 to 5 meters before coming to a full stop. Power was then re-applied and aircraft was taxied to terminal. After shutting down the aircraft at the terminal a thorough post flight inspection was carried out. No damage to the aircraft was found. In addition, a runway inspection of the excursion area was also conducted. No damage to runway lights or equipment was found. Photographs were taken of the tyre marks on the side of the runway in the excursion area. The Chief Pilot and Safety Manager were informed of the incident. The Captain believed that the excursion was caused by a nosewheel steering failure. The matter is being investigated. A report has been submitted to the ATSB. The Chief Pilot is preparing a report for CASA.\"','NOTAC 29/09 was issued to pilots discussing the correct procedures for the use of nosewheel steering during landings. The Captain involved went through extensive retraining on operations without nosewheel steering and additional surveillance was carried out.','','',NULL),(1064,161,'group','','2','2009-11-09 00:57:00','2009-10-15 13:00:00','2009-10-04 13:00:00','2009-11-09 00:57:00','Albert Stewardson','[\"10\",\"8\",\"9\"]','Cessna 441 Conquest','VH-VEH','Canberra','','ACT',0,0,0,'[\"FBOCO\",\"FLTOPS01\"]','[\"DESIGN\"]','Drain Plug Not Installed','During the preflight of the aircraft the drain for the removed bar was not blanked. This could have resulted in the cabin not pressurising correctly.','Procedures will be put in place within MRO to ensure that aircraft are correctly configured for intended usage.','','',NULL),(1065,160,'group','','2','2009-11-04 04:13:00','2009-10-15 13:00:00','2009-10-04 13:00:00','2009-11-04 04:13:00','Albert Stewardson','[\"10\",\"8\",\"9\"]','Cessna 441 Conquest','VH-VEH','Canberra','','ACT',0,0,0,'[\"FBOCO\",\"FLTOPS01\"]','[\"DESIGN\"]','Bar Wiring Across Seat Rails','During the preflight of the aircraft there were loose wires for the bar behind the pilots seat across the seat rail where passengers feet could damage/short them. See the attached photograph.','Procedures will be put in place within MRO to ensure that aircraft are correctly configured for intended usage.','','',NULL),(1066,159,'group','','2','2009-11-04 04:06:00','2009-10-15 13:00:00','2009-10-04 13:00:00','2010-05-21 05:42:00','Albert Stewardson','[\"10\",\"8\",\"9\"]','Cessna 441 Conquest','VH-VEH','Canberra','','ACT',0,1,0,'[\"ENGCO\",\"FLTOPS01\"]','[\"DESIGN\"]','Fire Extinguisher Pin Missing','During the preflight of the aircraft the fire extinguisher bottle was found to have the safety pin missing (found on the floor) and the securing latch was loose. See attached photograph.','Maintenance procedures will be put in place to ensure that the pins and clips on the bracket will not inadvertantly come loose during normal operations.','','',NULL),(1067,158,'group','','2','2009-11-04 03:28:00','2009-10-15 13:00:00','2009-10-04 13:00:00','2009-11-04 03:28:00','Albert Stewardson','[\"10\",\"8\"]','Cessna 441 Conquest','VH-VEH','Canberra','','ACT',0,0,0,'[\"ENGCO\",\"FLTOPS01\"]','[\"DESIGN\"]','Oxygen Masks Stowed Incorrectly','The passenger oxygen masks in the aircraft were incorrectly stowed. The strap was wrapped around the mask for easy stowage. In the event of a depressurisation at high altitude there would probably not be enough time for the passenger to unwrap the elastic strap before donning the mask. See the attached photograph which shows how the mask was installed and photographs on how they should be installed.','\"As part of the maintenance program, all C441 aircraft will be inspected to ensure that oxygen masks are stowed correctly.\"','','',NULL),(1068,157,'group','','2','2009-11-04 04:02:00','2009-10-04 13:00:00','2009-10-03 05:08:00','2009-11-04 04:02:00','Gerry Hanstede','[\"10\",\"8\"]','Cessna 441 Conquest','VH-VEJ','Ballera','','QLD',0,0,0,'[\"FLTOPS07\"]','[\"EQUIP\"]','Nosewheel Deflates','During the landing roll the nose wheel tyre deflated on landing. The aircraft was stopped and shutdown on the runway and a NOTAM was put out to close the airstrip. The aircraft was then towed off the runway using a forklift with the nosewheel held off the ground to avoid damage to the rim. The matter is being investigated.','\"Background On three separate occasions between 3 November 2006 and 3 October 2009 C441 Cessna Conquest VH-VEJ had nosewheel tyre deflations on landing. On all three occasions, the aircraft was landing at an airport with high ambient temperature (Brisbane and Ballera in Queensland and Telfer in WA). There have been other nosewheel landing deflations in other company C441 aircraft and also in C441 aircraft operated by other companies in Australia. While the C441 aircraft does not offer any significant handling difficulties following the deflation of a nosewheel tyre, the aircraft is usually not taxied from the runway to prevent damage being caused to the rim. This means that until the aircraft can be towed from the runway, the runway has to be closed. This may have significant operational consequences. Company Action All affected Company C441 aircraft and those of at least one other Australian operator had Goodyear tubes fitted to the nosewheel tyre when it deflated. None of the deflations in Company aircraft had a common rim or tyre fitted to the nose leg and deflations had occurred in as little as 150 hours after replacing both tyre and tube. Following the last two incidents in VH-VEJ a review of assembly procedures for the nosewheel tyres on the C441 was conducted. This review confirmed that the rims, tyres and tubes were all being assembled in accordance with the manufacturerÕs instructions and approved data. Further checks were conducted on VH-VEJ to determine the alignment of the nosewheel on touchdown, no abnormalities were found and the nose leg was found to be correctly aligned. The deflated tubes were inspected by Licensed Company engineers. The tubes had slits at identical points on the sidewall of the tube opposite the valve where the tube had failed and caused the tyre to deflate. These tubes were from different batches. There was no evidence of pinching or installation damage. The tyre sidewalls were inspected for damage that may have caused the tube to fail, no damage was evident in either case. All remaining C441 nosewheel tubes were drawn from the store and inspected. They all showed manufacturing marks in the same place where the affected tubes had failed. Another Australian operator was contacted and they confirmed that the tube failures that they had experienced had been with Goodyear tubes and that they had consequently changed to Michelin tubes. Further, research of the US FAA Service Difficulty Report (SDR) database revealed that the same tubes had failed in C172 aircraft in the US. Nosewheel tyres on other Company C441s were dismantled and inspected. The tubes in these tyres exhibited the same manufacturing fault. The Company has reported the tube failures to the Civil Aviation Authority via their online SDR system. The remaining Goodyear tubes were withdrawn from the store and returned to the supplier who will contact the manufacturer to inform them of the fault. The Company has purchased Michelin tubes and is progressively replacing all nosewheel tubes in the C441 fleet. Findings The nosewheel deflations appear to have been the result of manufacturing faults in the Goodyear tubes fitted to the aircraft. The high ambient temperatures in the locations where the failures have occurred may be a contributing factor because tyre pressures increase directly with a rise in temperature. Whilst the same tube is fitted to the Company C404 Cessna Titan aircraft it is thought that the lower landing weight of the C404 may be a factor in them not failing. Also the Company operates only two C404s and seven C441s and typically the C404s are not operating into airports where the temperatures are as high as for the C441s. Safety Action The company will progressively replace all C441 Goodyear nosewheel tubes with Michelin product as soon as possible. The Company has reported the failures to CASA to alert other aircraft operators of potential problems with Goodyear tubes.\"','','',NULL),(1069,156,'group','','2','2009-09-04 01:00:00','2009-09-03 14:00:00','2009-09-02 14:00:00','2009-09-04 01:00:00','','[\"10\",\"8\"]','Cessna 441 Conquest','Not applicable','Sydney','','NSW',0,0,0,'[\"FLTOPS05\"]','[\"EQUIP\"]','Pitot Heat Failure','\"While climbing through F180 enroute SY to CB through cloud with IOAT below 0, the pilot noticed that the L/H airspeed indicator started reducing suddenly to as low as 70kts with no changes in aircraft pitch or power. Soon after, the CMD flag appeared on L/H HSI and the autopilot disconnected. R/H airspeed indicted normal suggesting a blocked L/H pitot tube and therefore a failed pitot heater. The remainder of the flight was hand flown without incident with airspeed referenced from the R/H ASI and power settings set with an extra buffer below any limits until a warmer temperature cleared the L/H pitot tube of ice. The pitot heat tested normal during the preflight checks and was selected on when lining up before takeoff. After landing, testing of the pitot heat proved a failure of the L/H pitot tube heat.\"','','','',NULL),(1070,155,'group','','2','2009-09-01 09:51:00','2009-08-31 14:00:00','2009-08-18 14:00:00','2010-05-21 05:43:00','John Christensen','[\"8\"]','Not applicable','Not applicable','Goulburn','','NSW',0,1,0,'[\"ENGCO\"]','[\"INDIV\"]','Fall From Ladder','An engineer misstepped from a 2 step ladder in the MRO hangar and injured his left knee. As a result of this he was away from duties for 3 days. A workers compensation path was followed and the engineer has returned to work.','','','',NULL),(1071,154,'group','','2','2009-09-01 09:43:00','2009-08-23 14:00:00','2009-08-18 04:57:00','2009-09-01 09:43:00','Scott Lemon','[\"10\",\"8\"]','Cessna 441 Conquest','VH-VED','Ballera','','QLD',0,0,0,'[\"FLTOPS04\"]','[\"EQUIP\"]','Aborted Take-off','The aircraft was operating in daylight VMC on RWY 21 with surface conditions 060/9. The takeoff was aborted following an asymmetric engine acceleration at the start of the takeoff roll. The pilot decided to remove the power early in the takeoff roll and abort the takeoff as a precaution. A total distance of 300m was covered a backtrack and return for takeoff was made. All subsequent operations were normal.','The Chief Pilot investigated and found that the asymmetry was caused by fuel computer switching and will raise a NOTAC advising of this problem.','','',NULL),(1072,153,'group','','2','2009-11-04 03:35:00','2009-07-30 14:00:00','2009-07-15 14:00:00','2009-11-04 03:35:00','Rob Boyes','[\"10\",\"8\",\"7\"]','Beech 58 Baron','VH-VEB','Canberra','','ACT',0,0,0,'[\"ENGCO\"]','[\"EQUIP\"]','VEB Audit Findings','During a recent audit VEB was found to have some issues that need correction.','The Chief Pilot is investigating.','All issues are now corrected.','',NULL),(1073,152,'group','','2','2009-11-04 03:35:00','2009-07-30 14:00:00','2009-07-15 14:00:00','2009-11-04 03:35:00','Rob Boyes','[\"10\",\"8\",\"7\"]','Beech 58 Baron','VH-VEG','Canberra','','ACT',0,0,0,'[\"ENGCO\"]','[\"EQUIP\"]','VEG Audit Findings','During a recent audit VEG was found to have some issues that need correction.','The Chief Pilot is investigating.','All issues are now corrected.','',NULL),(1074,151,'group','','2','2009-11-04 03:34:00','2009-07-30 14:00:00','2009-07-15 14:00:00','2009-11-04 03:34:00','Rob Boyes','[\"10\",\"8\",\"7\"]','Cessna 441 Conquest','VH-VEY','Canberra','','ACT',0,0,0,'[\"ENGCO\"]','[\"EQUIP\"]','VEY Audit Findings','During a recent audit VEY was found to have some issues that need correction.','The Chief Pilot is investigating.','All issues are now corrected.','',NULL),(1075,150,'group','','2','2009-11-04 03:33:00','2009-07-30 14:00:00','2009-07-15 14:00:00','2009-11-04 03:33:00','Rob Boyes','[\"10\",\"8\",\"7\"]','Cessna 404 Titan','VH-VEC','Canberra','','ACT',0,0,0,'[\"ENGCO\"]','[\"EQUIP\"]','VEC Audit Findings','During a recent audit VEC was found to have some issues that need correction.','The Chief Pilot is investigating.','All issues are now corrected.','',NULL),(1076,149,'group','','2','2009-08-04 08:44:00','2009-07-30 14:00:00','2009-07-20 14:00:00','2009-08-04 08:45:00','Rob Boyes','[\"9\",\"7\"]','Not applicable','Not applicable','Canberra','','ACT',0,0,0,'[\"FBOCO\"]','[\"EQUIP\"]','YFP48H Requires Radio','A recent audit found that a radio needs to be fitted to vehicle YFP 48H.','The Ground Handling Manager has determined that all vehicles requiring radios have them fitted.','','',NULL),(1077,148,'group','','2','2009-08-04 08:38:00','2009-07-30 14:00:00','2009-07-20 14:00:00','2010-05-21 05:44:00','Rob Boyes','[\"10\",\"8\",\"9\",\"7\",\"6\"]','Not applicable','Not applicable','Canberra','','ACT',0,1,0,'[\"COYGEN\"]','[\"DESIGN\"]','Pialligo Muster Point','A recent audit at Pialligo found that a muster point needs to be added to the Emergency Exit signs.','The Ground Handling Manager has corrected this problem.','','',NULL),(1078,147,'group','','2','2009-07-14 05:35:00','2009-07-13 14:00:00','2009-07-09 14:00:00','2009-07-23 07:56:00','Brad Rule','[\"10\",\"8\"]','Cessna 404 Titan','VH-VEC','Bankstown','','NSW',0,0,0,'[\"FLTOPS10\"]','[\"EQUIP\"]','Nut Missing From Brake Caliper','On taxiing the pilot heard a knocking sound from the left wheel and stopped had a look at the brake but could not see anything. An engineer looked at the wheel and thought that it was a spacer in the brake caliper and that it would be ok. The aircraft was flown back to Canberra and on landing the knocking was still there. On further inspection by a company engineer it was found that the wheel through bolt had failed at the last thread below the base of the nut. This had caused some damage to the brake torque adaptor.','','','',NULL),(1079,146,'group','','2','2009-07-14 05:16:00','2009-07-06 14:00:00','2009-07-01 14:00:00','2010-05-21 05:45:00','Paul Kell','[\"10\",\"9\"]','Cessna 441 Conquest','VH-VEH','Canberra','','ACT',0,1,0,'[\"FBOCO\"]','[\"INDIV\",\"TASK\"]','Seat Stops Not Fitted','Both aft seat stops for pilot & copilot seats were found not fitted lying between seats just behind the center console.','The personnel involved have been counseled and new procedures have been put in place to prevent a reoccurrence.','','',NULL),(1080,145,'group','','2','2009-07-14 05:15:00','2009-06-02 14:00:00','2009-06-02 12:50:00','2009-07-14 05:15:00','Mark Norris','[\"10\"]','Metro 23','VH-VEU','Melbourne','','VIC',0,0,0,'[\"FLTOPS06\"]','[\"ENVIRO\"]','Wake Turbulence Encounter','Whilst on short final for RWY 27 at Melbourne the aircraft became caught in wake turbulence from a proceeding 737 and rolled approx 10-15 degrees to the right and was difficult to correct. A missed approach was initiated by the pilot in command. A visual circuit was then conducted without incident. The matter will be investigated.','Adequate separation was provided by ATC.','','',NULL),(1081,144,'group','','2','2009-07-14 05:10:00','2009-05-31 14:00:00','2009-05-24 14:00:00','2009-07-14 05:13:00','','[\"10\",\"8\"]','Cessna 441 Conquest','Not applicable','Ballera','','QLD',0,0,0,'[\"FLTOPS10\"]','[\"EQUIP\"]','Fire Extinguisher Maintenance','\"During an inspection of an C441 aircraft\'s fire extinguisher, a pilot was surprised to find that, under the Company\'s System of Maintenance, overhaul of fire extinguishers is only required to be performed every 12 years. The Manager MRO will investigate.\"','','The system of Maintenance will be changed to reflect 100 hourly inspections and 6 yearly overhauls.','',NULL),(1082,143,'group','','2','2009-06-01 03:03:00','2009-05-21 14:00:00','2009-05-18 05:31:00','2009-06-01 03:03:00','Antony Springer','[\"10\"]','Cessna 441 Conquest','VH-VED','Ballera','','QLD',0,0,0,'[\"FLTOPS05\"]','[\"INFO\"]','Precautionary Engine Shutdown','\"Background At 0501UTC the aircraft, which was engaged in a closed charter operation in the Cooper Basin with one passenger on board, was enroute from Ballera Airport to Moomba Airport when the left engine start light illuminated. Brisbane ATC was contacted at approximately 0505 UTC and a level change was requested while the pilot tried to analyse what was occurring. The pilot referenced the System Emergencies section of the Pilot Operating Handbook (POH). He performed a precautionary shut down of the left engine according to the checklist on page 3-14 ÒLeft or Right Engine Start Light Remains On After StartÓ at 0507 UTC. Brisbane ATC were contacted at approximately 0509 UTC and told that an engine shut down had occurred and that the aircraft would be returning to Ballera Airport and was given traffic and QNH. At 0510 UTC Ballera Base was contacted and informed that the aircraft would be returning to Ballera Airport at 0516 UTC with the left engine shut down and the Airport Manager arranged to have emergency services on standby for the arrival. After ascertaining the conditions at the field with the Aerodrome Weather Service the pilot conduced a normal glide path asymmetric approach and landing, cancelled Sarwatch on HF 8831, taxied to the ramp and shut down at 0518 UTC. Analysis The POH for the Cessna 441 does not have a procedure for an engine start light illuminating in flight. The only mention is on page 3-14 ÒLeft or Right Engine Start Light Remains On After StartÓ in the Systems Emergency Section, which requires that the engine be immediately shut down to prevent a catastrophic starter motor failure. The pilot had read an article in the CASA publication ÒFlight Safety AustraliaÓ where a starter/generator had failed in flight and had caused a failure of the engine computer, engine instruments, all pilot instruments, all radios and navigation instruments on that bus and the undercarriage and flap actuating systems. Concerned that the starter motor could be engaged and could lead to the same scenario, the pilot felt that the safest course of action was to conduct a precautionary engine shutdown. The starter motor fitted to the Cessna 441 Garrett engine is a starter/generator. After the engine has been started, it is then used as a generator to recharge the batteries. Once the start cycle is completed and the generator is on, it is not possible for it to then revert to a starter motor. This could explain why the POH makes no mention of a procedure for managing a situation where the start light illuminates in flight. If the generator light is not illuminated and the generator is producing load on the ammeter, then it is not possible for the starter motor to be engaged. Additionally, there is a squat switch on the undercarriage that prevents the starter motor from being engaged once the aircraft is in flight. Examination of the aircraft by an engineer determined that the starter/generator was working correctly and that the illumination of the start light was caused by a wire on the light becoming loose. At interview, the Chief Pilot felt that more guidance is required for pilots who are faced with this situation. In the absence of any information provided by the manufacturer, he will amend the emergency checklist for the aircraft to incorporate measures to ensure that the starter is not actually engaged when the start light illuminates in flight. As an interim measure, all Cessna 441 pilots will be contacted by phone and a Notice to Aircrew (NOTAC) will be raised highlighting the procedures to be followed in the event that a start light illuminates in flight\"','The pilot conducted a precautionary shut down of the left engine in accordance with the limited information that was available to him in the POH. The pilot performed this precautionary shutdown because he was concerned that it could progress to a major system emergency. The aircraft manufacturer provides no information to pilots in the POH for dealing with a start light illuminating in flight. To prevent a reoccurrence of this incident the company needs to produce clear guidance for pilots to deal with this situation.','Safety Action ¥ The Chief Pilot will contact all Cessna 441 pilots by phone to highlight the procedures to be followed in the event that a start light illuminates in flight. ¥ The Chief Pilot will raise a Notice to Aircrew (NOTAC) to all pilots detailing the procedures to be followed in the event that a start light illuminates in flight. ¥ The Cessna 441 Emergency Checklist will be amended to include a procedure to be followed if a start light illuminates in flight.','',NULL),(1083,142,'group','','2','2009-08-04 08:36:00','2009-05-14 14:00:00','2009-05-13 14:00:00','2010-05-21 05:46:00','Darren King','[\"10\",\"8\",\"9\"]','Metro 23','Not applicable','Canberra','','ACT',0,1,0,'[\"FLTOPS01\"]','[\"EQUIP\"]','Metro Tail Covers','A hazard exists for Ground Handlers putting the tail covers on the Metro\'s during the winter months. The GH staff were using the Allianze Fokker 100 Stairs to reach to that height but these have been positioned in Melbourne since the VIC bushfires. An investigation underway to determine: 1. What are the safe height restrictions for staff applicable to this duty. 2. What cost effective solution can be found to ensure the aircraft are protected from ice by utilising the covers safely and to ensure staff are protected from a potential safety incident.','Qantas stairs are now available for use.','NOTGH 10/09 has been issued detailing procedures to be followed.','',NULL),(1084,141,'group','','2','2009-06-01 11:47:00','2009-05-14 14:00:00','2009-05-04 14:00:00','2009-06-01 11:47:00','Rob Boyes','[\"8\"]','Not applicable','Not applicable','Goulburn','','NSW',0,0,0,'[\"ENGCO\"]','[\"EQUIP\"]','Sealants etc Time Expired','\"During a Quality Audit of the MRO Section,it was found that sealants, silicone and Loctite are time expired and/or caps missing exposing the contents to contamination.\"','Items were removed from service and the MRO Stores Manager is to regularly check stock expiry dates.','','',NULL),(1085,140,'group','','2','2009-06-01 11:46:00','2009-05-14 14:00:00','2009-05-04 14:00:00','2009-06-01 11:46:00','Rob Boyes','[\"8\"]','Not applicable','Not applicable','Goulburn','','NSW',0,0,0,'[\"ENGCO\"]','[\"EQUIP\"]','Inadequate Segregation of Parts and Goods','\"During a Quality Audit of the MRO Section,it was found that incoming goods and aircraft U/S items were all placed on the same area.\"','\"Suggested Solution - Incoming, outgoing and U/S goods/parts storage need to be segregated to comply with MPM.\"','All goods have now been separated.','',NULL),(1086,139,'group','','2','2009-11-04 03:32:00','2009-05-14 14:00:00','2009-05-04 14:00:00','2010-05-21 05:46:00','Rob Boyes','[\"8\"]','Metro 23','Not applicable','Goulburn','','NSW',1,1,0,'[\"ENGCO\"]','[\"DESIGN\"]','Flammables and Corrosives Incorrectly Stored','\"During a Quality Audit of the MRO Section, it was found that flammable and corrosive items were incorrectly stored.\"','It was identified that insufficient cupboard space exists; it is recommended that more cupboard space is acquired. The Manager MRO will ensure that this matter is addressed with the opening of the new hangar.','Flammable and corrosive materials are now being stored correctly in the new hangar.','',NULL),(1087,138,'group','','2','2009-11-04 03:31:00','2009-05-13 14:00:00','2009-05-04 14:00:00','2009-11-04 03:31:00','Rob Boyes','[\"8\"]','Not applicable','Not applicable','Goulburn','','NSW',0,0,0,'[\"ENGCO\"]','[\"EQUIP\"]','GSE Maintenance Inadequate','\"During a Quality Audit of the MRO Section, it was found that GSE equipment maintenance has been falling behind due to nil time, no GSE area and no GSE personnel.\"','\"Audit Proposed Solution The new hangar will relieve the space issue by providing a designated GSE area. Due to a change in work regularity, more focus can be aimed in GSE maintenance. Part time GSE personnel can be an option. The Manager MRO will ensure that this matter is addressed with the opening of the new hangar.\"','It was decided that Ground Handling in Pialligo would be responsible for tracking and maintenance and that MRO would do weekly inspections.','',NULL),(1088,137,'group','','2','2009-07-14 05:07:00','2009-05-05 14:00:00','2009-05-04 14:00:00','2010-05-21 05:47:00','Antony Springer','[\"10\",\"8\"]','Cessna 441 Conquest','VH-VED','Ballera','','QLD',0,1,0,'[\"FLTOPS10\"]','[\"DESIGN\"]','Difficulty Accessing Life Jackets','\"Whilst checking the serial numbers and expiry dates of the pilot\'s and co-pilots life jackets the following was observed: 1. The Pilot\'s life jacket was difficult to deploy due to the effectiveness of the Velcro tape sealing the jacket receptacle. 2. The Co-Pilot\'s jacket was difficult to deploy due to the effectiveness of the Velcro tape and with the additional problem of poor access due to the fire extinguisher. The jacket would not release the from the receptacle from the front, but had to be accessed from the rear underside of the seat. In both cases it was necessary to remove the jackets whilst kneeling on the floor. The matter is being investigated.\"','The MRO manager will ensure that all aircraft are inspected to ensure that life jackets are easy to remove from their storage pouch. The Chief Pilot will issue a NOTAC to ensure that pilots understand that their seats must be reclined to gain access to the life jacket stowage pouches.','NOTAC 18/09 has been issued to remind pilots of the procedure to access the life jackets.','',NULL),(1089,136,'group','','2','2009-07-14 05:03:00','2009-05-04 14:00:00','2009-04-11 13:14:00','2009-07-14 05:03:00','Mark Norris','[\"10\"]','Metro 23','VH-VEU','Melbourne','','VIC',0,0,0,'[\"FLTOPS01\"]','[\"COMMS\"]','Incorrect Aircraft Load Sheet Information','\"About 10 minutes before departure the F/O noticed that the load in the aircraft did not appear to be the same as the information on the load sheet. The load sheet was re checked and it was found that the calculations provided by the client did not match the aircraft load. The client was contact by telephone by the Captain to inquire as to the discrepancies. The captain was informed that 444kg was omitted from the load sheet in zone 4(zone 4 previously had shown no freight on the load sheet), this appeared to be due to a clerical error. After aircraft weight and balance and V speeds were re worked, the flight was continued without incident. In this case a potential incident was adverted due to the F/O diligently checking the aircrafts actual load vs the information on the load sheet. The matter is under investigation.\"','The Chief Pilot will develop a procedure to prevent aircraft loading errors from occurring in future.','NOTAC 17/09 has been issued.','',NULL),(1090,134,'group','GS134','2','2009-05-05 00:31:00','2009-04-30 14:00:00','2007-12-31 13:00:00','2009-05-05 00:31:00','Michael Bird','[\"10\"]','Cessna 441 Conquest','VH-VEJ','Ballera','','QLD',0,0,0,'[\"FLTOPS07\"]','[\"ENVIRO\",\"TECH\"]','Tyre Blowout during the Landing Roll','On landing at Ballera excessive brake pressure was applied to the left brake during the landing roll. This caused the left hand main tyre to blowout causing the aircraft to come to a stop on the runway. The pilot applied the excessive braking due to a deeper than expected landing due to thermal turbulence and a 13 knot crosswind causing an unstabilised approach very late in the landing.','The pilot failed to commence a go around from late in the approach which would have prevented this incident from occurring.','The pilot was counselled with regard to this incident. Pilots are encouraged to conduct a go around if the final approach to land is an unstablised approach.','',NULL),(1091,133,'group','GS133','2','2009-05-01 02:36:00','2009-04-30 14:00:00','2008-03-02 13:00:00','2009-05-04 22:07:00','Mark Norris','[\"10\"]','Cessna 441 Conquest','Other','Hillston','','NSW',0,0,0,'[\"FLTOPS05\"]','[\"EQUIP\",\"TECH\"]','Breakdown of Separation','TFB and VEM both departed Hillston for Renmark within 2 min of each other on a normal charter operation. TFB was cleared to climb to FL240 and VEM cleared to FL230 but requested FL260. Both aircraft were maintaining there cleared levels when a regular radar return was recieved by ATC. VEM was then cleared to climb through the level of the leading aircraft (TFB) at which time the radar return from TFB was lost. At the time when there was a constant radar return there was 12nm between the two aircraft with this distance increasing. VEM had a constant radar return throughout the entire climb.','This incident report was raised due to the irregular return of the lead aircraft\'s transponder in a remote area. From the facts presented flight crews had complied with all issued instructions and procedures.','\"The flight crew were reminded of the separation requirements between radar and non radar environments. The company requires that all multiple aircraft flights in the future will depart with up to 5 mins between aircraft depending on the airspace they are flying in, i.e. radar or non radar airspace.\"','',NULL),(1092,132,'group','GS132','2','2009-05-01 01:59:00','2009-04-30 14:00:00','2008-03-23 13:00:00','2009-05-04 22:04:00','Mark Norris','[\"10\"]','Cessna 441 Conquest','VH-VEH','Canberra','','ACT',0,0,0,'[\"FLTOPS06\"]','[\"DESIGN\",\"ENVIRO\",\"EQUIP\",\"ORGAN\",\"TECH\"]','Failure to Comply with ATC Instruction','\"The aircraft was approaching Canberra on a flight from West Sale when it was radar vectored for the runway 35 ILS approach. The aircraft failed to intercept the localiser and passed through the centreline towards the east. The aircraft was issued another intercept heading but failed to intercept the localiser in a position that allowed for an instrument approach. ATC issued a missed approach instruction and the aircraft was radar vectored for a second attempt at the runway 35 ILS approach. The pilot commented on whether the localiser was working with the tower advising that there were no issues and that 7 previous landing aircraft had indicated no faults. The aircraft appeared to intercept the localiser but failed to report this to ATC. The aircraft was then observed to diverge to the right of the centre line by 0.5nm and informed the pilot of the deviation. The pilot initiated a missed approach and asked if there was another instrument approach available and agreed upon the runway 35 VOR after ruling out the RNAV approach (the pilot was not endorsed to carry out this procedure). The pilot declined an offer from ATC to hold at Church Creek to sort the issue out and continued with the runway 35 VOR approach. The aircraft intercepted the 168 radial at 18 DME Canberra and was then cleared for the approach, the aircraft immediately began a descent below 6000ft. The aircraft was closely monitored and initially remained above the MVA. When the aircraft descended below 5300ft the aircraft was issued with a warning of \'appear 300 to 400ft below profile\'. The rate of descent was decreased but at 13 DME at an altitude of 4600ft an Altitude Safety Alert was issued with the aircraft immediately climbing to 6000ft. The tower was questioned about the possibility of a visual approach with the aircraft being radar vectored to a possible hole in the cloud northeast of the field. The aircraft subsequently became visual and conducted a visual approach onto runway 30. Several other aircraft were delayed to facilitate the extra handling of the aircraft.\"','The pilot in this incident had failed to correctly identify and test the navigation aids prior to commencing the ILS approach. It was found after the flight that the VOR/LLZ aerial cables had come loose and disconnected from the aerial causing the instrumentation indications that the pilot was observing at the time. The pilot also failed to ask for the DME arrival procedure or for the NDB approach which would have allowed the pilot to become visual on either of those respective approaches. The pilot also failed to allow himself time to resolve the issues prior to the second ILS approach. The time taken here may have allowed him to establish That the VOR and LLZ indications would have been unavailable prompting him to request either the DME arrival or the NDB approach. The pilot also became very distracted during this incident which would have lowered his decision making capability and allowing himself to be talked into conducting the runway 35 VOR approach by the tower when the instrument for this procedure was unservicable. Time mangement and Cockpit Resource Management were definitely contributing factors in this incident.','The pilot was immediately removed from flying duties pending retraining. An extensive debrief was conducted by a senior member of the check and training staff to help identify how this incident was allowed to develop. This debrief session was also used to determine the level of retraining that would be required to bring the pilot upto company standards. A training session and base check were undertaken with a successful pass being awarded to the pilot at the completion. The pilot was also endorsed to conduct GPS non precision approaches which would have allowed the pilot to conduct a successful instrument approach on the day of the incident.','',NULL),(1093,131,'group','GS131','2','2009-05-01 01:36:00','2009-04-30 14:00:00','2008-04-04 01:15:00','2009-05-04 21:59:00','Nicholas Faulks','[\"10\"]','Cessna 404 Titan','VH-VEC','Bankstown','','NSW',0,0,0,'[\"FLTOPS03\"]','[\"ORGAN\",\"TECH\"]','Runway Incursion','The pilot called ready for runway 29R at Bankstown. The tower asked the pilot if runway 29R was acceptable or would he prefer runway 29C. The pilot replied that runway 29R was fine if there was no delay. Since there was going to be no delay the aircraft was instructed to line up. When the tower controller looked up the aircraft had crossed runway 29R and was entering runway 29C.','\"During the taxi report to Bankstown SMC, the pilot requested runway 29C. At the holding point for runway 29R the pilot called ready 29R but incorrectly assumed that this was only the name of the holding point, his intention was takeoff on runway 29C. The tower controller instructed the pilot to line up after asking if 29R was acceptable but had neglected to instruct the pilot to line up 29R, only the term line up was used. A read back confirmation from the pilot confirming that the lineup clearance was for runway 29C was not responded to from the tower and the pilot incorrectly assumed that the line up clearance was for 29C. The tower then advised the pilot of the runway incursion and the rest of the flight was completed without incident. The pilot later contacted the tower to discuss the issue and clear up any ambiguity.\"','\"The pilot concerned was counselled with regard to this incident and was instructed that if there is any doubt about an instruction, stop and get a confirmation. This incident occurred due to assumptions made by both parties involved in addition to a lack of familiarity with Bankstown operations on the pilot\'s behalf.\"','',NULL),(1094,130,'group','GS130','2','2009-05-01 01:19:00','2009-04-30 14:00:00','2008-03-11 13:00:00','2009-05-04 21:55:00','Damon Banks','[\"10\"]','Cessna 441 Conquest','VH-VEM','Sydney','','NSW',0,0,0,'[\"FLTOPS05\"]','[\"DESIGN\",\"INFO\",\"TASK\",\"TECH\"]','Failure to Comply with ATC Instruction.','The aircraft was assigned 5000ft on departure from sydney following the glenfield 6 departure with a Cordo transition. The aircraft was observed climbing through 5500ft and was asked to confirm that he was maintaining 5000ft. The pilot then responded that he was commencing a descent back to 5000ft.','During the departure the pilot had been recleared from 3000ft to 5000ft and had correctly set the altitude alerter to 5000ft. Other cockpit duties had caused a distraction and after the altitude alerter had chimed stating that the aircraft had climbed through 5300ft the pilot was drawn to the altitude incursion and immediately started a descent back to 5000ft. The pilot commented on the complexity of the Glenfield 6 departure and not having flown this procedure in the past he became fixated on the lateral navigation of the aircraft allowing the altitude incursion to occur.','\"The pilot was counselled on this incident and informed of the importance of being familiar with the approach procedure before calling ready to the tower. It is important that crews take time to study the impending departure prior to takeoff to avoid in flight distractions to occur, particularly when operating high performance aircraft.\"','',NULL),(1095,129,'group','GS129','2','2009-05-01 00:55:00','2009-04-30 14:00:00','2008-03-15 13:00:00','2009-05-04 21:53:00','Bradley Rule','[\"10\",\"8\"]','Cessna 441 Conquest','VH-VEM','Adelaide','','SA',0,0,0,'[\"FLTOPS05\"]','[\"EQUIP\"]','Inflight Engine Failure.','While transferring to the tower the pilot advised that an engine had been shutdown. There was no previous advice to ATC of an engine problem although the pilot was slow to respond to several ATC transmissions.','Passing through 6000ft on descent the right hand engine lost power. Having identified the engine failure the engine was secured and ATC advised of the situation. The subsequent landing and taxi were carried out without further incident. The aircraft was delivered to a maintenance facility in Adelaide where the fuel control unit was replaced and the aircraft put back into service.','\"The pilot in command flew the aircraft in accordance with all published checklists and followed all ATC instructions to the safe termination of the flight, Well done.\"','',NULL),(1096,128,'group','GS128','2','2009-05-01 00:43:00','2009-04-30 14:00:00','2008-03-24 13:00:00','2009-05-01 00:43:00','Bradley Rule','[]','Cessna 441 Conquest','Other','Canberra','','ACT',0,0,0,'[\"FLTOPS08\"]','[\"TASK\",\"TECH\"]','Runway Incursion','\"On return from Goulburn,TFB landed runway 35 when the tower observed the aircraft entering runway 30 to taxi to the GA parking area. The tower immediately advised TFB of the runway incursion and gave instructions to taxi to the GA park via runway 30 and taxiway Kilo.\"','The pilot had allowed himself to become complacent due to the simple nature of the ferry flight from Goulburn. The turn onto runway 30 after landing on runway 35 is a common occurrence which caused the pilot to follow this \'usual\' procedure without first receiving a clearance.','The pilot was counselled and a NOTAC was issued. This incident was also accomodated in the Goulburn to Canberra route guide whcih was published.','',NULL),(1097,127,'group','GS127','2','2009-05-01 00:33:00','2009-04-30 14:00:00','2008-03-05 17:10:00','2009-05-04 21:56:00','Phillip Chambers','[\"10\"]','Metro 23','VH-VEK','Adelaide','','SA',0,0,0,'[\"FLTOPS05\"]','[\"COMMS\"]','Violation of Controlled Airspace','\"The aircraft was out of communication at 1709 UTC and subject to INCERFA, the aircraft entered Adelaide CTA at 90nm. The aircraft called on several Melbourne centre frequencies but was unable to establish communication. AT 1718 UTC the pilot was contacted via mobile phone and asked to call ATC.\"','At approximately 100nm the crew noticed that there had been no communication with ATC for quite a while. The crew made several attempts to contact ATC but to no avail. Eventually a text message was sent from ATC to contact them on another frequency and a succesful attempt was made using the second VHF radio and an airways clearance issued after the aircraft had entered CTA.','\"The crew members on this flight were counselled and a NOTAC was issued after this incident reminding crews that if a prolonged silece is witnessed whilst in flight, crews are to make a \'check call\' with ATC to confirm that two way communication is available at all times.\"','',NULL),(1098,126,'group','GS126','2','2009-04-30 23:33:00','2009-04-30 14:00:00','2008-04-23 06:08:00','2009-04-30 23:56:00','Bradley Rule','[]','Cessna 441 Conquest','VH-VEM','Goulburn','','NSW',0,0,0,'[\"FLTOPS05\"]','[\"COMMS\",\"INDIV\",\"TECH\"]','Violation of Controlled Airspace.','\"At approximately 1604 local time ATC heard a call from VEM taxiing at Goulburn. A squawk code was issued but no readback or two way communication was heard. Soon after an open mike situation occurred which made communication to ATC on that frequency very difficult. An additional report was then heard assumed to be VEB but again no two way communication could be established. At approximately 1607 two radar paints appeared inside controlled airspace at an unverified 7000ft, this was subsequently confirmed by Canberra ATC. Both aircraft were producing STCA visual and aural alarms (proximity warnings) at the ATC facility. Traffic information was passed to both aircraft and VEM instructed to orbit. VEB was instructed to descend to 7000ft to establish separation from VEM and a clearance to enter Canberra controlled airspace was issued. Vem was then given an airways clearance to track to Canberra once separation with VEB had been achieved. There were a significant number of RPT departures and arrivals at the time and had the two VCA aircraft continued on there original route separation from these aircraft would have also been an issue.\"','\"This situation was created by a combination of pilot experience, a lack of two way communication between aircraft due to the open mike situation, the separation breakdown between the two aircraft due to the faster aircraft departing Goulburn behind the slower aircraft and the levels that were flown on the return flight to Canberra (effectively placing them in CTA too close to Goulburn).\"','Both of these pilots were counselled and after significant safety meetings amongst management staff a Goulburn to Canberra route guide was produced outlining the company policy that all pilots will plan the return flight to Canberra at 6000ft to allow sufficient time for high performance aircraft to obtain an airways clearance prior to entering controlled Canberra controlled airspace. A NOTAC 14/08 was also issued.','',NULL),(1099,125,'group','GS125','2','2009-04-30 22:54:00','2009-04-30 14:00:00','2008-05-25 09:12:00','2010-05-21 05:50:00','Adam Saddington','[]','Cessna 441 Conquest','VH-VEM','Wagga Wagga','','NSW',1,1,0,'[\"FLTOPS08\"]','[\"ENVIRO\",\"INDIV\",\"TECH\"]','Aircraft taxied into fuel installation.','\"After flying from Sydney to Wagga Wagga the aircraft was taxied to the General aviation parking area abeam the mobil refuelling bowser. During a turn to position the aircraft next to a parked Saab 340, the aircrafts right wing made contact with the shed surrounding the Mobil fuel installation. The aircraft was immediately shutdown, and the passengers disembarked before carrying out an inspection on the wing. Substantial damage had occurred to the fibreglass wingtip but no damage had occurred to the metal structure of the wing itself. The aircraft was subsequently repositioned on the airfield and parked awaiting maintenance.\"','\"Poor airfield lighting at night, the absence of taxiway lead in lines, high volumes of parked traffic and personal distractions were contributing factors to this incident.\"','\"The pilot in command was counselled after this incident regarding the requirement to stop the aircraft if in doubt of being able to complete a manoeuver during taxi operations particularly in bad light. The pilot may have placed pressure on himself at the time to complete the task quickly whilst passengers were on board. The company would like ALL staff members take the following two points on board: 1 - IF IN DOUBT, STOP. 2 - NEVER ASSUME. It is better to slow down and do a job properly, than to rush a job and make a potentially costly mistake. A JOB DONE WELL SAVES MONEY.\"','',NULL),(1100,124,'group','GS124','2','2009-04-30 04:48:00','2009-04-29 14:00:00','2008-04-03 13:00:00','2009-04-30 05:15:00','Cameron Heathwood','[]','Cessna 441 Conquest','VH-VEJ','Canberra','','ACT',0,0,0,'[\"FLTOPS06\"]','[\"INDIV\",\"TASK\"]','Failure to comply ATS instr/proc','VEJ was originally on the POLLY SEVEN ARRIVAL when offered track shortening to CCK thence YSCB which the pilot accepted. Several minutes after this and the pilot reporting visual VEJ was cleared a visual approach with no amendment to the route clearance. At about 15NM south east of Canberra the ATC noticed the aircraft tracking direct to the field and asked to pilot if they were still tracking via CCK to which the pilot replied in the negative due to the visual approach. The ATC reminded the pilot of the tracking requirements of a visual approach and transferred the aircraft to the tower.','\"The following factors may have had some bearing: 1) In the pilots experience with Canberra Approach, when offered a visual app the controller usually gives tracking instructions with the clearance, e.g. \"\"make visual app, RWY 35, track for close left base\"\". In this case the instruction for track shortening was given prior to the offer of a vis app. The pilot assumed that the vis app clearance cancelled the previous tracking instruction. 2) Relaxing approaching the home airport due to familiarity.\"','\"Following the incident the pilot had learned not to make assumptions. Instead ask for clarification and to not relax when approaching your home airport. The pilot also reviewed and familiarised himself with vis app requirements. As a result, all incidents by company pilots would be de-identified and placed on the company internal website. All crew would be required to read the internal incidents and other relevant posts on the website in order to raise awareness and prevent similar occurrences.\"','',NULL),(1101,123,'group','GS123','2','2009-04-30 04:13:00','2009-04-29 14:00:00','2008-05-06 14:00:00','2009-04-30 04:33:00','Allister Polkinghorne','[]','Cessna 441 Conquest','VH-VEJ','Abeam Canberra','','ACT',0,0,0,'[\"FLTOPS05\"]','[\"EQUIP\",\"TASK\"]','Failure to comply ATS instr/proc','\"VEJ was assigned F180. At time 2136, at the transition from class C to Class E abeam Canberra on the CORDO dct cooma track, VEJ climbed to F190 without clearance. CLAM alert activated on ATC display. Prior to this at time 2128, VEJ also deviated 60 degrees and 6 NM to the right of cleared track without clearance, separation was uncompromised as adjacent aircraft were at vertically separated levels.\"','This incident was a result of multiple minor equipment malfunctions which had no specific warnings: 1) HSI had been intermittently (for up to 2 minutes) U/S on a previous flight but functioned normally ok generally. 2) The ALT hold on the autopilot very occassionally disengaged without disengaging the autopilot giving an aural. 3) With the ALT hold disengage there is no altitude warning unless ALT select is activated. Both occured similtaneously at the time a trend check was being carried out. Componants were replaced in the aircraft on the return flight via Goulburn.','\"The aircaft\'s #1 inverter was responsible for the intermittent failures. Inverter was replaced. However, the pilot was counselled on maintaining a more vigilant scan while doing any paperwork and in particular, as he had reported in his response, that there had been an intermittent fault with the HSI on the previous sector. The pilot was advised that the trend check should have been disregarded and his focus should have been on monitoring the aircrafts systems.\"','',NULL),(1102,122,'group','GS122','2','2009-04-30 03:52:00','2009-04-29 14:00:00','2008-07-09 14:00:00','2009-05-04 21:52:00','Brad Rule','[\"10\"]','Cessna 441 Conquest','VH-VEJ','Mackay','','QLD',0,0,0,'[\"FLTOPS04\"]','[\"ENVIRO\",\"INDIV\"]','Failure to comply ATS instr/proc','The aircraft was given a conditional lineup clearance behind a departing DASH 8. As the DASH 8 commenced departure roll ADC observed the aircraft to have stopped inside the runway strip.','\"The pilot was given a conditional lineup clearance behind the DASH 8. While taxiing to the holding point for 14, the pilot missed the holding point but stopped short of the active runway. The pilot believed the holding point was not clearly visible.\"','\"The pilot had been involved in a number of incidents. Following a formal interview and counselling, it was concluded that the pilot\'s standards need to be higher during line operations. Personal issues may have contributed to this incident.\"','',NULL),(1103,121,'group','','2','2009-05-08 05:17:00','2009-04-22 14:00:00','2009-04-22 14:00:00','2009-06-01 11:39:00','Damon Banks','[\"10\",\"8\"]','Cessna 441 Conquest','VH-VEH','Canberra','','ACT',0,0,0,'[\"FLTOPS10\"]','[\"ENVIRO\"]','Windscreen Defog Required for VEH','\"A pilot has suggested that a windscreen defog fan be fitted to VEH to enhance safety during approach, landing and taxi after landing. The matter is being investigated.\"','','The aircraft has had the fans fitted.','',NULL),(1104,120,'group','','2','2009-07-14 04:59:00','2009-04-22 14:00:00','2009-04-19 14:00:00','2009-07-14 04:59:00','Antony Springer','[\"10\",\"8\"]','Cessna 441 Conquest','VH-VEJ','Ballera','','QLD',0,0,0,'[\"FLTOPS07\"]','[\"EQUIP\"]','Nosewheel Deflates','\"On a scheduled flight from Ballera to Moomba(NC46)upon landing the Nose gear tyre deflated. From touchdown to the point of recognition the time delay would have been between 3 and 5 seconds when the nose gear began to vibrate badly. The pilot felt this may have been due to either a slow leak or little weight on the gear The aircraft was taxied to the ramp and shut-down. Upon visual inspection a rupture in the tyre carcass was evident. A runway inspection was carried out to ascertain if the deflation was caused by FOD, but no evidence of this could be found. The matter is being investigated.\"','\"The aircraft has been fitted with a number of different tyres, tubes and wheels but has still blown three tyres.\"','The aircraft will be tested for nosewheel alignment on touchdown. Preliminary checks have been done with no faults found. The aircraft is scheduled for major maintenance soon and will be examined more closely.','',NULL),(1105,119,'group','GS119','2','2009-04-22 07:08:00','2009-04-21 14:00:00','2008-07-17 14:00:00','2009-04-23 05:05:00','Allister Polkinghorne','[\"10\"]','Cessna 441 Conquest','VH-VEM','YSBK','','NSW',0,0,0,'[\"FLTOPS05\",\"FLTOPS06\"]','[\"INFO\",\"TECH\"]','Failure to Comply ATS INSTR/PROC','VEM Joined downwind for RWY 29R A010(observed on TSAD) instead of A015 as required by ERSA.','\"Pilot reported that owing to the need to keep other aircraft in sight against an urban back ground, desent was commenced early. i.e to provide a more contrasting back ground than an urban landscape. He felt tht failure to do this may have resulted in a lack of certainty of seperationfrom other circuit traffic. VMC existed but there was low light owing to rain and cloud cover.\"','The pilot in command was questioned about the procedures at GAAP aerodromes and he said that he was aware of the requirments to maintain 1500\' until on downwind. A NOTAC was been issued regarding this incident.','',NULL),(1106,118,'group','GS118','2','2009-04-22 06:58:00','2009-04-21 14:00:00','2008-09-23 14:00:00','2009-04-23 05:07:00','Phil Chambers','[\"10\"]','Metro 23','VH-VEU','YMML','','VIC',0,0,0,'[\"FLTOPS01\",\"FLTOPS02\"]','[\"ENVIRO\"]','Freight left in front of aircraft','\"The aircraft was parked at YMML on bay F18A. Before starting the Captain noticed four freight barrows parked in front of the aircraft. The barrows were left \"\"outside\"\" of the red parking line, that would infringe on the turning radius. The first officer disembarked and asked one of the ground handlers to move the barrows. The aircraft was then started and taxied with out incident.\"','','','',NULL),(1107,117,'group','GS117','2','2009-04-22 06:52:00','2009-04-21 14:00:00','2008-09-28 14:00:00','2009-04-23 05:11:00','Scott Lemon','[\"10\"]','Cessna 441 Conquest','VH-VEM','YLLE','','QLD',0,0,0,'[\"FLTOPS04\"]','[\"ENVIRO\"]','Bird Strike','\"A bird strike occured on take-off roll on RWY 21, it was subsequently identified as a Plover. There was no damage to the aircraft as the bird had passed through the left propellor arc at about 80kts. The carcass was removed by the Airport Manager after departure.\"','','','',NULL),(1108,116,'group','GS116','2','2009-04-22 06:40:00','2009-04-21 14:00:00','2008-10-07 13:00:00','2009-04-23 05:12:00','Michael Haduka','[\"10\"]','Cessna 441 Conquest','VH-VEJ','Ballera','','QLD',0,0,0,'[\"FLTOPS07\"]','[\"ENVIRO\"]','Bird Strike','On landing roll the bird struck the R/H propeller. Aircraft speed on impact wa approximately 60kts.','','','',NULL),(1109,115,'group','GS115','2','2009-04-22 06:23:00','2009-04-21 14:00:00','2008-07-28 14:00:00','2009-04-23 05:21:00','Michael Bird','[\"10\"]','Cessna 441 Conquest','VH-VEM','Sydney','','ACT',0,0,0,'[\"FLTOPS05\",\"FLTOPS06\"]','[\"TECH\"]','Failure to Comply ATS INSTR/PROC','\"The aircraft was being radar vectored on to a left circuit to land on runway 16L and was issued heading instructions to intercept the runway 16L localiser. The aircraft appeared to pass through centerline and the Director asked the pilot if the aircraft was established on 16L, which the pilot confirmed. The aircraft was observed to pass through the centreline. and the Director reconfirmed the aircraft was intercepting R16 and the 16L localiser frequency was reiterated. The aircraft continued towards the 16R localiser, traffic was passed on a B737 ahead on final for 16R and a wake turbulence caution given. The aircraft continued in a left turn to intercept final R16L.\"','\"Whilst under radar vectoring in cloud for RWY 16L the pilot broke visual just prior to intercepting the 16L LLZ. The pilot immediatly transitioned to visual flight and sighted prededing traffic. The pilot began to roll out of the intercepting turn to follow another aircraft, when he realised that the traffic was in fact tracking along the RWY16R LLZ not 16L. Recognising the error, he immediately restarted the turn to intercepr the 16L LLZ. He replied with \"\"Affirm\"\" and conducted the rest of the flight normally.\"','\"To prevent this scenario from re-occuring in the future, pilots are reminded to maintain a \"\"Full\"\" instrument scan and not transition to visual flight until the aircraft has completely intercepted the LLZ. This is a classic case of human error where the instrument scan was dropped to follow an incorrect visual cue. The crew member has been counselled and has been asked to re-read, NOTACS 01/08 and 14/08.\"','',NULL),(1110,114,'group','GS114','2','2009-04-22 06:12:00','2009-04-21 14:00:00','2008-08-12 14:00:00','2009-04-23 05:28:00','Blair Fraser','[\"10\"]','Metro 23','VH-VEU','Approaching Sydney','','NSW',0,0,0,'[\"FLTOPS05\"]','[\"INDIV\"]','VCA Failure to comply ATS INSTR/PROC','\"The aircraft was assigned A060 inbound to Sydney via the Odale STAR. The aircraft was observed to descend to A057 and the controller queried the pilot. The pilot said \"\"Sorry\"\" and was observed to descend to A056 before climbing back to A060. There was no conflicting departing traffic at the time.\"','\"The Captain was the non-flying pilot. The aircraft was cleared to 6000\' on the Odale star into SY. Company procedures require an \"\"approaching altitude\"\" call from the non-flying pilot 300\' from the nominated altitude. The Captain cannot say with confidence whether he made that call. However, he does recall calling \"\"altitude\"\" when they were 300\' below the assigned altitude. The crew belive that they may have becom distracted by the radios, as AAE were atempting to contact them at around that time. In addition the flying pilot may have been momentarily distracted adjusting the power levers as they were flying through cloud and associated turbulence at that altitude. Strictly following company procedures would have adverted the whole incident. Since the incident, the crew have become more dilligent in these matters.\"','The crew memeber has been counselled and has been asked to re-read Notac 01/08 & 14/08','',NULL),(1111,113,'group','GS113','2','2009-04-23 07:51:00','2009-04-21 14:00:00','2008-11-11 13:00:00','2009-04-23 07:51:00','Richard Bennet','[\"10\"]','Cessna 404 Titan','VH-VEC','Melbourne','','VIC',0,0,0,'[\"FLTOPS05\"]','[\"TECH\"]','Failure to Comply ATS INSTR/PROC','\"At 0151 the aircraft was carrying out east west survey runs at A060 to the north of Melbourne. Duty Runway 34 at Melbourne, with all departures maintaining the standard paper stop level of A050. The aircraft was observed to commence descent to A057, and was immediately instructed to maintain A060. The pilot acknowledged this but was observed to descend to A054 shortly afterwards. There was no immediate conflict with any departures. The aircraft was turned back to the west to remain clear of the RWY 34 departure path. The survey area can be affected by mechanical turbulence in a strong northerly wind which was present at the time. Shortly afterwards the pilot cancelled the survey in the area and requested clearance to the south east of Melbourne. During the flight the pilot reported moderate turbulance and thermal activity and having difficulty maintaining altitude and ground speed due to the aircrafts power settings and configuration with the autopilot engaged. At one stage the pilot encountered flight charcteritics akin to pre stall buffet.\"','\"The pilot involved in this incident is only new to this style of operation and did not consider the effect that the mechanical turbulance would have on the aircraft in its high drag configuration required for this survey operation. Survey pilots typically fly with auto pilot on to guarantee customer satisfaction with the accuracy of the survey lines flown. Auto pilots use also serves to reduce pilot fatigue during survey operations due to high levels of accuracy required and long duty days that can be experienced. This pilot was breifed on use of the auto pilot during high drag and low speed operations. In addition to use of the auto pilot in high turbulence and inadvertant icing conditions. The pilot has completed an online course in the use of weather radar, flight around thunder storms, fog and icing traning. This has been a learning experience for the pilot concerned and will be a syllabus item for inital training of new pilots for survey operations\"','','',NULL),(1112,112,'group','GS112','2','2009-04-22 05:08:00','2009-04-21 14:00:00','2008-04-28 14:00:00','2009-04-23 05:38:00','Hugh Antony Springer','[\"10\",\"8\"]','Cessna 441 Conquest','VH-VEW','15NM NNE Ayers Rock','','NT',0,0,0,'[\"FLTOPS05\"]','[\"EQUIP\",\"TECH\"]','Inflight Shutdown','\"While conducting a photographic survey in the vicinity of \"\"The Olgas\"\" the left engine oil pressure gauge of decreased rapidly from normal operating pressure reading to a zero reading. AThe pilot decided to conduct a precautionary engine shut down and feather and immediately proceed to Ayers Rock airport approximately 15nm to the NNE. A \"\"Pan\"\" call was made to Melbourne Centre and the flight proceeded without further incident and an uneventful asymmetric landing followed upon arrival. Post flight examination in conjunction with advice from company engineers showed no discernable problem with the engine and a succesful ground run was performed. The suspected cause of the erroneous reading was thought to be an oil pressure sender unit located in the aft section of the engine bay. This was later confirmed and the faulty part was replaced. When this incident occurred the aircraft was in the middle of a survey line and the pilot was concerned to see the oil pressure gauge reading zero. The pilot knew that the engine had been recently overhauled and, although there were no other indications of a system failure, (surging, annunciator warning) the pilot elected to shut-down the engine, referencing the Emergency Check List as a precaution to prevent possible engine damage.\"','\"After the aircraft had safely landed at Ayers Rock and the fault was determined, the pilot reviewed his actions with the intent of finding procedural errors. They were: Not taking the time to correctly diagnose a system fault or failure. Not having a sufficient recall of secondary system failure procedures. Not referencing the POH to aid in the diagnostic process.\"','The PIC has been reminded of the company requirments to refer to the check lists and flight manual for all emergencies/abnormal procedures operations.','',NULL),(1113,111,'group','GS111','2','2009-04-22 04:54:00','2009-04-21 14:00:00','2007-02-11 13:00:00','2009-04-23 05:44:00','Denis Gailey','[\"10\",\"8\"]','Cessna 441 Conquest','VH-VEJ','Newlands Coal Mine','','QLD',0,0,0,'[\"FLTOPS04\",\"FLTOPS05\"]','[\"EQUIP\"]','Maladjusted Up lock','\"On departure Newlands Coal mine, the pilot selected gear up. The \"\"Hydraulic Press\"\" annunciator remained on as well as the gear unlocked light. The Pilot cycled the gear down to get 3 greens. The Check List finally calls to land ASAP. The Pilot diverted direct to Mackay.\"','The fault was determined to be a maladjusted up lock.','NOTMRO 07/09 has been issued to advised engineers about uplock adjustment.','',NULL),(1114,110,'group','GS110','2','2009-04-23 07:52:00','2009-04-21 14:00:00','2007-03-13 13:00:00','2009-04-23 07:52:00','Andrew Major','[\"10\"]','Beech 58 Baron','VH-VEG','Canberra','','ACT',0,0,0,'[\"FLTOPS05\"]','[\"TECH\"]','VCA Firing Area South','On departure the aircraft flew through Firing Area South despite being given a heading which would have kept the aircraft clear of the restricted area. The tower had received a correct read back of the assigned heading of 350. The aircraft heading was later compared against its tracking and when the aircraft was tracking 001 the pilot reported the heading as 005. The SFIRE restricted area firing was shut down by the control tower just prior to the aircraft infringing the restricted airspace.','','The pilot was counselled to take more care to observe assigned headings.','',NULL),(1115,109,'group','GS109','2','2009-04-22 04:35:00','2009-04-21 14:00:00','2007-05-10 14:00:00','2009-04-23 05:48:00','Tim Leatch','[\"10\"]','Cessna 441 Conquest','VH-VEJ','Oaky Creek','','QLD',0,0,0,'[\"FLTOPS04\"]','[\"ENVIRO\"]','Bird Strike','The aircraft suffered a bird strike on take off run mid-way down the runway.','A vehicle was later used to disperse birds','','',NULL),(1116,108,'group','GS108','2','2009-04-22 04:15:00','2009-04-21 14:00:00','2007-08-04 14:00:00','2009-04-23 06:05:00','Phil Chambers','[\"10\"]','Cessna 441 Conquest','VH-VED','YTRE','','NSW',0,0,0,'[\"FLTOPS06\",\"FLTOPS07\"]','[\"ORGAN\",\"TECH\"]','SPFIB information','\"On receiving SPFIB #40525, there was no relevant NOTAM information on YTRE indicating maintenance work was going to be carried out on the runway. The RWY at YTRE did not have an \"\"X\"\" indicating that the RWY was unservicable or any other visible markings that the RWY was under maintenance. On conducting a safe go-around procedure the pilot elected to divert to YPMQ for a landing.\"','\"The missing NOTAM information occured because when downloading the SPFIB the pilot selected the option for Australian International NOTAMS. This option provides no information on non-International aerodromes like YTRE on the SPFIB. The pilot concerned, like other pilots, had been shown that in order to receive full text notams with command Flight Planner, the easiest way was to select \"\"Aus International Series NOTAM\"\" The correct method is to go to \"\"location Briefing\"\" which has an additional option for \"\"Full Text Notams\"\" or the Airservices Australia NAIPS site.\"','\"All crew were phoned and NOTAC 18/07 was issued to ensure that this incident does not re- occur. A suggestion, was put to Airservices Australia to change the title of \"\" Aus International Series NOTAM\"\" To \"\" Aus International Series Notam Only\"\"\"','',NULL),(1117,107,'group','GS107','2','2009-04-22 04:03:00','2009-04-21 14:00:00','2007-06-04 14:00:00','2009-04-23 06:08:00','Andrew Bligh','[\"10\"]','Cessna 404 Titan','VH-VEA','Albury','','NSW',0,0,0,'[\"FLTOPS05\",\"FLTOPS06\"]','[\"INFO\",\"TECH\"]','VCA Albury','The pilot was told to expect a clearance on the 045 Radial because of traffic. At the sartime (incorrect sar time applied) the aircraft was observed on TSAD to be approximately 22nm AY at A080 inside CTA. Communication was established and the aircraft cleared to cross CTA.','','The pilot was counselled.','',NULL),(1118,106,'group','GS106','2','2009-04-22 03:50:00','2009-04-21 14:00:00','2007-07-25 14:00:00','2009-04-23 06:13:00','Anthony Willis','[\"10\"]','Cessna 441 Conquest','VH-VEZ','Moomba','','SA',0,0,0,'[\"FLTOPS04\",\"FLTOPS05\"]','[\"ENVIRO\"]','Gas detector alarm sounding','\"Shortly after lift off a loud alarm sounded in the aeroplane. An employee, who was traveling with four gas detector units carried in the cabin as freight, identified the problem. He advised the pilot that he thought it was a \"\"low battery alarm\"\" and volunteered to go and silence the device. The pilot declined this offer and instruced the passangers to remain seated while returning for landing. Two of the four (\"\"Growcon Detective Gas Detector\"\") Units activated. There noise was disruptive even through the pilot\'s headset impinging on both clear thinking and radio communication. Communications with other traffic, ATC and Moomba base were maintained with difficulty and a normal circuit and landing made on runway 30.\"','','\"Pilot noted that as a result of this event he shall not carry gas detector units until an adequate protocol is adopted to prevent a recurrence. The client has advised that, in future, any gas detector units consigned by air will have their batteries removed.\"','',NULL),(1119,105,'group','GS105','2','2009-04-22 03:32:00','2009-04-21 14:00:00','2007-02-11 13:00:00','2009-04-23 06:19:00','Neil Glanville','[\"10\"]','Metro 23','VH-VEK','Albury','','NSW',0,0,0,'[\"FLTOPS03\",\"FLTOPS04\"]','[\"INFO\",\"ORGAN\"]','Runway Incursion','\"The Co-pilot received the taxi clearance, ATC cleared the aircraft to taxi & line up RWY 07. A smaller aircraft was cleared to take off from the intersection on RWY 07. The Co-pilot and Captain completed the usual visual checks prior to entering RWY 07 and back tracking. The Co-pilot reported ready approaching end of RWY 07 and ATC cleared the aircraft for take-off.\"','','\"The clearance as understood by the crew on initial contact with ATC was to \"\"taxi via the parallel for RWY 07 enter, backtrack and line up\"\". There was some doubt by both the crew and ATC (after a phone call to ATC) as to the exact clearance that was given. The Chief Pilot requested that the tapes be pulled to clarify what the clearance was. To prevent a similar occurrance all crew are to confirm with ATC prior to entering a runway if the clearance to line up was received prior to approaching the holding point.\"','',NULL),(1120,104,'group','GS104','2','2009-04-22 03:17:00','2009-04-21 14:00:00','2007-05-31 14:00:00','2009-04-23 06:23:00','Ian Kehle','[\"10\"]','Metro 23','VH-VEU','1NM East of Doncaster Shopping Centre','','ACT',0,0,0,'[\"FLTOPS06\"]','[\"ENVIRO\"]','Laser Shone into cockpit','On approach to ML whilst flying the Boyse 1 arrival for RWY 34 a green laser was shone into the cockpit','','This incident is similar to another occuring to a Company aircraft. NOTAC 08/05 refers.','',NULL),(1121,103,'group','GS103','2','2009-04-22 03:11:00','2009-04-21 14:00:00','2007-08-01 14:00:00','2009-04-23 06:26:00','Scott Lemon','[\"10\"]','Cessna 441 Conquest','VH-VEZ','100nm North of Adelaide','','SA',0,0,0,'[\"FLTOPS05\"]','[\"EQUIP\"]','VCA North of Adelaide','Between 0615 (135nm North of Adelaide) VEZ was unable to be contacted until time 0629 (81nm North of Adelaide) the aircraft could not be contacted by ATC and thus violated restricted CTA C airspace at 100nm. VEZ had made initial contact at transfer from an adjoining ATC unit but thereafter would not reply on any ATS frequency.','Pilot discovered that the radio he was using had failed. The pilot switched to the secondary radio and made contact with ATS.','','',NULL),(1122,102,'group','GS102','2','2009-04-22 02:05:00','2009-04-21 14:00:00','2007-08-31 14:00:00','2009-04-23 06:31:00','Michael Bird','[\"10\"]','Cessna 441 Conquest','VH-VEM','Adelaide','','SA',0,0,0,'[\"FLTOPS06\",\"FLTOPS07\"]','[\"EQUIP\"]','Undercarriage Downlight Failure','\"ATC had positioned the aircraft on a wide base for a visual approach to RWY 05. Normal pre landing checks were conducted at an appropriate position on this extended base leg. It was noticed that only two landing gear lights illuminated (the NLG and the left MLG lights). The pilot elected to recycle the gear which was conducted succedfully, but still the right MLG light failed to illuminate. Due to the close proximity of the aircraft to the final leg turn, the pilot elected to inform Adelaide Tower of the situation as there was insufficent time to properly diagnose the fault. The pilot was given an instruction from the tower to complete a flyby of the tower for visual inspection. He was informed that the gear was indeed down and appeared to be locked. A clearance for a left hand circuit was given and the pilot confirmed that the right hand MLG iindicator bulb was blown, via the use of the warning system annunciator pannel test switch. A normal left hand circuit for RWY 05 at Adelaide was flown with an incident free landing on RWY 05. Emergency services were called to local standby condition by Adelaide tower after the situation was reported. Emergency services followed the aircraft to the final parking position.\"','','Corporate Air has implemented a policy where all of it\'s aircraft carry spare 327 globes for this type of event.','',NULL),(1123,101,'group','GS101','2','2009-04-22 01:37:00','2009-04-21 14:00:00','2007-08-16 14:00:00','2009-04-23 06:33:00','Brad Rule','[\"10\"]','Beech 58 Baron','VH-VEB','Sydney','','NSW',0,0,0,'[\"FLTOPS05\"]','[\"INDIV\"]','Failure to Comply ATS INSTR/PROC','The iarcraft departed Sydney from RNWY 34R and climbed above its cleared altitude.','The pilot was distracted by a passenger and missed the assigned altitude.','\"The PIC was remined about the importance of maintaining a sterile flight deck in accordance with the operations manual, particularly when operating into Sydney, where an altitude excursion could be catastropic with over flying aircraft only 1000\' above.\"','',NULL),(1124,100,'group','GS100','2','2009-04-22 01:28:00','2009-04-21 14:00:00','2007-12-03 13:00:00','2009-04-23 06:38:00','Denis Gailey','[\"10\"]','Cessna 441 Conquest','VH-VEW','YMEN','','VIC',0,0,0,'[\"FLTOPS05\"]','[\"EQUIP\"]','Radio Failure-Open Microphone','\"The pilot was on ML departures frequency 118.9 after becoming airborne After several transmissions he became concerned that the radio was no receiving. It turned out there was an open microphone caused by the aircraft radio. The fault disabled all radios, nav aids and also the HF. The pilot transmitted in the blind and squawked 7600. His last assigned heading was a radar vector to the northeast at FL140. The pilot maintained HDG & altitude and advised intention of descending OCTA and landing at Mangalore.\"','','','',NULL),(1125,99,'group','','2','2009-04-23 06:42:00','2009-04-01 13:00:00','2009-04-01 05:15:00','2010-05-21 05:54:00','Andrew Yeats','[\"10\",\"9\"]','Metro 23','VH-VEU','Canberra','','ACT',0,1,0,'[\"FBOCO\"]','[\"TECH\"]','Failure to disconnect GPU','After assisting with a GPU start the ground handler drove off without disconnecting the GPU cable. The ground handler got the aircraft to shut down so the pilots could check the aircraft. The GPU plug and cable were both damaged and the ground power unit was declared unservicable. There was some damage to the aircraft around the plug insert. The matter is being investigated.','','The ground handler was counselled to exercise more care to ensure that the GPU is disconnected prior to driving away from the aircraft.','',NULL),(1126,98,'group','','2','2009-04-23 06:41:00','2009-04-01 13:00:00','2009-03-28 05:11:00','2009-05-08 05:15:00','Mark Norris','[\"10\",\"8\"]','Cessna 441 Conquest','VH-VEY','140 nm NW YPAD','','SA',0,0,0,'[\"FLTOPS05\"]','[\"EQUIP\"]','Malfunctioning TCAS','\"The pilot received a hard TCAS warning stating ÒTraffic Traffic 12Õoclock same altitude less than one mileÓ. Although he did not have visual contact with any aircraft the pilot immediately took evasive action. He informed Melbourne Centre that he had a TCAS warning and was commencing immediate descent. Melbourne Centre then informed the pilot that there was no known traffic in the area. Upon reaching FL150 the pilot ceased the aircraft\'s descent and recommenced climb back to FL170 informing Melbourne centre of his actions. At this point he informed the six passengers of the situation and determined that the TCAS warning was indeed a false indication, as the TCAS was indicating a phantom target moving around the aircraft around one mile. Throughout the remainder of the day numerous other TCAS warnings were received at various stages of flight. No action was taken on the addition TACS warnings as the pilot determined the system to be malfunctioning. Approximately 10mins after the initial TCAS warning and subsequent actions, ATC contacted the pilot to ask for further information on the TCAS warning. He informed them that he believed that it was a false indication. The matter is behing investigated.\"','A number of faults were found with the transponder which appear to have caused this problem.','\"Flight crew members that operate the conquest are currently undertaking training in the use and limitations of the TCAS systems. In accordance with the flight manual supplements fitted to each of the conquests flight manuals, crews are not to react to traffic warnings from this system by taking evasive action. The TCAS systems fitted to company conquests are only a tool to aid in visual identification and separation from other aircraft, the system does not provide a resolution advisory for traffic separation reasons. A TCAS course has been arranged for all pilots.\"','',NULL),(1127,97,'group','','2','2009-04-01 21:43:00','2009-03-25 13:00:00','2009-03-23 19:39:00','2009-04-01 21:43:00','Antony Springer','[\"10\",\"6\"]','Cessna 441 Conquest','VH-VED','Ballera','','QLD',0,0,0,'[\"FLTOPS04\"]','[\"INDIV\"]','Nose Locker Opens on Take-off','\"While commencing the take-off roll at Ballera for Mount Margaret Station, the forward most nose locker door opened pior to reaching rotation speed. The aircraft was safely decelerated to taxi speed and taken back to the apron. After engine shutdown the locker door was secured (and locked) and the leg was completed without further incident. The Safety Manager is investigating.\"','\"An investigation by gthe Safety Manager revealed the following. The pilot had commenced duty nine hours before the incident and had completed four legs in his five leg schedule for the day. The preceding leg from Moomba to Ballera was delayed because of late passenger check-ins on the BAE146 flight departing for Adelaide. The pilot reported that because of the delay he felt some pressure to commence the flight. As a result, he inadvertently failed to complete the walk around check of the aircraft in accordance with Company procedures laid down in both the Operations Manual and the Flight Crew Operating Manual and did not notice that the forward nose locker door was not properly secured. Analysis Pilots operating in the Cooper Basin are aware that timeliness of aircraft operations is an essential component of the clientÕs business. The Company has a standard procedure of conducting a final walk around to inspect the aircraft immediately before flight. This procedure is performed as a final check to ensure, amongst other things, that panels and doors are properly secured. In the case of the nose locker doors, the procedure not only calls for the doors to be secured by the latches but they must also be locked with a key. This ensures that, should a latch fail, the lock will hold the door closed. The nose locker doors are designed so that if they do come open in flight, they will not adversely affect the flight characteristics of the aircraft. On this occasion, the pilot failed to conduct this walk around check prior to the flight and the nose locker door was not secured. Findings The flight was running behind schedule because a previous flight had been delayed. The pilot allowed the resulting time pressure to affect his performance to the extent that he failed to secure the forward nose locker door. The pilot then failed to conduct the final walk around check in accordance with Company procedures. During the take-off roll the door opened and the pilot abandoned the take-off.\"','\"Safety Action The pilot identified a number of behavioral deficiencies that led to this incident: ¥ Allowing events beyond his control to influence his actions, ¥ Failure to follow standard Company procedures, and ¥ Failing to recognise time pressure as a trigger for increased awareness. The pilot has been counselled on the requirement to always perform the final walk around check prior to flight. He has also been counselled on the importance of not allowing time pressure to affect his duties. The Chief Pilot has raised a Notice to Aircrew (NOTAC) to all pilots re-iterating the requirement to conduct the walk around check immediately prior to flight in accordance with Company procedures.\"','',NULL),(1128,96,'group','GS96','2','2009-03-26 06:43:00','2009-03-25 13:00:00','2007-10-17 14:00:00','2009-04-23 06:43:00','Albert Stewardson','[\"10\"]','Cessna 441 Conquest','VH-VEJ','Canberra','','ACT',0,0,0,'[\"FLTOPS06\"]','[\"ORGAN\"]','Violation of Controlled Airspace.','The aircraft departed Goulburn and was instructed to contact Canberra Approach for an airways clearance. The aircraft was observedat 8500ft inside controlled airspace prior to calling for a clearance. ATC advised the pilot of the violation of controlled airspace and subsequently issued an airways clearance.','The Canberra approach frequency was congested at the time of the handover and the pilot was unable to contact Canberra Approach prior to reach the edge of the control area step.','It has now been made company policy to conduct all flights back from Goulburn to Canberra at 6000ft to allow extra time for the handover to Canberra approach prior to reaching the control area steps at higher altitudes. A route guide has been produced and is now published on the company website regarding flights between Goulburn and Canberra.','',NULL),(1129,95,'group','GS95','2','2009-03-26 06:08:00','2009-03-25 13:00:00','2007-11-13 13:00:00','2009-04-23 06:47:00','Blair Fraser','[\"10\"]','Metro 23','VH-VEK','Bathurst','','NSW',0,0,0,'[\"FLTOPS05\"]','[\"COMMS\",\"INFO\",\"ORGAN\",\"TECH\"]','Failure to Comply with ATC Instruction.','\"The following incident occurred on a flight from Canberra to Bathurst. At the handover stage from Goulburn to Bathurst sectors the pilot had requested a descent, but no clearance to descend was issued owing to the handover from one approach sector to the next. The aircraft left FL170 without a clearance and an alert was issued as the aircraft descended through FL165.\"','The pilot in command was in the process of giving the descent brief for the arrival into Bathurst. During the handover to Bathurst sector the pilot in command believed that he had been given the descent clearance and commenced the descent from FL170 at the completion of the descent brief. The pilot also failed to comply with the altitude setting requirements that are laid down by the company by not setting the altitude alerter following the readback of an instruction from ATC.','The Metro Flight Crew Operating Manual (FCOM) in section 1.1 clearly states the procedures to be followed with the use of the altitude alerter. . Both crew members were briefed on how their deviation from this operating procedure led to the this incident occurring.','',NULL),(1130,94,'group','GS94','2','2009-03-26 05:45:00','2009-03-25 13:00:00','2007-02-02 13:00:00','2009-04-23 06:49:00','Graham Sorrenson','[\"10\"]','Cessna 441 Conquest','VH-VEW','Orbost','','VIC',0,0,0,'[\"FLTOPS05\"]','[\"EQUIP\"]','Press to Talk Failure','\"Whilst operating at 14,000ft near Orbost on aerial survey operations the pilot became aware of an avionics malfunction in the radio press to talk switch. The pilot squawked 7600 on the transponder and immediately returned to land at Orbost. After landing the press to talk switch began to function normally again. The aircraft was then flown back to Canberra for maintenance.\"','The intercom unit for the aircraft had caused a problem with the transmit function of the communication radio.','The pilot responded correctly by diverting to an uncontrolled airfield. He was briefed that in returning to Canberra he was in jeapordy of the same fault reoccuring but in controlled airspace and that the return leg to Canberra was not necessarily the correct thing to do. Int the event that an aircraft breakdown occurs the crew should follow the breakdown procedures checklist that is kept in the maintenance release folder of each aircraft.','',NULL),(1131,93,'group','GS93','2','2009-03-26 05:14:00','2009-03-25 13:00:00','2007-07-03 14:00:00','2009-04-23 06:51:00','Bradley Rule','[\"10\"]','Beech 58 Baron','VH-VEG','Enroute to Shepparton','','NSW',0,0,0,'[\"FLTOPS05\"]','[\"ENVIRO\",\"INFO\",\"ORGAN\",\"TECH\"]','Inflight Airframe Icing','\"The aircraft was conducting a charter flight in accordance with the instrument flight rules from Sydney, NSW to Shepparton, Vic. At about 1415 Eastern Standard Time, the pilot departed Sydney Airport with one passenger on board. The flight was planned via overhead Canberra, ACT and Albury, NSW. The weather forecasts obtained by the pilot indicated that in the Canberra area the freezing level would be about 6,000 ft above mean sea level (AMSL) and that broken cumulus or stratocumulus cloud could be expected to extend between 5,000 and 10,000 ft with moderate icing in cloud. The aircraft was not equipped for flight into icing conditions. The pilot climbed the aircraft to the planned cruise altitude of 10,000 ft AMSL and was generally clear of cloud until over Canberra at 1532. At about 50 km to the south-west of Canberra the aircraft entered cloud with high moisture content at a temperature below 0 degrees C, resulting in the rapid accumulation of clear ice on the airframe. The pilot continued on track, but the build-up of ice eventually forced the pilot to descend below 7,500 ft, the published lowest safe altitude for the route. After maintaining 7,100 ft in cloud for a short time the pilot was cleared to descend to 4,900 ft. The pilot became visual and was able to descend further and to dislodge the ice.\"','The investigation found that the pilot was inexperienced operating in conditions conducive to icing and had not assimilated the guidance provided by the operator and the aircraft manufacturer.','\"While on this occasion the aircraft did not get very close to terrain, the circumstances of the occurrence are a salutary reminder of the hazard that winter weather in southern Australia can present to pilots of aircraft not equipped for flight in icing conditions. Corporate Air has introduced better training for new pilots that have not been exposed to significant icing conditions and now tests all flight crew members annually on the subject of Fog and Icing conditions.\"','',NULL),(1132,92,'group','GS92','2','2009-03-25 06:46:00','2009-03-24 13:00:00','2006-09-25 14:00:00','2009-04-23 06:55:00','Bill McIntyre','[\"10\"]','Cessna 441 Conquest','VH-VEW','Wagga Wagga','','NSW',0,0,0,'[\"FLTOPS05\"]','[\"INFO\",\"TECH\"]','Violation of Controlled Airspace.','The aircraft departed Wagga and the controller advised the pilot to expect clearance on radar identification. The pilot had requested and was given all traffic and had established communication with them on the CTAF frequency. When the aircraft painted on radar it had already passed through the lower limit of Class E airspace. The aircraft was subsequently identified and verified altitude and a clearance was issued. At no time was there a breakdown in separation or traffic co-ordination.','The aircraft had entered controlled airspace before being radar identified.','\"The pilot was briefed on the importance of reading the en route chart more carefully and if in doubt about the lower limit of the E airspace not to climb above 8500ft which is the lowest limit of E air space in Australia. The pilot was reminded about the procedures in the operations manual chapter A8.3.4 ÒWhen climbing into controlled airspace, set the lower limit of controlled airspace on the altitude alerter (AAI) to prevent inadvertent entry into controlled airspace before receiving a clearanceÓ. The pilot believes that it may been advisable to climb VFR (as conditions were VMC and he knew about all traffic) until the airways clearance could be given.\"','',NULL),(1133,91,'group','GS91','2','2009-03-25 06:35:00','2009-03-24 13:00:00','2006-04-17 14:00:00','2009-04-23 06:56:00','Dennis Gailey','[\"10\"]','Cessna 441 Conquest','VH-VEM','Mount Margaret Station','','QLD',0,0,0,'[\"FLTOPS07\"]','[\"ENVIRO\"]','Bird Strike.','A small flock of Galahs flew in front of the aircraft on landing. One of the birds struck the pilots front windscreen and was deflected into the tailplane. No damage was sustained.','\"Nil damage was sustained, the aircraft continued the operation without any further incident.\"','','',NULL),(1134,90,'group','GS90','2','2009-03-25 06:30:00','2009-03-24 13:00:00','2006-11-02 13:00:00','2009-04-23 06:58:00','Gerard Hanstede','[\"10\",\"8\"]','Cessna 441 Conquest','VH-VEJ','Brisbane','','QLD',0,0,0,'[\"FLTOPS07\"]','[\"EQUIP\"]','Blown Nosewheel Tyre.','On landing at Brisbane the pilot suspected a blown nosewheel tyre during the landing roll. After the aircraft came to a stop on the runway a security vehicle was was called to confirm that the nosewheel had indeed blown. After confirmation from the security vehicle the passengers were loaded from the aircraft onto the security vehicle and escorted to the terminal. A tug was called to remove the aircraft from the runway. The aircraft occupied the runway for almost an hour whilst the tug was enroute. Runway 32 was closed whilst the aircraft occupied the runway.','Blown nosewheel tyre on landing.','The nosewheel assembly was replaced with the aircraft being put back into service. The crew handled this situation very professionally. An investigation recommended changing to different tubes for the C441 fleet.','',NULL),(1135,89,'group','GS89','2','2009-03-25 06:19:00','2009-03-24 13:00:00','2006-06-05 14:00:00','2009-04-23 06:59:00','Andrew Dorman','[\"10\"]','Cessna 441 Conquest','Other','Canberra','','ACT',0,0,0,'[\"FLTOPS04\"]','[\"EQUIP\"]','Incorrect Transponder Code.','\"The aircraft became airborne on code 4240, but was assigned 4340. after takeoff the pilot was asked to check the code and advised that he was squawking 4340. The pilot switched to the secondary transponder which then transmitted the correct code.\"','The transponder was tested but no fault was found.','During the debrief the pilot was confident that he had selected the correct code. There have been no previous or subsequent reports of an incorrect code being transmitted.','',NULL),(1136,88,'group','GS88','2','2009-03-25 06:02:00','2009-03-24 13:00:00','2006-11-06 13:00:00','2009-04-23 07:02:00','Les Kiss','[\"10\"]','Cessna 404 Titan','VH-VEA','Bankstown','','NSW',0,0,0,'[\"FLTOPS04\"]','[\"INFO\",\"TECH\"]','Aircraft Turned in the Wrong Direction.','\"The aircraft was issued, as part of a standard radar departure, a left turn onto 290. On departure the pilot turned right onto 290.\"','The pilot turned right onto 290 as this was a shorter turn and allowed the aircraft to reach this heading much sooner than the cleared direction of turn.','\"The pilot was briefed on the importance of turning in the correct direction after take off, in particular at Bankstown where there could have been a slow training aircraft in the circuit. The pilot described the risk of turning in the wrong direction after take off is minimised if the assigned heading is less than 179 degrees from radar heading. However he was briefed on the possibility of doing a turn of more than 180 degrees so pilots should never presume that just because the heading bug is to one side that is the direction of the turn. The pilot was reminded of the requirements of chapter A14.6.3 of the operations manual of recording the assigned heading when it is given in advance which he did not do. Ò14.6.3 Use of heading bug Clearance with a Heading given in advance must be recorded on the ÔTake-off data cardsÕ/flight plan and cross-checked\"\". ? Aircraft equipped with a Flight Director The heading bug must be set on the initial heading for take-off. A subsequent heading (such as for a radar departure) should not be set on the heading bug until immediately before turning. ? Other Aircraft The heading bug must be set for the initial heading for take-off and a subsequent heading should not be set on the heading bug until immediately before turning. However, for Radar departures the heading bug is to be set to the assigned heading. Prior to take-off crew should familiarise themselves with the initial Radar departure requirements and be capable of maintaining runway heading, allowing for drift, until the required altitude, before turning onto the assigned heading.Ó The pilot displayed a positive attitude at the briefing and I am confident that he will not make the same error again.\"','',NULL),(1137,87,'group','GS87','2','2009-03-25 05:37:00','2009-03-24 13:00:00','2006-10-29 13:00:00','2009-04-23 07:04:00','Darrin Cridge','[\"10\"]','Beech 58 Baron','VH-VEG','Canberra','','ACT',0,0,0,'[]','[\"COMMS\",\"EQUIP\"]','Press to Talk Failure','\"Enroute from Shepparton to Canberra communication with Canberra tower was established at approx. 9nm with the aircraft being cleared to land. several unsuccesful attempts were made to read back the clearance but the press to talk switch had failed. At approx. 300 ft AGL on final for RWY 12 the instruction \"\"VEG if hearing this, you are cleared to land RWY 12\"\". The aircraft landed on RWY 12 and cleared the runway without delay. Communication with Canberra ground was then established using a hand held microphone.\"','The press to talk was found to be unservicable and was endorsed on the maintenance release.','\"The pilot may have been able to respond to ATC sooner had he considered the use of the handheld microphone. However, owing to the proximity of the aircraft to the landing runway, the pilots focus was on configuring and landing the aircraft.\"','',NULL),(1138,86,'group','GS86','2','2009-03-25 04:48:00','2009-03-24 13:00:00','2006-07-05 14:00:00','2009-04-23 07:06:00','Craig Lehmann','[\"10\"]','Cessna 404 Titan','VH-VEA','Canberra','','ACT',0,0,0,'[\"FLTOPS07\"]','[\"EQUIP\"]','Emergency Gear Extension at Canberra.','On arrival at Canberra both low flow lights illuminated indicating a loss of hydraulic system fluid which required an emergency gear extension to lower the gear correctly. The emrgency gear extension was successful and the landing and taxi occurred without incident.','A rigid hydraulic line in the belly of the aircraft was found to be cracked due to fatigue. The pilot carried out the gear extension in accordance with the company S.O.P.\'s.','The rigid hydraulic line was replaced and the landing gear emergency extension system was serviced in accordance with the Cessna 441 maintenance manual.','',NULL),(1139,85,'group','GS85','2','2009-03-25 04:35:00','2009-03-24 13:00:00','2006-05-15 14:00:00','2009-04-23 07:08:00','Darrin Cridge','[\"10\"]','Cessna 404 Titan','VH-VEA','Canberra','','ACT',0,0,0,'[\"FLTOPS07\"]','[\"TECH\"]','Main Tyres Blown on Landing.','During landing on RWY 30 at Canberra both main tyres blew out.','The pilot used an unstabilised approach during the landing phase which led to a high landing speed. Excessive brake pressure was used to control the aircrafts speed during the landing roll which led to both main tyres blowing. The aircraft was taxied off the runway under power.','\"The pilot was briefed on the importance of using a stabilised approach for every approach and landing. He was also briefed on not landing deep into the runway for a \"\"soft\"\" landing.\"','',NULL),(1140,84,'group','GS84','2','2009-03-25 03:26:00','2009-03-24 13:00:00','2006-07-10 14:00:00','2009-04-23 07:12:00','Darrin Cridge','[\"10\"]','Cessna 404 Titan','VH-VEA','Canberra','','ACT',0,0,0,'[\"FLTOPS04\"]','[\"ENVIRO\",\"INFO\",\"TECH\"]','Attempted Takeoff on Incorrect Runway.','The pilot attempted to takeoff from RWY 30 which was a closed runway. He was instructed to taxi for holding point Charlie runway 35. He called ready from holding point Charlie and was given a takeoff clearance which was read back correctly. VEA was then observed to be comencing the takeoff roll from RWY 30 and was instructed to STOP. The pilot was advised that RWY 30 was closed and was then instructed to taxi for RWY 35. VEA subsequently departed from RWY 35.','The windscreen on the aircraft had become fogged whilst taxiing for RWY 35. The pilot elected to continue taxiing using the side windows as reference for visibility. This caused the pilot to become disoriented and lining up on the incorrect runway for takeoff. The pilot actually lined up on taxiway Golf for runway 30 after being distracted by a flickering alternator light due to the low engine RPM during taxi. Recent runway works meant that there had been a number of changes to the airfield lighting which also led to the lack of situational awareness.','\"The pilot was advised to be more vigilant especially at night and also to ensure that the aircraft has sufficient forward vision to ensure that aircraft, personnel and ground obstacles are not endangered during taxi operations.\"','',NULL),(1141,83,'group','GS83','2','2009-03-25 02:58:00','2009-03-24 13:00:00','2006-07-07 14:00:00','2009-04-23 07:14:00','Adam Minutello','[\"10\"]','Cessna 441 Conquest','VH-VEW','Essendon','','VIC',0,0,0,'[\"FLTOPS06\"]','[\"INFO\",\"TECH\"]','Failure to Comply with Landing Clearance','\"The aircraft was being vectored for a visual right base RWY 26 at Essendon. When the aircraft was 7nm north east of Essendon the pilot reported the runway in sight. The aircraft was told to track for right base and given a visual straight in approach and instructed to call Essendon tower. As VEW passed through the Melbourne RWY 27 centerline, 8nm north east of Melbourne it suddenly turned right and tracked for Melbourne RWY 27. Essendon tower corrected the situation and there were no traffic conflictions.\"','The pilot mistook the bright lights of Melbourne RWY 27 as the landing RWY rather than RWY 26 at Essendon. Essendon is not lit as brightly as Melbourne at night and unfamiliarity led the pilot to believe he was tracking for the correct runway. The expectation that Essendon would be well lit and just becoming visual passing through 4000ft led to a moment of confusion that caused the pilot to line up for the incorrect RWY and airport.','Whilst the pilot had stated that he was unfamiliar with Essendon airport at night he was briefed on the importance of maintaining maximum situational awareness through the use of all available nav aids. It was also stressed that if in doubt continue with radar vectors.','',NULL),(1142,82,'group','GS82','2','2009-03-25 01:26:00','2009-03-24 13:00:00','2006-08-12 14:00:00','2009-04-23 07:16:00','Craig Lehmann','[\"10\"]','Beech 58 Baron','VH-VEG','Canberra','','ACT',0,0,0,'[\"FLTOPS04\"]','[\"INFO\"]','Incorrect Transponder Code','\"The aircraft departed Canberra with the transponder code 3734 set, the tower advised that the correct code was 7244. The pilot apologised and changed the code.\"','The pilot had set the wrong transponder code during the taxi phase of flight.','The pilot was advised to be more vigilant in selecting the correct code. It was suggested that he recheck the code when checking the nav aids during the taxi checks in the future.','',NULL),(1143,81,'group','GS81','2','2009-03-25 00:58:00','2009-03-24 13:00:00','2006-03-18 13:00:00','2009-04-23 07:22:00','Simon Close','[\"10\"]','Metro 23','VH-VEK','Williamtown','','NSW',0,0,0,'[\"FLTOPS05\"]','[\"INDIV\",\"INFO\",\"TECH\"]','Failure to Comply with Cleared Route.','The aircraft was cleared to Canberra via LOWEP-CALGA-SYDNEY. At 0936 UTC ATC the aircraft was observed proceeding beyond the turning point LOWEP by approximately 5nm. The controller advised the pilot to turn left 120 to regain track. As the aircraft approched the cleared track the controller cleared the aircraft direct to CALGA planned route resume own navigation.','Amended tracking instructions were given during the taxi phase of flight at williamtown. The waypoint CALGA was incorrectly entered into the GPS database which gave incorrect tracking details from overhead LOWEP. whilst the error was being corrected the aircraft continued on its present track which took the aircraft away from its cleared route.','The crew were briefed on the potential of a break down in separation (which they were aware of) and to check the inputs into the GPS with more care. They were reminded of checking the way points track and distance with the flight plan. In this case this would have been difficult in that the crew were given amended tracking details which are not in the ERSA route requirements so the crew had not planned via CAA. Another step the crew were briefed on was to check that they were tracking to the CAA NDB and not to Calga which was a user way point that someone had entered into the database. I am confident that there will not be a repeat of this incident with this particular crew and a Notac will be issued to all crew as a reminder of the importance of checking all data in the GPS to prevent a similar occurrence.','',NULL),(1144,80,'group','','2','2009-03-04 00:31:00','2009-03-03 13:00:00','2009-02-22 14:20:00','2009-03-04 00:31:00','Mark Norris','[\"10\",\"8\"]','Metro 23','VH-VEK','Mudgee','','ACT',0,0,0,'[\"FLTOPS08\"]','[\"EQUIP\"]','Brake Lockup on M23','\"The aircraft suffered a brake lockup on landing. The landing at was conducted normally without incident. Whilst backtracking the runway to the apron the pilots noticed that the aircraft was steadily requiring more power to taxi. Initially they thought this was due to the incline of the runway, however the situation continued to worsen. They were able to taxi the aircraft from the runway with difficulty and the aircraft was shut down on the main taxiway. Upon visual inspection a lot of smoke was coming from the right hand main wheel. Operations and Engineering were informed of the situation. A local engineer was arranged to look at the aircraft. He pried the brake pad from the disk with a screw driver. This action solved the problem. Taxi checks were conducted followed by further discussion with both the local engineer and our Chief Engineer. As no problem was present the aircraft continued without incident.\"','Engineering investigated the matter further. It is believed that a build up of brake dust may have caused the lock up.','','',NULL),(1145,79,'group','GS79','2','2009-02-19 05:49:00','2009-02-18 13:00:00','2006-02-25 13:00:00','2009-04-23 07:25:00','Andrew Dorman','[\"10\"]','Other aircraft type','VH-VEH','Canberra','','ACT',0,0,0,'[\"FLTOPS07\",\"FLTOPS08\"]','[\"COMMS\",\"ORGAN\"]','Failure to Comply with Taxi Instruction','The aircraft landed on runway 30 at Canberra and was instructed to roll through and vacate on taxiway Charlie at the end for the GA park. The crew requested a backtrack on runway 30 and started to manoeuver the aircraft in anticipation of the backtrack instruction. The aircraft commenced a right turn to backtrack but stopped due to a conflict in the taxi instruction. The tower controller could see that the aircraft had already commenced a turn and decided to issue the backtrack instruction as this was the quickest solution due to a Dash 8 on finals for runway 30. The controller still had the intention for the aircraft to vacate via Taxiway Charlie as ERSA showed the published limitations on taxiway Charlie as 20m max wingspan but the marked limitation on the taxyway was 15m. This was the reason for the crews actions on the runway.','\"The chief pilot spoke to the Senior Air Traffic Controller at Canberra who was unaware of the marked Taxiway limitations on taxiway Charlie. The Captain was correct in questioning this instruction. Turns without a clearance on the runway is a direct contravention of the rules and the crew made the mistake of \"\"assuming\"\" that the backtrack instruction would be issued. With the information that the tower controller had the instruction he was issuing was not an incorrect instruction. The Captain was instructed by the Chief Pilot to remain on the centreline in future until a backtrack instruction is given.\"','\"There were errors made by both parties during this incident. It should be enforced that we should \"\"NEVER ASSUME\"\" that a situation will play out the way we expect it to, and that if we are ever in doubt \"\"STOP\"\" and if necessary, question the authority involved.\"','',NULL),(1146,78,'group','GS78','2','2009-02-19 04:07:00','2009-02-18 13:00:00','2006-06-29 15:15:00','2009-04-23 07:26:00','Phillip Hollands','[\"10\"]','Other aircraft type','VH-VEH','Canberra','','ACT',0,0,0,'[\"FLTOPS07\"]','[\"INDIV\"]','Heavy Landing in Metro 3','A heavy landing during night freight operations resulted in aircraft sustaining substantial airframe damage. The aircraft was eventually written off by insurance.','','','',NULL),(1147,77,'group','GS77','2','2009-02-19 02:14:00','2009-02-18 13:00:00','2006-01-13 21:30:00','2010-05-21 05:58:00','Bill McIntyre','[\"10\"]','Cessna 441 Conquest','VH-VED','Canberra','','ACT',1,0,0,'[\"FLTOPS05\"]','[\"EQUIP\",\"LEADER\",\"ORGAN\",\"TECH\"]','Hydraulic Leak','Whilst climbing enroute to Wilcannia the left and right HYD FLOW annunciators illuminated and a passenger observed red fluid streaking back along the left hand engine nacelle. On return to the circuit at Canberra an emergency gear extension had to be conducted to lower the landing gear. After a succesful emergency gear extension the aircraft landed and taxied toward the parking area without further incident.','An under torqued hydraulic fitting led to the hydraulic leak resulting in an emergency gear extension in flight. Implementation of procedures to strengthen post maintenance inspections is required.','Procedures have now been put in place to ensure that prior to an aircraft being returned to service following maintenance LAME\'s are to ensure that any completed work is CORRECTLY inspected prior to being signed off.','',NULL),(1148,76,'group','GS76','2','2009-02-19 01:03:00','2009-02-18 13:00:00','2006-06-26 14:00:00','2009-04-23 07:37:00','Tony Willis','[\"10\"]','Cessna 441 Conquest','VH-VEZ','Moomba','','SA',0,0,0,'[\"FLTOPS06\"]','[\"EQUIP\"]','Incorrect Gear Indication.','\"On arrival at Ballera the right MLG did not indicate a locked down position, ATC were advised and the passengerswere briefed. Climbing to FL 150 and operating within 20 nm of Ballera the pilot commenced to trouble shoot the landing gear system. After cycling the gear, no \'green\' light was obtained and a red unsafe light with both the hydraulic flow light and pressure light were on. The gear unsafe light and both hydraulic lights were also on with the wheels selected up. The pilot elected to return to Moomba at FL 180, called for emergency services and briefed his passengers to expect a normal landing after \"\"manually extending the wheels\"\". Ten miles out and at FL 180 the pilot performed the Emergency Gear extension procedure from the Aircraft Flight Manual and did not obtain a safe gear indication. Reviewing the forthcoming landing, the pilot decided to land into wind and with the upper half of the airstair door cracked open, in case the cabin buckled and the door jammed closed. As a precaution he briefed his passengers for an emergency landing followed by an evacuation. This briefing included removing all potential hazards from their person (pens, false teeth, torches) and briefed a passenger (a pilot) to crack open the top half of the airstair door - with appropriate warning and information for all the passengers. He declined the suggestion that he make a \'fly by\' but asked for a visual inspection from the ground as he maneuvered into the circuit at about 2000 ft. Joining down wind, at 110 knots, he instructed the briefed passenger to unlatch the door but hold it closed, made a final call to Emergency Services, turned off all unnecessary electrics and landed. The aircraft touched down at the expected position and rolled straight. The passenger seated nearest the door continued to open it, as briefed, and everyone deplaned in an orderly manner in the shortest direction off the runway.\"','\"Cessna 441 main landing gear actuators are hydraulic powered and lock internally in the down position and remain locked regardless of hydraulic pressure applied to the extend port. An adjustable electric micro switch mounted in the body of the actuator is mechanically closed when the actuator reaches the down and locked position. In this position the switch powers the respective down and locked light and sends power to the hydraulic control system to remove pressure from the actuator down port. In addition to the normal gear extension system an independent emergency high pressure source of nitrogen can be applied to lock the gear down regardless of the status of electrical and hydraulic systems. Following the landing on the 28/06/2006 and prior to the aircraft being ferried to Canberra the actuator micro switch was unlocked and rotated in. This resulted in a normal indication being obtained (3 green lights on and no other landing gear related lights illuminated). On disassembly in Canberra the switch/wiring loom was found to have 2 intermittent open circuits. However the configuration of these faults could not have caused the defects reported by the pilot nor could it be determined if the faults existed at the time of the incident. The switch was replaced and the investigation continued, Further investigation of the main landing gear actuator revealed the internal down-lock spring could interfere with the down-lock switch actuator when the spring is seated off centre; causing initial switch adjustment to be incorrect. It would appear that subsequent operation of the actuator had allowed the spring to move away from switch actuator resulting in nil actuation of switch in down and locked position although the undercarriage is mechanically down and locked. This fault conforms with the indications as reported by the pilot and is further supported by the fact that rotation of the switch, as detailed above, resulted in a return to normal gear indications. Conclusion The incident followed an erroneous indication caused by the down lock spring interfering with the switch actuator within the actuator assembly fitted to the aircraft. Action Both the actuator and switch from the aircraft have been replaced in accordance with the Cessna 441 Maintenance Manual. The removed actuator was forwarded to an appropriately approved overhaul facility for investigation to determine how the down lock spring was able to interfere with the micro switch installation. Results from there findings were inconclusive. Landing gear retraction and extensions are exhaustively checked on jacks by maintenance personnel after micro switches have been adjusted or replaced to ensure that this scenario is never repeated.\"','It was determined that in this scenario crews are not to crack open the cabin door to hasten the emergency evacuation procedure. A gear indication chart was created and fitted to all of the Corporate Air cessna aircraft (both C441\'s and C404\'s) as they share a common hydraulic system. This will aid flight crew in making a correct diagnosis of the situation should this scenario reoccur in the future.','',NULL),(1149,75,'group','GS75','2','2009-02-18 23:05:00','2009-02-18 13:00:00','2006-09-20 19:45:00','2009-04-23 07:39:00','Bill McIntyre','[\"10\",\"8\"]','Cessna 441 Conquest','VH-VEW','60NM West of Canberra','','NSW',0,0,0,'[\"FLTOPS05\"]','[\"EQUIP\"]','Radio Failure','Aircraft radios 1 and 2 failed in transmit mode. the pilot switched off radios 1 and 2 and tried radio 3 which transmitted carrier wave only. The pilot squawked 7600 and followed ATC instructions for a landing at Canberra. All transmissions were acknowledged by squawking ident.','Microphone switch on the audio panel had failed. Audio panel was replaced.','\"This situation was resolved quite succesfully due to the pilot conducting operations as per the emergency procedures described in Jeppesen EMERGENCY procedures, section 3.2 and by following ATC instructions.\"','',NULL),(1150,74,'group','13-Sep','2','2009-03-04 00:09:00','2009-02-02 13:00:00','2009-02-02 13:00:00','2010-05-21 05:58:00','','[\"10\",\"6\"]','Cessna 404 Titan','VH-VEA','Canberra','','ACT',0,1,0,'[\"FBOEXT\",\"FLTOPS01\"]','[\"COMMS\",\"INDIV\",\"TASK\",\"TECH\"]','Dry Ice Loaded in Aircraft Cabin','Dangerous Goods 9 - Dry Ice was loaded into main cabin on a night freight run. The SY ground crew brought this to the pilot\'s attention when unloading. The pilot was unaware that this was loaded and there was no mention of DG on the manifest.','\"The Chief Pilot investigated. The container, which came from Wagga, didnÕt contain dangerous goods. The incorrect label was used and the person responsible has been instructed on the correct use of labels by AAE.\"','','',NULL),(1151,73,'group','12-Sep','2','2009-03-04 00:06:00','2009-02-02 13:00:00','2009-02-02 13:00:00','2009-03-04 00:06:00','Damon Banks','[\"10\",\"6\"]','Cessna 441 Conquest','Not applicable','Canberra','','Oth',0,0,0,'[\"FLTOPS10\"]','[\"INFO\",\"ORGAN\"]','Brief Sheets to Include Aircraft Configuration','\"A pilot has suggested to Operations that Brief Sheets to flight crew also include the configuration of the aircraft (VIP, commuter)as this would assist flight crew planning as the configuration affects the operating weight and therefore available payload. It also helps flight crew with refueling without having to attend the aircraft.\"','Operations are considering this request.','Operations will endeavour to ensure that aircraft configuration is listed on the brief sheet in future.','',NULL),(1152,72,'group','11-Sep','2','2009-03-04 00:03:00','2009-02-02 13:00:00','2009-02-02 07:45:00','2009-03-04 00:03:00','Damon Banks','[\"10\",\"6\"]','Cessna 441 Conquest','VH-VED','Innaminka','','SA',0,0,0,'[\"FLTOPS09\"]','[\"ENVIRO\",\"EQUIP\"]','Loose Protective Rubber Matting not Secured Properly','\"A pilot reported that two sections of rubber conveyor belt have been laid as mats to prevent stone damage to propellers during Conquest startup and shutdown. One of the mats (the thinner one) has been partially pegged down, however the eastern 1/3 is free. The thicker mat is not pegged down at all. The pilot was concerned that the mats could lift and be drawn into the propellers or (as the aircraft moves forward), be blown and lifted aft, striking main gear doors and lower wing or aft fuselage of the Conquest. The pilot considered that although the thicker mat is quite heavy, it still could be considered a risk as the propellers move a lot of air.\"','The Chief Pilot and Operations will investigate.','The mats have now been properly secured.','',NULL),(1153,71,'group','10-Sep','2','0000-00-00 00:00:00','2009-02-02 13:00:00','2009-02-02 07:45:00','2009-03-04 00:00:00','Damon Banks','[\"10\"]','Cessna 441 Conquest','VH-VED','Innaminka','','SA',0,0,0,'[\"FLTOPS08\"]','[\"ENVIRO\"]','Stone Damage to Underside of Aircraft','\"During the landing on runway 02 with approx 15 knots of crosswind (wind 100/15)during nosewheel touchdown, there was the usual spray of gravel heard under the aircraft Ð although possibly louder than usual. Upon inspection, the lens of the rotating beacon was found to have been impacted and broken by rocks. The comm antennas on the lower aft fuselage were also observed to have sustained damage Ð one fibreglass antenna had the lower 2 inches of its outer fairing removed. Suspect that rudder input to maintain directional control during the crosswind landing rollout (causing nosewheel steering) lifted stones from the surface which struck the lens and antennas. The lens was replaced with one from another aircraft.\"','It was suspected that rudder input to maintain directional control during the crosswind landing rollout (causing nosewheel steering) lifted stones from the surface which struck the lens and antennas.','No further action.','',NULL),(1154,70,'group','9-Sep','2','2009-03-03 23:57:00','2009-02-01 13:00:00','2009-02-21 07:05:00','2009-04-23 07:41:00','Alister Polkinghorne','[\"10\",\"8\"]','Cessna 441 Conquest','VH-VEY','Grafton','','NSW',0,0,0,'[\"FLTOPS05\"]','[\"EQUIP\"]','Low torque in Auto Mode','\"On climb out from Grafton going though 4000\' the Right Hand engine displayed the symptoms of an engine failure. They were: zero torque, negligible fuel flow, EGT at less than 150 degrees and auto-ignition on. RPM was slightly decreased. Given the symptoms and windmilling prop, the pilot elected to shut the engine down using emergency feather. The aircraft was six kilos below gross weight for take-off and the temperature was 32 degrees. Weather was VMC. Time was about 1805 Eastern Australian Summer time. There were six passengers on board. Subsequent efforts to restart the engine were successful but no torque could be obtained in Automatic mode. After reverting to manual mode torque was available. After ascertaining that power was available with throttle movement in manual mode, the pilot elected to continue the flight operating in manual mode. Once on the ground, the computer could be restored to automatic mode. Subsequent starting was normal. Operations were then conducted in Manual mode. The Chief Pilot and HAAMC are investigating.\"','The Chief Pilot will issue a NOTAC emphasising the need for pilots to ensure that they go immediately to manual mode if they experience this problem.','NOTAC 09/09 has been issued.','',NULL),(1155,69,'group','8-Sep','2','2009-03-03 23:48:00','2009-01-31 13:00:00','2009-01-26 13:00:00','2009-03-03 23:48:00','Mark Norris','[\"10\"]','Metro 23','VH-VEK','Sydney','','ACT',0,0,0,'[\"FBOEXT\",\"FLTOPS01\"]','[\"COMMS\",\"INDIV\",\"TECH\"]','Aircraft Overloaded at Take-off','\"The pilot was informed at Sydney airport by freight staff that on a previous flight from SY-AD the aircraft was overloaded by 250kg. This was caused by the incorrect \"\"barrow\"\" being taken to the aircraft. The flight was conducted normally with no abnormal flight characteristics observed. The freight company management informed CASA of the overloading. The Chief Pilot is investigating. The aircraft can take-off but not land overloaded by this amount.\"','The freight company was bringing the barrows to the aircraft and telling the loaders which bays they are to be loaded into. No paper work was given to the loaders and the barrows were not marked with the weight or bay number.','The procedure has now been changed and the loaders have a copy of the LIR (Load instruction sheet) and the barrows are marked with the bay number and weight which is cross checked by the ground handlers before loading.','',NULL),(1156,68,'group','7-Sep','2','2009-03-03 23:43:00','2009-01-31 13:00:00','2009-01-12 13:00:00','2009-04-23 07:43:00','Antony Springer','[\"10\",\"8\"]','Cessna 441 Conquest','VH-VEJ','Moomba','','SA',0,0,0,'[\"FLTOPS04\"]','[\"EQUIP\"]','Gear Failed to Retract','\"After take-off from Moomba with gear selected up, actuation did not complete a complete cycle. The gear lever was momentarily selected down and then up and the gear completed a full cycle. This occurrence repeated itself in a later flight that day, with the same method being used to correct the problem. There have been no further occurrences. The HAAMC is investigating this problem.\"','This is common fault on the C441 aircraft. The aircraft was tested extensively and no fault could be found. The HAAMC will raise a NOTENG.','NOTMRO 07/09 has been issued to ensure sorrect adjustment of the microswithces.','',NULL),(1157,67,'group','6-Sep','2','2009-03-03 23:39:00','2009-01-31 13:00:00','2009-01-08 13:00:00','2009-04-23 07:44:00','Addie Birkett','[\"8\"]','Metro 23','VH-VEK','Goulburn','','NSW',0,0,0,'[\"ENGCO\"]','[\"EQUIP\",\"INDIV\",\"INFO\",\"TECH\"]','Spacers Ommitted From Wheels','\"During recent maintenance of a M23 at GLB, it was discovered that two washers or spacers were omitted from the replacement of previous main wheels. The washers are mandatory as they prevent the brake unit from impinging on the inner side of the main wheel causing damage.\"','The QBN overhaul shop has found one spacer in the grease on the side of the bearing on wheel removed. The HAAMC is investigating.','The HAAMC will issue a NOTENG highlighting the need for engineers to ensure that spacers are re-installed when main wheels are changed on the M23 aircraft. NOTMRO 06/09 has been issued.','',NULL),(1158,65,'group','5-Sep','2','2009-08-04 08:28:00','2009-01-08 13:00:00','2008-12-29 13:00:00','2009-08-04 08:28:00','Nick Walsh','[\"10\",\"6\"]','Metro 23','Not applicable','Melbourne','','VIC',0,0,0,'[\"FLTOPS02\"]','[\"INFO\",\"TECH\"]','GPU Starting Procedures','A First Officer was briefed by the Captain on how to conduct an APU start using a motorised unit. The First Officer later commented on the need for clearly defined procedures and training to be in place for pilots who may be required to conduct GPU starts. The ground handling personnel have specific training for this task which is contained in the Ground Handling Manual.','\"The Chief Pilot to ensure that as part of the induction process for pilots, they will be required to complete the same training on GPU starts as ground handling personnel. The route guide for the ports involved will be revised to include the specific motorised GPUs available at Sydney and Melbourne.\"','All pilots will now be required to complete the GPU training course. The Pelair base in Melbourne has been closed and the particular GPU has been removed. The Chief Pilot will monitor the situation and look at another source for ground power starts. Various options are currently being reviewed.','',NULL),(1159,64,'group','4-Sep','2','2009-07-14 04:56:00','2009-01-08 13:00:00','2008-12-18 13:00:00','2010-05-21 06:00:00','','[\"8\",\"6\"]','Cessna 441 Conquest','VH-VEY','Goulburn','','NSW',1,1,0,'[\"ENGCO\"]','[\"INDIV\",\"LEADER\",\"TECH\"]','Explosion During Maintenance','\"Whilst performing maintenance on an aircraft, an explosive blast was encountered in the cabin of the aircraft. A solvent had been used to clean hydraulic fluid and later a small blow torch was being used to shrink some heat shrink which acted as an ignition source for the residual solvent vapour fumes.\"','HAAMC to conduct a full investigation with suggested mechanisms to prevent a reoccurrence. Report to be submitted to the Safety Committee members for consideration by COB 16 January 2009.','\"The investigation recommended, and the Safety Committee agreed, to implement the following new workshop procedures: . When using solvents in a confined space such as an aircraft cabin no other maintenance shall be performed in the area until all solvent has been removed and the cabin adequately ventilated. . Naked flames banned from the hangar. . Heat gun to be used to apply heat shrink products only when there is no solvent odor present. . Note to ensure shower is available for use at all times. . Training be provided in the familiarization and correct use fire extinguishers. . Reinforce the requirement for engineers to wear breathing protection while exposed chemical vapors. . Issue a breathing mask to every engineer. Masks have been arranged for all engineers and a course on the use of fire extinguishers is now on the Company website.\"','',NULL),(1160,63,'group','3-Sep','2','2009-04-23 07:54:00','2009-01-08 13:00:00','2008-11-30 13:00:00','2009-04-23 07:54:00','Brad Rule','[\"10\",\"6\"]','Cessna 441 Conquest','Not applicable','En route','','QLD',0,0,0,'[\"ENGCO\",\"FBOCO\"]','[\"INDIV\",\"TASK\"]','Tool in Aircraft after Maintenance','A pilot reported finding a pair of multigrips pliers between the rudder pedals whilst inflight.','The HAAMC will investigate the matter and develop a strategy to prevent further occurrences. He will also issue a NOTENG emphasising the importance of counting out tools after maintenance.','NOTMRO 08/09 has been issued.','',NULL),(1161,62,'group','2-Sep','2','0000-00-00 00:00:00','2009-01-08 13:00:00','2008-12-12 13:00:00','2009-02-16 23:04:00','Antony Springer','[\"10\",\"6\"]','Cessna 441 Conquest','Not applicable','Ballera','','QLD',0,0,0,'[\"FLTOPS07\"]','[\"EQUIP\"]','EGPWS Alert','A pilot reported that the EGPWS had sounded a ÒdonÕt sinkÓ warning during final approach in turbulence. Power was applied to arrest the rate of descent and the landing continued without further incident.','','','',NULL),(1162,61,'group','1-Sep','2','2009-03-03 22:41:00','2009-01-08 13:00:00','2008-12-31 13:00:00','2009-03-03 22:41:00','','[\"10\",\"6\"]','Cessna 404 Titan','VH-VEA','Sydney','','NSW',0,0,0,'[\"FLTOPS03\"]','[\"ENVIRO\",\"INDIV\"]','Taxy Into Night Works Area','A report was received from a pilot that he had taxied across a row of red lights into a night works area. The pilot attributed a number of causes to this incident. ¥ He had incorrectly read back his clearance and this was not challenged by ATC. ¥ Focussing too much attention inside the cockpit during taxying. ¥ Non standard delineation of the works area leading to confusion for the pilot.','The Chief Pilot will raise a NOTAC emphasising the problems involved with taxying around night works areas.','The Chief Pilot raised NOTAC 04/09 which emphasised the problems involved with taxying around night works areas.','',NULL),(1163,60,'group','004/09','2','0000-00-00 00:00:00','2008-12-01 13:00:00','2008-08-21 14:00:00','2009-02-16 23:03:00','','[\"10\",\"8\"]','Metro 23','VH-VEK','Canberra','','ACT',0,0,0,'[\"ENGCO\",\"FLTOPS10\"]','[\"EQUIP\"]','Flight Timer Unserviceable/Inaccurate Fuel Gauges','A pilot reported that the flight timer on the aircraft could not be zeroed and this could lead to errors in the recording of flight time for the aircraft. He also reported that he was concerned about the accuracy of the fuel gauges.','The backup battery was replaced and the problem with the clock was resolved. The HAAMC was tasked with fitting calibration cards to the Metro fleet as it is a known problem that the fuel gauges are inaccurate at some fuel loads.','','',NULL),(1164,59,'group','','2','0000-00-00 00:00:00','2008-12-01 13:00:00','2008-08-20 14:00:00','2009-02-16 23:02:00','','[\"10\",\"8\"]','Beech 58 Baron','VH-VEG','Canberra','','ACT',0,0,0,'[\"FLTOPS01\"]','[\"INDIV\"]','Nose Locker Opened On Landing','A pilot reported that the nose locker of the aircraft had opened after landing on the rollout. The pilot found that both the latches were in the locked position.','An inspection by engineering established that the catches were functioning correctly. It was determined that the pilot had failed to close the locker correctly and the Chief Pilot demonstrated to the pilot that the locker could look closed but the catches might not be engaged.','','',NULL),(1165,58,'group','002/09','2','0000-00-00 00:00:00','2008-12-01 13:00:00','2008-08-31 14:00:00','2009-02-16 23:01:00','','[\"10\"]','Metro 23','Not applicable','Sydney','','NSW',0,0,0,'[\"FBOEXT\",\"FLTOPS01\"]','[\"COMMS\",\"INDIV\",\"INFO\",\"TASK\"]','Metro Incorrectly Loaded','A pilot reported that loading staff were not loaded the aircraft in accordance with the documentation provided by the freight company. He had to intervene twice to ensure that the aircraft was correctly loaded.','The Safety Manager called the freight company immediately on receiving the report to remind them of their responsibilities in loading company aircraft. He then phoned all pilots operating freight out of Sydney to remind them to closely supervise the loading of their aircraft.','There has been no further re-occurence of this problem.','',NULL),(1166,57,'group','001/09','2','0000-00-00 00:00:00','2008-12-01 13:00:00','2008-07-31 14:00:00','2009-02-16 23:00:00','','[\"10\",\"8\",\"9\"]','Cessna 404 Titan','Not applicable','Canberra','','ACT',0,0,0,'[\"FBOCO\"]','[\"ENVIRO\",\"EQUIP\",\"INDIV\",\"TASK\"]','Seat Damage','An engineer reported that company aircraft seats were sustaining damage as a result of the way they were being fitted.','Operations and Maintenance Control have put procedures in place to ensure aircraft seats are installed correctly','','',NULL),(1167,56,'group','023/08','2','2009-04-23 07:55:00','2008-12-01 13:00:00','2008-05-05 14:00:00','2009-04-23 07:55:00','','[\"10\"]','Cessna 441 Conquest','Not applicable','Canberra','','ACT',0,0,0,'[\"FLTOPS10\"]','[\"ORGAN\"]','Dangerous Goods Manual Not In Aircraft','\"A pilot reported that, whilst engaged on a freight flight, he could not find the dangerous goods manual in the aircraft.\"','A new manual has been produced and is to be placed in the maintenance release folder of all aircraft.','All aircraft now have dangerous goods manuals in their maintenance release folders.','',NULL),(1168,55,'group','022/08','2','0000-00-00 00:00:00','2008-12-01 13:00:00','2008-03-18 13:00:00','2009-02-16 22:59:00','','[\"10\"]','Cessna 441 Conquest','Not applicable','Canberra','','ACT',0,0,0,'[\"FLTOPS10\"]','[\"INDIV\",\"ORGAN\",\"TECH\"]','Pilot Endorsement Training','A report was received from a supervisory pilot that a pilot under supervision was not aware of manual mode operations.','\"Although the training pilot who conducted the initial training could recall covering this in the endorsement, it appeared that the pilot could not. The training and checking section has now placed all of the training material on the company portal and it is now a requirement for all pilots to complete the online course before undergoing endorsement training.\"','','',NULL),(1169,54,'group','021/08','2','0000-00-00 00:00:00','2008-12-01 13:00:00','2008-03-27 13:00:00','2009-02-16 22:59:00','','[\"10\"]','Other aircraft type','VH-VEG','Canberra','','ACT',0,0,0,'[\"FLTOPS01\"]','[\"COMMS\",\"EQUIP\",\"INDIV\"]','Incorrect Fuel On Flight Record','A pilot reported that he had discovered that the fuel figure entered on the flight record was incorrect and that he had relied up this figure for his flight planning.','The pilot had meant to enter 290 litres on the fuel record but had entered 390 in error. The pilot responsible was counselled by the Chief Pilot and digital fuel low gauges and totalisers were fitted to the BE58 aircraft so that accurate fuel calculations could be made.','','',NULL),(1170,53,'group','020/08','2','0000-00-00 00:00:00','2008-12-01 13:00:00','2008-12-01 13:00:00','2010-05-21 06:02:00','','[\"10\",\"8\",\"9\"]','Metro 23','Not applicable','Canberra','','ACT',0,1,0,'[\"ENGCO\",\"FBOCO\",\"FLTOPS10\"]','[\"EQUIP\"]','CAWI Trolley Unsafe','\"A pilot reported that the CAWI trolley had an empty eye wash container, had no eye protection available and had no material safety data sheet attached.\"','Engineering addressed these deficiencies immediately. Ground handling staff would be responsible for all future CAWI replenishment.','','',NULL),(1171,52,'group','4-Aug','2','2009-04-23 07:56:00','2008-12-01 13:00:00','2008-01-31 13:00:00','2010-05-21 06:02:00','','[\"10\"]','Not applicable','Not applicable','Goulburn','','NSW',0,1,0,'[\"FLTOPS10\"]','[\"ENVIRO\",\"INDIV\",\"ORGAN\"]','Fatigue After Night Flights','A pilot reported that he felt fatigued when he was required to drive back to Canberra after positioning an aircraft at Goulburn for maintenance after a night flight.','Operations were tasked to roster a driver to drive crews back from Goulburn.','','',NULL),(1172,51,'group','','2','0000-00-00 00:00:00','2008-12-01 13:00:00','2008-02-29 13:00:00','2009-02-16 22:56:00','','[\"10\"]','Metro 23','VH-VEK','Sydney','','NSW',0,0,0,'[\"FLTOPS04\"]','[\"ENVIRO\"]','Laser Directed At Aircraft','\"On departure from Sydney, the aircraft was illuminated by a laser. The incident was reported to departures and the police were informed.\"','No further action could be taken.','','',NULL),(1173,50,'group','002/08','2','0000-00-00 00:00:00','2008-12-01 13:00:00','2007-12-31 13:00:00','2009-02-16 22:56:00','','[\"8\"]','Not applicable','Not applicable','Goulburn','','NSW',0,0,0,'[\"ENGCO\"]','[\"EQUIP\"]','Condition Of Brakes On Engineering Truck','A report was received that the brakes in the engineering truck were not working very well.','The Chief Engineer was tasked with ensuring that the engineering truck was properly serviced and not used as a general vehicle for travel between Canberra and Goulburn.','A new bus was purchased to make travel for engineering staff more pleasant. Travel between Canberra and Goulburn is kept under constant review by management to ensure optimum arrangements for staff are in place.','',NULL),(1174,49,'group','001/08','2','0000-00-00 00:00:00','2008-12-01 13:00:00','2007-12-31 13:00:00','2010-05-21 06:03:00','','[\"8\"]','Not applicable','Not applicable','Goulburn','','NSW',0,1,0,'[\"ENGCO\"]','[\"EQUIP\"]','Condition of Engineering Utility','\"A report was received that the Engineering utility was not in good condition, particularly considering the increased number of kilometers that it was travelling between Canberra and Goulburn.\"','The Chief Engineer was tasked with having the utility brought up to a high servicability standard.','','',NULL),(1175,48,'group','','2','2009-04-23 07:57:00','2008-12-01 13:00:00','2007-08-31 14:00:00','2009-04-23 07:57:00','','[\"10\",\"8\"]','Cessna 441 Conquest','VH-VED','Brisbane','','QLD',0,0,0,'[\"ENGCO\",\"FLTOPS06\"]','[\"EQUIP\"]','LH Main Landing Gear Door Loose','\"During approach to landing the LH main landing door became loose. After landing, it was noticed that the door had scraped on the tyre during taxy but there was no further damage\"','This was not a known fault on the C441 aircraft and so no specific action could be taken other than to remind pilots to do very thorough preflight inspections of the gear doors to prevent a re-occurence.','','',NULL),(1176,47,'group','019/07','2','0000-00-00 00:00:00','2008-12-01 13:00:00','2007-08-31 14:00:00','2009-02-16 22:55:00','','[\"10\",\"9\"]','Cessna 441 Conquest','VH-VEZ','Canberra','','QLD',0,0,0,'[\"FBOCO\",\"FLTOPS01\"]','[\"INDIV\",\"TASK\",\"TECH\"]','Seats Not Locked','On as preflight inspection the pilot noticed that the executive seats fitted to the aircraft were not locked into the seat rails.','The Chief Pilot issued a NOTAC to ensure that pilots checked the Maintenance Release for aircraft configuration changes. Ground handling staff were reminded of the importance of correctly fitting the seats during a configuration change.','','',NULL),(1177,46,'group','','2','0000-00-00 00:00:00','2008-12-01 13:00:00','2007-08-31 14:00:00','2010-05-21 06:04:00','','[\"10\",\"6\"]','Cessna 441 Conquest','Not applicable','Cooper Basin','','QLD',0,1,0,'[\"FLTOPS10\"]','[\"ENVIRO\",\"INDIV\"]','Fatigue In The Cooper Basin','\"With the approach of summer and the higher workload on pilots because of increased activity, there was an increased risk of fatigue. While pilots were notified to report any fatigue that they were experiencing and the fuel truck at Moomba and the airconditioned hut at Mount Margaret were good mitigators, it was decided to approach the client to find a solution to potential fatigue problems.\"','The client agreed to reduce the number of days in the schedule for each pilot.','','',NULL),(1178,45,'group','','2','0000-00-00 00:00:00','2008-12-01 13:00:00','2007-06-11 14:00:00','2009-02-16 22:54:00','','[\"10\",\"6\"]','Beech 58 Baron','VH-VEB','Nowra','','NSW',0,0,0,'[\"FLTOPS10\"]','[\"COMMS\",\"ORGAN\",\"TECH\"]','Nowra Approval Not Obtained','\"The aircraft was approaching Nowra and the pilot was questioned by approach control as to whether he had obtained approval to land at Nowra. The pilot thought that approval had been sought by Operations, but this hadn\'t occured. The pilot had defence personnel on board the aircraft. If the flight had arrived before the tower was open, this would have been a contravention of the Crimes Act.\"','Operations agreed that there would be no mention of approvals on the brief sheet unless the approval had actually been granted.','','',NULL),(1179,44,'group','','2','2009-04-23 07:58:00','2008-12-01 13:00:00','2007-08-31 14:00:00','2009-04-23 07:58:00','','[\"10\"]','Cessna 441 Conquest','VH-VEZ','Adelaide','','SA',0,0,0,'[\"FLTOPS07\"]','[\"EQUIP\",\"INDIV\"]','Landing Gear Fault','\"The aircraft was positioned for a visual approach, when the gear was selected down the pilot noticed that the R main landing gear light had not illuminated. The pilot recycled the gear but the down light still did not illuminate. The pilot notified the tower of the problem and he was instructed to fly by the tower for a visual inspection by ATC. The gear appeared to be down and locked. The pilot took further time to analyse the fault and found that the bulb had blown for the indicator. A successful circuit and landing was conducted with emergency services standing by.\"','\"The Chief Pilot was tasked with developing a fault diagram to assist pilots with landing gear difficulties. This diagrams would be carried in each aircraft. He was also tasked with ensuring, as part of the 20.11 check to ensure that pilots knew how to replace bulbs.\"','The fault diagram is now in the maintenance release folders.','',NULL),(1180,43,'group','018/07','2','0000-00-00 00:00:00','2008-11-30 13:00:00','2007-07-27 14:00:00','2009-02-16 22:53:00','','[\"10\"]','Metro 23','VH-VEU','Melbourne','','VIC',0,0,0,'[\"FLTOPS07\"]','[\"ENVIRO\"]','Laser Pointed at Aircraft','\"During the landing phase, the aircraft was illuminated by a blue laser almost completely obscuring forward vision for about 7 or 8 seconds. One of the pilots complained about having sore eyes after the event\"','The incident was reported to Airservices Australia and was investigated. The Chief Pilot issued a NOTAC telling pilots not to look at laser beam and to concentrate on instruments until minima or until laser stops illuminating the flight deck.','','',NULL),(1181,42,'group','017/07','2','0000-00-00 00:00:00','2008-11-30 13:00:00','2007-07-16 14:00:00','2010-05-21 06:05:00','','[\"10\"]','Cessna 441 Conquest','VH-VEZ','Ballera','','QLD',1,1,0,'[\"FLTOPS05\"]','[\"COMMS\",\"ENVIRO\"]','Gas Detector Activation','\"During a flight in the Cooper Basin between Moomba and Ballera, a gas detector unit activated in the cargo area of the aircraft. The alarm was very distracting to the pilot and passengers.\"','The client agreed that the batteries would be removed from these units prior to them being transported by air.','','',NULL),(1182,41,'group','016/2007','2','0000-00-00 00:00:00','2008-11-30 13:00:00','2007-07-08 14:00:00','2009-02-16 22:51:00','','[\"10\",\"8\"]','Cessna 441 Conquest','Other','Canberra','','ACT',0,0,0,'[\"FLTOPS09\"]','[\"INDIV\"]','Radar Left On','\"When an engineer plugged in the Ground Power Unit, it was noticed that the radar was still on.\"','The Chief Pilot counselled the pilot involved to remind him to follow the shutdown checklist.','','',NULL),(1183,40,'group','015/07','2','0000-00-00 00:00:00','2008-11-30 13:00:00','2007-07-31 14:00:00','2009-02-16 22:50:00','','[\"9\"]','Not applicable','Not applicable','Canberra','','ACT',0,0,0,'[\"FBOCO\"]','[\"INDIV\"]','T Hangar Key Left On Tug','It was reported that the T hangar key was left on one of the aircraft tugs with the potential for anyone to get into the hangar.','Ground Handlers were briefed on the importance of securing the T hangar key.','','',NULL),(1184,39,'group','014a/07','2','0000-00-00 00:00:00','2008-11-30 13:00:00','2007-07-31 14:00:00','2010-05-21 06:06:00','','[\"8\"]','Not applicable','Not applicable','Goulburn','','NSW',0,1,0,'[\"ENGCO\"]','[\"ENVIRO\"]','Goulburn Airport Flooded','Goulburn Airport became floodeddue to heavy rainfall. The engineers were reported not to be ready for this and were stranded for hours. There was also a report of a potential car accident occuring at this time.','The issue was resolved when the wet weather ceased and the engineering staff were settled into their new accomodation.','','',NULL),(1185,38,'group','012a/2007','2','0000-00-00 00:00:00','2008-11-30 13:00:00','2007-05-31 14:00:00','2009-02-16 22:50:00','','[\"10\",\"9\"]','Metro 23','VH-VEK','Canberra','','ACT',0,0,0,'[\"FBOCO\",\"FLTOPS07\"]','[\"INDIV\",\"INFO\",\"ORGAN\",\"TECH\"]','PAL Lighting','\"On arrival at Canberra Airport after a night freight flight the Pilot Activated Lighting didn\'t work. In line with the SOP, the pilot called the Ground Handlers and the lights were turned on, but it was discovered that the telephone call went through to an off duty staff member.\"','The Chief Pilot made the reponsible managers the first point of contact on the SOP.','','',NULL),(1186,37,'group','013a/07','2','0000-00-00 00:00:00','2008-11-30 13:00:00','2007-05-31 14:00:00','2010-05-21 06:06:00','','[\"10\",\"8\",\"9\"]','Not applicable','Not applicable','Canberra','','ACT',1,1,0,'[\"FBOCO\"]','[\"ENVIRO\",\"EQUIP\"]','Bio Hazard Bin Unsafe','\"It was reported that the biohazard bin was near a tap outlet. The bin was reported to be leaking, creating a health hazard.\"','The Bin was moved to a new location immediately and replaced with a bin that didn\'t leak.','','',NULL),(1187,36,'group','014/07','2','0000-00-00 00:00:00','2008-11-30 13:00:00','2007-02-28 13:00:00','2009-02-16 22:48:00','','[\"10\",\"8\"]','Metro 23','VH-VEU','Canberra','','ACT',0,0,0,'[\"FLTOPS09\"]','[\"INDIV\",\"INFO\",\"TECH\"]','Radar Left On','An engineer powered up the aircraft and found that the radar had been left on by the last pilot to fly the aircraft.','The Chief Pilot amended the checklists to ensure that the radar was placed in SBY mode before shutting down the aircraft.','','',NULL),(1188,35,'group','013/07','2','0000-00-00 00:00:00','2008-11-30 13:00:00','2007-02-28 13:00:00','2009-02-16 22:48:00','','[\"10\"]','Metro 23','VH-VEK','Canberra','','ACT',0,0,0,'[\"FLTOPS01\"]','[\"INDIV\",\"TECH\"]','Incomplete Preflight Check','\"A Captain asked a First Officer if the preflight inspection had been completed, the FO replied \"\"yes\"\". When the aircraft was powered up, it was found the bus tie switches were off.\"','The Chief Pilot counselled the pilot concerned.','','',NULL),(1189,34,'group','012/07','2','0000-00-00 00:00:00','2008-11-30 13:00:00','2007-02-28 13:00:00','2009-02-16 22:47:00','','[\"8\",\"9\"]','Not applicable','Not applicable','Canberra','','ACT',0,0,0,'[\"ENGCO\"]','[\"ENVIRO\",\"EQUIP\"]','Sun Glare With Aircraft Tug','\"It was reported that when the sun was low in the west the tugs with windscreens were difficult to operate, particular with reference to the nose wheel limits on the aircraft being pushed.\"','The Chief Engineer briefed staff that operated the tug of the hazards of using it when the sun was shining through the windscreen.','','',NULL),(1190,33,'group','011/07','2','0000-00-00 00:00:00','2008-11-30 13:00:00','2007-02-28 13:00:00','2010-05-21 06:07:00','','[\"8\"]','Not applicable','Not applicable','Canberra','','ACT',0,1,0,'[\"ENGCO\"]','[\"EQUIP\",\"INDIV\",\"TECH\"]','Power Leads Draped Over Drums','It was reported that power leads and charging cables were draped over the oil and water methanol drums creating a potential fire hazard.','','The power outlet was shifted immediately so that the leads did not pass near the drumstock.','',NULL),(1191,32,'group','','2','0000-00-00 00:00:00','2008-11-16 13:00:00','2007-01-31 13:00:00','2008-11-17 01:13:00','','[\"10\",\"6\"]','Cessna 441 Conquest','Not applicable','Mount Margaret','','QLD',0,0,0,'[]','[]','Mount Margaret Safety Concerns','The matter of how safety concerns at the Mount Margaret airfield can be raised with SANTOS. The senior base pilot in the Cooper Basin was tasked with progressing the matter with National Jet Systems.','','The Company now has clear lines of communication with National Jet Systems for resolution of safety matters.','',NULL),(1192,31,'group','','2','0000-00-00 00:00:00','2008-11-16 13:00:00','2006-12-31 13:00:00','2008-11-17 01:09:00','','[\"10\",\"9\",\"6\"]','Metro 23','VH-VEK','Canberra','','ACT',0,0,0,'[]','[]','PAL Lighting Failure','\"At the completion of a night freight flight, the crew could not turn on the PAL lighting. Despite the aircraft having sufficient fuel to hold until ground staff were alerted, the crew were concerned that ground staff may not be totally sure of the procedure to be employed.\"','The Operations Manager and the Chief Pilot agreed to put a procedure in place with input from the Ground Handling Manager to ensure that ground handlers move immediately to manually turn on the airfield lighting if the crew can\'t do it from the aircraft.','The procedure has been developed and in place without any further problems being reported.','',NULL),(1193,30,'group','010/07','2','0000-00-00 00:00:00','2008-11-16 13:00:00','2006-12-31 13:00:00','2009-02-16 22:46:00','','[\"10\",\"8\",\"6\"]','Cessna 441 Conquest','VH-VEJ','Ballera','','ACT',0,0,0,'[\"FLTOPS10\"]','[\"ENVIRO\",\"EQUIP\"]','Blade Erosion on C441 Propellers','The reported suggested that 4 bladed propellers be fitted to VEJ in the Cooper Basin to avoid damage from unmade airstrips.','Management agreed to look into this request.','','',NULL),(1194,29,'group','009/07','2','0000-00-00 00:00:00','2008-11-16 13:00:00','2006-12-31 13:00:00','2009-02-16 22:46:00','','[\"8\",\"6\"]','Not applicable','Not applicable','Canberra','','ACT',0,0,0,'[\"ENGCO\"]','[\"EQUIP\",\"ORGAN\"]','Requirement for Additional Computer','It was reported that Engineering required another computer because the Chief Engineer had to wait for other engineering staff when they were using the computer.','Another computer was purchased for the Chief Engineer.','','',NULL),(1195,28,'group','008/07','2','0000-00-00 00:00:00','2008-11-16 13:00:00','2007-01-22 13:00:00','2008-11-20 05:25:00','','[\"10\",\"8\",\"6\"]','Beech 58 Baron','VH-VEB','Canberra','','ACT',0,0,0,'[]','[]','Incorrect Data Card','\"A pilot reported that during a preflight inspection it was noted that the GPS data card was out of date. It was also noted that the aircraft had flown on a number of occassions since the data card had expired, but it could not be determined if the pilots had relied on the GPS for navigation. The reporter asked what the procedure was for ensuring data cards were replaced.\"','Engineering agreed to take responsibility for ensuring that GPS data cards were updated in a timely fashion.','','',NULL),(1196,27,'group','007/07','2','0000-00-00 00:00:00','2008-11-16 13:00:00','2006-12-31 13:00:00','2009-02-16 22:43:00','','[\"10\",\"8\",\"9\",\"6\"]','Not applicable','Not applicable','Canberra','','ACT',0,0,0,'[\"COYGEN\"]','[\"INDIV\",\"TECH\"]','Visitor Passes','It was reported that contract staff who did not hold ASICs were not issued with visitor passes but had hangar access. The contractors had asked whether they needed visitor passes but were told by a staff member that it wasn\'t necessary.','Staff were reminded of the security requirements.','This problem has not re-occured.','',NULL),(1197,26,'group','006/07','2','0000-00-00 00:00:00','2008-11-16 13:00:00','2006-12-31 13:00:00','2010-05-21 06:08:00','','[\"8\",\"6\"]','Not applicable','Not applicable','Canberra','','ACT',0,1,0,'[\"ENGCO\"]','[\"ENVIRO\",\"EQUIP\"]','Protective Equipment','\"Owing to the amount of outdoors work that was being done, it was requested that hats, sunglasses and sunscreen be issued to engineering staff.\"','The requested protective equipment was issued immediately.','','',NULL),(1198,25,'group','005/07','2','0000-00-00 00:00:00','2008-11-16 13:00:00','2006-12-31 13:00:00','2009-02-16 22:30:00','','[\"10\",\"8\",\"6\"]','Metro 23','VH-VEU','Canberra','','Oth',0,0,0,'[\"FLTOPS10\"]','[\"INDIV\",\"TECH\"]','Incorrect Entry on Maintenance Release','\"It was reported the the Maintenance Release had an itme listed which was subsequently cleared by Engineering. At a later time, a pilot noted another similar defect but instead of creating a new entry, he altered the previous entry.\"','The Chief Pilot was tasked with organising MR training for all pilots.','MRs are now part of the induction procedure for pilots. There has been no further re-occurrence of this problem.','',NULL),(1199,24,'group','004/07','2','0000-00-00 00:00:00','2008-11-16 13:00:00','2006-12-31 13:00:00','2009-02-16 22:30:00','','[\"8\",\"6\"]','Not applicable','Not applicable','Canberra','','ACT',0,0,0,'[\"ENGCO\"]','[\"INDIV\",\"LEADER\",\"ORGAN\"]','Maintenance Scheduling','It was reported that there was insufficient time to preform all maintenance on aircraft because of the minimum downtime that was scheduled on the aircraft.','The Safety Copmmittee referred this matter to the Management Committee to address the manpower issues.','\"All downtime scheduling is done with collaboration between Operations and the HAMCO to enure there is sufficient time to perform maintenance. In most cases additional time, over the standard maintenance times, is factored in.\"','',NULL),(1200,23,'group','003/07','2','0000-00-00 00:00:00','2008-11-16 13:00:00','2006-12-31 13:00:00','2009-02-16 22:29:00','','[\"8\",\"6\"]','Not applicable','Not applicable','Canberra','','ACT',0,0,0,'[\"ENGCO\"]','[\"ORGAN\"]','AOG laptop','It was reported that engineers had no method of checking to the electronic version of the Maintenance Manual and approved data if they were operating away from the office in an AOG situation. The pruchase of a laptop was suggested.','A laptop was purchased.','','',NULL),(1201,22,'group','002/07','2','0000-00-00 00:00:00','2008-11-16 13:00:00','2006-12-31 13:00:00','2009-04-23 08:00:00','','[\"8\",\"6\"]','Cessna 441 Conquest','Not applicable','Canberra','','ACT',0,0,0,'[\"ENGCO\"]','[\"INFO\",\"ORGAN\",\"TECH\"]','Cable Inspections','It was reported that some engineers were not aware of the requirement to do a full cable inspection under the floor every two hundred hours because the SOM didn\'t make this clear.','The HAMCO and the Chief Engineer informed engineering staff of this requirment.','Inspections are now being conducted correctly.','',NULL),(1202,21,'group','001/07','2','0000-00-00 00:00:00','2008-11-16 13:00:00','2006-12-31 13:00:00','2009-02-16 22:28:00','','[\"10\",\"8\",\"9\",\"7\",\"6\"]','Not applicable','Not applicable','Canberra','','ACT',0,0,0,'[\"COYGEN\"]','[\"ORGAN\"]','Safety Newsletter','An employee asked when the next Safety Newletter would be released.','The Safety Manager produced a Newsletter immediately.','\"The company will continue to keep staff informed of safety matters through the portal, particularly on the Group Safety Area.\"','',NULL),(1203,20,'group','017/06','2','0000-00-00 00:00:00','2008-11-16 13:00:00','2006-12-31 13:00:00','2009-02-16 01:32:00','','[\"10\",\"8\",\"6\"]','Not applicable','Not applicable','Canberra','','ACT',0,0,0,'[\"FLTOPS07\"]','[\"INDIV\",\"TECH\"]','Flat Spots on Tyres','Engineering staff reported an increase in the occurence of flat spots on tyres within the aircraft fleet.','The Safety Committee decided that they would wait to see the effect of previous measures to reduce this problem before taking any further action.','The incidence of flat spots on tyres has reduced to very low levels.','',NULL),(1204,19,'group','016/06','2','0000-00-00 00:00:00','2008-11-16 13:00:00','2006-12-31 13:00:00','2010-05-21 06:10:00','','[\"10\",\"8\",\"6\"]','Not applicable','Not applicable','Canberra','','ACT',1,1,0,'[\"FLTOPS01\"]','[\"INDIV\",\"TECH\"]','Fuel Drains','Engioneering staff reported seeing evidence of fuel drains not being done correctly and were concerned about corrosion or fungal growth in the fuel tanks.','The Chief Pilot raised a NOTAC to pilots reminding them of the correct procedure for fuel drains. The NOTAC also emphasised post flight inspection requirements.','','',NULL),(1205,18,'group','015/06','2','0000-00-00 00:00:00','2008-11-16 13:00:00','2006-12-31 13:00:00','2010-05-21 06:10:00','','[\"8\",\"9\",\"6\"]','Not applicable','Not applicable','Canberra','','ACT',0,1,0,'[\"ENGCO\",\"FBOCO\"]','[\"INDIV\"]','Aircraft Tug Driven Erratically','One of the aircraft tugs was observed being driven in an erratic fashion in the hangar and on the tarmac.','The Head of Maintenance Control issued a NOTENG and NOTGH to exercise more care when operating the tugs. He also had the Ground Handling Equipment Engineer place a speed limit on tug operation.','','',NULL),(1206,17,'group','014/06','2','0000-00-00 00:00:00','2008-11-16 13:00:00','2006-12-13 13:00:00','2009-02-16 01:31:00','','[\"10\",\"8\",\"9\",\"6\"]','Cessna 441 Conquest','VH-VED','Canberra','','ACT',0,0,0,'[\"FLTOPS02\"]','[\"INDIV\",\"TECH\"]','Aircraft Moving During Start','\"After starting the left engine, the aircraft moved forward a couple of metres before the pilot noticed and stopped the aircraft.\"','The pilot involved was counselled by the Chief Pilot to ensure that the brakes were used properly during starts.','','',NULL),(1207,16,'group','013/06','2','0000-00-00 00:00:00','2008-11-16 13:00:00','2006-12-31 13:00:00','2010-05-21 06:11:00','','[\"9\",\"6\"]','Not applicable','Not applicable','Canberra','','ACT',1,1,0,'[\"ENGCO\",\"FBOCO\"]','[\"ENVIRO\",\"EQUIP\"]','Bus Exhaust Fumes','It was reported that the bus was left running whilst the airconditioning unit was being recharged. This caused fumes to enter the hangar and radio room.','The Head of Maintenance Control spoke to the Ground Handling Engineer to make him aware of the problem of running the bus in this manner.','','',NULL),(1208,15,'group','012/06','2','0000-00-00 00:00:00','2008-11-16 13:00:00','2006-12-31 13:00:00','2009-02-16 01:30:00','','[\"10\",\"8\",\"6\"]','Cessna 441 Conquest','Other','Canberra','','ACT',0,0,0,'[\"FLTOPS10\"]','[\"INDIV\",\"TECH\"]','VH-TFB Open Defects','It was discovered that the aircraft had flown with defects open on the Maintenance Release.','The Chief Pilot reminded all pilots of the requirement to ensure that there were no open items on the Maintenance Release prior to flight.','There have been no further re-occurrences of this problem','',NULL),(1209,13,'group','011/06','2','0000-00-00 00:00:00','2008-10-29 13:00:00','2005-12-31 13:00:00','2009-02-16 01:30:00','','[\"10\",\"8\",\"9\"]','Metro 23','Not applicable','Canberra','','ACT',0,0,0,'[\"FBOCO\",\"FLTOPS08\"]','[\"EQUIP\"]','Ground Equipment Parked Too Close to Metro','Ground equipment was being parked to close to the Metroliner because the GSE parking area was not clearly delineated.','The Chief Engineer arranged for the parking limit lines to be repainted.','','',NULL),(1210,12,'group','010/06','2','0000-00-00 00:00:00','2008-10-29 13:00:00','2005-12-31 13:00:00','2009-02-16 01:28:00','','[\"10\",\"8\"]','Metro 23','VH-VEU','Canberra','','ACT',0,0,0,'[\"FLTOPS07\"]','[\"INDIV\",\"TECH\"]','Flat Spots on Tyres','There were numerous examples of flat spots on the tyres of this aircraft and other aircraft in the fleet.','The damaged tyres were put on display in the pilot\'s room as examples of over braking. the Chief Pilot counselled pilots on braking techniques.','The incidents of flat spots on tyres decreased.','',NULL),(1211,11,'group','009/06','2','0000-00-00 00:00:00','2008-10-29 13:00:00','2005-12-31 13:00:00','2009-02-16 01:28:00','','[\"10\",\"8\"]','Cessna 404 Titan','VH-VEA','Canberra','','ACT',0,0,0,'[\"ENGCO\",\"FLTOPS05\"]','[\"EQUIP\"]','VEA Altitude Hold','The altitude hold function of the autopilot had been reported as unsatisfactoy on a number of occassions.','A new autopilot computer was ordered and the aircraft was only used for freight operations until the new computer was fitted.','','',NULL),(1212,10,'group','008/06','2','0000-00-00 00:00:00','2008-10-29 13:00:00','2005-12-31 13:00:00','2009-02-16 01:27:00','','[\"8\"]','Metro 23','Not applicable','Canberra','','ACT',0,0,0,'[\"ENGCO\"]','[\"EQUIP\"]','Stands for Metro Maintenance','There was a request for more appropriate stands to be constructed for maintenance on the M23','New stands were constructed','','',NULL),(1213,9,'group','007/06','2','0000-00-00 00:00:00','2008-10-29 13:00:00','2005-12-31 13:00:00','2010-05-21 06:12:00','','[\"8\",\"9\"]','Not applicable','Not applicable','Canberra','','ACT',0,1,0,'[\"ENGCO\"]','[\"EQUIP\"]','Tug Safety Equipment','The tug reversing chime was reported as being too loud to conduct conversation when tugging aircraft. There was a request for a fire extinguisher to be fitted for engine starts','The reversing chime was quietened and a fire extinguisher was fitted.','','',NULL),(1214,8,'group','','2','0000-00-00 00:00:00','2008-10-29 13:00:00','2005-12-31 13:00:00','2009-02-16 01:26:00','','[\"10\"]','Metro 23','Not applicable','Canberra','','ACT',0,0,0,'[\"FLTOPS05\"]','[\"INDIV\",\"TECH\"]','Inadvertent Actuation of Dump Valve','An inexperienced first officer activated the cabin dump switch instead of moving the pressurisation from hi to lo.','It was decided not to modify the aircraft by fitting a guard on the dump valve. It was decided to ensure that Captains more closely monitor inexperienced FOs','','',NULL),(1215,7,'group','005/06','2','0000-00-00 00:00:00','2008-10-29 13:00:00','2005-12-31 13:00:00','2009-02-16 01:26:00','','[\"10\",\"9\"]','Metro 23','VH-VEK','Canberra','','ACT',0,0,0,'[\"FLTOPS03\",\"FLTOPS08\"]','[\"ENVIRO\"]','Parking of Brindabella Airlines Aircraft','A pilot reported a further occurence of a Brindabella Airlines aircraft being parked over the parking clearance lines reducing safety margins for taxying aircraft.','The Chief Pilot spoke to Brindabella Airlines management.','','',NULL),(1216,6,'group','004/06','2','0000-00-00 00:00:00','2008-10-29 13:00:00','2005-12-31 13:00:00','2009-02-16 01:25:00','','[\"10\",\"8\",\"9\",\"7\",\"6\"]','Not applicable','Not applicable','Canberra','','ACT',0,0,0,'[\"ENGCO\"]','[\"ORGAN\"]','First Aid Notices Require Amending','A staff member was still listed on the first aid notice even though the staff member had left Corporate Air','The HAMCO had the notices amended.','','',NULL),(1217,5,'group','003/06','2','0000-00-00 00:00:00','2008-10-29 13:00:00','2005-12-31 13:00:00','2010-05-21 06:13:00','','[\"10\",\"9\"]','Metro 23','VH-VEK','Canberra','','ACT',0,1,0,'[\"FLTOPS03\"]','[\"ENVIRO\"]','Fuel Truck Close to Taxying Aircraft','On taxying in to the parking area the aircraft had to brake to avoid a collision with the fuel track heading towards the terminal area at higher than normal speed.','The Operations Manager submitted a report to the Airport Safety Committee to prevent a re-occurence.','','',NULL),(1218,4,'group','002/06','2','0000-00-00 00:00:00','2008-10-29 13:00:00','2006-12-31 13:00:00','2009-02-16 01:24:00','','[\"10\",\"9\"]','Metro 23','VH-VEK','Canberra','','ACT',0,0,0,'[\"FLTOPS03\",\"FLTOPS08\"]','[\"ENVIRO\"]','Parking of Brindabella Airlines Aircraft','Brindabella Airlines SA227 parked with one wing a metre over the parking clearance line. Brindabella staff not available. Corporate ground staff guided company aircraft out of parking area clear of Brindabella aircraft','Chief Pilot spoke to Brindabella about parking and told Corporate pilots to report further occurences.','','',NULL),(1219,3,'group','001/06','2','0000-00-00 00:00:00','2008-10-29 13:00:00','2006-12-31 13:00:00','2009-02-15 08:26:00','Unknown','[\"10\",\"8\"]','Not applicable','Not applicable','Canberra','','ACT',0,0,0,'[\"ENGCO\",\"FLTOPS10\"]','[\"COMMS\"]','Maintenance Release Endorsement','A pilot was hassled by engineering staff for endorsing a maintenance release with an unservicability.','\"It was agreed that , where there were matters of dispute between engineering and flying operations over maintenance release endorsement, that the matter would immediately be raised with the Chief Pilot and Chief Engineer to resolve\"','','',NULL),(1220,2,'group','TBA','2','0000-00-00 00:00:00','2008-10-13 13:00:00','2008-10-04 07:45:00','2010-05-21 06:15:00','Hajduk','[\"10\",\"8\",\"9\",\"7\",\"6\"]','Cessna 441 Conquest','VH-VEM','Ballera','','QLD',0,1,0,'[\"FLTOPS10\"]','[\"ENVIRO\",\"EQUIP\"]','Storm Damage','\"At 1426 EST the aircraft, which was engaged in a closed charter operation in the Cooper Basin, had completed operations for the day and was parked facing towards the North in front of the terminal at Ballera airport in southwest Queensland. At 1500 the park brake was set, the aircraft nose wheel was chocked, the gust locks were installed, the aircraft was locked and the bungs and covers for the pitot tubes and engine apertures were installed. The flaps were in the take-off position, a requirement for inspection of the flap connections prior to the next flight. There is no provision at Ballera airport to tie aircraft down to the parking area. The aircraft weight was approximately 3,100kg. At 1720 the pilot left the airport and went back to the camp area for the evening and the airport manager left the airport shortly thereafter. The pilot observed the weather to be light NNW winds with light cloud cover at about 10,000 feet and no significant weather. At 1750 the pilot was alerted by Ross Brown, the airport manager, that the aircraft had been blown some distance by the wind and the pilot drove to the airport at 1755. The pilot noted that there was very strong wind with driving rain and loose objects were been blown around. There was no thunder or lightning apparent. When the pilot arrived at the airport he found that the aircraft had been blown approximately 140 metres across the parking area to the North Eastern side and had impacted a light pole, a fire extinguisher stand and an eyewash station causing considerable damage to the tail and left wing of the aircraft. The nosewheel chocks were still where the aircraft was originally parked. A helicopter that was parked at the airport had shifted across the ground about 150mm. The pilot also observed that there had been a lot of rain because of the depth of water in puddles near the aircraft.\"','\"Steve Ferguson, an employee of a subcontractor to Santos at Ballera, reported that he saw the aircraft flying backwards across the parking area well clear of the ground. He said that it came to rest in a nose up attitude facing into wind. He was located near the Santos administrative building approximately 350 metres from where the aircraft was parked. He described the weather as like a mini tornado with things being blown everywhere and a building nearby being blown over. Mr Ferguson did not notice any thunder or lightning. The weather observations for Ballera are shown below. At 1700 when the pilot left the aircraft the weather station was showing the wind was swinging from the Northwest to the South and was 7 knots gusting to 12 knots. At 1737 the wind moved to the Southwest with gusts of 75 knots for about a minute. Over the next 23 minutes the wind returned to North at about 10 knots. During this period just over 5 millimetres of rain had fallen. The TAF indicated a 30% probability of thunderstorms at Ballera between 1300 and 1800. Neither the TAF nor the ARFOR forecast the winds that were experienced at Ballera at 1737. Examination of the parking area showed that there were no skid marks from where the aircraft was parked to where it came to rest. This is consistent with Mr FergusonÕs observation that the aircraft was flying. Examination of the flight manual for the C441 shows that at 3,100kg the aircraft stall speed is 72 knots. Therefore, gusts of 75 knots would have been sufficient for the aircraft to become airborne. For this to happen, the aircraft would have to be pointing into wind. Mr Ferguson noted that the aircraft appear to be flying backwards, so it can be assumed that the aircraft must have weathercocked as the wind went around to the Southwest.\"','\"The aircraft was subjected to winds in excess of the stall speed for its weight, it weathercocked and become airborne until striking posts at the North-eastern corner of the parking area approximately 140 metres from where it was originally parked. The TAF for Ballera and the ARFOR did not predict the extreme conditions that occurred at the Ballera airport at 1737 and a witness described the conditions to be like a mini tornado. From the information available to him, the pilot could not have reasonably expected that the winds would have been as strong or from the Southwest direction. There was no information available to the pilot from either forecasts or observation that would have indicated such extreme conditions that caused this accident. Other than shifting the aircraft to another airfield or securing it to something that would not move in such extreme winds there is little that the pilot could have done to prevent this accident. There is no provision for aircraft to be secured to the apron parking area at Ballera airport. The pilot took all actions at his disposal to secure the aircraft including facing the aircraft into the prevailing and forecast wind, applying the park brake and chocking the nosewheel. Santos, the owner of Ballera airport, is arranging for hard point tie downs to be installed in the apron parking area so that the aircraft can be better secured. On any occasion where the aircraft is parked overnight or where the pilot will not be in attendance for an extended period, the aircraft will be secured to the hard point tie downs to ensure that a similar accident does not re-occur.\"','',NULL),(1222,310,'group','','2','2011-10-01 07:20:00','2011-10-01 07:27:00','2011-09-03 07:20:00','2011-09-06 07:20:00','Allister Polkinghorne','[\"10\",\"42\",\"48\",\"54\",\"52\",\"53\",\"58\",\"44\",\"45\",\"41\",\"47\",\"40\",\"39\",\"51\",\"43\",\"56\",\"55\",\"46\",\"57\",\"50\",\"49\",\"38\"]','Beech 58 Baron','VH-VEB','Canberra','','ACT',0,0,0,'[\"FLTOPS01\"]','[\"COMMS\"]','Fuel Docket Left on Wrong Aircraft','','','','a:0:{}',NULL),(1223,311,'group','','2','2011-10-01 07:25:00','2011-10-01 07:29:00','2011-10-03 06:35:00','2011-09-06 07:25:00','Allister Polkinghorne','[\"10\",\"42\",\"48\",\"54\",\"52\",\"53\",\"58\",\"44\",\"45\",\"41\",\"47\",\"40\",\"39\",\"51\",\"43\",\"56\",\"55\",\"46\",\"57\",\"50\",\"49\",\"38\",\"8\",\"33\",\"30\",\"26\",\"31\",\"25\",\"27\",\"32\",\"29\",\"28\"]','Beech 58 Baron','VH-VEB','Canberra','','ACT',0,0,0,'[\"ENGCO\"]','[\"DESIGN\"]','Nav Light Switch Dims Gear Down Lights','','','','a:0:{}',NULL),(1224,312,'group','','1','2011-10-01 07:35:00','2011-10-01 07:31:00','2011-09-07 07:25:00','2011-10-01 07:25:00','Albert Stewardson','[\"10\",\"42\",\"48\",\"54\",\"52\",\"53\",\"58\",\"44\",\"45\",\"41\",\"47\",\"40\",\"39\",\"51\",\"43\",\"56\",\"55\",\"46\",\"57\",\"50\",\"49\",\"38\",\"8\",\"33\",\"30\",\"26\",\"31\",\"25\",\"27\",\"32\",\"29\",\"28\"]','Cessna 441 Conquest','VH-VEY','Near Bourke','','NSW',0,0,0,'[\"ENGCO\",\"FLTOPS05\"]','[\"EQUIP\"]','Precautionary Engine Shutdown','<p>The aircraft was en route from Canberra<br />to Mount Isa approx 120nm NW of Bourke maintaining F260 the pilot noticed the<br />R/H oil pressure gauge dropped to zero, followed by the Master Warning Light<br />flashing. The R/H 40 psi oil pressure light was illuminated (which caused the<br />Master Warning to flash). The pilot secured the R/H engine and notified ATC of<br />the engine shut down and diverted to Bourke for a single engine landing. The<br />cause of the loss of oil pressure is being investigated.</p>','<p>The cause for the loss of oil pressure was failure of<br />the scavenge pump because the oil return line and the vent line were<br />reversed.&nbsp; The Maintenance Manual shows<br />this incorrect configuration.&nbsp; The<br />manufacturer is aware of the problem and CASA has been informed.</p>','','a:0:{}',NULL),(1225,313,'group','','2','2011-10-20 02:00:00','2011-10-01 07:33:00','2011-09-06 07:30:00','2011-10-01 07:30:00','Richard Bennet','[\"10\",\"42\",\"48\",\"54\",\"52\",\"53\",\"58\",\"44\",\"45\",\"41\",\"47\",\"40\",\"39\",\"51\",\"43\",\"56\",\"55\",\"46\",\"57\",\"50\",\"49\",\"38\",\"8\",\"33\",\"30\",\"26\",\"31\",\"25\",\"27\",\"32\",\"29\",\"28\"]','Metro 23','VH-VEU','Melbourne','','VIC',0,0,0,'[\"ENGCO\",\"FLTOPS05\"]','[]','Windscreen Cracks','<p>The aircraft was operating between YMHB<br />to YMML at F140 the co-pilot\'s windscreen cracked. The aircraft was in cloud at<br />the time with St elmos fire over both windscreens evident. Windshield heats<br />were on LOW from taxi through to shutdown as per the FCOM. The cabin<br />differential was reduced and a normal landing carried out in YMML.</p>','<p><span style=\"font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-size: 12pt; mso-bidi-font-family: &quot;Times New Roman&quot;; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-ansi-language: EN-AU; mso-fareast-language: EN-AU; mso-bidi-language: AR-SA;\" lang=\"EN-AU\">This is a known problem for this aircraft type and<br />nothing can be done to prevent a re-occurrence. </span></p>','','a:0:{}',NULL),(1226,314,'group','','1','2011-09-15 07:35:00','2011-10-01 07:40:00','2011-09-13 07:35:00','2011-10-01 07:35:00','Sam Moore','[\"10\",\"42\",\"48\",\"54\",\"52\",\"53\",\"58\",\"44\",\"45\",\"41\",\"47\",\"40\",\"39\",\"51\",\"43\",\"56\",\"55\",\"46\",\"57\",\"50\",\"49\",\"38\"]','Beech 58 Baron','VH-VEB','Shepparton','','VIC',0,0,0,'[\"FLTOPS05\"]','[]','Breakdown of Separation','<p>The aircraft departed Shepparton for Canberra closely behind VEG, conditions were cavok. After the departure report was given the pilot was asked by ATC if he was visual with VEG. He replied \'negative\' as sighting had been lost momentarily. The aircraft then became identified by ATC. After being identified for a few minutes at 9000ft a clearance was half given by ATC then stopped and the aircraft was told to remain clear of class E airspace for separation purposes. This created confusion as the pilot assumed that for the area he was in, the lower limit for class E airspace was 12500ft. The aircraft was then told to descend immediately out of the airspace. The pilot acknowledges the mistake was made by assuming he knew the areas of airspace and not consulting the charts before departure.&nbsp; The Chief Pilot will counsel the pilot involved.&nbsp;</p>','','','a:0:{}',NULL),(1227,315,'group','','0','2012-11-26 05:36:04','2011-10-01 07:41:00','2011-09-19 07:40:00','2011-10-01 07:40:00','Gerry Hanstede','[\"10\",\"42\",\"48\",\"54\",\"52\",\"53\",\"58\",\"44\",\"45\",\"41\",\"47\",\"40\",\"39\",\"51\",\"43\",\"56\",\"55\",\"46\",\"57\",\"50\",\"49\",\"38\",\"8\",\"33\",\"30\",\"26\",\"31\",\"25\",\"27\",\"32\",\"29\",\"28\"]','Cessna 441 Conquest','VH-VEJ','Ballera','','QLD',0,0,0,'[\"ENGCO\"]','[\"EQUIP\"]','Seats Too High','<p><span style=\"font-family: Times New Roman; font-size: small;\"> </span></p>\n<p><span style=\"font-size: small;\">The re-upholsterd seats in this aircraft are too high in lowest position. It does not allow for any clearance between the ceiling of the aircraft and the pilot\'s head (for the taller ones that is). The control yoke is also not fully usable due to the yoke sitting snug on top of the legs, especially in a crosswind landing it makes for interesting flying.</span></p>\n<p><span style=\"font-family: Times New Roman; font-size: small;\"> </span></p>','<p>MRO believe that the problem is to do with the height adjustment in the particular aircraft involved.&nbsp; This will be checked when the aircraft is next serviced.&nbsp;</p>','','a:0:{}','a:1:{i:0;b:0;}'),(1228,316,'group','','2','2011-10-01 07:40:00','2011-10-01 07:43:00','2011-09-19 07:40:00','2011-09-21 07:40:00','Bill McIntyre','[\"10\",\"42\",\"48\",\"54\",\"52\",\"53\",\"58\",\"44\",\"45\",\"41\",\"47\",\"40\",\"39\",\"51\",\"43\",\"56\",\"55\",\"46\",\"57\",\"50\",\"49\",\"38\"]','Metro 23','VH-VEK','Melbourne','','VIC',0,0,0,'[\"FLTOPS06\"]','[\"ENVIRO\"]','Laser Illumination','<p>The aircraft was approaching PLE for the Rwy 27 ILS approach. The aircraft was illuminated by a green laser along its right hand side. ATC were notified.&nbsp;</p>','','','a:0:{}',NULL),(1229,317,'group','','2','2012-11-26 05:34:34','2011-10-01 07:44:00','2011-09-21 07:40:00','2011-10-01 07:40:00','Antony Springer','[\"10\",\"42\",\"48\",\"54\",\"52\",\"53\",\"58\",\"44\",\"45\",\"41\",\"47\",\"40\",\"39\",\"51\",\"43\",\"56\",\"55\",\"46\",\"57\",\"50\",\"49\",\"38\"]','Cessna 441 Conquest','VH-VED','Newlands','','QLD',0,0,0,'[\"FLTOPS07\"]','[]','Cone Marker on Runway','<p><span style=\"font-family: Times New Roman; font-size: small;\"> </span></p>\n<p><span style=\"font-size: small;\">During the approach phase of the flight into Newlands Mine an object was identified at approximately 2nm to be infringing the landing zone of Runway 35. The object was identified as a cone marker, 120-130m from the threshold and offset from the centerline by approximately 5-7m. Wind at the time was from 310/5-10 with generally good prevailing conditions. Based on the prevailing wind conditions and remaining strip length the aircraft conducted a safe landing and roll-out on the Northern side of the obstacle. Xstrata personnel in the aircraft were briefed on the hazard and have initiated safety reporting through their SMS. Contrary to their policy and procedures for airstrip inspection and safety, Xstrata ground personnel were not in place.</span></p>\n<p><span style=\"font-family: Times New Roman; font-size: small;\"> </span></p>','<p>The Safety Manager has written to the client advising them of this problem.&nbsp;</p>','','a:0:{}','a:1:{i:0;b:0;}'),(1230,318,'group','','2','2012-11-26 05:34:20','2011-10-01 07:46:00','2011-09-23 07:40:00','2011-10-01 07:40:00','Rob Boyes','[\"9\",\"37\",\"34\",\"36\",\"35\"]','','Not Applicable','Goulburn','','NSW',0,0,0,'[]','[\"EQUIP\"]','Collapsed Shelf','<p><span style=\"font-family: Times New Roman; font-size: small;\"> </span></p>\n<p><span style=\"font-size: small;\">A shelf holding archived boxes in Area J of the store at the hangar has collapsed and is only being held up by the boxes under it. This shelf needs to be repaired and care needs to be taken when moving the boxes that a collapse does not occur.</span></p>\n<p><span style=\"font-family: Times New Roman; font-size: small;\"> </span></p>','<p>The shelf will be replaced during the week ending the 7<sup>th</sup> of October.&nbsp;</p>','','a:0:{}','a:1:{i:0;b:0;}'),(1231,319,'group','','2','2011-10-20 02:15:00','2011-10-01 07:49:00','2011-09-29 07:45:00','2011-10-06 04:50:00','Andrew Puddifer','[\"9\",\"37\",\"34\",\"36\",\"35\"]','','Not Applicable','Pialligo','','ACT',0,0,0,'[\"FBOCO\"]','[\"EQUIP\"]','Steps on HIgh Lift Truck','<p><span style=\"font-family: Times New Roman; font-size: small;\"> </span></p>\n<p><span style=\"font-size: small;\">Access into the rear of the new High Lift truck is poor. The bottom step bolted to the front bumper bar is on a considerable angle and is somewhat loose. The next step up from that is small and located on top of the bumper and the handle on the side of the cab used to assist climbing onto the front boarding platform is loose and small. The steps all have non skid on them but the surrounding areas are very easy to step on to and have poor slip resistance. The layout of the steps and handle are not ideal and force the body to be out of line for an easy upward climb.</span></p>\n<p><span style=\"font-family: Times New Roman; font-size: small;\"> </span></p>','<p>A new retractable rear ladder is being custom made to fit the vehicle.&nbsp; The front steps will be permanently removed.&nbsp; The Ground Handling Manger will raise a NOTGH advising personnel of the safe ingress procedure.&nbsp;</p>','','a:0:{}',NULL),(1232,320,'group','','2','2011-10-20 02:15:00','2011-10-01 07:51:00','2011-09-28 07:45:00','2011-10-06 06:45:00','Andrew Puddifer','[\"8\",\"33\",\"30\",\"26\",\"31\",\"25\",\"27\",\"32\",\"29\",\"28\"]','','Not Applicable','Pialligo','','ACT',0,0,0,'[\"FBOCO\"]','[\"ORGAN\"]','Safety Officer for Catering/Cabin Services','<p>A staff member has suggested that because of the large numbers of new staff and procedures, in particular that the Catering/Cabin Services Division operates pretty much independently from the rest of the operation on a day to day basis, perhaps a safety officer/representative could be appointed for each shift to help identify problem areas and work on solutions to any potential hazards</p>','<p>This matter will be kept under consideration until the SOPs for Catering Services have been finalised.&nbsp;</p>','','a:0:{}',NULL),(1234,321,'group','','2','2012-11-26 05:34:09','2011-10-06 00:41:00','2011-10-04 00:40:00','2011-10-06 00:40:00','','[\"9\",\"37\",\"34\",\"36\",\"35\"]','','Not Applicable','Canberra','','ACT',0,1,0,'[\"FBOCO\",\"COYGEN\"]','[\"DESIGN\"]','Worker Breaks Finger','<p><span id=\"ctl00_ContentPlaceHolder1_FormView1_reportSummaryLabel\">The employee was loading carts on a cold start aircraft in the early morning hours when he tripped on the bridging ramp on the high lift truck. The employee tried to catch the falling cart during his fall to the ramp and his little finger on his left hand was jammed between the cart and the edge of the ramp by the falling cart. He was taken to emergency with a suspected broken finger as bone had pierced the skin. The employee will receive surgery this afternoon to clean the break area up and possibly pin the joint. An ACT workers compensation early notification form has been completed and sent to CGU.</span></p>','<p>The Manager Ground Handling will investigate painting of the ramp for better visual effect.&nbsp; A NOTGH will be issued.</p>','','a:0:{}','a:1:{i:0;b:0;}'),(1235,322,'group','','2','2012-11-26 05:33:59','2011-10-18 22:03:00','2011-09-28 23:00:00','2011-10-03 22:00:00','Andrew Puddifer','[\"9\",\"37\",\"34\",\"36\",\"35\"]','','Not Applicable','Canberra','','ACT',0,1,0,'[\"FBOCO\"]','[\"ENVIRO\"]','Stairs Blow Away in Wind','<p><span id=\"ctl00_ContentPlaceHolder1_FormView1_reportSummaryLabel\">A set of mobile stairs was blown away from the L2 door of Embraer 190 aircraft VH ZPE, which was located at gate 6. A cabin services crew had finished performing an uplift to this aircraft within five minutes of this occurring and was required to stop the stairs blowing across the apron under the force of wind and assist to push the stairs back to the aircraft (under guidance of an Aerocare employee). Winds at the time were shown as steady between 44-54 km/h and gusting to between 70 and 83 km/h. If staff been a few more minutes later to the uplift they could have found themselves stepping into thin air, the stairs blew away from the aircraft within a couple of seconds. As it was, a member of the cabin crew was very surprised by the fact the stairs were gone as she entered the doorway. </span></p>','<p><span id=\"ctl00_ContentPlaceHolder1_FormView1_reportFeedbackLabel\">It is suggested that all staff be extra vigilant when using mobile stairs in storm conditions as wind gusts have more than enough force to move the stairs, even though on this day, not very strong winds were not forecast.</span></p>','<p><span id=\"ctl00_ContentPlaceHolder1_FormView1_managerFeedbackLabel\">The Manager Ground Handling will issue a NOTGH to staff to be extra vigilant in checking that stairs are correctly locked in place.&nbsp; Virgin Australia have escalated this matter to Aerocare.&nbsp; </span></p>','a:0:{}','a:1:{i:0;b:0;}'),(1236,323,'group','','2','2011-11-01 04:40:00','2011-10-18 22:05:00','2011-10-04 22:00:00','2011-10-18 22:00:00','Darren King','[\"9\",\"37\",\"34\",\"36\",\"35\"]','','Not Applicable','Canberra','','ACT',0,0,0,'[\"FBOCO\"]','[\"DESIGN\"]','Gate 5 Strikes Hi Lift Truck','<p><span id=\"ctl00_ContentPlaceHolder1_FormView1_reportSummaryLabel\">On exiting Gate 5 in one of the Highlift trucks the staff member waited until the gate had fully opened to ensure the vehicle behind him was able to exit also. As he edged forward to exit, the Gate started to close and came into contact with the side of the truck ramp. On first inspection the sensor on gate 5 is below the truck ramp which meant that the gate started to close without picking up that the ramp was in fact over the gate line. By the time he had stopped the truck (30cm-1m) the gate was pushed landside bending the leading edge of the gate. The gate was able to close but has been classed as unserviceable as it would not open again. A Canberra Airport Hazard report has been completed and sent to the Airport Operations staff. No damage was noticed on the Highlift truck. Deatils of the incident to follow from the airport when received.</span></p>','<p>NOTGH 13-1011 has been issued.</p>','','a:0:{}','a:1:{i:0;b:0;}'),(1237,324,'group','','2','2012-11-26 05:33:49','2011-10-18 22:06:00','2011-10-09 22:05:00','2011-10-18 22:05:00','Andrew Puddifer','[\"9\",\"37\",\"34\",\"36\",\"35\"]','','Not Applicable','Canberra','','ACT',0,0,0,'[\"FBOCO\"]','[\"INDIV\"]','Hi Lift and Dutro Truck Conflicts','<p><span id=\"ctl00_ContentPlaceHolder1_FormView1_reportSummaryLabel\">A staff member has raised the issue that both high lift catering trucks have large blind spots to the left side, from the 7 o\'clock position through to the 9-10 o\'clock position. He has noticed several times when airside, a driver in the Dutro has pulled out to the left side of the high lift trucks as both trucks have moved off and the high lift driver is completely unaware it is there. He feels it would be very easy for high lift driver to turn left into the Dutro. Also, Dutros are being parked in the High Lift blind spot when airside. He feels that both issues are easily avoided, trucks shouldn\'t be travelling side by side, but in single file and the Dutro should be parked behind, in front of, or to the left of the High Lift trucks, but not to the left hand side. He feels the High Lift trucks are difficult enough to manoeuvre in confined spaces around aircraft without having to worry where the Dutro is.</span></p>','','','a:0:{}','a:1:{i:0;b:0;}'),(1238,325,'group','','2','2012-11-26 05:33:36','2011-10-18 22:07:00','2011-10-11 22:05:00','2011-10-18 22:05:00','Richard Bennet','[\"10\",\"42\",\"48\",\"54\",\"52\",\"53\",\"58\",\"44\",\"45\",\"41\",\"47\",\"40\",\"39\",\"51\",\"43\",\"56\",\"55\",\"46\",\"57\",\"50\",\"49\",\"38\"]','','Not Applicable','Canberra','','ACT',0,1,0,'[\"FLTOPS10\"]','[\"INDIV\"]','Rostering','<p><span id=\"ctl00_ContentPlaceHolder1_FormView1_reportSummaryLabel\">A pilot had been rostered on and had completed 2 consecutive weeks of night freight operations and had commenced his 3rd straight week of rostered freight. Following the Monday night ML freight run the pilot received a phone call from operations at approx 1400 on the Tuesday afternoon informing him of a roster change. The pilot was now required to sign on the next morning (Wednesday) at 0515 for an early morning departure involving a considerably long duty day (14hrs). The pilot was told he was the last resort and that there were no other pilots available to do the charter. The pilot had adjusted his previous sleep pattern already to fit the rostered freight ops. Fortunately the pilot was able to get sufficient rest prior to waking at 0430 (within 2hrs of the average time the pilot had been going to bed following work for the last 2 and a half weeks), to be able to conduct the charter safely and free of fatigue. Although the company\'s fatigue management system enables such a rostering procedure the inherent hazard associated with it is that pilots may feel pressured into accepting and completing such duty periods while suffering the effects of fatigue due to insufficient time to adjust one&rsquo;s body clock irrespective of one&rsquo;s flight and company experience. The apparent fear of calling in sick should a pilot not get the required rest before an early charter due to a) the time of morning that pilot would make such a decision and b) the knowledge that operations has passed onto the pilot that he/she is the only pilot available and is a last resort for such a charter, is another hazard associated with such a rostering policy. </span></p>','','','a:0:{}','a:1:{i:0;b:0;}'),(1239,326,'group','','2','2012-11-26 05:33:23','2011-10-18 22:09:00','2011-10-11 22:05:00','2011-10-18 22:05:00','Richard Bennet','[\"10\",\"42\",\"48\",\"54\",\"52\",\"53\",\"58\",\"44\",\"45\",\"41\",\"47\",\"40\",\"39\",\"51\",\"43\",\"56\",\"55\",\"46\",\"57\",\"50\",\"49\",\"38\",\"9\",\"37\",\"34\",\"36\",\"35\"]','Beech 58 Baron','VH-VEG','Canberra','','ACT',0,0,0,'[\"FLTOPS01\"]','[\"EQUIP\"]','Ice Protection not Applied','<p><span id=\"ctl00_ContentPlaceHolder1_FormView1_reportSummaryLabel\">Upon arrival at the aircraft at 0530 the outside air temperature was minus 1 degree with ice covering the windshield which subsequently had to be scraped off to be able to see out. The aircraft windshield and wing covers had not been put on aircraft on the night before this early morning charter. As this is the second occasion that this has occurred to this pilot&nbsp; in the last month he wonders what is the point of having covers if we don\'t use them. </span></p>','','','a:0:{}','a:1:{i:0;b:0;}'),(1240,327,'group','','2','2011-11-01 04:55:00','2011-10-18 22:10:00','2011-10-17 22:05:00','2011-10-18 22:05:00','Andrew Puddifer','[\"9\",\"37\",\"34\",\"36\",\"35\"]','','Not Applicable','Canberra','','ACT',0,0,0,'[\"FBOCO\"]','[\"EQUIP\"]','No Limit Safety Switch on Hino','<p><span id=\"ctl00_ContentPlaceHolder1_FormView1_reportSummaryLabel\">The Hino lift truck known as \"Droopy\" has no limit or safety switch on the boarding ramp side shift function. This means the boarding ramp can be lowered onto the roof of the cab if the side shift function has been used.&nbsp; This may cause damage to the roof of the cab. A possible work around could be to disable the side shift function on the boarding ramp, keeping it fully to the left on the truck. There is no real need for the side shift function if the truck is positioned and marshalled in properly.</span></p>','','','a:0:{}','a:1:{i:0;b:0;}'),(1241,328,'group','','2','2011-11-01 03:33:16','2011-11-01 03:31:00','2011-10-20 14:30:00','2011-11-01 03:25:00','Timo Hemminki','[\"10\",\"42\",\"48\",\"54\",\"52\",\"53\",\"58\",\"44\",\"45\",\"41\",\"47\",\"40\",\"39\",\"51\",\"43\",\"56\",\"55\",\"46\",\"57\",\"50\",\"49\",\"38\",\"9\",\"37\",\"34\",\"36\",\"35\"]','Cessna 404 Titan','VH-VEA','Canberra','Australia','ACT',0,0,0,'[\"FLTOPS06\"]','[\"EQUIP\"]','PAL and ATIS U/S at Canberra','<p>The  aircraft was approaching Canberra when the pilot noticed that the ATIS  on frequency 116.7 was not available. Also, when making inbound call on  the CTAF frequency 118.7 there was no AFRU response or beeb-back when  trying to activate runway lights. Melbourne centre was notified and when  approaching waypoint TALAG in VMC it was obvious that Canberra lights  were not on. The aircraft commenced holding in TALAG 5100 ft  approximately 01:20 local time and AAE was notified. Melbourne Centre  controller managed to get in contact with Canberra Airport Operations  who eventually arrived to turn on the lights after 40 min holding.</p>','<p>The  CB tower was contacted to determine the cause of the failure.  ATC are  investigating the problem and will ensure that, no matter what  configuration the tower lighting control is in, it can be overriden by  the manual switch at the Safety Officer\'s building.</p>','','a:0:{}',NULL),(1242,329,'group','','2','2011-11-01 03:30:31','2011-11-01 03:36:22','2011-10-20 14:30:31','2011-11-01 03:30:31','NIck Faulks','[\"10\",\"42\",\"48\",\"54\",\"52\",\"53\",\"58\",\"44\",\"45\",\"41\",\"47\",\"40\",\"39\",\"51\",\"43\",\"56\",\"55\",\"46\",\"57\",\"50\",\"49\",\"38\",\"9\",\"37\",\"34\",\"36\",\"35\"]','Metro 23','VH-VEU','Canberra','Australia','ACT',0,0,0,'[\"FLTOPS06\"]','[\"EQUIP\"]','PAL and ATIS U/S at Canberra','<p>The  aircraft was approaching CB when the crew could not activate the PAL.  ATC and ground staff were notified of the lighting failure immediately  (approx 45NM CB), and attempts were made by ATC to contact CB airport  Ops personnel (first call went to message bank). At the same time the  crew contacted AAE via VHF to arrange manual lighting activation by  ground handlers. The aircraft entered holding pattern overhead WLE at  01:23am, while lighting problem was being rectified. Holding was  coordinated with VEA to avoid potential conflict. Multiple attempts at  activating lighting using PAL and manual key were unsuccessful. The  lights were activated approx 02:05 by the CB airport duty officer, 5  minutes short of latest divert time. A normal approach and landing was  then conducted. The crew also noted the AWIS was not available on 116.7,  and the ATIS Zulu was broadcasting instead. No response was noted by  the AFRU on 118.7 to any transmissions.</p>','<p>The  CB tower was contacted to determine the cause of the failure.  ATC are  investigating the problem and will ensure that, no matter what  configuration the tower lighting control is in, it can be overriden by  the manual switch at the Safety Officer\'s building.</p>','','a:0:{}',NULL),(1243,330,'group','','2','2011-11-01 05:00:00','2011-11-01 03:38:00','2011-10-22 03:35:00','2011-11-01 03:35:00','Andrew Puddifer','[\"9\",\"37\",\"34\",\"36\",\"35\"]','','Not Applicable','Canberra','Australia','ACT',0,1,0,'[\"FBOCO\"]','[\"EQUIP\"]','Hino Brake Air Leak','<p>The  Hino lift truck known as \"Droopy\" has an air leak in the air brakes  system. Over about two hours sitting, the air pressure drops into the  red low pressure part of the gauge on both air tanks. The leak has been  getting worse, previously the air systems would hold good pressure  overnight. The reporter suggests the leak is located and fixed as both  air systems are depleting with the potential to leave the truck with no  brakes if the leak gets suddenly worse. He also suggests that staff are  warned to ensure the red low air pressure warning light on the dash and  both needles are out of the red arc on the air pressure gauge before  moving off.</p>','','','a:0:{}','a:1:{i:0;b:0;}'),(1244,331,'group','','2','2011-11-01 05:00:00','2011-11-01 03:42:00','2011-10-21 14:00:00','2011-11-01 03:35:00','Andrew Puddifer','[\"9\",\"37\",\"34\",\"36\",\"35\"]','','Not Applicable','Canberra','Australia','ACT',0,1,0,'[\"FBOCO\",\"FLTOPS05\"]','[\"EQUIP\"]','Forklift has Missing Bolt','<p>The  Crown forklift used for loading and unloading catering carts has a bolt  missing  from the front right leg of the roll cage and the left front  leg has a loose bolt. This means roll over protection is compromised  should a roll over event occur. The reporter suggests that all bolts are  checked for tightness and perhaps Loctite is used to reinstall them?</p>','','','a:0:{}','a:1:{i:0;b:0;}'),(1245,332,'group','','2','2011-11-01 05:05:00','2011-11-01 03:49:00','2011-11-25 14:00:00','2011-11-01 03:45:00','Tom Menogue','[\"10\",\"42\",\"48\",\"54\",\"52\",\"53\",\"58\",\"44\",\"45\",\"41\",\"47\",\"40\",\"39\",\"51\",\"43\",\"56\",\"55\",\"46\",\"57\",\"50\",\"49\",\"38\",\"8\",\"33\",\"30\",\"26\",\"31\",\"25\",\"27\",\"32\",\"29\",\"28\"]','Cessna 441 Conquest','VH-VEH','Sydney','Australia','NSW',0,0,0,'[\"FLTOPS06\"]','[\"EQUIP\"]','Door Unlocked Light Illuminates in Flight','<p>On  descent into Sydney from FL320 on a freight run the pilot was assigned  FL110. Passing FL200 the pilot heard a thud noise from the rear of the  aircraft followed by a master warning light and a door unlocked light.  The pilot depressurised the cabin, notified ATC and carried out an  emergency descent as per the FCOM. On landing in Sydney the pilot asked  AAE to not open the door as an internal inspection was carried out. All  locks were still intact and over braced. The maintenance controller was  notified and a ferry back to Canberra was conducted with no further  issue</p>','','','a:0:{}','a:1:{i:0;b:0;}'),(1246,333,'group','','2','2012-11-26 05:31:43','2011-11-01 03:51:00','2011-10-25 03:50:00','2011-11-01 03:50:00','','[]','Cessna 441 Conquest','VH-VEZ','Ballera','Australia','QLD',0,0,0,'[\"FBOCO\",\"FLTOPS01\"]','[\"EQUIP\"]','	Seat in Wrong Position','<p>The  forward right commuter seat was incorrectly installed in VEZ, partially  blocking access to forward emergency exit. Seat was subsequently moved  into the correct position.</p>','','','a:0:{}','a:1:{i:0;b:0;}'),(1251,336,'group','','2','2012-11-24 22:20:00','2012-11-24 22:26:00','2011-11-06 22:20:00','2011-11-17 22:20:00','John Christensen','[\"8\",\"33\",\"30\",\"26\",\"31\",\"25\",\"27\",\"32\",\"29\",\"28\"]','Cessna 441 Conquest','VH-VEW','Goulburn','','NSW',0,0,0,'[\"ENGCO\"]','[\"ICAO-Accident\",\"ICAO-Serious Incident\",\"ICAO-Incident\",\"EDA-COMMS\",\"EDA-DESIGN\",\"EDA-ENVIRO\",\"EDA-EQUIP\",\"EDA-INDIV\",\"EDA-INFO\",\"EDA-TASK\",\"EDA-LEADER\",\"EDA-ORGAN\",\"EDA-TECH\"]','Antenna Broken by GPU','<p>The aircraft was parked outside of the hangar in the north east corner. Trouble shooting of failure to start engines was being carried out by staff.&nbsp; Later, as the GPU was not being used, the engineer proceeded to fold up the leads, took the chocks from the wheels and started to move the GPU towards the hangar. Another engineer came from aircraft and wanted GPU power. He took the lead and plugged it into the aircraft, then went back inside of aircraft. The GPU was left where it was. A slight noise was later heard and the GPU was seen to be just under left hand side aft of entrance door. The GPU had rolled down the slope of the concrete and had struck the aft lower VHF 2 antenna&nbsp; and had fractured its surround.&nbsp; The damaged&nbsp; antenna was removed from the aircraft.</p>','<p>Staff have been reminded to exercise more care in the use of GPUs.&nbsp; The CATs will be amended to include a chocking procedure for GPUs when not attached to a tug.&nbsp;</p>','','a:0:{}','a:0:{}'),(1247,334,'group','','2','2012-11-26 05:31:35','2011-11-01 03:54:00','2011-10-28 03:50:00','2011-11-01 03:50:00','Antony Springer','[\"10\",\"42\",\"48\",\"54\",\"52\",\"53\",\"58\",\"44\",\"45\",\"41\",\"47\",\"40\",\"39\",\"51\",\"43\",\"56\",\"55\",\"46\",\"57\",\"50\",\"49\",\"38\",\"8\",\"33\",\"30\",\"26\",\"31\",\"25\",\"27\",\"32\",\"29\",\"28\"]','Cessna 441 Conquest','VH-VED','Enroute to Rolleston','Australia','QLD',0,0,0,'[\"FLTOPS05\"]','[\"EQUIP\"]','Autopilot Commands Pitch Down','<p>The  aircraft was enroute to Rolleston at F270 With no warning the auto-pilot  commanded a sharp pull-up. Conditions at the time were calm, the  aircraft was centrally balanced and had been hand flown with no unusual  characteristics. The auto-pilot was immediately disengaged and it was  noted that the aircraft was in a nose down trim condition. The remainder  of the flight was hand flown without incident</p>','','','a:0:{}','a:1:{i:0;b:0;}'),(1248,335,'group','','2','2012-11-26 05:31:26','2011-11-01 03:57:00','2011-10-01 04:55:00','2011-11-01 03:55:00','Albert Stewardson','[\"10\",\"42\",\"48\",\"54\",\"52\",\"53\",\"58\",\"44\",\"45\",\"41\",\"47\",\"40\",\"39\",\"51\",\"43\",\"56\",\"55\",\"46\",\"57\",\"50\",\"49\",\"38\",\"9\",\"37\",\"34\",\"36\",\"35\"]','Metro 23','VH-VEK','Canberra','Australia','ACT',0,0,0,'[\"FBOCO\",\"FLTOPS01\"]','[\"EQUIP\"]','Seat in Wrong Position','<p>During the preflight inspection, it was noted that the seat spacing was incorrect with the emergency exit obstructed.</p>','','','a:0:{}','a:0:{}');
