ound Handling','J',4,'DK','2009-10-19 00:00:00',NULL,'2009-10-19 00:00:00','\"GPU use on aircraft, electric shock, impact\"','D',3,2,'Ensure all staff performing duties have current ADA. Ensure practical training reviewed. Monitored on training status tab on FBO mgr program and completion of relevant theory exam annually.','3',0,'05/05/10','DK'),(71,2,'Ground Handling','J',0,'DK','2009-10-19 00:00:00',NULL,'2009-10-19 00:00:00','GSE Slippery when wet','D',2,1,'','',0,'',''),(72,2,'Ground Handling','L',5,'DK','2009-10-19 00:00:00',NULL,'2009-10-19 00:00:00','\"Injury and damage to aircraft/staff during bad weather. Lightning, high winds, rain, frost and fog\"','C',3,2,'Provide all staff with correct uniform (footwear). Ensure stoem and weather warnings known. Review in audits. FBO-4 CorpAir Flight operations','3',0,'28/04/10','DK'),(74,2,'Ground Handling','J',3,'DK','2009-10-19 00:00:00',NULL,'2009-10-19 00:00:00','Injury from x-ray equipment','E',3,1,'','',0,'',''),(114,3,'Flight Ops','L',5,'NF','2010-03-17 00:00:00',NULL,'2010-03-17 00:00:00','\"No lighting of the walkway from the car park to the piallago office, could cause injury to pedestrians at night\"','D',1,2,'Adequate lighting to be installed.','3',0,'',''),(115,3,'Flight Ops','L',0,'NF','2010-03-17 00:00:00',NULL,'2010-03-17 00:00:00','Trucks and other Earth Moving equipment operating in the vicinity of the office could cause injury to pedestrians and damage to vehicles.','D',5,2,'Pilots are to stay on designated walkways.  Vehicles to be parked in accordance with GH procedures','4',0,'',''),(116,3,'Flight Ops','L',3,'NF','2010-03-17 00:00:00',NULL,'2010-03-17 00:00:00','\"Snakes and spiders in the vicinity of the office, in the cooper basin, and other remote locations we occasionally operate from can cause injury and death if someone is bitten.\"','E',4,2,'\"Staff to be provided with information on avoiding venomous reptiles and spiders and first aid information ',NULL,0,NULL,NULL),(117,3,'Flight Ops','L',3,'NF','2010-03-17 00:00:00',NULL,'2010-03-17 00:00:00','Other aircraft and equipment operating on the airport (particularly in low visibility) can damage equipment and people.','E',5,2,'Pilots and ground crew are to adhere to the requirements of the GHM.','4',0,'',''),(118,3,'Flight Ops','J',1,'NF','2010-03-17 00:00:00',NULL,'2010-03-17 00:00:00','Handling fuel during pre-flight checks and whilst refuelling from bowsers can damage skin and eyes.','B',2,2,'Pilots to use Company provided PPE.','3',0,'',''),(119,3,'Flight Ops','J',1,'NF','2010-03-17 00:00:00',NULL,'2010-03-17 00:00:00','\"Nose locker doors can pop open and potentially fail during flight if not latched correctly, causing damage to aircraft.\"','C',2,2,'Clear procedures for the locking of nose locker doors to be included in the FOM.','3',0,'',''),(120,3,'Flight Ops','J',2,'NF','2010-03-17 00:00:00',NULL,'2010-03-17 00:00:00','\"Gust locks, pitot covers and engine bungs cause a risk to the safety of flight if not removed before flight.\"','D',3,2,'\"Clear procedures for preflight inspections and preflight walk around inspection after passengers/freight 	have been loaed to be contained in FOM.\"','3',0,'',''),(121,3,'Flight Ops','J',1,'NF','2010-03-17 00:00:00',NULL,'2010-03-17 00:00:00','Violent or anxious passengers can cause harm to other passengers and crew if not managed correctly.','D',5,2,'Pilots to be examined annually during Emergency Procedures checks to ensure that they understand the requirement for them to be able to identify and handle passengers that may provide problems in an aircraft.','4',0,'',''),(122,3,'Flight Ops','J',3,'NF','2010-03-17 00:00:00',NULL,'2010-03-17 00:00:00','\"Take-Off and Landing on loose, uneven or contaminated surfaces, and in unusual weather conditions reduces handling ability of the aircraft increasing the risk of overshoot or runway excursions.\"','C',4,2,'Prohibition of the operation of Company aircraft on contaminated runways to be in the FOM.  Only pilots that are competent to operate into unpaved strips are to be rostered for these operations.','4',0,'',''),(123,3,'Flight Ops','J',2,'NF','2010-03-17 00:00:00',NULL,'2010-03-17 00:00:00','\"Airframe icing pre flight and during flight will reduce aircraft performance, which could potentially lead to aircraft crash.\"','B',5,2,'\"Training on flight in icing conditions provided on Company portal.  Clear policy in Flight Operations Manual 	prohibiting flight in icing conditions in aircraft that are not properly equipment\"','2',0,'',''),(124,3,'Flight Ops','J',1,'NF','2010-03-17 00:00:00',NULL,'2010-03-17 00:00:00','\"Flight crew driving to/from GLB, could be injured in motor vehicle accident, or colliding with wildlife.\"','D',5,2,'\"Ensure that drivers are appropriately qualified.  Policy that fatigued crew are to contact Operations',NULL,0,NULL,NULL),(125,3,'Flight Ops','J',0,'NF','2010-03-17 00:00:00',NULL,'2010-03-17 00:00:00','\"Lightning strike, hail damage and in flight break-up are all risks associated with flight in the vicinity of Thunderstorms.\"','D',5,2,'\"Pilots to be provided with training for operating in the vicinity of thunderstorms and to be examined ',NULL,0,NULL,NULL),(126,3,'Flight Ops','J',3,'NF','2010-03-17 00:00:00',NULL,'2010-03-17 00:00:00','Flight crew driving/walking between airport and Piallago. Could be injured in motor vehicle accident.','D',5,2,'Flight crew are to strictly adhere to road rules for vehicle operation.  Flight crew are to only walk between Airport and Pialligo when there is no other possible alternative and are to use Company risk analysis procedure outlined in the S&QM beforehand.','4',0,'',''),(127,3,'Flight Ops','J',4,'NF','2010-03-17 00:00:00',NULL,'2010-03-17 00:00:00','\"Ferry flights to GLB after freight at night, particularly with low cloud and a lack of approach guidance lighting at GLB. Errors can occur due to fatigue and poor visual cues. Increased animal hazard also exists. This could lead to A/C Crash.\"','D',5,2,'Company to limit the number of occasions that aircraft are repositioned at night.  Pilots to adhere to aviation legislation and guidance material in the AIP in relation approaches to ensure adequate levels of safety are maintained.','4',0,'',''),(128,3,'Flight Ops','J',2,'NF','2010-03-17 00:00:00',NULL,'2010-03-17 00:00:00','No AFRU at GLB for the PAL frequency. There is a risk that the lights may not be illuminated even though the procedure to turn them on has been carried out.','C',2,2,'\"Pilots to adhere to aviation legislation and guidance material in the AIP in relation approaches',NULL,0,NULL,NULL),(129,3,'Flight Ops','J',2,'NF','2010-03-17 00:00:00',NULL,'2010-03-17 00:00:00','Dehydration is a risk to flight crew and can cause a number of negative side effects. This risk is increased at higher altitudes and operating in very hot environments i.e. Cooper Basin.','A',3,2,'\"Pilots are to adhere to hydration instructions given by Santos in the Cooper Basin.  Company to provide 	water to pilots when operating aircraft in hot environments.\"','4',0,'',''),(130,3,'Flight Ops','J',5,'NF','2010-03-17 00:00:00',NULL,'2010-03-17 00:00:00','\"Flight crew that operate up to four aircraft types have the risk of not being current, or familiar enough with normal operating/emergency procedures, and systems. This could easily lead to the incorrect procedure being implemented for that aircraft type.\"','A',3,2,'Requirement in place to ensure that pilots have flown the type within the previous 70 days and have an annual check in each type flown.','4',0,'',''),(131,3,'Flight Ops','C',3,'NF','2010-03-17 00:00:00',NULL,'2010-03-17 00:00:00','\"Computer/Internet faults. There is a risk that flight crew canÕt access valuable tools for flight planning and weather assessment if these systems are not operating correctly i.e. Command Flight Planner, NAIPS, and BOM Weather Radar.\"','B',2,2,'Duplication of computers in pilotÕs briefing room.  Provision for separate internet access by Wireless access card','3',0,'',''),(132,3,'Flight Ops','J',2,'NF','2010-03-17 00:00:00',NULL,'2010-03-17 00:00:00','With the current fuel ordering policy there is a risk that fuel has been ordered by operations with no record in the Aircraft folders at Piallago for the flight crew to see. This could result in double fuelling or a long delay if no fuel was ordered.','B',2,2,'\"Pilots to be in attendance at aircraft for refueling operations to ensure correct fuel is loaded. Whenever ',NULL,0,NULL,NULL),(133,3,'Flight Ops','J',4,'NF','2010-03-17 00:00:00',NULL,'2010-03-17 00:00:00','\"There is the risk that an aircraft may crash for a number of reasons including; mechanical failure, extreme weather or pilot error.\"','E',5,2,'\"Training for extreme weather provided on Company portal.  Systematic training and checking under CAR217 	to RPT standard to ensure high levels of pilot proficiency.  Training on CRM and TEM provided on Company portal to trap errors. Class A system of main\"','4',0,'',''),(134,2,'Ground Handling','C',3,'DK','2009-10-19 00:00:00',NULL,'2009-10-19 00:00:00','\"Emercengy equipment failure - fire extinguishere expiry, not servicable, none present\"','D',4,2,'Fire extinguishers fitted at Pialligo office and vehicles monitored through asset register on FBO mgr program on 6 monthly basis or on vehicle servicing date.','3',0,'05/05/10','DK'),(135,2,'Ground Handling','C',0,'DK','2009-10-19 00:00:00',NULL,'2009-10-19 00:00:00','Evaculation plan not current or incorrect - not updated or reviewed','E',5,2,'Review evacuation plan on 12 month cycle. Monitored on asset register on FBO mge program.','3',0,'05/05/10','DK'),(136,2,'Ground Handling','L',0,'DK','2009-10-19 00:00:00',NULL,'2009-10-19 00:00:00','\"Emergency lighting not working - equipment failure, evaculation hindered\"','E',5,2,'\"Review on 6 month basis, Emergency lighting Pialligo monitored on GSE asset register on FBO mgr program.\"','3',0,'07/05/10','DK'),(137,2,'Ground Handling','J',2,'DK','2009-1