3,'RFS Imaging','J',0,'SM','2011-10-17 09:15:31','QM','2011-10-19 09:15:31','Spilling of Liquid nitrogen on Operator or Aircraft','C',2,1,'MSDS to be carried in the Aircraft.  Operator to wear appropriate PPE when handling liquid nitrogen.  Camera not to be topped up with Liquid Nitrogen if the aircraft is in any turbulance.','Moderate',0,'','MFO'),(171,3,'RFS Imaging','J',0,'SM','2011-10-17 09:18:07','QM','2011-10-19 09:18:07','Smoke in Aircraft','C',2,1,'If noticable and exit from the area is not possible, use of oxygen by crew.','EXTREME',1,'','MFO'),(172,3,'NSWRFS linescan','J',0,'SM','2011-10-17 09:19:16','QM','2011-10-19 09:19:16','Operations at low level could place the aircraft in conflict with water bombers','C',5,1,'Aircarft to co-ordinate activities with RFS ground controller on dicrete allocated frequency to develop situational awareness of the location of other aircraft.  Base guide to refer to this.','EXTREME',1,'','MFO, CEO, Ops Manager'),(173,3,'NSWRFS linescan','J',0,'SM','2011-10-17 09:21:07','QM','2011-10-19 09:21:07','15 minute notification leading to rushed departure.','B',3,1,'Following SOP\'s comprehensively to allow for adequate preparation.','EXTREME',1,'',''),(174,3,'NSWRFS linescan','J',0,'SM','2011-10-17 09:21:53','QM','2011-10-19 09:21:53','Contract pilots losing currency through lack of flying','C',2,1,'Each pilot to fly a minimum of once per week IAW contract and more frequently on other tasks where possible and practical','EXTREME',1,'',''),(177,3,'Introduction of New Aircraft','J',1,'Quality Manager','2012-10-01 10:15:37','COO','2012-10-01 10:15:37','With the introduction of the new Aircraft Type, staff will not concentrate on there current jobs.','B',2,0,'','EXTREME',1,'','');
